'descr','keywords',0.0000,0,NULL,0,0,NULL,NULL,NULL,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(253,'Название статьи','Дескрипшн','фывавыбб, фвафыва',0.0000,0,NULL,0,0,NULL,NULL,NULL,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(254,'Мета заголовок','Тестовая статья','ключ, ключ',0.0000,0,NULL,0,0,NULL,NULL,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL),(255,'Раннее развитие детей: за и против','развитие детей раннего возраста','раннее развитие детей \r\n',0.0000,0,NULL,0,0,NULL,NULL,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,1,'\nраннее развитие детей\n',NULL,NULL),(257,'Гиперактивность у детей. Ее причины.','Гиперактивность, в основном, наблюдается у детей и подростков из-за эмоционального и неуравновешенного состояния.\nИм не всегда удается справиться с таким состоянием самостоятельно. Связывают это явление с перенапряжением и нервной возбудимостью организма.\n','гиперактивный ребенок \n',0.0000,0,NULL,0,0,NULL,NULL,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,1,'\nгиперактивный ребенок\n',NULL,'<p>Гиперактивность, в основном, наблюдается у детей и подростков из-за эмоционального и неуравновешенного состояния.<br />\nИм не всегда удается справиться с таким состоянием самостоятельно. Связывают это явление с перенапряжением и нервной возбудимостью организма.</p>\n'),(262,'Раннее развитие детей: за и против','Конечно же все родители хотят, чтобы их дети были здоровыми, умными и развитыми для своих лет. Часто это желание распространяется ещё дальше – и тогда мамы и папы всерьез начинают задумываться об опережающем развитии своего ребенка.','раннее развитие детей ',0.0000,0,NULL,0,0,NULL,NULL,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,1,'\nраннее развитие детей\n',NULL,'<p>Конечно же все родители хотят, чтобы их дети были здоровыми, умными и развитыми для своих лет. Часто это желание распространяется ещё дальше &ndash; и тогда мамы и папы всерьез начинают задумываться об опережающем развитии своего ребенка.</p>\n'),(266,'Как обустроить детскую комнату','Как обустроить детскую комнату. Просто детская комната должна отражать внутренний мир вашего ребенка, соответствовать его интересам и развивать его способности.','Как обустроить детскую комнату ребенка ',0.0000,0,NULL,0,0,NULL,NULL,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,1,'\nкак обустроить детскую комнату\n',NULL,'<p>Как обустроить детскую комнату. Просто детская комната должна отражать внутренний мир вашего ребенка, соответствовать его интересам и развивать его способности.</p>\n'),(267,'Конфликт между детьми','Когда в семье не один ребенок, то возникает проблема в их взаимопонимании между собой. Нет ничего ужасного в ссорах.','конфликт между детьми',0.0000,0,NULL,0,0,NULL,NULL,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,1,'\nконфликт между детьми\n',NULL,'<p>Когда в семье не один ребенок, то возникает проблема в их взаимопонимании между собой. Нет ничего ужасного в ссорах.</p>\n'),(268,'Как сказать \"нет\" своему ребенку?','Всем, кто занимается воспитанием детей, приходится прибегать довольно часто к запретам.«Можно мне погулять?» - «Нет!». «Могу я взять конфету?» - «Нельзя!».','методы воспитания детей',0.0000,0,NULL,0,0,NULL,NULL,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,1,'\nметоды воспитания детей\n',NULL,'<p>Всем, кто занимается воспитанием детей, приходится прибегать довольно часто к запретам.&laquo;Можно мне погулять?&raquo; - &laquo;Нет!&raquo;. &laquo;Могу я взять конфету?&raquo; - &laquo;Нельзя!&raquo;.</p>\r\n'),(269,'Воспитание ребенка лидера.','Воспитание детей в любой семье имеет свои особенности. У каждого родителя есть свои методы воспитания. Люди, создавшие семью, надеются на то, что в их семье будет царить мир, дружба и согласие между всеми членами семьи.','Воспитание ребенка лидера',0.0000,0,NULL,0,0,NULL,NULL,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,1,'\nметоды воспитания детей\n',NULL,'<p>Воспитание детей в любой семье имеет свои особенности. У каждого родителя есть свои методы воспитания. Люди, создавшие семью, надеются на то, что в их семье будет царить мир, дружба и согласие между всеми членами семьи.</p>\n'),(270,'Воспитание ребенка','Воспитание ребенка в основном ложится на родителей. В большей степени первоначальным воспитанием ребенка занимается мать. Потому что только мать в состоянии уделять ребенку наибольшую часть времени и может отдать ему всю свою нежность, заботу и ласку. ','Воспитание ребенка',0.0000,0,NULL,0,0,NULL,NULL,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,1,'\nвоспитание ребенка\n',NULL,'<p>Воспитание ребенка в основном ложится на родителей. В большей степени первоначальным воспитанием ребенка занимается мать. Потому что только мать в состоянии уделять ребенку наибольшую часть времени и может отдать ему всю свою нежность, заботу и ласку.</p>\r\n'),(271,'Самостоятельность развивает у детей интеллект','Результаты показали, что те дети, чьи родители воспитывают детей самостоятельными и независимыми, показали лучшие результаты, чем те, чьи родители излишне оберегают и ограничивают детей.','развитие ребенка',0.0000,0,NULL,0,0,NULL,NULL,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,1,'\nразвитие ребенка\n',NULL,'<p>Результаты показали, что те дети, чьи родители воспитывают детей самостоятельными и независимыми, показали лучшие результаты, чем те, чьи родители излишне оберегают и ограничивают детей.</p>\n'),(285,'Как помочь ребенку адаптироваться к детскому саду?','Дети - цветы жизни! С рождения они приносят в мир взрослого радость и счастье! Чего стоит только одна улыбка малыша, от которой жизнь становится яркой, осмысленной, наполненной положительными эмоциями!','Адаптация в детском саду',0.0000,0,NULL,0,0,NULL,NULL,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,1,'\nадаптация ребенка\n',NULL,'<p>Дети - цветы жизни! С рождения они приносят в мир взрослого радость и счастье! Чего стоит только одна улыбка малыша, от которой жизнь становится яркой, осмысленной, наполненной положительными эмоциями!</p>\r\n'),(291,'Обман или одиночество?','Вы никогда не задумывались над тем, в какой мере мы женщины склонны к самообману. ','Обман одиночество',0.0000,0,NULL,0,0,NULL,NULL,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'\nсамообман\n','<p>Вы никогда не задумывались над тем, в какой мере мы женщины склонны к самообману.</p>\r\n'),(292,'Стоит ли знакомиться в Интернете','Знакомство в Интернете – это довольно распространенное явление в нашем современном мире. И ведь в таком знакомстве очень много положительного. ','Знакомство в Интернете',0.0000,0,NULL,0,0,NULL,NULL,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'\nзнакомство\n','<p>Знакомство в Интернете &ndash; это довольно распространенное явление в нашем современном мире. И ведь в таком знакомстве очень много положительного.</p>\r\n'),(293,'А может любви нет','Ты об этом не думала? Я вот задумалась… Любовь – это сказка для детей? Или для маленьких взрослых девочек? Для тех, кто еще не вырос…\r\n','Любовь',0.0000,0,NULL,0,0,NULL,NULL,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'\nлюбовь\n','<p>Ты об этом не думала? Я вот задумалась&hellip; Любовь &ndash; это сказка для детей? Или для маленьких взрослых девочек? Для тех, кто еще не вырос&hellip;</p>\r\n\r\n<p>&nbsp;</p>\r\n'),(294,'Интернет знакомства','Каждый человек мечтает найти свою вторую половинку, но увы не каждому это удается... Мечты об идеальном спутнике жизни, романтических прогулках при луне и кротких поцелуях заставляют нас прибегать к помощи интернета.','Интернет знакомства',0.0000,0,NULL,0,0,NULL,NULL,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'\nзнакомство\n','<p>Каждый человек мечтает найти свою вторую половинку, но увы не каждому это удается... Мечты об идеальном спутнике жизни, романтических прогулках при луне и кротких поцелуях заставляют нас прибегать к помощи интернета.</p>\n'),(295,'Идеальная девушка глазами мужчин.','«На вкус и цвет все фломастеры разные», - скажете вы. А я отвечу: «Несомненно, но всё-таки существуют такие черты, которые каждый мужчина хотел бы видеть в своей спутнице». Было проведено несчётное множество различных опросов, на основе которых психологи и вывели «формулу идеальной девушки». Давайте разбираться.','Идеальная девушка глазами мужчин.',0.0000,0,NULL,0,0,NULL,NULL,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'\nглазами мужчин\n','<p>&laquo;На вкус и цвет все фломастеры разные&raquo;, - скажете вы. А я отвечу: &laquo;Несомненно, но всё-таки существуют такие черты, которые каждый мужчина хотел бы видеть в своей спутнице&raquo;. Было проведено несчётное множество различных опросов, на основе которых психологи и вывели &laquo;формулу идеальной девушки&raquo;. Давайте разбираться.</p>\r\n'),(296,'Как показать себя уверенным?','Тело человека может очень многое о нем рассказать, даже больше чем ему (человеку) хотелось бы. По определенному положению тела можно увидеть например, чего мы боимся или о чем думаем. ','Уверенность в себе',0.0000,0,NULL,0,0,NULL,NULL,1,0,0,NULL,'\nуверенность в себе\n',NULL,NULL,NULL,NULL,1,NULL,NULL,'<p>Тело человека может очень многое о нем рассказать, даже больше чем ему (человеку) хотелось бы. По определенному положению тела можно увидеть например, чего мы боимся или о чем думаем.</p>\n'),(301,'Очная и заочная формы обучения. Их плюсы и минусы.','Заканчивая школу, многие ребята задумываются о том, какую же форму обучения предпочесть: дневную или заочную. Несомненно, чтобы они не выбрали для себя, цель у них одна – получить диплом, но процессы и принципы обучения у этих форм существенно отличаются. Рассмотрим плюсы и минусы каждой из этих форм обучения','Очная и заочная формы обучения плюсы и минусы ',0.0000,0,NULL,0,0,NULL,NULL,1,0,0,NULL,'\nобучение\n',NULL,NULL,NULL,NULL,1,NULL,NULL,'<p>Заканчивая школу, многие ребята задумываются о том, какую же форму обучения предпочесть: дневную или заочную. Несомненно, чтобы они не выбрали для себя, цель у них одна &ndash; получить диплом, но процессы и принципы обучения у этих форм существенно отличаются. Рассмотрим плюсы и минусы каждой из этих форм обучения</p>\n'),(303,'10 способов изучения английского!','Знание английского сегодня это отличное конкурентное преимущество. Умея говорить на английском проще найти работу, можно быстрее получать новые знания, создать успешный бизнес на примере иностранных аналогов. Так что если ты думаешь над тем, как быстро выучить английский язык с нуля, вот тебе 10 способов для этого.','10 способов изучения английского!',0.0000,0,NULL,0,0,NULL,NULL,1,0,0,NULL,'\nобучение\n',NULL,NULL,NULL,NULL,1,NULL,NULL,'<p>Знание английского сегодня это отличное конкурентное преимущество. Умея говорить на английском проще найти работу, можно быстрее получать новые знания, создать успешный бизнес на примере иностранных аналогов. Так что если ты думаешь над тем, как быстро выучить английский язык с нуля, вот тебе 10 способов для этого.</p>\r\n'),(304,'Как расширить память. Один из способов.','Для работы, учебы и для общего развития человека ему необходимо иметь хорошую память. Не будем углубляться в теорию, что собой представляет человеческий мозг и память в частности, а лучше рассмотрим один из способов улучшения и расширения памяти.','расширить память',0.0000,0,NULL,0,0,NULL,NULL,1,0,0,NULL,'\nразвитие\n',NULL,NULL,NULL,NULL,1,NULL,NULL,'<p>Для работы, учебы и для общего развития человека ему необходимо иметь хорошую память. Не будем углубляться в теорию, что собой представляет человеческий мозг и память в частности, а лучше рассмотрим один из способов улучшения и расширения памяти.</p>\n'),(305,'Выбор профессии как важнейший аспект в современном обществе.','Выбор профессии как важнейший аспект в современном обществе. Основные факторы выбора профессии.','Выбор профессии',0.0000,0,NULL,0,0,NULL,NULL,1,0,0,NULL,'\nвыбор профессии\n',NULL,NULL,NULL,NULL,1,NULL,NULL,'<p>Выбор профессии как важнейший аспект в современном обществе. Основные факторы выбора профессии.</p>\r\n'),(308,'От куда рождаются новые идеи?','В повседневной жизни мы так привыкли к стандарту разнообразий наших мыслей, если мы хотим что то изменить в своей работе, жизни или элементарно что то придумать, мы сразу же бросаем это дело. Потому что придумать