е ребенка 3-4 года','Период развития ребенка в возрасте от 3 до 4 лет является наиболее определяющим и важным этапом в его жизни. Опираясь на исследования ученых, можно сказать о том, что основой его развития в это время является его положительное самоощущение: уверенность ребенка в себе и в своих действиях, его ощущение того, что он является самым любимым и самым хорошим. Но сами по себе такие ощущения у малышей не возникают..','воспитание ребенка',0.0000,0,NULL,0,0,NULL,NULL,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,1,'\nвоспитание ребенка\n',NULL,'<p>Период развития ребенка в возрасте от 3 до 4 лет является наиболее определяющим и важным этапом в его жизни. Опираясь на исследования ученых, можно сказать о том, что основой его развития в это время является его положительное самоощущение: уверенность ребенка в себе и в своих действиях, его ощущение того, что он является самым любимым и самым хорошим. Но сами по себе такие ощущения у малышей не возникают..</p>\r\n'),(362,'Творческое развитие детей','Творческие способности есть у всех детей с рождения. Им не нужно учиться использовать свое воображение. К сожалению, взрослые могут все испортить','творческий ребенок',0.0000,0,NULL,0,0,NULL,NULL,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,1,'\nразвитие ребенка\n',NULL,'<p>Творческие способности есть у всех детей с рождения. Им не нужно учиться использовать свое воображение. К сожалению, взрослые могут все испортить</p>\r\n'),(363,'Когда и почему вы должны игнорировать своего ребенка ','Вашим детям не нужно все ваше внимание. Как быть избирательным для своей выгоды','истерика ребенка',0.0000,0,NULL,0,0,NULL,NULL,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,1,'\nвоспитание ребенка\n',NULL,'<p>Вашим детям не нужно все ваше внимание. Как быть избирательным для своей выгоды</p>\n'),(364,' Как подготовить ребенка к детскому саду ','Как правило, когда у мамы заканчивается отпуск по уходу за ребенком, малыш тоже отправляется на свою первую «работу» – в детский сад. ','детский сад',0.0000,0,NULL,0,0,NULL,NULL,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,1,'\nдетям до трёх лет\n',NULL,'<p>Как правило, когда у мамы заканчивается отпуск по уходу за ребенком, малыш тоже отправляется на свою первую &laquo;работу&raquo; &ndash; в детский сад.&nbsp;</p>\n'),(365,'Этикет для детей ','Воспитание - постоянная тема, которая сопровождает родителей на протяжении всего периода взросления их чад. Малышам, которые усвоили правила поведения еще в детстве, легче взаимодействовать с окружающим миром.','поведение детей',0.0000,0,NULL,0,0,NULL,NULL,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,1,'\nвоспитание ребенка\n',NULL,'<p>Воспитание - постоянная тема, которая сопровождает родителей на протяжении всего периода взросления их чад. Малышам, которые усвоили правила поведения еще в детстве, легче взаимодействовать с окружающим миром.</p>\r\n'),(366,' Как электронные устройства стали модными детскими игрушками ','Современным детям можно только позавидовать. Ассортимент игрушек настолько огромен, что сможет удивить даже самого искушенного покупателя, а в детском магазине легко заблудиться. ','электронные игрушки',0.0000,0,NULL,0,0,NULL,NULL,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,1,'\nраннее развитие детей\n',NULL,'<p>Современным детям можно только позавидовать. Ассортимент игрушек настолько огромен, что сможет удивить даже самого искушенного покупателя, а в детском магазине легко заблудиться.&nbsp;</p>\r\n'),(367,'Как помочь ребенку избавиться от чувства страха в темноте','Не существует практически ни одного ребенка, который бы комфортно чувствовал себя в сумраке. Боязнь возникает чаще всего из-за богатой природной фантазии, которая рисует малышам монстров и чудовищ в затемненных углах комнаты.','страхи детей',0.0000,0,NULL,0,0,NULL,NULL,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,1,'\nразвитие ребенка\n',NULL,'<p>Не существует практически ни одного ребенка, который бы комфортно чувствовал себя в сумраке. Боязнь возникает чаще всего из-за богатой природной фантазии, которая рисует малышам монстров и чудовищ в затемненных углах комнаты.</p>\n'),(368,'Как быстро успокоить ребенка','Дети не всегда бывают милыми и послушными. Иногда они устраивают настоящие истерики, а еще хуже, если это происходит в общественном месте. Что вы можете сделать, чтобы быстро успокоить своего ребенка?','истерика ребенка',0.0000,0,NULL,0,0,NULL,NULL,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,1,'\nвоспитание ребенка\n',NULL,'<p>Дети не всегда бывают милыми и послушными. Иногда они устраивают настоящие истерики, а еще хуже, если это происходит в общественном месте. Что вы можете сделать, чтобы быстро успокоить своего ребенка?</p>\r\n'),(369,'Как научить ребёнка писать красиво?','Важной составной частью всестороннего развития подрастающего поколения является обучение школьника ровному почерку. В прежние годы в начальных классах советской школы детей учили чистому и красивому письму. Сейчас, к сожалению, не во всех российских школах чистописание входит в программу обучения.','красиво писать',0.0000,0,NULL,0,0,NULL,NULL,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,1,'\nразвитие ребенка\n',NULL,'<p>Важной составной частью всестороннего развития подрастающего поколения является обучение школьника ровному почерку. В прежние годы в начальных классах советской школы детей учили чистому и красивому письму. Сейчас, к сожалению, не во всех российских школах чистописание входит в программу обучения.</p>\r\n'),(370,'Как приучить ребенка ложиться спать вовремя','Все дети засыпают по-разному. Укладывание в постель не должно вызывать у малышей неприятных ощущений, но непреклонность взрослых является обязательным условием. ','спать во время',0.0000,0,NULL,0,0,NULL,NULL,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,1,'\nвоспитание ребенка\n',NULL,'<p>Все дети засыпают по-разному. Укладывание в постель не должно вызывать у малышей неприятных ощущений, но непреклонность взрослых является обязательным условием.</p>\r\n'),(371,'Слова-бандиты','Реальный случай произошел когда-то. К очень интеллигентной бабушке издалека приехал маленький внук. Был он очень ласковый, с голубыми любознательными глазенками, умный и начитанный','плохи слова для детей\n',0.0000,0,NULL,0,0,NULL,NULL,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,1,'\nдетям до трёх лет\n',NULL,'<p>Реальный случай произошел когда-то. К очень интеллигентной бабушке издалека приехал маленький внук. Был он очень ласковый, с голубыми любознательными глазенками, умный и начитанный</p>\n'),(372,'Как помочь дошкольнику овладеть правильной и красивой речью','Речевые нарушения детей являются серьезной проблемой нашего времени. Огорчает то, что количество их не уменьшается, а год от года только растет - всё больше родителей обращается за помощью логопеда. Известно, что речь не дана ребенку от рождения, она развивается и совершенствуется одновременно с физическим и психическим развитием, а также зависит от определенных условий.','правильная речь',0.0000,0,NULL,0,0,NULL,NULL,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,1,'\nвоспитание ребенка\n',NULL,'<p>Речевые нарушения детей являются серьезной проблемой нашего времени. Огорчает то, что количество их не уменьшается, а год от года только растет - всё больше родителей обращается за помощью логопеда. Известно, что речь не дана ребенку от рождения, она развивается и совершенствуется одновременно с физическим и психическим развитием, а также зависит от определенных условий.</p>\r\n'),(373,'Как научить ребенка спорить?','Когда ребенок маленький, он воспринимает то, что ему говорят, как истину. Он просто верит в то, о чем говорят ему родители и другие взрослые. ','личное мнение',0.0000,0,NULL,0,0,NULL,NULL,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,1,'\nметоды воспитания детей\n',NULL,'<p>Когда ребенок маленький, он воспринимает то, что ему говорят, как истину. Он просто верит в то, о чем говорят ему родители и другие взрослые.</p>\r\n'),(374,'Формирование мировоззрения ребёнка','Психика маленького человека - это чистый лист, на котором можно написать что угодно. Первыми и самыми главными учителями ребёнка становятся его родители. Ребят часто называют \"отражением\" своих родителей','психика детей',0.0000,0,NULL,0,0,NULL,NULL,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,1,'\nдетям до трёх лет\n',NULL,'<p>Психика маленького человека - это чистый лист, на котором можно написать что угодно. Первыми и самыми главными учителями ребёнка становятся его родители. Ребят часто называют &quot;отражением&quot; своих родителей</p>\r\n');
