9-04 20:13:55',NULL,0),(223,'','Новые',NULL,'/studentam/stati/novye','2017-09-03 16:55:03','2017-09-03 16:57:26',NULL,0),(224,'','Популярные',NULL,'/studentam/stati/populyarnye','2017-09-03 16:55:33','2017-09-04 20:13:55',NULL,0),(225,'','Новые',NULL,'/otnosheniya/sovety/novye','2017-09-03 16:56:13','2017-09-03 16:57:26',NULL,0),(226,'','Популярные',NULL,'/otnosheniya/sovety/populyarnye','2017-09-03 16:56:28','2017-09-04 20:13:55',NULL,0),(227,'','Новые',NULL,'/otnosheniya/stati/novye','2017-09-03 16:56:46','2017-09-03 16:57:26',NULL,0),(228,'','Популярные',NULL,'/otnosheniya/stati/populyarnye','2017-09-03 16:57:00','2017-09-04 20:13:55',NULL,0),(219,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0),(232,' Введите текст страницы... \r\n\r\nТут будет подзаголовок\r\n\r\n Тут что нибудь пишем \r\n\r\n \r\n\r\n   \r\n\r\n   \r\n\r\n   \r\n\r\n   \r\n\r\n   \r\n\r\n   \r\n\r\n   \r\n\r\n   \r\n\r\n Продолжаем писанину, все вроде хорошо получается \r\n ','Тестовая статья',NULL,'/roditelyam/stati/novye/testovaya-statya','2017-09-04 19:25:37','2017-09-06 19:12:57',NULL,0),(239,' Введите текст страницы... \r\n ','second_test_page',NULL,'/roditelyam/stati/vse/second-test-page','2017-09-04 20:47:37','2017-09-06 19:16:05',NULL,0),(240,' Введите текст страницы... \r\n ','once_more',NULL,'/roditelyam/stati/vse/once-more','2017-09-04 21:02:42','2017-09-08 15:56:50',NULL,0),(243,' Введите текст страницы... \r\n ','some third',NULL,'/roditelyam/stati/vse/some-third','2017-09-05 01:32:11','2017-09-06 14:04:42',NULL,0),(246,'Подзаголовок\r\n\r\n Введите текст страницы... \r\n\r\n фывафывафывафывафываыфыфвафыва \r\n\r\n фывафывафывафывафывафывафыва \r\n\r\n фывафывафывафывафывафывафыва \r\n\r\n\r\n фывафывафывафывафывафывафываыва \r\n\r\n   \r\n\r\n\r\nЧто то под картинкой\r\n\r\n\r\n\r\n ывафывафывафывафываывф фвафывафыва фвыафыва \r\n ','Новая статья родителям',NULL,'/roditelyam/stati/vse/novaya-statya-roditelyam','2017-09-08 15:17:34','2017-09-08 16:02:29',NULL,0),(252,' Введите текст сюда \r\n ','Тестовая статья',NULL,'/roditelyam/stati/testovaya-statya','2017-09-08 18:55:18','2017-09-08 18:57:09',NULL,0),(253,' Введите текст сюда \r\n ','Название статьи',NULL,'/roditelyam/stati/nazvanie-stati','2017-09-08 19:10:28','2017-09-08 19:17:55',NULL,0),(254,' Введите текст сюда \r\n ','Тестовая статья',NULL,'/roditelyam/stati/testovaya-statya','2017-09-08 22:56:33','2017-09-08 22:57:12',NULL,0),(255,' Конечно же все родители хотят, чтобы их дети были здоровыми, умными и развитыми для своих лет. Часто это желание распространяется ещё дальше – и тогда мамы и папы всерьез начинают задумываться об опережающем развитии своего ребенка. Благо сегодня существует огромное количество авторских методик раннего развития детей ( Г. Домана, Н. Зайцева, С. Лупан , система Никитиных и других), предлагающих игровое обучение чтению и счету, а также знакомство с цифрами чуть ли не годовалых детей. \r\n\r\n   \r\n\r\n\r\n   \r\n\r\n \r\n\r\n   \r\n\r\n\r\n   \r\n\r\n Безусловно, каждая из этих методик интересна и имеет положительные стороны: большинство детей действительно овладевают навыками чтения, счета и письма в возрасте 1-3 лет. Но так ли это нужно вашему ребенку? Ведь всему этому он сможет научиться в подготовительной к школе группе и школе, а драгоценное время безмятежного детства подменяется пусть и игровым, но всё же обучением. В то же время общение со сверстниками, становление которого происходит как раз в период 1-3 лет, и социализация ребенка отходят на второй план, а при поступлении в школу это выльется в весьма серьезные проблемы: ребенок может стать «изгоем» среди одноклассников, да и обучение в первом классе потеряет для него всю свою привлекательность из-за того, что он всему уже научился ранее.  \r\n\r\n   \r\n\r\n Так что, родители, выбор за вами – выбирать раннее обучение для своего ребенка или нет, но помните, что это очень серьезный и ответственный шаг, который может оказать влияние на дальнейшую жизнь вашего ребенка. \r\n\r\n  \r\n ','Раннее развитие детей',NULL,'/roditelyam/stati/rannee-razvitie-detej','2017-09-08 22:57:59','2017-09-09 00:44:27',NULL,0),(257,'  \r\n\r\nГиперактивность, в основном, наблюдается у детей и подростков из-за эмоционального и неуравновешенного состояния.  \r\n\r\n Им не всегда удается справиться с таким состоянием самостоятельно. Связывают это явление с перенапряжением и нервной возбудимостью организма. \r\n\r\n Гиперактивность – это повышенное эмоциональное состояние, которое вызвано нервно-психическим расстройством. Оно выходит за пределы полагающейся нормы. \r\n\r\n Причины возникновения у детей говорят сами за себя, а именно: \r\n\r\n\r\n	Недостаток внимания со стороны родителей.\r\n	Активность, превышающая норму.\r\n	Чрезмерная эмоциональность.\r\n	Импульсивность.\r\n\r\n\r\n\r\n Как бороться родителям с таким непоседливым малышом? \r\n\r\n\r\n Ребенок уже на первых месяцах жизни, может проявлять гиперактивность: \r\n\r\n\r\n	Плохо спать.\r\n	Много плакать.\r\n	Реагировать на любой звук, шум.\r\n\r\n\r\n Детки, которые постарше: \r\n\r\n\r\n	Неусидчивы.\r\n	Не сидят на одном месте.\r\n	Агрессивны.\r\n	Возбудимы.\r\n	Невнимательны.\r\n\r\n\r\n Сложности могут возникнуть: \r\n\r\n 1)Когда вы поведете ребенка впервые в детский сад, ведь ему приходится вливаться в незнакомую обстановку. Для него, конечно же, это стресс. \r\n\r\n 2)В школьный период гиперактивным детям приходится нелегко. Он может плохо усваивать информацию, вступать в конфликтные ситуации со сверстниками и учителями. \r\n\r\n\r\n Большие ошибки совершают родители, испытывая трудности с гиперактивным ребенком.  \r\n\r\n\r\n Мера наказания должна быть не такой строгой и дисциплинированной. Детям с повышенной активностью и непоседливостью очень трудно соблюдать правила и рамки, которые устанавливают ему родители. Здесь поможет только терпеливый и мудрый подход в сложившейся ситуации, а лучше всего поход к специалисту, который поможет разобраться, в чем причина такого поведения у ребенка. \r\n\r\n Дети с ярко выраженной гиперактивностью чаще наблюдаются у невролога и психолога, для того чтобы избежать последствий. Гиперактивный ребенок подвержен в два раза больше различным травмам. Поэтому необходимо заранее позаботиться о его безопасности. Пик активности у детей начинается в два, три года, далее в восемь, десять лет. \r\n\r\nфото ребенкка с разбитым коленом \r\n\r\n По статистике, гиперактивность чаще всего выявляют у мальчиков. Причина тому, что они рождаются крупней, чем девочки, и мозг развивается у них гораздо позже. \r\nДля того чтобы облегчить состояние ребенка, лучше всего давать лекарства, которые помогут успокоить детскую нервную систему и сосредоточиться на информации, исходящей от взрослых людей. \r\n\r\n Своевременная помощь малышу поможет сделать жизнь его спокойней. И это порадует самих родителей. \r\n\r\nПравильный подход и терпение, в сложившейся ситуации, помогут справиться с гиперактивностью малыша. Важно дать ему понять, что его все равно любят, несмотря ни на что.  \r\n\r\nфото любящей семьи \r\n ','Гиперактивный ребенок',NULL,'/roditelyam/stati/giperaktivnyj-rebenok','2017-09-08 23:38:55','2017-09-23 21:51:25',NULL,0),(262,'\r\n Конечно же все родители хотят, чтобы их дети были здоровыми, умными и развитыми для своих лет. \r\n\r\n\r\n  Часто это желание распространяется ещё дальше – и тогда мамы и папы всерьез начинают задумываться об опережающем развитии своего ребенка. \r\n\r\n Благо сегодня существует огромное количество авторских методик раннего развития детей ( Г. Домана, Н. Зайцева, С. Лупан , система Никитиных и других), предлагающих игровое обучение чтению и счету, а также знакомство с цифрами чуть ли не годовалых детей. \r\n\r\n \r\n\r\n Безусловно, каждая из этих методик интересна и имеет положительные стороны: большинство детей действительно овладевают навыками чтения, счета и письма в возрасте 1-3 лет. Но так ли это нужно вашему ребенку? Ведь всему этому он сможет научиться в подготовительной к школе группе и школе, а драгоценное время безмятежного детства подменяется пусть и игровым, но всё же обучением. \r\n\r\n В то же время общение со сверстниками, становление которого происходит как раз в период 1-3 лет, и социализация ребенка отходят на второй план, а при поступлении в школу это выльется в весьма серьезные проблемы: ребенок может стать «изгоем» среди одноклассников, да и обучение в первом классе потеряет для него всю свою привлекательность из-за того, что он всему уже научился ранее. \r\n\r\nфото скучающего школьника \r\n\r\nТак что, родители, выбор за вами – выбирать раннее обучение для своего ребенка или нет, но помните, что это очень серьезный и ответственный шаг, который может оказать влияние на дальнейшую жизнь вашего ребенка. \r\n ','Раннее развитие детей',NULL,'/roditelyam/stati/rannee-razvitie-detej-2','2017-09-09 00:57:17','2017-09-23 21:48:32',NULL,0),(266,' Купить мебель для детской комнаты довольно непросто. Дело даже не в том, что выбор шкафов и кроваток ограничен. В наше время в магазинах есть практически все, а остальное можно сделать на заказ. \r\n\r\n\r\n  \r\n \r\nПросто детская комната должна отражать внутренний мир вашего ребенка, соответствовать его интересам и развивать его способности. \r\n\r\n\r\n \r\nКомната малыша должна быть яркой, чтобы ему захотелось исследовать ее, открывать шкафчики, заглядывать на полки с книгами и разными мелочами \r\n\r\n                                   фото необычной детской комнаты \r\n \r\n1.Кровать может быть с прекрасными подушками разных цветов, которыми можно биться как мечами и на которых так сладко засыпать. \r\n \r\n2.Компьютерный стол (для детей постарше) должен быть удобным не только для компьютерных игр, но и для выполнения домашних заданий. А у школьников очень много различных книг, тетрадок и других школьных принадлежностей. \r\n\r\n 3.Необходимо найти место и для разнообразных игр ребенка (куклы, машинки, железные дороги) Они не должны валяться по всей комнате. \r\n\r\n 4.Стены можно сделать разных цветов, но лучше слегка приглушенных тонов. Ведь ребенок не только играет и занимается в своей комнате, он в ней еще и спит. Перевозбуждение от ярких цветов может обернуться плохим сном для малыша. \r\n\r\n                                   фото ребенка,который не может заснуть \r\n\r\n  \r\n\r\nПусть детская комната для вашего ребенка станет не только миром, в котором он живет, но и окном в большой, взрослый мир \r\n \r\n  \r\n ','Как обустроить детскую комнату',NULL,'/roditelyam/stati/kak-obustroit-detskuyu-komnatu','2017-09-09 18:44:56','2017-09-23 21:32:19',NULL,0),(267,'\r\n Когда в семье не один ребенок, то возникает проблема в их взаимопонимании между собой. Нет ничего ужасного в ссорах. \r\n\r\n\r\n                                                            фото конфликта 2 детей \r\n  \r\n\r\nЧасто дети и обзываются, и дерутся. \r\n\r\n 1.Правильным решением будет не вмешиваться в конфликты детей до поры до времени, они способны сами разобраться в своих проблемах. \r\n\r\n 2.Нельзя оставаться в стороне, когда драки уже переходят ту грань, что становятся опасными, тут стоит вмешаться и развести их в разные стороны, попробовать отвлечь на время друг от друга. \r\n\r\n  \r\nЧаще всего наказывают старших детей, но не стоит забывать, что в ссоре участвовали оба. Для старшего ребенка складывается впечатление, что он всегда должен уступать, делиться с младшим, присматривать и помогать ему. Но он личность, у него свои интересы, занятия, не взваливайте на его плечи обязанности няньки, этим вы только вредите отношениям между детьми. \r\n\r\n                               фото наказанного ребенка \r\n\r\n  \r\nВ детском возрасте у них много общего между собой, они вместе играют, едят, ездят в гости, по сути, являются лучшими друзьями друг другу. И здесь родителям нужно быть аккуратными, уделять равное внимание и любовь. \r\n\r\n 1.Если покупаете игрушку, то двоим. \r\n\r\n 2.Не допустите ревности между ними, от этого скапливаются обиды и злость на того ребенка, который, по их мнению, получает больше заботы. Это не касается одежды. \r\n\r\n 3.Приучайте детей с малого возраста быть объективными, в каждой семье разное материальное положение. Бывают ситуации, когда есть деньги купить только одну вещь в этом месяце, ребенок должен понимать это и не обижаться, если придется немного подождать. \r\n\r\n\r\n  \r\nЕсли старшая в семье девочка, она обычно с радостью помогает матери с младшим ребенком. Для нее это своеобразная игра, развивающая женское начало. А вам становится хорошей помощницей. \r\n\r\n\r\n  \r\nПри вступлении в подростковый возраст, братья и сестры отдаляются друг от друга, предпочитая общение со своими сверстниками. Интересуйтесь жизнью и проблемами вашего ребенка за пределами дома, чтобы не потерять ту нить, которая связывает вас и оградить его от необдуманных поступков. \r\n\r\n \r\nСколько бы детей ни было в семье, ваша задача сохранить между всеми хорошие, крепкие отношения. Чтобы ребята выручали друг друга и пронесли свою любовь на долгие годы длиною в жизнь. \r\n ','Как детям жить дружно?',NULL,'/roditelyam/stati/kak-detyam-zhit-druzhno','2017-09-09 19:15:32','2017-09-23 21:27:20',NULL,0),(268,'\r\nВсем, кто занимается воспитанием детей, приходится прибегать довольно часто к запретам. \r\n\r\n\r\nИзвестно, что подрастающее поколение реагирует на запреты по-разному: если один ребенок молча прекратит запрещенное мероприятие, то другой закатит настоящую истерику. \r\n\r\n  \r\nА если воспитанник подросток, то тут и вовсе жди серьезного протеста – либо скрытого (который постепенно вырвется наружу в самый неожиданный момент) или же явного и последствия его не будут такими безобидными, как у младших детей. \r\nНу и что же делать – запрещать-то все равно приходится. Тут, как говорится, подход будет индивидуальным. \r\n\r\n В каждой семье приняты свои нормы поведения, методы воспитания могут быть отличными у каждого родителя. \r\n1.Но есть общепринятые нормы поведения в обществе, уголовный кодекс, наконец, и вот здесь как раз все понятно – нельзя, значит нельзя. Главное доступно и понятно объяснить ребенку почему нельзя и какие последствия может повлечь за собой нарушение запрета. \r\n2.А вот во всем, что касается личного пространства семьи и ребенка, немного все по-другому. Некоторые родители придерживаются принципа: «запрещено все, что не разрешено». Дети от них только и слышат: то нельзя и это нельзя. \r\n\r\n\r\n \r\n«Можно мне погулять?» - «Нет!». «Могу я взять конфету?» - «Нельзя!». «Можно пригласить Мишу в гости?» - «Нет!» И так на все вопросы, без объяснения причин. Что же в итоге? \r\n\r\n   \r\n\r\n\r\n                                                    фото конфликта ребенка и родителей \r\n\r\n   \r\n\r\nПока маленький, ребенок будет подчиняться родителям, а куда деваться-то?  \r\n\r\n Но по мере взросления постоянные запреты уже будут вызывать протест. \r\nДети начинают нарушать их, сначала скрывая это от родителей, а потом, в подростковом периоде, уже в открытую, демонстративно: «Я уже вырос, могу делать что захочу! Ваше мнение мне безразлично!» И вот начинается конфликт поколений, который может иметь весьма печальные последствия. \r\nТак что же делать, ведь нельзя же в самом деле все позволять? Конечно, нельзя. Но запреты должны быть как можно более редкими и иметь серьезные причины, такие, чтобы можно было объяснить ребенку. \r\n\r\n \r\nОбъяснять нужно обязательно, потому что голый запрет воспринимается как ваш личный каприз и вызывает обиду. \r\n\r\n 1.«Мам, можно я залезу на дерево?» - «Попробуй, а я тебя подстрахую». Так вы сможете проконтролировать ситуацию. А если вы сейчас запретите ему этот эксперимент, то ребенок все равно полезет на это дерево, но уже когда вас не будет рядом и тогда он может серьезно пострадать.Когда малыш попробует и поймет, что это сложно и опасно, вот тогда и объясните ему, почему не стоит одному, без взрослого повторять этот трюк. \r\n2.Или такая ситуация. Ребенок спрашивает, можно ли ему пригласить на День рождения весь класс. Конечно, разместить в однокомнатной квартире двадцать отпрысков не просто, да и накормить их и развлечь влетит вам в копеечку, но если вы сразу скажете «нет», ребенок почувствует себя обиженным и еще долго будет считать, что вы поступили несправедливо.Лучше ответить «да», а потом вместе с ребенком попытаться разобраться, что из этого получится. Когда он сам дойдет до мысли, что ничего хорошего выйти не может, получится, что вы ничего не запрещали, ребенок сам решил пригласить не весь класс, а нескольких друзей. Конфликта удалось избежать. \r\n\r\n                                                фото помощи родителя ребенку \r\n\r\n\r\n  \r\nОднозначный запрет нужно накладывать на поступки, которые могут угрожать жизни и здоровью ребенка или окружающих. Тут необходимо твердое «нет», раз и навсегда. И ни при каких обстоятельствах нельзя менять свое решение, так как непоследовательность в поступках взрослого серьезно подрывает его авторитет. \r\n\r\n ','Как сказать \"нет\" своему ребенку?',NULL,'/roditelyam/stati/kak-skazat-net-svoemu-rebenku','2017-09-09 19:50:27','2017-09-23 21:24:10',NULL,0),(269,' Воспитание детей в любой семье имеет свои особенности. У каждого родителя есть свои методы воспитания.Люди, создавшие семью, надеются на то, что в их семье будет царить мир, дружба и согласие между всеми членами семьи. \r\n\r\n Раньше детей учили скромности и сдержанности. Было не принято говорить о своих способностях, рекламировать свои таланты и навыки. В наше время авторы многих книг пишут о том, что детей нужно хвалить, поощрять, прививать с детства самоуважение, высокую самооценку. \r\n\r\n                                                     фото поощерения детей \r\n\r\nСемьи,которые следуют данным правилам, воспитывать ребенка-лидера. В этом есть свои плюсы. \r\n\r\n 1.Ребенок-лидер умен, хитер, горд. \r\n\r\n 2.Он легко может влиться в новый коллектив, умеет за себя постоять, знает себе цену. 3.Ребенок-лидер всегда находится в центре внимания сверстников, его уважают, иногда даже боятся.   \r\n\r\n 4.Такой ребенок уверен в себе, умеет быстро принимать решения. \r\n\r\n 5.Ему будет гораздо проще в жизни \"освоиться\", чем ребенку, который не уверен в себе, и зажат. \r\n\r\n\r\nЧтобы воспитать ребенка-лидера , требуется немало усилий. \r\n\r\n ','Воспитание ребенка лидера.',NULL,'/roditelyam/stati/vospitanie-rebenka-lidera','2017-09-09 20:23:54','2017-09-23 21:20:43',NULL,0),(270,'\r\nВоспитание ребенка в основном ложится на родителей. В большей степени первоначальным воспитанием ребенка занимается мать. Потому что только мать в состоянии уделять ребенку наибольшую часть времени и может отдать ему всю свою нежность, заботу и ласку. \r\n\r\n\r\n  \r\nНо стоит также помнить, что прекрасное воспитание зависит от семьи, в которой живет ребенок. Такой семьей может считаться та, где царит не только любовь друг к другу, но и любовь и уважение к другим людям. \r\n\r\n \r\nВоспитание единственного ребенка.  \r\n\r\n  \r\nОбычно, в семье, где один ребенок, родители уделяют ему слишком много внимания. Основной причиной этого считается неопытность. Важно знать, что ребенок самостоятельно должен выработать в себе человека, нужно только не мешать ему в этом, а посодействовать. \r\n\r\n                                                 фото ребенка-царя \r\n\r\n  \r\nНельзя воспитывать ребенка в тепличных условиях, постоянно холить и лелеять, баловать и нежить - это может привести к помехам в психологическом развитии ребенка - оно замедляется. А также он вырастит избалованным, несамостоятельным и неуверенным в себе человеком. \r\n\r\n И когда ребенок пойдет в детский сад, то ожидая от окружающих такого же внимания, к какому он привык дома и не получая его, он может столкнуться с трудностями, что может привести к разочарованию. А также он начнет замыкаться в себе и уединяться, чтобы не находиться в обществе других детей, так как он не привык делиться игрушками, а привык к пристальному вниманию со стороны взрослых, что все ему и все для него. \r\n\r\n  \r\nИ чтобы в дальнейшем такого не произошло, следует учесть то, что ребенок тоже человек, хоть пока еще и маленький, и у него должна быть свобода.  \r\n\r\n 1. У него должно быть детство, а в детстве имеет место беготня во дворе с друзьями и испачканные, рваные штаны. \r\n\r\n 2.Не надо делать из него образцового ребенка. \r\n3.Весь смысл воспитания ребенка состоит в том, чтобы научить его самостоятельности. 4.Родители должны относиться к нему с первых дней жизни как к взрослому человеку и должны помнить, что ребенок - это тоже личность. \r\n ','Воспитание ребенка.',NULL,'/roditelyam/stati/vospitanie-rebenka','2017-09-09 20:44:38','2017-09-23 21:16:34',NULL,0),(271,'\r\nКанадские ученые из Монреальского университета определили, что дети, которых с детства воспитывают самостоятельными, имеют более высокие умственные и когнитивные навыки. \r\n\r\n\r\n  \r\nВ рамках исследования ученые наблюдали за 78 детьми в возрасте от трех лет, которые играли в настольные игры, и их родителями. По мнению исследователей, именно такой способ игры позволяет: \r\n\r\n 1. максимально оценить интеллектуальные возможности детей \r\n\r\n 2.умение самостоятельно планировать и организовывать определенные процессы. \r\n\r\n 3.выполнять несколько действий одновременно. \r\n                                      фото игры детей в настольные игры \r\nРезультаты показали, что те дети, чьи родители воспитывают детей самостоятельными и независимыми, показали лучшие результаты, чем те , чьи родители излишне оберегают и ограничивают детей.  \r\n ','Развитие интелекта у ребенка',NULL,'/roditelyam/stati/razvitie-intelekta-u-rebenka','2017-09-09 22:27:29','2017-09-23 21:03:10',NULL,0),(285,' Дети - цветы жизни! С рождения они приносят в мир взрослого радость и счастье! Чего стоит только одна улыбка малыша, от которой жизнь становится яркой, осмысленной, наполненной положительными эмоциями! \r\n\r\n\r\n Когда женщина узнает, что ожидает малыша, она испытывает невероятные чувства и эмоции. Это может быть удивление, неожиданность или, наоборот, долгожданное чудо, радость от ощущения нового состояния. \r\n\r\n\r\n Порой материнство кардинально изменяет жизнь: новые заботы, обязанности, а какая доля ответственности за физиологическое и психологическое здоровье малыша ложится на плечи новоиспеченных родителей?! Первый вздох, плач, смех, слово, первые шаги - все это производит неизгладимое впечатление на людей, подаривших жизнь своему чаду. \r\n\r\n   \r\n\r\n                                         \r\n\r\n              Познавая новый мир, дети учатся: \r\n\r\n 1.общению со своими сверстниками \r\n\r\n 2. у них возникают привязанности, эмоциональные связи \r\n\r\n 3.выстраиваются определенные взаимоотношения, взаимодействия, столь необходимые для их социального развития. \r\n\r\n                                                 \r\n\r\nНаверное, каждый взрослый замечал, что человек не может жить в одиночестве, без общения. \r\n\r\n Для нормального, полноценного развития человеку необходимы социальные контакты. Каждый из нас проходит через такие социальные институты как семья, детский сад, школа, средне или высшее профессиональное образование, различные объединения (по интересам, увлечениям, хобби), организации, религиозные институты (церкви, мечети или синагоги). \r\n\r\n Отсутствие важных социальных институтов оказывает огромное влияние на формирование личности. В этом случае, важно помнить, что ребенок познает, осваивает новый, сложный для него мир и учится выстраивать взаимоотношения самостоятельно. \r\n\r\n Поэтому, взрослым важно позитивно оценивать личность ребенка, тактично и аргументировано указывать на недостатки, терпеливо и умело поддерживать, хвалить за старание и инициативность. Ни в коем случае ребенка нельзя наказывать и запрещать. \r\n\r\n              \r\n\r\nПомните такое выражение – запретный плод сладок? \r\n\r\n  Так и ребенок в этом возрасте может совершать действия, которые противоречат словам взрослым. Необходимо предоставить ребенку возможность быть взрослым в бытовых ситуациях (самому завязать шнурки, почистить зубы, выбрать, что ему съесть на завтрак овсянку или яичницу с колбасой, играть дома или на детской площадке). Тем не менее ребенок должен придерживаться режима (во сколько подъем, завтрак, прогулка, сон). \r\n\r\n\r\n \r\nУважаемые родители, учитывайте возрастные особенности своего ребенка, будьте терпимее к его капризам, создайте для него благоприятную атмосферу, наполненную жизнерадостностью и оптимизмом, тогда процесс адаптации ребенка к детскому саду пройдет легко и быстро!  \r\n\r\n   \r\n\r\n\r\n   \r\n ','адаптация ребенка в детском саду',NULL,'/roditelyam/stati/adaptaciya-rebenka-v-detskom-sadu','2017-09-09 23:22:40','2017-09-17 18:07:07',NULL,0),(291,'Вы никогда не задумывались над тем, в какой мере мы женщины склонны к самообману. Что руководит нами в подобных действиях? Неужели страх одиночества настолько силен? \r\n\r\n Нас всегда и везде окружают мужчины, нам лестно их внимание. И ведь, чем больше мужчин, тем больше склонность к одиночеству. Вся проблема в том, что человек не может без социума. Особенно мы женщины ищем постоянства и защиты за плечом любимого. \r\n\r\n                                             фото женщина за спиной мужчины \r\n\r\nЧто делать, если мы этого не получаем? Самообман?  \r\n\r\n Ненавидя себя за это и его за то, что мы покупаемся, продолжаем играть, будто ничего не происходит. Может вся наша жизнь сплошной самообман? И возможно ли от этого избавится? Или же удобнее продолжать игру, мило улыбаясь, показывать свою женскую слабость и кокетство? \r\n\r\n\r\n А одиночество - не так страшно, как описано? Я, читатели, не стремлюсь к переменам. И все продолжаю заниматься самообманом, пытаясь это использовать с умом. Наша сила в нашей слабости. Почему бы и не воспользоваться этим. Что же выберете вы?... \r\n\r\n ','Обман или одиночество?',NULL,'/otnosheniya/stati/obman-ili-odinochestvo','2017-09-10 00:30:53','2017-09-17 16:55:25',NULL,0),(292,'\r\n Знакомство в Интернете – это довольно распространенное явление в нашем современном мире. И ведь в таком знакомстве очень много положительного.  \r\n\r\n\r\n Например, люди, у которых довольно мало шансов встретиться в нашей жизни по каким – либо причинам свободно могут повстречать друг друга в этом неограниченном пространстве. И это должно радовать. Ведь теперь счастливых людей станет больше. \r\n\r\n Но, к сожалению, все это оказывается совершенно не так. И иногда такое знакомство в Интернете заставляет не столько радоваться, сколько грустить. И приносит такое «счастье» обычно больше горе и всевозможных неприятностей. \r\n\r\nфото грустного человека за компьютером \r\nПочему же так происходит? Почему знакомство в Интернете бывает таким сложным и непонятным? \r\n\r\n Ответить однозначно на эти вопросы просто невозможно, но можно объяснить все это несколькими фактами. \r\n\r\n Например, тем, что не все знакомящиеся в интернете рассказывают всю правду о себе и вообще бывают честны. \r\n\r\n 1.Именно во всемирной паутине поселились те, кто ищет свою будущую жертву. Это могут быть и педофилы, и воры, и убийцы, и даже мошенники. \r\n\r\n  \r\n2.Скучающие домохозяйки, молодые мамы, находящиеся в декретном отпуске, тоже неплохо проводят время в Интернете. Они знакомятся и развлекаются там с мужчинами в то время, пока их мужья зарабатывают деньги. И такое надувательство мужчин или кокетство также является преградой для тех, кто просто пытается познакомиться. \r\n\r\nПоэтому всегда будьте осторожны и не доверяйте первому встречному. \r\n ','Знакомство в Интернете',NULL,'/otnosheniya/stati/znakomstvo-v-internete','2017-09-10 00:50:08','2017-09-17 16:54:50',NULL,0),(293,'\r\n  \r\n\r\nТы об этом не думала? Я вот задумалась… Любовь – это сказка для детей? Или для маленьких взрослых девочек? Для тех, кто еще не вырос… \r\n\r\n\r\n\r\n\r\n   \r\n\r\n А вырастаешь ты очень быстро, и уже научился ставить все доказанные теоремы мира под сомненье! И даже можешь опровергнуть, что земля круглая…так каково же черта мы так упорно верим в эту сказку под названием «Любовь»? Пора вырасти. Её нет! Как нет и принца на белом коне, и даже злой колдуньи нет. Ты это можешь понять? Разуй глаза! \r\nЭто не любовь, это все иллюзия… фокус-покус для дурочек! Мне иногда кажется, что мы мазахистки. \r\n\r\n 1)Как же – это состояния счастья, чувство окрыленности, когда ты \"пищищ \"от удовольствия в его объятьях, как ты бежишь навстречу, как засыпаешь и просыпаешься с мыслью о нем. \r\n\r\n 2)Как отдаешь всю себя, как забываешь все то, что было для тебя дорого до встречи с ним! С твоим принцем! \r\n\r\n А этот принц уже не смотрит на тебя с обожанием, больше не звонит тебе по несколько раз в день, и даже не пишет СМС! Эти самые обычные СМС! И ты терзаешься, мучаешься, винишь себя, потом его, а потом опять себя…И это замкнутый круг. Ты с ним даже говоришь: «Скажи, милый, что не так? Я же чувствую, тебя что-то беспокоит!» Классная! Ты очень внимательная! Можешь себя поздравить! Да все не так, ему скучно, ему все надоело! И вроде ты хорошая, но ему больше неинтересно! \r\n\r\n                                                   фото   девушки с телефоном в руках \r\n\r\n\r\n  \r\nТак, скажи — это любовь? То к чему мы всегда так стремимся? Запомни милая – если ты себе не дашь крылья, их тебе никто не даст! Твое счастье не зависит от какого-то там «принца». Мы куем счастье своими руками, и если ты не будешь счастлива сама с собой, то счастливой тебя никто не сделает! Ни кто и ни когда! Забудь! Получай удовольствие, играй, заманивай, дразни, бери все и не отдавай ничего! В конце концов если не ты, то тебя! \r\n\r\n\r\n  \r\nМожет, это будет для него больно, но какая разница? Главное - не тебе! Ты же помнишь это чувство, когда сердце вырывается из груди, когда всю ночь воешь в подушку, а с утра протираешь лицо льдом, чтобы спала припухлость, как бродишь по улицам в надежде встретить его случайно, как мерзнешь и куришь, куришь и мерзнешь, как улыбаешься знакомым и говоришь, что все в порядке! Все отлично в твоей гребаной жизни. А потом — ночь и тоска. И тебе так холодно, и хочется, чтобы тебя согрела его нежная и сильная рука. \r\n\r\n                                                  фото девушки разочерованной \r\nТы мне только ответь на один вопрос — зачем? Зачем тебе все это? Ты глупая? Мазохистка? Идиотка? Или слепая? Почему мы не видим очевидных вещей? Ее нет! Любви нет! Забудь! И просто живи для себя! Люби себя! Ведь ни кто и никогда не полюбит тебя больше чем ты сама! Цени себя! Холь и лелей! Ты одна – уникальная, сексуальная и свободная! И ни от кого не зависишь! \r\n\r\n                                 \r\n ','А может любви нет',NULL,'/otnosheniya/stati/mozhet-lyubvi-net','2017-09-10 00:58:00','2017-09-17 16:54:22',NULL,0),(294,'\r\n Каждый человек мечтает найти свою вторую половинку, но увы не каждому это удается... Мечты об идеальном спутнике жизни, романтических прогулках при луне и кротких поцелуях заставляют нас прибегать к помощи интернета. \r\n\r\n\r\n В различных социальных сетях мы можем найти идеальную по внешности или предпочтениям половинку. Почему идеальную по внешности? Хм... Не стоит скрывать, что практически в 80% случаях знакомств в соц. сетях служит привлекательная внешность оппонента. \r\n\r\n Конечно, это может быть и так называемый \"фейк\", а может и вполне реальный человек. Просматривая множество страниц в соц. сетях мы натыкаемся на самых разных людей и возможно некоторые привлекают наше внимание. Существует множество примеров знакомства в интернете, которые не редко заканчиваются свадебным маршем Мендельсона, но к сожалению есть и случаи горького расставания. \r\n\r\n \r\nНечего плохого в таких знакомствах нет! Это совершенно нормально! Ведь как говорится \" В любви как на войне - все средства хороши!\". \r\n\r\n Но все есть и отрицательные стороны интернет знакомств. Мошенники! И не только! Насильники, маньяки, педофилы - и это далеко не весь список опасностей подобных знакомств. Конечно, все это кому-то может показаться большим преувеличение, но отнюдь нет, как бы мне хотелось чтобы это было лишь большой выдумкой. Обычно такие люди затевают знакомства очень даже радушно и мило, а потом начинают настаивать о встрече, где и происходит преступление. \r\n\r\n                               фото насильника \r\n\r\nЧтобы обезопасить себя от такого рода посягательств следует соблюдать несколько не сложных предостережений: \r\n\r\n 1.Если вы познакомились с кем-то в интернете не стоит после недели общения сразу соглашаться на встречу. Лучше немного подождите и продолжите общения. Ведь кто умеет ждать, тот много добивается! \r\n\r\n 2.Если все-таки оппонент удовлетворяет ваши требования и вроде ни каких особых угроз по вашему мнению он не представляет, вы согласились на встречу, то лучше пойти туда не одному, а с близким другом или на худой конец со старшим братом или сестрой. Чтобы не произошло недопонимание, просто попросите вашего потенциального партнера тоже пригласить близкого друга. Уверена не желающий вам нечего плохого человек с радостью согласится! \r\n\r\n\r\n Не переживайте о том, что вдруг вам не удастся побыть наедине, ведь в любой момент вы просто сможете покинуть своих друзей и пойти в какое-нибудь другое кафе или ресторан. Кто знает, может эта встреча соединит сразу несколько пар сердец!.. \r\n\r\n\r\n  \r\nЯ считаю, что поиски любимого или любимой должна быть случайными и спонтанными, устраивая смотрины в соц. сетях мы часто не задумываемся о состоянии души человека. Может нам совершенно не понравиться его дальнейшее поведение, но не стоит исключать и удовлетворительного исхода общения... \r\n\r\nТак что, дорогие читатели ищите свои вторые половинки! \r\n ','Интернет знакомства',NULL,'/otnosheniya/stati/internet-znakomstva','2017-09-10 01:13:26','2017-09-17 16:53:52',NULL,0),(295,'\r\n «На вкус и цвет все фломастеры разные», - скажете вы. А я отвечу: «Несомненно, но всё-таки существуют такие черты, которые каждый мужчина хотел бы видеть в своей спутнице». \r\n\r\n\r\nБыло проведено несчётное множество различных опросов, на основе которых психологи и вывели «формулу идеальной девушки». Давайте разбираться.. \r\n\r\n  \r\n1.Увидев первый пункт, девушки недовольно вздохнут, но такова мужская психология. Итак, мужчины поставили на первое место внешние данные женщины. Да-да, «Внешность – не главное», - говорили они, - «Смотри, какая страшная баба идёт», - говорили они. Но представители мужского пола отметили именно ухоженность девушки, а не природную красоту. То есть мужчине будет важно то, что ты следишь за собой, а не то что у тебя от природы нет ног от ушей и груди третьего размера. \r\n\r\n                                                       фото идеала девушки \r\n\r\n 2.На втором месте легендарный женский ум. Мужчины хотят видеть рядом интеллектуально развитую девушку и в то же время не хотят, чтобы женщина слишком много «умничала». Следовательно, парням важна наша способность думать, но они хотят, чтобы мы это тщательно скрывали. \r\n\r\n 3.Третье место в топе заняла верность. Именно так, мужчине важно, чтобы его любимая принадлежала только ему. Да, собственно, и сами женщины это хотят видеть и в мужчинах, не так ли? \r\n\r\n 4.На четвёртом месте сексуальность. Это вовсе не значит, что мужчина хочет видеть вас круглосуточно в нижнем белье, вовсе нет. Он должен чувствовать к вам желание. Ему должно вас хотеться, а это возможно и тогда, когда вы в одетом виде. \r\n\r\n                                 фото красивой фигуры девушки \r\n\r\n 5.И последнее место заняла хозяйственность. Да, мужчине хочется, чтобы вы порадовали его вкусным борщом и постирали его рубашку, но согласно статистике, мужчине важнее, что вы – верная, любящая и настоящая девушка, ведь какое счастье со «стервозной бабой», даже несмотря на её широкие познания в кулинарии? \r\n\r\n   \r\n\r\n\r\n \r\nТаким образом, дорогие дамы, будьте собой. Будьте той, кем вы являетесь на самом деле, и ваша любовь вас найдёт! \r\n\r\n  \r\n\r\n\r\n   \r\n ','Идеальная девушка глазами мужчин.',NULL,'/otnosheniya/stati/idealnaya-devushka-glazami-muzhchin','2017-09-10 01:18:37','2017-09-17 16:53:24',NULL,0),(296,'\r\n Тело человека может очень многое о нем рассказать, даже больше чем ему (человеку) хотелось бы. По определенному положению тела можно увидеть например, чего мы боимся или о чем думаем. \r\n\r\n\r\n Сейчас очень много фирм при приеме человека на работу, имеют в своем штате сотрудников умеющих понимать язык тела. Они очень точно распознают, что значит та или иная поза человека, пришедшего устраиваться к ним на фирму. \r\nДовольно часто мы ощущаем в себе какую-то скованность и неудобство в самых важных для нас ситуациях. \r\n\r\n И тут возникает вопрос, а возможно ли как-то поменять состояние неловкости и показать собеседнику, что вы уверенны в себе. Достаточно разучить ряд жестов и немного изменить манеру поведения, и вы сможете расположить к себе любого человека, а также убедить его в том, что вы уверенны в себе. \r\n\r\n   \r\n\r\nТак как же нужно вести себя, чтобы всем было приятно видеть вас? \r\n\r\n  \r\n1.Будьте улыбчивы.Если все видят что вы улыбаетесь, то значит вы все довольны и счастливы, ну и конечно уверены в себе. Улыбка значит, что вы ничего не боитесь чувствовать себя уверенно. Тогда у всех окружающих вы будете вызывать только симпатию. \r\n\r\n  \r\n2.Ходите с расправленными плечами. \r\nХодите прямо и не тащите ноги. Нужно расправить плечи и держать спину ровно, чтобы все люди видели, что от вас исходит сила, а сильный человек всегда производит приятное впечатление на окружающих. Не семените, шагайте шире и не оглядывайтесь по сторонам. \r\n\r\n                                  фото красивой походки \r\n3.Не прячьте глаза. \r\nЕсли вы уверены в себе, то вам нечего скрывать от окружающих. Уверенный в себе человек не опускает глаза при разговоре, а спокойно смотрит собеседнику в глаза, не отводя взгляд. При разговоре это очень важно, когда вы смотрите собеседнику в глаза, то он видит, что вы ничего от него не скрываете и честны с ним. Не держите руки в карманах и не прячьте за спиной. Это может создать впечатление, что вы что-то скрываете. Держите руки в спокойном положении. Сидя, можно положить их на стол или на колени. \r\n\r\n 4.Будьте всегда опрятны. \r\nВнешний вид играет очень важную роль. Неряшливый, с дурным запахом и с непричесанными волосами человек, приятное впечатление на окружающих точно не произведет. И в себе уверен он от этого тоже не будет. Надо быть опрятным и хорошо выглядеть всегда, а не только перед каким-то мероприятием или встречей. \r\nВсегда будьте спокойны. \r\n\r\n                                                     фото человека идущего в офис \r\n\r\n\r\n  \r\nБольшинство людей во время серьезного разговора, начинают активно жестикулировать. Такое поведение, как правило, снимает чувство страха и обеспокоенность. Но вашему собеседнику все эти жестикуляции будут неприятны. Также это показывает вашу нервозность. И люди вокруг вас тоже становятся нервными. \r\n\r\n\r\n Все таки лучше взять себя в руки и успокоиться. \r\n1.Не нужно скрещивать руки.Такой жест как скрещенные руки, истолковывается как защитный жест. Своим видом вы показываете окружающим, что разговор вам неприятен и общаться вы не хотите. Этим вы вызовете антипатию у знакомых или коллег по работе. Скрещенные руки – самая неудачная поза во время разговора. \r\n\r\n 2.Держите руки спокойно. \r\nВо время разговора большинство людей начинает сжимать руки в кулак, скрещивать пальцы, приглаживать волосы, крутить в руках какую-нибудь вещь. Такая жестикуляция показывает, что вы неуверенны в себе. Нужно успокоиться и не делать лишних телодвижений. \r\n\r\nВсем понравиться вы не сможете, но в некоторых случаях благоприятное впечатление на окружающих вы произведете. Независимо от того где вы находитесь – на деловой встрече или на свидании, позитивный настрой и уверенность в себе обязательно помогут вам решить исход дела (разговора) положительно. \r\n ','Как показать себя уверенным?',NULL,'/studentam/stati/kak-pokazat-sebya-uverennym','2017-09-10 01:25:11','2017-09-17 17:57:18',NULL,0),(301,'\r\n Заканчивая школу, многие ребята задумываются о том, какую же форму обучения предпочесть: дневную или заочную форму. Несомненно, чтобы они не выбрали для себя, цель у них одна – получить диплом, но процессы и принципы обучения у этих форм существенно отличаются. \r\n\r\n\r\n \r\n \r\nРассмотрим плюсы и минусы каждой из этих форм обучения.  \r\n\r\n  \r\n1.Заочную форму обучения многие выбирают, исходя из следующих положительных моментов: \r\n- в первую очередь, это конечно, возможность совмещать работу и учебу, ведь посещать занятия нужно лишь раз в полгода; \r\n- стоимость обучения заочно, зачастую значительно ниже, а это хорошая экономия средств; \r\n- студент заочник, как правило, самостоятельно изучает нужные для учебы источники, а значит, он может это делать в удобное для него время; \r\nпреподаватели также довольно благосклонны к заочникам, прекрасно понимая их занятость.  \r\n\r\n \r\nНо при всех достоинствах заочной формы у нее есть и существенные минусы  \r\n\r\n 1.) это достаточно невысокое качество образования, так как программы заочного обучения преподаются в сокращенной форме. \r\n\r\n 2.)Студенты мало общаются с преподавателями вне занятий, не участвуют в студенческих научных проектах, экспедициях. \r\n\r\n 3.)Практика по специальности часто носит формальный характер. \r\n\r\n 4.)Да и качественно изучить гору специальной учебной литературы самостоятельно, у работающего студента не всегда получается. \r\n\r\n 5.)Работа после школы, когда нет специальности, редко бывает высоко оплачиваемой. \r\n\r\n                              фото совмещение учебы и работы \r\n\r\n  \r\n2.Теперь перейдем к дневной форме обучения и обозначим явные плюсы: \r\n- конечно же, главным плюсом будет получение полноценных теоретических знаний, а учебные программы по специальным предметам носят углубленный характер; \r\n- участие в семинарах, практических работах, экспедициях, молодежных слетах, студенческих олимпиадах дает большой опыт общественной работы и отлично закрепляет полученные знания; \r\n- получение образование очно, считается более престижным, и работодатели предпочитают брать на работу выпускников, которые учились на дневной форме; \r\n- полноценная студенческая жизнь, в полной мере, ощущается при дневном обучении, воспоминания об этих веселых годах остаются на всю жизнь. \r\n\r\n \r\nК недостаткам этой формы обучения относят  \r\n\r\n 1.) в первую очередь, довольно высокую плату \r\n\r\n 2.)проходной балл также значительно выше \r\n\r\n 3.)прохождение практик и стажировок не дают большого опыта, так как времени на них учебный план отводит немного. \r\n\r\n                                  фото счастливого студента \r\n\r\n \r\nНесомненно, одно – для получения действительно качественного образования, нужно иметь большое желание учиться. А что выбрать, каждый студент решает сам, в зависимости от своих финансовых возможностей, семейного положения и личных предпочтений. \r\n ','Очная и заочная формы обучения. Их плюсы и минусы.',NULL,'/studentam/stati/ochnaya-i-zaochnaya-formy-obucheniya-ih-plyusy-i-minusy','2017-09-11 11:37:58','2017-09-17 17:56:46',NULL,0),(303,'\r\n Знание английского сегодня это отличное конкурентное преимущество. Умея говорить на английском проще найти работу, можно быстрее получать новые знания, создать успешный бизнес на примере иностранных аналогов. \r\n\r\n\r\n Так что если ты думаешь над тем, как быстро выучить английский язык с нуля, вот тебе 10 способов для этого. \r\n\r\n 1. Нанять профессионала \r\nПожалуй, это лучший способ. Поэтому здесь могу порекомендовать онлайн школу английского Skyeng.ru. Онлайн формат позволит тебе: \r\n\r\n -самому выбирать где и когда учиться \r\n\r\n -тебе подберут преподавателя под твои интересы и характер \r\n\r\n -а цифровой учебник облегчит обучение, сохранит все, что учишь в одном месте и покажет прогресс. Запишись на бесплатный урок на Skyeng.tu. \r\n\r\n  \r\n2. Полное погружение дома \r\n1)Обклей каждый предмет в доме словом на английском языке. \r\n\r\n 2)Подключи зарубежные каналы по ТВ. \r\n\r\n 3)Установи на всех устройствах иностранный язык. \r\n\r\n 4)Купи книги на английском языке. \r\n\r\n 5)Слушай аудио на английском в плеере и машине. Это хороший способ выучить английский для начинающих. \r\n\r\n  \r\n3. Полное погружение за рубежом \r\n\r\n Переезд в другую страну значительно ускоряет изучение языка. Ты везде слышишь иностранную речь. Все что тебя окружает на другом языке. Тебе самому приходится общаться на иностранном языке, чтобы тебя поняли. В таких условиях можно заговорить на английском уже через месяц. \r\n\r\n                      фото русского в америке \r\n4. Перейти на общение дома только на английском \r\nНайди единомышленника среди родственников. И начните говорить только на английском языке. Не можешь сказать ищи словарь и переводи. С помощью приложений для смартфона это быстро делается. \r\n\r\n  \r\n5. Просмотр любимых фильмов в оригинале с русскими субтитрами \r\nОбучение проходит быстрее и эффективнее когда тебе нравится то, что ты делаешь. Любимые фильмы создадут атмосферу интереса. Так что изучение английского будет проходить легче. \r\n\r\n  \r\n6. Найти иностранца желающего выучить русский \r\nТы будешь учить его, он тебя. Вы можете общаться по скайп у. Познакомившись, можете начать ездить друг другу в гости еще больше погружаясь в нужную языковую среду. \r\n\r\n                                                            фото разговора русского с американцем \r\n7. Через музыку \r\nЕсли ты меломан, найди тексты песен и их перевод. Пой, повторяй любимые песни и очень скоро наберешь необходимый словарный запас. Так же это хороший способ научиться понимать английскую речь на слух. \r\n\r\n  \r\n8. Купи интерактивные обучающие программы \r\nИ занимайся каждый день минимум 1 час. Секрет успеха в изучении английского это постоянство. Занимайся каждый день и через 3 месяца уже сможешь общаться на английском. \r\n\r\n  \r\n9. Используй свое подсознание \r\nНаше подсознание лучше запоминает если ты все прописываешь от руки. Также оно лучше запомнит если ты повторишь изученное за день перед сном. Также лучше запоминается информация, связанная с эмоциями. Поэтому ищи интересные для себя способы изучения английского. Как пример, я уже говорил про любимые фильмы и музыку. \r\n\r\n  \r\n10. Найди свое вдохновение \r\nДостижение любой цели ускоряется в десятки раз, когда ты находишь мотивирующий тебя ответ Зачем тебе это нужно Представь, что ты знаешь английский. Какую работу ты сможешь найти и на сколько больше начнешь зарабатывать. С кем сможешь познакомиться. Что это тебе даст. Подумай на этим. Особенно если тебе не хватает желания изучать английский. \r\n\r\n\r\n Вдохновение позволит тебе избавиться от лени, и нежелания зубрить английский. \r\n\r\n ','10 способов изучения английского!',NULL,'/studentam/stati/10-sposobov-izucheniya-anglijskogo','2017-09-11 14:29:55','2017-09-17 17:55:58',NULL,0),(304,'\r\n Для работы, учебы и для общего развития человека ему необходимо иметь хорошую память. \r\n\r\n\r\n Не будем углубляться в теорию, что собой представляет человеческий мозг и память в частности, а лучше рассмотрим один из способов улучшения и расширения памяти. \r\n\r\n 1.Максимализируйте силу своего мозга с помощью визуализации. \r\nИменно визуализация является мощным инструментом для увеличения памяти. Она способствует развитию креативности и созданию комплексных идей. \r\nСамый простой способ научится визуализация - это рисовать. Когда человек воспринимает информацию на слух, то он усваивает ее на 30% меньше, чем когда он видит это же. Нужно стараться рисовать то, что слышишь. \r\n\r\n                 фото рисующего человека \r\n2.Задействуйте больший спектр своего мозга. \r\nКогда человек мысленно воспроизводит информацию, его мозг задействует другую часть мозга, которая отвечает за креативность, что способствует лучшему усвоению полученных данных. \r\n3.Управляйте информацией и расставляйте приоритеты. \r\nПоскольку человек не может запомнить абсолютно весь поток информации, который он получает, очень важно уметь быстро анализировать и расставлять приоритеты. \r\n\r\n                            фото головы со светящимся мозгом \r\n\r\n\r\n Нужно концентрировать свое внимание на том, что мы считаем важным, и визуализировать.Визуальное восприятие информации намного сильнее. Не стесняйтесь рисовать и выделяйте для себя только саое важное. \r\n\r\n ','Как расширить память. Один из способов.',NULL,'/studentam/stati/kak-rasshirit-pamyat-odin-iz-sposobov','2017-09-11 14:55:06','2017-09-17 17:55:26',NULL,0),(305,' Основные факторы выбора профессии: \r\n\r\n  \r\n1.Профессиональная заинтересованность (зависит от увлечений и склонностей к определенным видам деятельности) \r\n\r\n 2.Умения (чаще всего бывает сложно определить свое истинное призвание для успешности в карьере) \r\n\r\n 3.Активность (высокая или низкая), степень подготовленности (успеваемость в школе) \r\n4.Осведомление о видах профессий \r\n\r\n 5.Социальная и семейная среда и многое другое. \r\n\r\n\r\n                                               фото разных профессий \r\n\r\n  \r\nОтсюда следует, что для удачной гармонизации всех трудных и разноречивых личностных взаимодействий в обществе и коллективе, в сочетании с группой экстроспективных политических, экономических и культурных обстоятельств, уместна и психологическая атмосфера, которые не реальны без развитых умений, навыков и работоспособности у любой переходящей на серьезный жизненный этап личности. Кризис таких данных резко проявляется в нынешний век, когда увеличиваются потребности в свободных коммуникациях с людьми различного статуса. \r\n  \r\n\r\n\r\n   \r\n ','Выбор профессии как важнейший аспект в современном обществе.',NULL,'/studentam/stati/vybor-professii-kak-vazhnejshij-aspekt-v-sovremennom-obshestve','2017-09-11 15:08:22','2017-09-17 17:54:41',NULL,0),(308,'\r\n В повседневной жизни мы так привыкли к стандарту разнообразий наших мыслей, если мы хотим что то изменить в своей работе, жизни или элементарно что то придумать, мы сразу же бросаем это дело.  \r\n\r\n\r\n Потому что придумать что-то уникальное очень тяжело. Порой можно сидеть часами придумывая новые идеи или хотя бы возможности изменить что-то в своей повседневной жизни. \r\n\r\n Но все таки есть уж люди у которых все получается. Они, как обычно, придумывают разные идеи одни да другими. Можно подумать что у них дар, но не стоит торопиться выводами. На самом деле есть несколько методов с помощью которых можно придумать самые различные, и уникальные идеи в любой сфере.  \r\n\r\n                         фото человека с лампочкой над головой \r\nНачнем мы с простого с метода сложения. Это очень простой метод. Надо только сложить две вещи и смотреть что получится. Например: возьмем зебру и карандаш у нас получится полосатый карандаш. \r\n\r\n 1.Выйдите на пробежку, когда тело человека находится в движении. То легче придумать что-то новое. \r\n2.Найдите свою среду обитания, то есть кто-то лучше думает в холоде, а кто-то на оборот. А вы попробуйте все. \r\n3.И по чаще смотрите в окно, за окном чаще всего найдется новое. \r\n\r\n \r\nНу вот и все желаю удачи! Успехов вам! \r\n ','От куда рождаются новые идеи?',NULL,'/studentam/stati/ot-kuda-rozhdayutsya-novye-idei','2017-09-11 22:50:05','2017-09-17 17:57:44',NULL,0),(309,'\r\n В современном мире, чтобы успешно существовать среди окружающих, выделяться из серой массы и уметь заинтересовать любого понравившегося человека, нужно быть умным. За ум отвечает мозг, поэтому его и нужно развивать, совершенствовать и заставлять работать на полную катушку. \r\n\r\n\r\n \r\nИтак, практические советы, или как улучшить работу мозга: \r\n\r\n 1. Больше книг, меньше телевизора. \r\nПервое и самое основное правило: больше читайте. Книги развивают человека, вдохновляют, мотивируют и помогают стать умным. Именно книги, а не развлекательные передачи или комедийные фильмы. \r\n\r\n Однако книги должны быть полезными. Любовные романы, например, в эту категорию не вписываются. Зато энциклопедии, психология и философия помогут вам обрести свою точку зрения, научиться понимать людей и стать умней. \r\n\r\n Если совсем отказаться от телевизора кажется невозможным, старайтесь: \r\n\r\n 1) постепенно ограничивать время просмотра, с каждым разом уделять ящику всё меньше времени \r\n\r\n 2) смотреть лишь полезные и развивающие передачи. \r\n\r\n                       фото интелектуальной программы \r\n2. Логически задачи. \r\nЗнания – это хорошо. Книги, люди, познавательные передачи и прочее помогут вам узнать много нового, но радоваться рано. Чтобы мозг работал, его нужно нагружать не только новой информацией, но и устраивать ему тренировки. \r\n\r\n -Нестандартные или логические задачки \r\n\r\n -кроссворды или сканворды, шарады или ребусы \r\n\r\n -головоломки, а также многие другие вещи позволят тренировать свой мозг. Кроссворды, например, помогут закрепить те знания, что вы получили из книг, ведь от теории без практики мало толку. \r\n\r\n                               фото размышляющего человека \r\n3. Оригинальность. \r\nРазвивайте свою оригинальность ежедневно, избегайте шаблонности и штампов. Во-первых, это значительно поможет мозгу и его работе, во-вторых, это всегда пригодится вам в жизни. Научитесь делать привычные вещи непривычными способами: например, если вы правша, попробуйте во время еды держать ложку или вилку в левой руке. Для вас это будет необычно и непривычно, но благодаря подобным мелким упражнениям, вы сами заметите, что стали меньше использовать шаблонные слова и творить шаблонные действия. \r\n\r\n  \r\n4. Память. \r\nЧтобы ваш мозг работал, вы обязаны развить свою память. То же чтение из 1-ого пункта вам неплохо поможет. Помимо чтения книг: \r\n\r\n -учите стихотворения \r\n\r\n -используйте интересные методики для запоминания цифр, имён и лиц и развивайтесь. \r\n\r\n Настоятельно не рекомендуется пользоваться таблетками, препаратами и другими искусственными «помощниками»; они не только не помогут положительно повлиять на работу мозга, но могут и навредить. \r\n\r\n \r\nВсего эти 4 совета помогут вам значительно повысить свой интеллект с помощью саморазвития. Ваш мозг будет трудиться, развиваться и совершенствоваться, а вы будете пожинать прекрасные плоды его качественной работы. \r\n  \r\n ','Как улучшить работу мозга',NULL,'/otnosheniya/stati/kak-uluchshit-rabotu-mozga','2017-09-11 22:59:04','2017-09-17 16:51:26',NULL,0),(316,'','Список советов родителям',NULL,'/roditelyam/sovety/spisok','2017-09-12 20:31:40','2017-09-12 20:35:07',NULL,0),(317,'','Список статей родителям',NULL,'/roditelyam/stati/spisok','2017-09-12 20:32:23','2017-09-12 20:35:07',NULL,0),(318,'','Список советов отношения',NULL,'/studentam/sovety/spisok','2017-09-12 20:34:01','2017-09-12 20:35:07',NULL,0),(319,'','Список статей студенты',NULL,'/studentam/stati/spisok','2017-09-12 20:34:31','2017-09-12 20:35:25',NULL,0),(320,'','Список советов студенты',NULL,'/studentam/sovety/spisok','2017-09-12 20:36:16','2017-09-12 20:41:03',NULL,0),(321,'','Список советов отношения',NULL,'/otnosheniya/sovety/spisok','2017-09-12 20:36:58','2017-09-12 20:41:03',NULL,0),(322,'','Список статей отношения',NULL,'/otnosheniya/stati/spisok','2017-09-12 20:38:07','2017-09-12 20:41:03',NULL,0),(335,' Введите текст сюда \r\n ','Новый совет отношения',NULL,'/otnosheniya/sovety/novyj-sovet-otnosheniya','2017-09-12 19:02:54','2017-09-12 19:06:47',NULL,0),(343,' Введите текст сюда \r\n ','Добавлена статья родителям',NULL,'/roditelyam/stati/dobavlena-statya-roditelyam','2017-09-14 09:07:30','2017-09-14 09:09:21',NULL,0),(344,' Введите текст сюда \r\n ','Добавлена статья в отношения',NULL,'/otnosheniya/stati/dobavlena-statya-v-otnosheniya','2017-09-14 09:11:08','2017-09-14 09:11:49',NULL,0),(345,' Введите текст сюда \r\n ','Добавлена статья в студенты',NULL,'/otnosheniya/stati/dobavlena-statya-v-studenty','2017-09-14 09:12:19','2017-09-14 09:12:50',NULL,0),(346,' Введите текст сюда \r\n ','Добавлена статья студентам',NULL,'/studentam/stati/dobavlena-statya-studentam','2017-09-14 09:15:37','2017-09-14 09:16:12',NULL,0),(348,' Введите текст сюда \r\n ','1',NULL,'/roditelyam/stati/1','2017-09-14 14:15:38','2017-09-14 14:16:14',NULL,0),(359,'\r\n В статье приводятся ошибки, которые люди, разочарованные предыдущими отношениями, часто допускают на первом свидании: поиск идеала, страх быть брошенным, отсутствие позитивного настроя и другие. \r\n\r\n\r\n \r\n \r\nОдинокие, незанятые, свободные люди в большинстве своем мечтают выйти из зачарованного круга бесконечных свиданий с потенциальными партнерами, но как-то неосознанно превращают постройку интимной связи в тяжелую работу. И этим одним отпугивают вторую половинку. \r\n\r\n Поговорим о распространенных ошибках при первом свидании, о том, как эти ошибки исправить. Итак, советы для тех, кому надоели извечные первые свидания. \r\n\r\n Ошибка № 1: поиск принца (принцессы) \r\n\r\n Мы зацикливаемся на поисках одного-единственного (одной-единственной), отвергая потенциальных претендентов через вторичные причины, и имеем склонность разрывать связь при первой возникшей проблеме. \r\n\r\n Что делать? Не потворствуйте невольному импульсу найти в новом партнере пороки и недостатки. Можно же взглянуть на полупустой стакан иначе. \r\n\r\n 1.Нужно отметить для себя преимущества и достоинства человека \r\n\r\n 2.найти в нем потенциал для продолжения отношений. \r\n\r\n                                                  фото ножа в сердце \r\n\r\n Ошибка 2: разрыв связи без всякой причины, боязнь быть отвергнутым \r\n\r\n Во многих случаях страх вынуждает человека преждевременно наносить предупреждающий удар. Помните, любовь - это не бокс! \r\n\r\n   \r\n\r\n Ошибка 3: пустые ожидания \r\n\r\n Во время первых свиданий люди, настроенные серьезно, зачастую избегают объяснений, не рассказывают, чего они ждут от будущей романтической связи. А потом выясняется, что их партнер вообще хотел легкого флирта. Все это приводит к болезненным переживаниям. \r\n\r\n 1.Поэтому не стесняйтесь спрашивать про вещи, которые важны для вас, говорить о них уже на первом свидании. \r\n\r\n 2.Объяснитесь (хотя бы намеками) про ваши ценности, про ваши ожидания от связи. В большинстве случаев вас поймут. \r\n\r\n\r\n Помните, разговор - надежный путь, который позволяет выяснить уже на первом свидании, совпадают ли ваши ожидания с ожиданиями другого человека. \r\n\r\n   \r\n\r\n\r\n Ошибка 4: отсутствие позитивной энергии и инициативы \r\n\r\n 1.Выйдите из дома такой, какой вы есть. Вы - не машина для свиданий. \r\n\r\n 2.Вычислите наперед атмосферу свидания (будете ли вы внимательно слушать друг друга, веселиться и т. д.), подумайте, что вы будете делать, чтобы создать ее. \r\n\r\n 3.Чтобы добиться искренности, которая в конечном итоге приведет к глубокому знакомству с человеком, кто-то из двоих должен взять инициативу на себя. Почему бы не вы? \r\n\r\n                                                фото сранения людей \r\n\r\n Ошибка 5: сравнение с прошлыми партнерами \r\n\r\n На первое свидание мы несем всю свою обиду, все просчеты прошлого, включая воспоминания о наших бывших, которые разочаровали, бросили и т. д. Мы садимся напротив нового человека и смотрим на него через фильтр прошлого. \r\n\r\n\r\n  Живите сегодняшним днем! Можно же одолеть черную полосу. И сначала попробуйте отнестись к человеку так, как бы вы хотели, чтобы он обошелся с вами. Поверьте, несчастная любовь не охотится лично на вас. \r\n\r\n   \r\n\r\n ','Как сделать первое свидание успешным',NULL,'/otnosheniya/sovety/kak-sdelat-pervoe-svidanie-uspeshnym','2017-09-17 07:43:21','2017-09-17 09:08:06',NULL,0),(349,' Введите текст сюда \r\n ','будем ли мы вместе?',NULL,'/otnosheniya/sovety/budem-li-my-vmeste','2017-09-16 16:12:07','2017-09-16 17:16:55',NULL,0),(352,' Введите текст сюда \r\n ','будем ли мы вместе?',NULL,'/otnosheniya/stati/budem-li-my-vmeste','2017-09-16 17:36:23','2017-09-16 18:19:02',NULL,0),(355,' Какие поступки разрушают отношения быстрее всего? Что может сделать девушка, чтобы сохранить отношения? \r\n\r\n\r\n Если ты дорожишь своими отношениями и партнером, никогда не совершай того, о чем пойдет речь ниже. Это способно разрушить даже самые крепкие отношения. \r\n\r\n\r\n   \r\n1.Попытки изменить его \r\n\r\n Тебе может показаться, что таким образом ты делаешь своему партнеру одолжение, помогаешь ему измениться и стать лучше во всех смыслах. \r\n\r\n Но нужно понять и принять тот факт, что он, скорее всего, не хочет ничего менять в своей жизни и прекрасно чувствует себя как есть. Попытки изменить человека – пустая трата времени и сил. Да и мало кому это может понравиться. \r\n                                                   фото ссоры пары \r\n2.Ссоры на публике \r\nТак ты демонстрируешь свое глубокое неуважение к партнеру. Или негатива накопилось столько, что ты только и ищешь возможности выплеснуть его наружу?     Во всяком случае, выяснять отношения нужно не на потеху публике, а дома. \r\n\r\n  \r\n3.Слежка \r\n\r\n Взломать его аккаунт в соцсети было делом плевым. Зато теперь ты знаешь о нем все: с кем он общается, с кем поддерживает хорошие отношения и, конечно, детали переписки. А он об этом знает? Нет? \r\n\r\n А теперь представь, как он отреагирует, когда все выяснится. Даже если он никогда не узнает об этом, уверена ли ты, что хочешь увидеть его переписку? Это один из тех случаев, когда знание бывает лишним. \r\n  \r\n4.Критиковать его семью \r\n  \r\nКакие бы «тараканы в голове» ни были у его родных, тебе не следует дурно отзываться о них. Вероятно, он и сам все прекрасно понимает, просто услышать правду от другого человека – всегда неприятно. Это может подорвать ваши отношения. \r\n  \r\n5.Врать \r\n  \r\n\r\n Об этом скажет всякий психолог и опытный в отношениях человек: доверие – основа отношений. \r\n\r\n\r\n Если вы постоянно что-то скрываете друг от друга, недоговариваете или врете, отношения уж никак нельзя считать здоровыми.А если это так, нужны ли они вам вообще? \r\n\r\n                                                                   \r\n\r\n ','Будем ли мы вместе?',NULL,'/otnosheniya/stati/budem-li-my-vmeste-1','2017-09-16 17:52:59','2017-09-17 16:20:16',NULL,0),(358,'  \r\nНесколько советов девушке, как стать популярной в коллективе \r\n\r\n \r\n \r\nЧто делать, если вам нужно вливаться в новый коллектив? Как найти новых друзей и стать частью нового окружения? \r\n\r\n\r\n  \r\nСовременная девушка - это уверенная и модная красотка, которая хочет быть всегда в центре внимания. \r\n\r\n\r\n Однако в нашей жизни случаются такие ситуации, когда человек попадает в новый коллектив. Соответственно, ему нужно наладить новые контакты, обзавестись друзьями и знакомыми. А сложившиеся компании не всегда готовы принять в свой коллектив новых и незрелых птенцов.  \r\n\r\n \r\nЧто же делать в этом случае?  \r\n\r\n 1.Прежде всего, вы должны привлекать внимание на себя. В этом вам, конечно, может помочь яркая одежда и аксессуары, но ваша общая история намного важнее.  \r\n\r\n 2.Вы должны казаться милой и коммуникабельной, чтобы заслужить уважение. Поэтому нужно заранее придумать, что рассказывать о себе своим будущим друзьям.  \r\n\r\n 3.Как вы переехали сюда? Кто ваши родители? \r\n\r\n                                   фото девушки в экстримальной ситуации \r\n\r\n Можно придумать какой-то острый поворот сюжета в вашей истории. Что-то экстремальное и курьезное. Это увлечет ваших слушателей, а далее вызовет долю уважения. Например, была какая-то опасная ситуация, а вам удалось удачно выпутаться из этой ситуации.  \r\n\r\n                                          \r\n\r\nИнтересуйтесь жизнью своих новых коллег, задавайте вопросы и внимательно слушайте ответы. \r\n\r\n 1.Старайтесь помогать своим новым коллегам, не отказывайте им в мелких просьбах. \r\n\r\n 2.Не игнорируйте общие походы на обед или по магазинах, берите активное участие в жизни коллектива. \r\n\r\n 3.Будьте активными на \"летучках\" и совещаниях, высказывайте свое мнение, советуйтесь, действуйте. \r\n\r\n 4.Ведите себя уверенно, что бы ни произошло. \r\n\r\n\r\n Уверенный в себе человек автоматически привлекает к себе внимание и уважение других. \r\n\r\n\r\n   \r\n ','Как стать популярной',NULL,'/studentam/sovety/kak-stat-populyarnoj','2017-09-16 19:12:08','2017-09-16 19:31:06',NULL,0),(360,'  \r\nВ статье рассказывается о том, что такое первая любовь, что чувствует человек в этот период жизни. \r\n\r\n\r\n  \r\n \r\nЕсли вы спросите о ней своих родителей, бабушек или дедушек, они мечтательно поднимут глаза к небу и улыбнутся. Какой бы, возможно, трагедией она не обернулась для них в юности, первая любовь, спустя много времени, приносит только приятные ностальгические воспоминания. \r\n\r\n   \r\n\r\n\r\n Сразу вспоминаются те первые нежные слова, робкие поцелуи и признания, имеющие аромат доверчивости и готовности жертвовать всем ради любимого. Только первая любовь воспринимается человеком настолько серьезно, потому что с получением житейского опыта и взросления вы становитесь уже не тем романтиком, что были раньше. \r\n\r\n Может быть, сказки о любви еще свежи в вашей памяти, или мерки об идеальном партнере еще не столь категоричны, и потому вам кажется, что именно ваш нынешний партнер по отношениям является человеком всей вашей жизни. \r\n\r\n   \r\n\r\nСо временем мечты и фантазии уступают место реальному взгляду на мир.  \r\n\r\n\r\n Почему-то сейчас вырастают незыблемые преграды, которые раньше вы переступили бы без раздумья. Что и говорить, первая любовь – это сочетание сумасбродства с юношеским максимализмом. И все же, как это прекрасно! \r\n\r\n\r\n 1.Если вы скажете молодому человеку, переживающему это непередаваемое чувство первой любви, что в будущем он не будет рядом со своей нынешней половинкой, он искренне удивится и будет яростно протестовать, говорить, что не представляет дальнейшей жизни без своей возлюбленной.  \r\n\r\n 2.К сожалению, многие из нас не могут уберечь это нежное чувство, и искренне завидуют тем редким случаям, когда люди, впервые полюбившие, проживают вместе всю жизнь. Наверное, у них есть свои непередаваемые секреты сохранения отношений, или они просто вовремя научились ценить и уважать друг друга, избегая мелких ссор и недопониманий, разбивающих всю поэзию первой любви. \r\n\r\n                                                фото ступеней любви \r\n\r\n Любовь должна пройти такие испытания: \r\n\r\n 1. как взросление \r\n\r\n 2.становление личности \r\n\r\n 3. нехватка денег \r\n\r\n 4.разногласия в быту \r\n\r\n 5.рождение и воспитание детей. \r\n\r\n Часто отношения между людьми так непрочны, а характеры так непохожи, что даже самая пламенная страсть остужается с приходом малейших поводов для раздора. \r\n\r\n\r\n А потому, цените друг друга именно тогда, когда это нужно, а не в тот момент, когда вы поняли, что все для вас потеряно. Храните свою первую любовь, сделайте ее бессмертной! \r\n\r\n   \r\n\r\n ','Первая любовь',NULL,'/otnosheniya/stati/pervaya-lyubov','2017-09-17 09:24:31','2017-09-17 09:37:36',NULL,0),(361,' Принципы и понятия воспитания ребенка на 3, 4 году жизни. \r\n\r\n\r\n  \r\n \r\nПериод развития ребенка в возрасте от 3 до 4 лет является наиболее определяющим и важным этапом в его жизни. \r\n\r\n\r\n Опираясь на исследования ученых, можно сказать о том, что основой его развития в это время является его положительное самоощущение: \r\n\r\n 1.уверенность ребенка в себе и в своих действиях \r\n\r\n 2.ощущение того, что он является самым любимым и самым хорошим. \r\n\r\n Но сами по себе такие ощущения у малышей не возникают. Они появляются у них только тогда, когда у них установлен счастливый, доверительный и искренний контакт с родителями и другими близкими членами семьи. \r\n\r\nПоэтому воспитание ребенка 3-4 года должно быть выстроено таким образом, чтобы маленький человечек постоянно ощущал заботу и любовь со стороны близких ему людей. \r\n\r\n И для этого много не надо, всего лишь: \r\n1. чаще прижимать свое маленькое сокровище к себе \r\n\r\n 2. тихо, ласково вести с ним разговор \r\n\r\n 3. во время ссор и конфликтов стараться как можно доступнее все объяснять.   \r\n\r\n                                   фото ребенка в обьятьях родителей \r\n\r\n Безусловно, чтобы быть хорошими родителями, прежде всего надо любить и понимать своего малыша. Но и не лишним будет иметь некоторые познания в области возрастных особенностей ребенка, а также способствовать его личностному, социальному и познавательному развитию. \r\n\r\nВообще, милые родители, нужно знать, что в научной литературе, посвященной дошкольному периоду, есть такое определение, как нежный возраст.  \r\n\r\n Не известно с чем связано такое название, может благодаря тому, что именно в этом возрасте дети особенно очаровательны и привлекательны и взрослые с упоением наблюдают за их мимикой, движениями, поступками. Однако, несмотря на все очарование, счастье и радость, именно этот возраст может вызвать у родителей массу проблем. \r\n\r\n 1,Очень часто малыш не слушается взрослых \r\n\r\n 2.не может занять себя, при этом капризничает и постоянно требует внимания со стороны родителей \r\n\r\n 3.также может проявлять агрессию к другим детям и родителям. \r\n\r\n Взрослые такое поведение ребенка очень часто связывают с его избалованностью. Также по незнанию, родители характеризуют поведение малыша, как неправильное, хотя наука дает этому совсем другое объяснение. \r\n\r\n Ученые связывают такое поведение с отношениями «родители и дети», которые в основном обусловлены неправильным поведением первых. Также стоит отметить и то, что правильное воспитание детей на данном этапе очень влияет на их здоровье и развитие. \r\n\r\n                                           фото спортивного ребенка \r\n\r\n Очень важно в этом возрасте начинать физически развивать ребенка, так как от этого зависит и развитие его умственных способностей. Но здесь самое главное – не переусердствовать, чтобы не вызвать у ребенка отвращения к занятиям физкультурой и умственным упражнениям. \r\n\r\n В возрасте 3-4 лет ребенок подвержен частой смене настроения и это вовсе не капризы, а формирование и становление его характера. Именно в этот период малыш начинает пересматривать свои взгляды на некоторые вещи. И родителям желательно не упустить этот момент и постараться перестроить свое поведение. \r\n\r\n\r\n Уважаемые папы и мамы, не оставляйте своего малыша наедине с его мыслями, так как только вы сможете доходчиво и подробно объяснить ему о тех трудностях, с которыми столкнется он. \r\n\r\n ','Воспитание детей',NULL,'/roditelyam/sovety/vospitanie-detej','2017-09-17 09:42:43','2017-09-17 09:59:28',NULL,0),(362,'4 вещи, препятствующие развитию креативности у ребенка￼ \r\n\r\n\r\n  \r\nНаличие креативности помогает решать многие проблемы во взрослой жизни. Что может помешать развитию креативности у вашего ребенка? \r\n\r\n   \r\n\r\n\r\n  \r\n \r\nТворческие способности есть у всех детей с рождения. Им не нужно учиться использовать свое воображение. К сожалению, взрослые могут все испортить. А жаль, потому что креативность помогает справиться с повседневностью и делает жизнь полной радости! Однако родители неоднократно подавляют воображение детей. \r\n\r\nВот 4 вещи, из-за которых ребенок забывает о своих творческих способностях. \r\n\r\n 1. Контроль \r\n\r\n Вы каждую минуту проверяете, что именно делает ваш малыш? \r\n\r\n 1)Дайте ему больше свободы \r\n\r\n 2). Помните, что креативность нуждается в свободе. \r\n\r\n 3)Даже если вы любите играть с ребенком, вы не должны управлять всеми его занятиями. \r\n\r\n 4)Также не подталкивайте его к готовому решению. Пусть ваш малыш научится искать выход даже из сложных ситуаций и не рассчитывать на вашу постоянную помощь. \r\n\r\n                                     фото скучающего ребенка \r\n\r\n 2. Напряженный график \r\n\r\n Вы хотите, чтобы ваши дети никогда не скучали, и плотно заполняете все их свободное время? Конечно, внеклассные мероприятия развивают детей, но лучшие идеи приходят от... скуки! Взрослые очень боятся ее, а дети даже любят. \r\n\r\nИменно скука позволяет им развивать воображение! \r\n\r\n 3. Строгое воспитание \r\n\r\n Ребенок нуждается в наличии понятных и четких правил поведения, но они, в то же время, должны оставлять ему свободное пространство для действий. \r\n\r\n Попробуйте отказаться от каких-то ежедневных вещей, из-за которых ваш ребенок не может играть тогда, когда он хочет, и так, как он хочет. Конечно, мы не говорим об игре среди ночи, но иногда стоит сделать исключение и позволить ребенку самому решать, как он хочет провести время. \r\n\r\n                             фото ребенка с наградой \r\n\r\n 4. \"Мотивация\" \r\n\r\n Вы приучили своего ребенка к тому, что каждый раз, когда он делает что-то, получает награду? Неужели полностью съеденный обед или уборка в комнате – занятия, на самом деле требующие много усилий? Поощрительные награды приводят к тому, что ребенок выполняет поручения только для получения награды, не думая о поиске интересных решений. Но ведь даже само действие может быть интересным!  \r\n\r\n\r\n Научите малыша, что каждый из вас имеет в доме свои обязанности, и не подкупайте его. \r\n\r\n ','Творческое развитие детей',NULL,'/roditelyam/stati/tvorcheskoe-razvitie-detej','2017-09-17 10:28:22','2017-09-23 20:57:25',NULL,0),(363,'\r\n Вашим детям не нужно все ваше внимание. \r\n\r\n\r\nКак быть избирательным для своей выгоды. \r\n\r\n   \r\n\r\n Родители, технологии, YouTube и социальные сети сговорились создать привлекательных монстров. Эти монстры - наши дети, и они будут делать что угодно, чтобы заставить кого-то обратить внимание. Даже когда есть негативные причины и они закричат, ваше увеличенное внимание продолжает мотивировать неприятное поведение детей. И все это неуместное поведение действительно может отнять радость воспитания. Трудно наслаждаться временем с детьми, когда они отвратительны. \r\n\r\n \r\nРодители обучаются с того момента, как их ребенок задумал привлекать внимание к ним. \r\n\r\n 1.Это начинается с недельных подробностей, представленных на родительских сайтах о чудесах, которые происходят внутри живота женщины. \r\n\r\n 2.Когда ребенок появляется, книги и видеоролики поощряют множество практических занятий. Добавьте необходимость публикаций фотографий и рассказов наших детей, делающих в основном что угодно, и у вас есть идеальная среда для постоянных проступков. \r\n\r\n  фото новорожденного \r\nКонечно, новорожденные нуждаются в кормлении, прогулках и ласке. \r\n\r\n В течение этого времени родители должны заботиться о каждом ребенке. Это создает надежные условия, которые помогают ребенку чувствовать себя комфортно, чтобы расти и обучаться в будущем. \r\nНо поскольку ребенок превращается в малыша, потребности ребенка меняются. Дети привыкли плакать, чтобы получить то, что они хотят. И родители, которые привыкли обращаться к каждому хныку и скулить от своих новорожденных, забывают переходить на другой вид воспитания. \r\n\r\n\r\n  \r\nКогда дети становятся старше, они узнают, что ныть, плакать, жаловаться, и бросаться истерику - все это эффективные способы добиться желаемого. \r\n\r\n\r\n  \r\nДети довольно умны. Они действуют только таким образом, который приносит им пользу. \r\nРодители поддаются махинациям своих детей по разным причинам. Возможно, они отвлекаются на заботу о других детях или заняты домашними хлопотами. \r\nПроблема состоит в том, что любое усиление поведения чаще повторяется. Поэтому каждый раз, когда мама говорит «нет» для печенья, но затем, после истерики, «хорошо, но только одно», она усиливает это поведение. \r\n\r\n                     фото истерящего ребенка \r\n\r\n \r\nЧтобы улучшить поведение, родители должны перестать уделять внимание детям (даже отрицательное внимание) когда они плохо себя ведут. \r\n\r\n  \r\n1.Вместо того, чтобы уступать плохому поведению, родители должны полностью его игнорировать. \r\n\r\n 2.Как только капризы прекратятся, нужно общаться с детьми, как будто этого эпизода никогда не было. \r\n3.Дети быстро получат сообщение о том, что их поведение не стоит усилий. Зачем бросаться в истерику или плохо себя вести, если из этого ничего не выйдет? \r\n\r\n  \r\nЧтобы быть ясным, есть несколько способов поведения, которые вы не должны игнорировать. \r\n\r\n -Не пренебрегайте ребенком, который испытывает настоящую боль. \r\n\r\n -Не игнорируйте любое поведение, которое опасно или может причинить вред другому ребенку или взрослым. \r\n\r\n -Самое главное, никогда не игнорировать хорошее поведение. \r\n ','Истерика у ребенка',NULL,'/roditelyam/stati/isterika-u-rebenka','2017-09-17 11:17:43','2017-09-23 19:46:32',NULL,0),(364,'  Данная статья расскажет о том, как подготовить малыша к посещению детского сада и сделать процесс адаптации максимально мягким. \r\n\r\n\r\n Как правило, когда у мамы заканчивается отпуск по уходу за ребенком, малыш тоже отправляется на свою первую «работу» – в детский сад. \r\n\r\n\r\n И это настолько ответственный и сложный этап в жизни крохи, что к нему стоит серьезно подготовиться. Как же сделать по возможности наименее травмирующим переход из уютного и безопасного семейного окружения в детское учреждение, где малышу предстоит провести 3–4 года? \r\n\r\n 1. Теоретическая подготовка \r\n\r\n Желательно за 2–3 месяца до поступления в садик начать рассказывать ребенку о том, что другие дети тоже туда ходят. При этом очень важно акцентировать внимание на положительных моментах в посещении детского сада. \r\n\r\n 1)Описать, какие чудесные там игрушки \r\n\r\n 2)Как дети занимаются все вместе \r\n\r\n 3) Можно рассказать малышу о примерном режиме дня в саду, это поможет ему легче адаптироваться к новому распорядку, ведь он уже будет в курсе того, что его ожидает.  \r\n\r\n                                                   фото самостоятельного малыша \r\n\r\nОчень важно перед поступлением в детский сад научить ребенка основным навыкам самообслуживания.  \r\n\r\n   \r\n\r\n Если он будет многое уметь делать самостоятельно, то почувствует себя гораздо более уверенно, а это поможет быстрой адаптации. \r\n\r\n Как минимум, малыш должен: \r\n\r\n -уметь аккуратно кушать \r\n\r\n -проситься в туалет \r\n\r\n -а также четко выражать свои желания. \r\n\r\n 2. Практическая подготовка \r\n\r\n Как правило, многие воспитатели во второй половине августа уже находятся на рабочем месте и активно готовятся к приему ребятишек. \r\n\r\n - Было бы неплохо в это время вместе с малышом посетить группу, осмотреться, познакомиться с воспитательницей. Когда ребенок придет в садик в качестве воспитанника, окружающая обстановка уже не будет для него совершенно незнакомой, это поможет ему быстрее сориентироваться и привыкнуть к новой жизни. \r\n\r\n - Желательно сразу рассказать воспитательнице об основных особенностях поведения и характере малыша, о том, на какие продукты у него аллергия, какие блюда он категорически отказывается есть. Чем больше воспитатель будет знать о ребенке, тем лучше. \r\n\r\nПосещение детского сада лучше всего начать с 1 сентября.  \r\n\r\n 1)Во-первых, дети с самого начала вместе адаптируются к новому распорядку и образу жизни, поэтому процесс привыкания к дошкольному учреждению проходит значительно легче. \r\n\r\n 2)Во-вторых, во многих садиках в этот день устраивается небольшой праздник, малышам это очень нравится. \r\n\r\n 3)В-третьих, иногда в первые недели посещения, когда дети только знакомятся с группой и воспитателем, мамам разрешается присутствовать в саду. Позже такая возможность может не представиться. \r\n\r\n                                                        фото часов \r\n\r\n 3. Полезные рекомендации \r\n\r\n\r\n У малышей еще не сформировано представление о времени, поэтому слова «я скоро за тобой приду» кроху вряд ли удовлетворят. \r\n\r\n\r\n 1)Лучше говорить, ориентируясь на определенные действия, происходящие в саду. Например, можно пообещать забрать малыша после сна или после прогулки. Но при этом обязательно следует выполнить обещанное и прийти в указанный промежуток времени, иначе ребенок будет относиться к посещению сада с недоверием и опаской. Ведь если малыш не знает, когда мама его заберет, то трудно быть спокойным и получать удовольствие от игр. \r\n\r\n 2)Если у крохи сильная привязанность к маме, то лучше, если первое время в садик его будет отводить папа. Как правило, это помогает избежать истерик при расставании. \r\n\r\n 3)Первое время ребенок может брать с собой в сад любимую игрушку, которая будет для него как бы частью «домашней жизни», а также выполнять роль друга, ведь малыш не сразу найдет себе товарища. \r\n\r\nЗабирая кроху из детского сада, важно обращать внимание на его настроение, обязательно поинтересоваться, как он провел день. Искренняя заинтересованность мамы поможет малышу быстрее привыкнуть к наступившим в его жизни переменам. \r\n ','Детский сад',NULL,'/roditelyam/sovety/detskij-sad','2017-09-17 11:46:34','2017-09-17 12:42:19',NULL,0),(365,' Рекомендации о том, как привить ребенку хорошие манеры. \r\n\r\n\r\n Воспитание - постоянная тема, которая сопровождает родителей на протяжении всего периода взросления их чад. \r\n\r\n\r\n Малышам, которые усвоили правила поведения еще в детстве, легче взаимодействовать с окружающим миром. \r\nЕсли родители подают хороший пример, то дети быстро учатся правилам поведения в обществе. Вежливым манерам учатся у взрослых. \r\n\r\nЭлементарные правила поведения для детей: \r\n\r\n 1. В вашей семье должно быть повседневным правилом благодарность. «Пожалуйста», «спасибо», «приятного аппетита» - эти слова ребенок должен слышать постоянно. \r\n\r\n 2. Правила гигиены. \r\n\r\n 2.1 После каждой прогулки, посещения туалета и перед едой руки тщательно вымыть. \r\n\r\n 2.2 Всегда иметь при себе салфетки. \r\n\r\n 2.3 Ребенок должен самостоятельно следить за своей гигиеной, внешним видом, состоянием прически. \r\n\r\n                                         фото ребенка за столом \r\n\r\n 3. Еда – не игрушка. Научите малыша пользоваться ложкой и вилкой до школы. \r\n\r\n 4. За столом необходимо сидеть прямо, не опираясь на локти. \r\n\r\n   \r\n\r\nСсоры, скандалы – неэффективный способ решения конфликтов. \r\n\r\n 5. Опять же, родители - лучшие образцы для подражания. Если они решают недомолвки цивилизованным образом, дети имеют больше шансов сделать так же. Строго пресекайте нецензурную брань, ругательства со стороны окружающих. \r\n\r\n 6. Ежедневно показывайте ребенку уроки вежливости и уважения, например, уступив место в транспорте пожилому человеку. \r\n\r\n 7. Уважайте личное пространство ребенка и научите уважать ваше право на личные границы. Тот факт, что ребенок стучит перед входом в спальню, уже говорит о его воспитанности. \r\n\r\n 8. Ковыряться в зубах, носу, грызть ногти – недопустимо. \r\n\r\n                                         фото ребенка-вандала \r\n\r\n 9. Научите малыша уважать не только взрослых, но и животных, растения, чужое имущество. \r\n\r\n 10. Обязательно научите малыша основным правилам безопасности! \r\n\r\n Сегодня существует много помощников для обучения: \r\n\r\n 10.1тематические мультфильмы \r\n\r\n 10.2 игры \r\n\r\n 10.3 конкурсы \r\n\r\n 10.4 эстафеты. \r\n\r\n\r\n Периодически напоминайте важную информацию. Беду лучше предотвратить. \r\n\r\n\r\n 11. Объясните ребенку ответственность за его поступки, научите признавать ошибки. \r\n\r\n Вместо наказания и упреков, вы можете и должны помочь любимому чаду адекватно реагировать на различные жизненные ситуации, искать способы взаимодействия с окружающим миром, развивать социальные навыки. \r\n\r\n В игровой форме, доступным языком даже неопытные родители смогут привить ребенку элементарные правила вежливого поведения. \r\n ','Хорошие манеры',NULL,'/roditelyam/sovety/horoshie-manery','2017-09-17 13:44:20','2017-09-17 14:00:30',NULL,0),(366,' Современным детям можно только позавидовать. Ассортимент игрушек настолько огромен, что сможет удивить даже самого искушенного покупателя, а в детском магазине легко заблудиться. Среди множества товаров всегда определяются такие, которые есть у всех. \r\n\r\nЧто же сейчас в топах популярности среди игрушек? \r\n\r\n Производители детских игрушек ежегодно тратят много времени и денег в попытке создать что-то новое, чтобы завоевать внимание покупателей. \r\n\r\n 1.То и дело появляются престижные новинки, обещающие стать следующим бестселлером и принести компании значительную прибыль. \r\n\r\n 2.Многие из этих игрушек быстро теряют свою популярность \r\n\r\n 3.Но есть и такие, которые остаются в топе продаж многие годы. \r\n\r\n\r\n  \r\nВ современном мире высоких технологий электронные игрушки пользуются наибольшей популярностью. \r\n\r\n\r\n То, что сравнительно недавно еще считалось научной фантастикой, теперь настолько внедрилось в нашу жизнь, что стало вполне обычным развлечением для ребенка.  \r\nЭлектронные игрушки включают в себя широкий спектр товаров от поющих медвежат до радиоуправляемых машин и могут стоить от нескольких десятков до нескольких сотен тысяч рублей. \r\n\r\n                                                              фото видеоигр \r\n\r\n  \r\nТоп рейтинга самых продаваемых игрушек последние два-три десятилетия занимают видеоигры. С тех пор, как первые компьютеризированные игры стали доступны в виде приставок для домашнего телевизора, этот вид развлечения продолжает бесконечно модернизироваться и набирать популярность с каждым годом. \r\n\r\n\r\n Сегодняшние видеоигры значительно превосходят даже те, что были выпущены только пять лет назад. Постоянно улучшаются графика и доступные опции. \r\n\r\n\r\n  \r\nНо есть еще один вид игрушек, который надолго завоевал топ продаж. Это электронная техника, переделанная в игрушки для детей. \r\nНапример, в качестве детских игрушек выпускаются музыкальные плееры. \r\n\r\n 1.Есть модели даже для малышей от шести месяцев. \r\n\r\n 2.Детские музыкальные плееры сконструированы так, чтобы с ними было удобно обращаться, когда еще не умеешь читать. \r\n\r\n 3.Многие плееры дополнены играми, возможностью просмотра видео и выхода в интернет. \r\n\r\n 4.С помощью детских плееров мамы развлекают малышей в поездках и в очередях, а дети постарше формируют свои первые музыкальные предпочтения. \r\n\r\n                                       фото ребенка за компьютером  \r\nЕсть множество других электронных устройств, которые специально переделали для детей. Можно найти детские электронные книги, предназначенные для обучения чтению, детские цифровые камеры, даже детские портативные компьютеры. \r\n\r\n\r\n  \r\nОчевидно, детям нравится идти в ногу со временем и использовать технологии наряду со взрослыми. \r\n\r\n ','Электронные игрушки',NULL,'/roditelyam/stati/elektronnye-igrushki','2017-09-17 15:41:24','2017-09-23 19:35:16',NULL,0),(367,' В статье содержатся советы по преодолению ребенком ощущения ложной боязни в условиях полной или частичной темноты. \r\n\r\n\r\n Не существует практически ни одного ребенка, который бы комфортно чувствовал себя в сумраке. Боязнь возникает чаще всего из-за богатой природной фантазии, которая рисует малышам монстров и чудовищ в затемненных углах комнаты. \r\n\r\n\r\n У впечатлительных детей такой страх может вызвать множество негативных расстройств: \r\n\r\n - истерический плач \r\n\r\n - постоянное ощущение тревоги \r\n\r\n - стабильную фобию \r\n\r\n Бороться с этой боязнью практически бесполезно, поэтому страхи называют ступеньками детства. \r\n\r\nЧтобы снизить неблагоприятное воздействие детской тревоги, стоит прислушаться к советам и рекомендациям психологов. Тем более что в коррекции поведения малыша при боязливых ощущениях для родителей существует больше категорических табу, чем правильных действий. \r\n\r\n   \r\n1.Нельзя насильно оставлять ребенка в темной комнате, надеясь, что он перешагнет порог ужаса самостоятельно. Не все дети обладают еще по-настоящему волевым характером, чтобы без последствий для психического здоровья пересилить этот страх. \r\n\r\n  \r\n2.Если ребенок панически боится спать один, стоит решать такой вопрос конструктивно, без категорических запретов и ультимативных заявлений. \r\n\r\n 2.1 Проводить ночной сон с открытыми дверьми во всех комнатах \r\n\r\n 2.2 Поспать некоторое время вместе с малышом или забрать его к себе – лучшие варианты выхода из ситуаций. \r\n\r\n                                                   фото ребенка гуляющего ночью \r\n3.Приучать к темноте ребенка стоит постепенно и совместно. То есть прогуливаться по ночным улицам хотя бы иногда. В домашних условиях также можно создавать игровые ситуации, танцевать и слушать музыку в полусумраке, чтобы малыш чувствовал себя спокойно при недостатке света. \r\n\r\n \r\nНаличие собственного фонарика у ребенка также добавит ему уверенности и храбрости. \r\n\r\n 4.Особенно если предварительно поиграть с малышом в теневой театр с помощью этого самого светильника и импровизированной сцены из простыни или покрывала. В этом случае стоит направить буйную детскую фантазию в русло творчества, пусть даже с негативными героями, но обязательно со счастливым концом. \r\n\r\n                                          фото монстра под кроватью \r\n5.Психотерапия страхов с помощью рисунка может проводиться и одним из родителей, которому малыш больше всего доверяет. Прорисовывание того, что пугает – лучшее избавление от внутренних тревог. Стоит помнить лишь, что в результате добрый герой обязан победить, а зло должно быть наказано. \r\n\r\n  \r\n6.Оборудование детской комнаты гирляндами или светящимися ночниками также пойдет на пользу. А посещение планетария подарит ребенку незабываемые эмоциональные моменты и докажет познавательные свойства ночной тьмы. \r\n\r\n\r\n  \r\nВ любом случае помогать собственному чаду в борьбе с его детскими страхами – обязанность каждого ответственного родителя. \r\n\r\n\r\n Но почувствовать душу ребенка и не навредить ей можно только с адекватным и терпеливым подходом к этому вопросу. А также стоит не забывать хвалить малыша за каждую маленькую победу, искренне радуясь тому, что темнота все больше становится загадочным другом, а не опасным врагом. \r\n ','Страхи у детей',NULL,'/roditelyam/sovety/strahi-u-detej','2017-09-19 10:39:09','2017-09-19 11:04:09',NULL,0),(368,'Ваш ребенок в очередной раз устроил истерику посреди улицы или в магазине? Вы не знаете, что делать? Наши советы помогут вам его успокоить. \r\n\r\n  \r\nДети не всегда бывают милыми и послушными. Иногда они устраивают настоящие истерики, а еще хуже, если это происходит в общественном месте. Что вы можете сделать, чтобы быстро успокоить своего ребенка? \r\n1.Понять \r\nСтоит помнить, что ребенок делает это не для того, чтобы вас позлить. Ребенок не знает, что плач в магазине или на улице – это что-то недопустимое. Дети понимают все не так, как взрослые. \r\n\r\n - прежде чем вы начнете уговаривать малыша успокоиться, постарайтесь успокоиться сами. \r\n\r\n - то, что вы злитесь, является еще одним стрессовым фактором для ребенка – в такой ситуации ему трудно перестать плакать. \r\n\r\n  \r\n2. Расспросить и узнать источник проблемы \r\nПрежде чем начать кричать на ребенка, спросите его, что именно произошло. Дети не всегда плачут из-за того, что они не могут получить желаемое в данный момент. Причина плача может быть какой угодно – его могут беспокоить тесные ботиночки или боль в животе. \r\n\r\n                             фото  плачущий ребенок в магазине \r\n3. Определить границы еще дома \r\nМаленькие дети с трудом понимают ограничения, с которыми им приходится сталкиваться. Поэтому когда вы собираетесь пойти за покупками вместе с ребенком: 1)объясните ему, какое поведение неприемлемо в общественном месте \r\n\r\n 2)скажите ему, может ли он рассчитывать на какую-либо покупку именно для него или нет \r\n\r\n 3)не реагируйте на его шантаж \r\n\r\n 4) если в магазине малыш начнет капризничать, напомните ему, что вы договорились дома купить ему только один предмет. \r\n\r\n 5) Научите его, что выполнение обещаний является очень хорошим качеством. \r\n\r\n  \r\n4. Переключить внимание \r\nВместо того чтобы сосредоточиться на истерике малыша, попробуйте занять его чем-то другим. Скажите, что вы спешите, и вам нужно закончить покупки как можно скорее. Его также может заинтересовать его любимая игрушка. Если вы начнете ругать ребенка за его плач, вы дадите ему дополнительный предлог, чтобы продолжать плакать. \r\n5. Объяснять \r\n- Не забывайте о трудных ситуациях, которые произошли с вами вне дома. \r\n\r\n - После каждой истерики объясните ребенку, почему его поведение было неуместным. \r\n\r\n - Дайте ему понять, что его слезы – это манипуляция, которая на вас не действует. \r\n ','Истерика у ребенка',NULL,'/roditelyam/sovety/isterika-u-rebenka','2017-09-19 11:20:33','2017-09-19 11:40:11',NULL,0),(369,'\r\n Важной составной частью всестороннего развития подрастающего поколения является обучение школьника ровному почерку. В прежние годы в начальных классах советской школы детей учили чистому и красивому письму. Сейчас, к сожалению, не во всех российских школах чистописание входит в программу обучения. \r\n\r\n\r\n \r\nКак научить ребёнка красиво писать? Что нужно, чтобы сделать почерк разборчивым и правильным? \r\n\r\n 1.Прежде всего, надо исключить у школьника заболевания, связанные с неспособностью правильно и красиво писать. \r\n\r\n Врач поможет определить причины плохого почерка у ребёнка. Невропатолог проверит наличие у ребёнка проблем с концентрацией внимания, моторикой кистей рук, правильность осанки. Как правило, ребёнок неправильно сидит во время письма или неверно держит ручку. \r\n\r\n Установив причину, можно вырабатывать каллиграфический почерк с помощью различных комплексов упражнений. Правильно подобрать их помогут детский психолог, логопед или школьный учитель. \r\n\r\n                                      фото пишущего ребенка  \r\n\r\n 2.Родителям следует обратить внимание на конструкцию стола и позу ребёнка, когда он пишет или рисует, подбор специальной ручки (она отличается толщиной, формой, материалом, из которого сделана). При выборе ручки необходимо учесть манеру письма — правой или левой рукой. Важно проследить — правильно ли он её держит. \r\n\r\n 3. Для получения красивого почерка применяются прописи: обычные или оптимизированные для подростков. \r\n\r\n После занятий мышцы руки сильно устают, поэтому их следует расслабить. \r\n\r\n                                     фото лепки пластилином \r\n\r\n Мелкая моторика рук, её развитие — первый шаг к получению красивого почерка.  \r\n\r\n Хорошим помощником являются занятия лепкой из глины или пластилина, рисование, различные конструкторы. \r\n\r\n\r\n  Добиться красивого почерка у школьника начальных классов гораздо легче, чем у подростка. \r\n\r\n\r\n В большинстве случаев, плохой почерк у ребёнка поддаётся исправлению. Существует много учебников и современных методик по этой проблеме. Но основным условием для достижения успеха являются настойчивость и терпение родителей, а также занятия каждый день в течение длительного времени. \r\n  \r\n ','Как красиво писать',NULL,'/roditelyam/sovety/kak-krasivo-pisat','2017-09-19 11:48:43','2017-09-19 12:13:06',NULL,0),(370,' О том, как приучить малыша ложиться спать без истерик. Какие ритуалы можно использовать. Сколько времени должен спать ребенок. \r\n\r\n Все дети засыпают по-разному.Укладывание в постель не должно вызывать у малышей неприятных ощущений, но непреклонность взрослых является обязательным условием. В редких случаях в виде исключения ребенок может отправиться в постель позже установленного времени, например, в праздничные дни. Многие семьи каждый вечер устраивают дебаты о времени отправления ребенка в постель. \r\n\r\n   \r\n\r\nТак как «безболезненно» уложить ребенка спать? \r\n\r\n  \r\n1.«Тихий час» посреди дня обязателен для всех детей. \r\n\r\n 1.1 Устраивать его желательно сразу после обеда, пока ребенок не начал увлеченно играть. \r\n\r\n 1.2 Слова и крики начинают действовать на малыша после трех-четырех лет, до этого времени его желательно вести в постель за руку. \r\n\r\n 2.Перед ночным сном хорошо поговорить о дневных занятиях ребенка. Действенно успокоить его определенным ритуалом перед сном, который повторяется каждый день. К примеру: \r\n\r\n 1)Уложить спать игрушку. \r\n2)Уложить в постель ребенка. \r\n3)Поцеловать, рассказать сказку на ночь. \r\n4)Потушить свет. \r\n\r\n                                                          фото ребенка с мягкой игрушкой \r\n\r\n 3.Нельзя позволять ребенку оттягивать время. Иногда пункт с прочтением книги можно пропустить. Нередко детки любят брать с собой в постель какую-либо игрушку. Это полезно, любимый мишка или кукла действуют успокаивающе. \r\n\r\n 4. Ребенок может душевно относиться к какому-нибудь предмету обихода, например, к старому одеялу. Не стоит запрещать ему любить эту вещь, нужно лишь напоминать, что наступит такое время, когда этот предмет больше не понадобится. \r\n\r\n 5. После двух лет малыш может бояться засыпать из-за сильных эмоций, ему мешающих. Он часто раздражается из-за «выяснения» отношений с родителями по вопросам установки «сонного времени». \r\n\r\n 6.Ребенка более старшего возраста часто беспокоят невыполненные домашние задания. Если малыш мало спит, то нужно стараться увеличить его время отдыха. \r\n\r\n Длительность ночного сна шестилетнего ребенка должна составлять около 12 часов. К 12 годам подросток спит ночью 10 часов. Это примерные цифры. \r\n\r\n\r\n Все люди индивидуальны, поэтому одному ребенку нужно больше времени для сна, другому меньше. \r\n\r\n\r\n                                                    фото играющего ребенка \r\n\r\n Если ребенок трех-четырех лет не спит днем, то необходимо устроить ему отдых после обеда в виде спокойных занятий в комнате. \r\n\r\nРазумеется, приятно, когда малыш ложится спать охотно.  \r\n\r\n 1)Необходимо всегда помнить, что ребенок хочет уснуть, а капризничает он просто из-за усталости. \r\n\r\n 2)Поэтому готовить его ко сну нужно как можно спокойнее, не спеша. \r\n\r\n 3)Важно отложить все семейные ссоры и споры на потом. \r\n\r\n 4)Ни в коем случае не ругайтесь на глазах у ребенка вечером. \r\n\r\n 7.Малыша проще уложить спать, так как его можно покачать на руках. Вообще перед сном ребенка важно всячески успокоить, чтобы он легче уснул, а ночью ему не снились кошмары. У себя в кроватке малыш должен чувствовать себя уютно. \r\n\r\n Многие дети боятся спать одни и хотят засыпать в постели родителей. До определенного возраста это возможно, впоследствии, около четырех-пяти лет ребенок сам начнет мечтать об отдельной кроватке. Волноваться по этому поводу не стоит. \r\n\r\n\r\n Важно помнить, что любовь к ребенку способна помочь во всех начинаниях. \r\n\r\n ','Время спать',NULL,'/roditelyam/stati/vremya-spat','2017-09-19 12:37:48','2017-09-23 19:30:22',NULL,0),(371,' Реальный случай произошел когда-то. К очень интеллигентной бабушке издалека приехал маленький внук. Был он очень ласковый, с голубыми любознательными глазенками, умный и начитанный. \r\n\r\n Бабушка гордилась пятилетним внуком, и водила к знакомым, чтобы все оценили его безупречные манеры и знание литературных произведений. Но в гостях случился страшный конфуз. Милый ребенок вдруг остановился перед зеркалом и глядя на отражение стал смачно материться. \r\n\r\nРазгневанная бабушка потребовала у родителей ответа – откуда ребенок знает такие отвратительные слова.  \r\n\r\n Из садика, ответили родители. И объяснили, что ходили по этому поводу к воспитателю, которая грустно заметила, что в группе 25 человек, и все произносят матерные слова. А бороться с этим явлением невозможно, так как никакие методы не помогают. \r\n\r\n\r\n \r\nВ любом случае, посещает ли ребенок детский сад, или приходит с мамой каждый день на детскую площадку, с нецензурной лексикой он обязательно познакомиться \r\n\r\n\r\n 1. Так как каждый день он пополняет свой словарный запас, эти слова будут для него такие же обычные, как и другие: те же различные сочетания букв. Потому для него не будет никакой разницы, какое новое слово произнести – которое воспринимается как неприличное, или обозначает, например, цвет неба. \r\n\r\n  \r\n2. Если из маленького милого ротика вылетело слово из нецензурной лексики, главное для родителей сдержаться и не устроить грандиозный скандал. Лучше постараться не проявить никаких эмоций, тогда есть вероятность, что слово просто забудется. \r\n\r\n                           фото взрослых смеющихся над ребенком \r\n\r\n 3. Есть еще одна родительская реакция. Малыш, похожий на ангелочка, коверкая произносит фразу, которую можно услышать в самой низкосортной забегаловке. Это несоответствие кажется слишком смешным. \r\n\r\n Родители весело смеются, а малышу так нравится, когда все счастливы, и он пытается развеселить всех, снова и снова повторяя запомнившиеся слова. Поэтому слыша от маленького дитя слова нецензурные, нужно вовремя сориентироваться, чтобы потом не ломать голову, как убедить ребенка не произносить такие словосочетания. \r\n\r\n  \r\n4.Если ребенок, вопреки просьбам и наказаниям продолжает произносить запрещенные фразы, пора использовать свою фантазию, придумывая интересные истории, главными героями выступают разные слова. Они в жизни людей играют важную роль. \r\n\r\n 1)Одни помогают что-то сделать, другие дарят хорошее настроение \r\n\r\n 2)Но есть плохие слова, которые стремятся все испортить в жизни, но хорошие слова ведут с ними борьбу и всегда побеждают. \r\n\r\n\r\n  \r\n И чтобы убедить ребенка, что плохие слова произносить нельзя, родителям необходимо следить за своим собственным лексиконом. \r\n\r\n ','Плохие слова для детей',NULL,'/roditelyam/sovety/plohie-slova-dlya-detej','2017-09-19 13:05:00','2017-09-19 13:46:01',NULL,0),(372,' 10 советов логопедов, помогающих развивать речь дошкольника, наполнять ее новыми словами, делать красивой.  \r\n\r\n Речевые нарушения детей являются серьезной проблемой нашего времени. Огорчает то, что количество их не уменьшается, а год от года только растет - всё больше родителей обращается за помощью логопеда. Известно, что речь не дана ребенку от рождения, она развивается и совершенствуется одновременно с физическим и психическим развитием, а также зависит от определенных условий. \r\n\r\n\r\n  \r\n \r\nВажно, чтобы малыш был здоровым, с нормальным слухом и интеллектом, активным, имел вокруг себя полноценное речевое общение. \r\n\r\n\r\n  \r\n  \r\nСоветы логопеда \r\n  \r\n1) Основной вид детской деятельности – игра, поэтому необходимо подбирать речевые игры и упражнения в соответствии с возрастом ребенка. Это могут быть звукоподражательные игры, проговаривание прибауток, потешек, коротких стишков. \r\n  \r\n2) Так как речь ребенка развивается за счет подражания, взрослым необходимо следить за собой: правильно и четко произносить все звуки, медленно проговаривать каждое слово от начала до конца, объяснять ребенку значение новых и малознакомых слов. \r\n\r\n                                                  фото разговора ребенка и родителя \r\n  \r\n3) Важно постоянно следить за речью ребенка, поправлять его и показывать на примере, как правильно произносить то или иное слово. Учите ребенка говорить внятно, четко, выразительно, не торопясь. Никогда не передразнивайте неправильную речь ребенка и не смейтесь над ним. \r\n  \r\n4) Каждый день необходимо читать. Не отказывайте малышу, даже если он просит снова и снова почитать понравившуюся сказку. Можно включить запись сказки, но все же ценным является именно личное общение. \r\n  \r\n5) Нужно отвечать на все детские вопросы, проявлять интерес к беседе с ребенком. \r\n  \r\n6) Через беседу с ребенком выясните, как он понимает вашу речь, как воспринимает содержание прочитанных произведений. \r\n\r\n                                                       фото сборки констпуктора детьми \r\n  \r\n7) Развивайте подвижность рук и пальчиков ребенка. Доказано, что с развитием мелкой моторики рук активизируются речевые зоны головного мозга. Необходимо учить малыша самостоятельно одеваться и раздеваться, шнуровать, застёгивать и расстегивать пуговицы. Полезными будут игры с мелкими игрушками, конструкторами, мозаиками, пазлами и т.д. \r\n  \r\n8) Часто у детей с речевыми нарушениями слабо развиты челюстные мышцы, которые также участвуют в речевом процессе. Поэтому для их развития необходимо давать чаще есть овощи и фрукты, мясо, сухари и хлеб с корочкой. \r\n  \r\n9) Плавность и красота речи во многом зависит от того, как ребенок умеет правильно дышать. Для этого можно использовать разнообразные игры и упражнения на дыхание: «Сдуй снежинку», «Бабочка летит», «Чей мяч дальше укатится». \r\n  \r\n10) Одна из причин неправильной речи – деформация челюсти. Отучайте как можно раньше ребенка от соски, следите, чтобы он не подкладывал ладошки под щёку во время сна. \r\n\r\n\r\n  \r\n  \r\nОчень важно, чтобы речь развивалась своевременно и правильно, так как от этого во многом зависит успешность ребенка в будущем – его общение со сверстниками и взрослыми, психическое состояние, обучение в школе, выбор будущей профессии. \r\n\r\n ','Правильная речь',NULL,'/roditelyam/sovety/pravilnaya-rech','2017-09-19 13:48:45','2017-09-23 22:09:54',NULL,0),(373,' О том, почему важно научить ребенка отстаивать свою точку зрения. Как это сделать? Несколько рекомендаций для родителей. \r\n\r\n\r\n Когда ребенок маленький, он воспринимает то, что ему говорят, как истину. Он просто верит в то, о чем говорят ему родители и другие взрослые. \r\n\r\n\r\n В маленьком возрасте ребенку не нужно уметь спорить, этот навык пока абсолютно бесполезен. Но чем старше малыш становится, тем для него важнее его собственная точка зрения. И если он не научится спорить, ему будет крайне тяжело отстоять свое мнение. \r\n  \r\n1.Существует немало людей, которые не хотят спорить или просто не умеют, а принимают чужое мнение. Но в таком случае человек теряется как личность. \r\n\r\n 2.Кроме того, у других людей могут быть ошибочные суждения, поэтому очень важно иметь свою точку зрения и отстаивать ее. \r\n\r\n 3.Люди со своей точкой зрения меньше попадают под влияние других, а значит, им не грозит физическая или психологическая зависимость от кого-то. \r\n\r\n 4.Те, кто умеет спорить, - это открытые, общительные, всесторонне развитые люди, поэтому очень важно научить ребенка еще в детском возрасте спорить и отстаивать свое мнение. \r\n                                                                фото задумчивого  малыша \r\n\r\n \r\nЧтобы у малыша сформировалось свое личное мнение, его необходимо учить думать. \r\n\r\n 1)Если он задает вопрос, не нужно тут же давать на него свой ответ. \r\n\r\n 2)Необходимо дать направление, подсказку, чтобы ответ ребенок нашел сам. Так он привыкнет самостоятельно мыслить, поскольку будет знать, что родители не будут за него это делать. \r\n\r\nИтак, вот некоторые примеры, которые помогут маленькому человечку научиться думать самостоятельно. \r\n  \r\n\r\n  \r\n1.В обычной жизни отвечать вопросом на вопрос не принято. Но в целях воспитания такой прием пойдет только на пользу. На вопрос: «Мама, где моя игрушка?» стоит ответить: «А где ты ее положил?» - так у ребенка начинает работать логика. \r\n\r\n Гулял на улице с игрушкой, пришел домой, положил ее в ящик для игрушек или оставил на детской площадке, забыл в машине у папы. Проверяя все возможные версии, ребенок в конечном итоге находит то, что искал. \r\n  \r\n2.Родителям необходимо постоянно интересоваться мнением ребенка, даже в бытовых вопросах. Понятно, что ритм современной жизни не позволяет постоянно спрашивать, что малыш будет на ужин или куда он хочет пойти после детского садика. Например, можно выделить один выходной, когда блюда будут готовиться по желанию ребенка. \r\n                                       фото поощерения ребенка \r\n3.Ребенку нужно чаще задавать вопросы с целью узнать его мнение - «Как ты считаешь, красивый ли цвет у этой машины?», «Почему ты хочешь надеть именно эти ботинки?». Необходимо хвалить малыша, если он пытается аргументировать свой ответ. \r\n\r\n  \r\n4.Ребенка необходимо слушать, не перебивая и ни в коем случае не критикуя его. Если ребенок будет уверен в том, что с его мнением считаются, ему будет легче научиться отстаивать свою точку зрения в споре. \r\n\r\n 5.Родители должны учить ребенка делать выводы - «Хорошо, что ты справился со своей застенчивостью и познакомился с этим мальчиком», «Замечательно, что ты сочувствуешь маленькому братику, который расплакался». \r\n ','Личное мнение',NULL,'/roditelyam/stati/lichnoe-mnenie','2017-09-19 14:35:47','2017-09-23 19:13:26',NULL,0),(374,'\r\n Психика маленького человека - это чистый лист, на котором можно написать что угодно. Первыми и самыми главными учителями ребёнка становятся его родители. \r\n\r\n\r\n 1.Ребят часто называют \"отражением\" своих родителей. Дети безоговорочно доверяют своим папам и мамам, они выполняют все их указания и рекомендации. \r\n\r\n Так происходит до определённого возраста, после которого маленький человек перестаёт слушать родителей. Он начинает просто копировать их поведение. Наставления и рекомендации при этом будут игнорироваться. \r\n\r\n 2.Родители дают своему чаду готовые схемы поведения в той или иной ситуации. Эти алгоритмы не всегда соответствуют нормам морали и нравственности. Ребёнок этого не понимает и принимает всё за чистую монету. \r\n\r\n                                 \r\n\r\n 3.На формирование мировоззрения ребёнка большое влияние оказывают мультфильмы, сказки, поговорки и пословицы. Родители должны тщательно следить за \"информационным рационом\" своего отпрыска. Ребята часто пытаются подражать поведению героев мультфильмов и компьютерных игр. Полученная с телеэкрана информация на всю жизнь остаётся в бессознательном . \r\n\r\nДети быстро растут и начинают знакомиться со сверстниками во дворе. \r\n\r\n 4.Эти встречи дают маленькому человеку почувствовать свою принадлежность к окружающему миру. \r\n\r\n 1)Игры детей не всегда бывают добрыми. \r\n\r\n 2)Они могут драться, мучить животных и заниматься мелким хулиганством. \r\n\r\n 3)Родители должны по возможности ограждать своё чадо от общения с детьми алкоголиков, наркоманов и уголовников. \r\n\r\n 5.Формирование детского мировоззрения заканчивается в старших классах школы. На него оказывает большое влияние мнение сверстников, учителей, спортивных тренеров и других взрослых людей из ближайшего окружения ребёнка. У молодого человека формируется общая картина своих достоинств и недостатков. \r\n\r\n\r\n Окончательные взгляды на жизнь появляются под влиянием кулаков сверстников, неразделённой первой любви и психологического давления со стороны педагогов.  \r\n\r\n\r\n 6.На формирование мировоззрения также влияют: \r\n\r\n -спортивные \r\n\r\n -творческие \r\n\r\n -школьные успехи подростка. \r\n\r\n Вся его дальнейшая жизнь будет зависеть от философии, которая сложилась в детские годы. \r\n\r\n Мировоззрение - это устойчивая конструкция, которая практически не поддаётся коррекции. Философские взгляды могут измениться только под влиянием чрезвычайных обстоятельств.  \r\n ','Психика ребенка',NULL,'/roditelyam/stati/psihika-rebenka','2017-09-19 14:58:34','2017-09-23 08:11:42',NULL,0);
