вивать его способности.',1365),('Как обустроить детскую комнату ребенка ',1366),('конфликт между детьми',1412),('Когда в семье не один ребенок, то возникает проблема в их взаимопонимании между собой. Нет ничего ужасного в ссорах.',1413),('конфликт между детьми',1414),('Конфликт между детьми',1424),('Когда в семье не один ребенок, то возникает проблема в их взаимопонимании между собой. Нет ничего ужасного в ссорах.',1425),('конфликт между детьми',1426),('Как сказать \"нет\" своему ребенку?',1622),('Всем, кто занимается воспитанием детей, приходится прибегать довольно часто к запретам.«Можно мне погулять?» - «Нет!». «Могу я взять конфету?» - «Нельзя!».',1623),('методы воспитания детей',1624),('Воспитание ребенка лидера.',1766),('Воспитание детей в любой семье имеет свои особенности. У каждого родителя есть свои методы воспитания. Люди, создавшие семью, надеются на то, что в их семье будет царить мир, дружба и согласие между всеми членами семьи.',1767),('Воспитание ребенка лидера',1768),('Воспитание ребенка',1826),('Воспитание ребенка в основном ложится на родителей. В большей степени первоначальным воспитанием ребенка занимается мать. Потому что только мать в состоянии уделять ребенку наибольшую часть времени и может отдать ему всю свою нежность, заботу и ласку. ',1827),('Воспитание ребенка',1828),('Самостоятельность развивает у детей интеллект',1898),('Результаты показали, что те дети, чьи родители воспитывают детей самостоятельными и независимыми, показали лучшие результаты, чем те, чьи родители излишне оберегают и ограничивают детей.',1899),('развитие ребенка',1900),('Как помочь ребенку адаптироваться к детскому саду?',1970),('Уважаемые родители, учитывайте возрастные особенности своего ребенка, будьте терпимее к его капризам, создайте для него благоприятную атмосферу, наполненную жизнерадостностью и оптимизмом, тогда процесс адаптации ребенка к детскому саду пройдет легко и быстро!\r\n',1971),('Адаптация в детском саду',1972),('Обман или одиночество?',2066),('Вы никогда не задумывались над тем, в какой мере мы женщины склонны к самообману. ',2067),('Обман одиночество',2068),('Стоит ли знакомиться в Интернете',2198),('Знакомство в Интернете – это довольно распространенное явление в нашем современном мире. И ведь в таком знакомстве очень много положительного. ',2199),('Знакомство в Интернете',2200),('А может любви нет',2228),('Ты об этом не думала? Я вот задумалась… Любовь – это сказка для детей? Или для маленьких взрослых девочек? Для тех, кто еще не вырос…\r\n',2229),('Любовь',2230),('Интернет знакомства',2258),('Каждый человек мечтает найти свою вторую половинку, но увы не каждому это удается... Мечты об идеальном спутнике жизни, романтических прогулках при луне и кротких поцелуях заставляют нас прибегать к помощи интернета.',2259),('Интернет знакомства',2260),('Идеальная девушка глазами мужчин.',2288),('«На вкус и цвет все фломастеры разные», - скажете вы. А я отвечу: «Несомненно, но всё-таки существуют такие черты, которые каждый мужчина хотел бы видеть в своей спутнице». Было проведено несчётное множество различных опросов, на основе которых психологи и вывели «формулу идеальной девушки». Давайте разбираться.',2289),('Идеальная девушка глазами мужчин.',2290),('Как показать себя уверенным?',2390),('Тело человека может очень многое о нем рассказать, даже больше чем ему (человеку) хотелось бы. По определенному положению тела можно увидеть например, чего мы боимся или о чем думаем. ',2391),('Уверенность в себе',2392),('Как показать себя уверенным?',2396),('Тело человека может очень многое о нем рассказать, даже больше чем ему (человеку) хотелось бы. По определенному положению тела можно увидеть например, чего мы боимся или о чем думаем. ',2397),('Уверенность в себе',2398),('Очная и заочная формы обучения. Их плюсы и минусы.',2444),('Заканчивая школу, многие ребята задумываются о том, какую же форму обучения предпочесть: дневную или заочную. Несомненно, чтобы они не выбрали для себя, цель у них одна – получить диплом, но процессы и принципы обучения у этих форм существенно отличаются. Рассмотрим плюсы и минусы каждой из этих форм обучения',2445),('Очная и заочная формы обучения плюсы и минусы ',2446),('Очная и заочная формы обучения. Их плюсы и минусы.',2450),('Заканчивая школу, многие ребята задумываются о том, какую же форму обучения предпочесть: дневную или заочную. Несомненно, чтобы они не выбрали для себя, цель у них одна – получить диплом, но процессы и принципы обучения у этих форм существенно отличаются. Рассмотрим плюсы и минусы каждой из этих форм обучения',2451),('Очная и заочная формы обучения плюсы и минусы ',2452),('10 способов изучения английского!',2468),('Знание английского сегодня это отличное конкурентное преимущество. Умея говорить на английском проще найти работу, можно быстрее получать новые знания, создать успешный бизнес на примере иностранных аналогов. Так что если ты думаешь над тем, как быстро выучить английский язык с нуля, вот тебе 10 способов для этого.',2469),('10 способов изучения английского!',2470),('10 способов изучения английского!',2474),('Знание английского сегодня это отличное конкурентное преимущество. Умея говорить на английском проще найти работу, можно быстрее получать новые знания, создать успешный бизнес на примере иностранных аналогов. Так что если ты думаешь над тем, как быстро выучить английский язык с нуля, вот тебе 10 способов для этого.',2475),('10 способов изучения английского!',2476),('Как расширить память. Один из способов.',2534),('Для работы, учебы и для общего развития человека ему необходимо иметь хорошую память. Не будем углубляться в теорию, что собой представляет человеческий мозг и память в частности, а лучше рассмотрим один из способов улучшения и расширения памяти.',2535),('расширить память',2536),('Выбор профессии как важнейший аспект в современном обществе.',2606),('Основные факторы выбора профессии:',2607),('Выбор профессии',2608),('От куда рождаются новые идеи?',2666),('В повседневной жизни мы так привыкли к стандарту р