ать ваши отношения',3330),('<blockquote>\r\n<p style=\"text-align: center;\"><br />\r\nБудем ли мы вместе?</p>\r\n</blockquote>\r\n\r\n<p style=\"text-align: center;\"><strong>5 вещей, которые разрушают отношения быстрее всего</strong></p>\r\n\r\n<p><br />\r\n<br />\r\nКакие поступки разрушают отношения быстрее всего? Что может сделать девушка, чтобы сохранить отношения?</p>\r\n\r\n<blockquote>\r\n<p><br />\r\n<br />\r\nЕсли ты дорожишь своими отношениями и партнером, никогда не совершай того, о чем пойдет речь ниже. Это способно разрушить даже самые крепкие отношения.</p>\r\n</blockquote>\r\n\r\n<p><br />\r\n&nbsp;<br />\r\n<strong>1.</strong>Попытки изменить его<br />\r\n&nbsp;Тебе может показаться, что таким образом ты делаешь своему партнеру одолжение, помогаешь ему измениться и стать лучше во всех смыслах. Но нужно понять и принять тот факт, что он, скорее всего, не хочет ничего менять в своей жизни и прекрасно чувствует себя как есть. <strong>Попытки изменить человека &ndash; пустая трата времени и сил.</strong> Да и мало кому это может понравиться.<br />\r\n&nbsp;<br />\r\n<strong>2.</strong>Ссоры на публике<br />\r\n&nbsp;Так ты демонстрируешь свое глубокое неуважение к партнеру. Или негатива накопилось столько, что ты только и ищешь возможности выплеснуть его наружу? Во всяком случае, выяснять отношения нужно не на потеху публике, а дома.</p>\r\n\r\n<p style=\"text-align: center;\"><br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong> фото ссоры пары</strong></p>\r\n\r\n<p><br />\r\n<strong>3</strong>.Слежка<br />\r\n&nbsp;Взломать его аккаунт в соцсети было делом плевым. Зато теперь ты знаешь о нем все: с кем он общается, с кем поддерживает хорошие отношения и, конечно, детали переписки. А он об этом знает? Нет? А теперь представь, как он отреагирует, когда все выяснится. Даже если он никогда не узнает об этом, уверена ли ты, что хочешь увидеть его переписку? Это один из тех случаев, когда знание бывает лишним.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong> &nbsp;фото шпиона</strong><br />\r\n&nbsp;<br />\r\n<strong>4.</strong>Критиковать его семью<br />\r\n&nbsp;<br />\r\nКакие бы &laquo;тараканы в голове&raquo; ни были у его родных, тебе не следует дурно отзываться о них. Вероятно, он и сам все прекрасно понимает, просто услышать правду от другого человека &ndash; всегда неприятно. Это может подорвать ваши отношения.<br />\r\n&nbsp;<br />\r\n<strong>5.</strong>Врать<br />\r\n&nbsp;<br />\r\nОб этом скажет всякий психолог и опытный в отношениях человек: <strong>доверие &ndash; основа отношений. </strong>Если вы постоянно что-то скрываете друг от друга, недоговариваете или врете, отношения уж никак нельзя считать здоровыми. А если это так, нужны ли они вам вообще?</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</strong></p>\r\n',3331),(' поступки разрушают отношения Попытки изменить человека – пустая трата времени и сил.доверие – основа отношений. Это может подорвать ваши отношения',3332),('будем ли мы вместе?',3735),('будем ли мы вместе?\n5 вещей, которые разрушают отношения быстрее всего \nКакие поступки разрушают отношения быстрее всего? Что может сделать девушка, чтобы сохранить отношения?\n ',3736),('',3737),('Какие поступки разрушают отношения быстрее всего',3738),('5 вещей, которые разрушают отношения быстрее всего Какие поступки разрушают отношения быстрее всего? Что может сделать девушка, чтобы сохранить отношения?',3875),('5 вещей, которые разрушают отношения быстрее всего\r\nКакие поступки разрушают отношения быстрее всего? Что может сделать девушка, чтобы сохранить отношения?\r\n',3876),('<p><br />\r\n5 вещей, которые разрушают отношения быстрее всего</p>\r\n\r\n<p>Какие поступки разрушают отношения быстрее всего? Что может сделать девушка, чтобы сохранить отношения?</p>\r\n\r\n<p>Если ты дорожишь своими отношениями и партнером, никогда не совершай того, о чем пойдет речь ниже. Это способно разрушить даже самые крепкие отношения.</p>\r\n\r\n<p>&nbsp;<br />\r\n1.Попытки изменить его<br />\r\n&nbsp;Тебе может показаться, что таким образом ты делаешь своему партнеру одолжение, помогаешь ему измениться и стать лучше во всех смыслах. Но нужно понять и принять тот факт, что он, скорее всего, не хочет ничего менять в своей жизни и прекрасно чувствует себя как есть. Попытки изменить человека &ndash; пустая трата времени и сил. Да и мало кому это может понравиться.<br />\r\n&nbsp;<br />\r\n2.Ссоры на публике<br />\r\n&nbsp;Так ты демонстрируешь свое глубокое неуважение к партнеру. Или негатива накопилось столько, что ты только и ищешь возможности выплеснуть его наружу? Во всяком случае, выяснять отношения нужно не на потеху публике, а дома.</p>\r\n\r\n<p><br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;фото ссоры пары</p>\r\n\r\n<p><br />\r\n3.Слежка<br />\r\n&nbsp;Взломать его аккаунт в соцсети было делом плевым. Зато теперь ты знаешь о нем все: с кем он общается, с кем поддерживает хорошие отношения и, конечно, детали переписки. А он об этом знает? Нет? А теперь представь, как он отреагирует, когда все выяснится. Даже если он никогда не узнает об этом, уверена ли ты, что хочешь увидеть его переписку? Это один из тех случаев, когда знание бывает лишним.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;фото шпиона<br />\r\n&nbsp;<br />\r\n4.Критиковать его семью<br />\r\n&nbsp;<br />\r\nКакие бы &laquo;тараканы в голове&raquo; ни были у его родных, тебе не следует дурно отзываться о них. Вероятно, он и сам все прекрасно понимает, просто услышать правду от другого человека &ndash; всегда неприятно. Это может подорвать ваши отношения.<br />\r\n&nbsp;<br />\r\n5.Врать<br />\r\n&nbsp;<br />\r\nОб этом скажет всякий психолог и опытный в отношениях человек: доверие &ndash; основа отношений. Если вы постоянно что-то скрываете друг от друга, недоговариваете или врете, отношения уж никак нельзя считать здоровыми. А если это так, нужны ли они вам вообще?</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n',3877),('Какие поступки разрушают отношения быстрее всего? Что может сделать девушка, чтобы сохранить отношения?',3878),('будем ли мы вместе?5 вещей, которые разрушают отношения быстрее всего',3994),('',3995),('',3996),('',3997),('будем ли мы вместе?',4029),('будем ли мы вместе?',4030),('',4031),('',4032),('будем ли мы вместе?5 вещей, которые разрушают отношения быстрее всего',4148),('будем ли мы вместе?5 вещей, которые разрушают отношения быстрее всего.Какие поступки разрушают отношения быстрее всего? Что может сделать девушка, чтобы сохранить отношения?',4149),('<p>будем ли мы вместе?5 вещей, которые ра