ом, уверена ли ты, что хочешь увидеть его переписку? Это один из тех случаев, когда знание бывает лишним.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;фото шпиона<br />\r\n&nbsp;<br />\r\n4.Критиковать его семью<br />\r\n&nbsp;<br />\r\nКакие бы &laquo;тараканы в голове&raquo; ни были у его родных, тебе не следует дурно отзываться о них. Вероятно, он и сам все прекрасно понимает, просто услышать правду от другого человека &ndash; всегда неприятно. Это может подорвать ваши отношения.<br />\r\n&nbsp;<br />\r\n5.Врать<br />\r\n&nbsp;<br />\r\nОб этом скажет всякий психолог и опытный в отношениях человек: доверие &ndash; основа отношений. Если вы постоянно что-то скрываете друг от друга, недоговариваете или врете, отношения уж никак нельзя считать здоровыми. А если это так, нужны ли они вам вообще?</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n',4171),('Какие поступки разрушают отношения быстрее всего? Что может сделать девушка, чтобы сохранить отношения?',4172),('5 вещей, которые разрушают отношения быстрее всего Какие поступки разрушают отношения быстрее всего?',4197),('1',4198),('o',4200),('5 вещей, которые разрушают отношения быстрее всего Какие поступки разрушают отношения быстрее всего?',4204),('1',4205),('<p>2</p>\r\n',4206),('o',4207),('будем ли мы вместе?5 вещей, которые разрушают отношения быстрее всего',4211),('будем ли мы вместе?5 вещей, которые разрушают отношения быстрее всего.Какие поступки разрушают отношения быстрее всего? Что может сделать девушка, чтобы сохранить отношения?',4212),('<p>будем ли мы вместе?5 вещей, которые разрушают отношения быстрее всего.Какие поступки разрушают отношения быстрее всего? Что может сделать девушка, чтобы сохранить отношения?</p>\r\n',4213),('будут ли вместе',4214),('Будем ли мы вместе?5 вещей, которые разрушают отношения быстрее всего',4281),('тут пиши не заголовок а уже само начало статьи, пару предложений',4282),('<p>Тут то же самое что и в мета описани</p>\r\n',4283),('будут ли вместе',4284),('Будем ли мы вместе?5 вещей, которые разрушают отношения быстрее всего',4316),('Какие поступки разрушают отношения быстрее всего? Что может сделать девушка, чтобы сохранить отношения?',4317),('<p>Какие поступки разрушают отношения быстрее всего? Что может сделать девушка, чтобы сохранить отношения?</p>\r\n',4318),('будут ли вместе',4319),('Будем ли мы вместе? 5 вещей, которые разрушают отношения быстрее всего',4344),('Какие поступки разрушают отношения быстрее всего? Что может сделать девушка, чтобы сохранить отношения?',4345),('<p>Какие поступки разрушают отношения быстрее всего? Что может сделать девушка, чтобы сохранить отношения?</p>\r\n',4346),('будут ли вместе',4347),('Будем ли мы вместе? 5 вещей, которые разрушают отношения быстрее всего',4351),('Какие поступки разрушают отношения быстрее всего? Что может сделать девушка, чтобы сохранить отношения?',4352),('<p>Какие поступки разрушают отношения быстрее всего? Что может сделать девушка, чтобы сохранить отношения?</p>\n',4353),('будут ли вместе',4354),('Будем ли мы вместе?  5 вещей, которые разрушают отношения быстрее всего',4358),('Какие поступки разрушают отношения быстрее всего? Что может сделать девушка, чтобы сохранить отношения?',4359),('<p>Какие поступки раз