ье приводятся ошибки, которые люди, разочарованные предыдущими отношениями, часто допускают на первом свидании: поиск идеала, страх быть брошенным, отсутствие позитивного настроя и другие.',4596),('<p>В статье приводятся ошибки, которые люди, разочарованные предыдущими отношениями, часто допускают на первом свидании: поиск идеала, страх быть брошенным, отсутствие позитивного настроя и другие.</p>\r\n',4597),('первое свидание',4598),('Первая любовь',4707),('Если вы спросите о ней своих родителей, бабушек или дедушек, они мечтательно поднимут глаза к небу и улыбнутся. Какой бы, возможно, трагедией она не обернулась для них в юности, первая любовь, спустя много времени, приносит только приятные ностальгические воспоминания',4708),('<p>Если вы спросите о ней своих родителей, бабушек или дедушек, они мечтательно поднимут глаза к небу и улыбнутся. Какой бы, возможно, трагедией она не обернулась для них в юности, первая любовь, спустя много времени, приносит только приятные ностальгические воспоминания</p>\r\n',4709),('первая любовь',4710),('Воспитание ребенка 3-4 года',4777),('Период развития ребенка в возрасте от 3 до 4 лет является наиболее определяющим и важным этапом в его жизни. Опираясь на исследования ученых, можно сказать о том, что основой его развития в это время является его положительное самоощущение: уверенность ребенка в себе и в своих действиях, его ощущение того, что он является самым любимым и самым хорошим. Но сами по себе такие ощущения у малышей не возникают..',4778),('<p>Период развития ребенка в возрасте от 3 до 4 лет является наиболее определяющим и важным этапом в его жизни. Опираясь на исследования ученых, можно сказать о том, что основой его развития в это время является его положительное самоощущение: уверенность ребенка в себе и в своих действиях, его ощущение того, что он является самым любимым и самым хорошим. Но сами по себе такие ощущения у малышей не возникают..</p>\r\n',4779),('воспитание ребенка',4780),('творческое развитие детей',4826),('Творческие способности есть у всех детей с рождения. Им не нужно учиться использовать свое воображение. К сожалению, взрослые могут все испортить',4827),('<p>Творческие способности есть у всех детей с рождения. Им не нужно учиться использовать свое воображение. К сожалению, взрослые могут все испортить</p>\r\n',4828),('творческий ребенок',4829),('Когда и почему вы должны игнорировать своего ребенка ',4875),('Вашим детям не нужно все ваше внимание. Как быть избирательным для своей выгоды',4876),('<p>Вашим детям не нужно все ваше внимание. Как быть избирательным для своей выгоды</p>\r\n',4877),('истерика ребенка',4878),('Когда и почему вы должны игнорировать своего ребенка ',4882),('Вашим детям не нужно все ваше внимание. Как быть избирательным для своей выгоды',4883),('<p>Вашим детям не нужно все ваше внимание. Как быть избирательным для своей выгоды</p>\n',4884),('истерика ребенка',4885),(' Как подготовить ребенка к детскому саду ',4924),('Как правило, когда у мамы заканчивается отпуск по уходу за ребенком, малыш тоже отправляется на свою первую «работу» – в детский сад. ',4925),('<p>Как правило, когда у мамы заканчивается отпуск по уходу за ребенком, малыш тоже отправляется на свою первую &laquo;работу&raquo; &ndash; в детский сад.&nbsp;</p>\r\n',4926),('детский сад',4927),(' Как подготовить ребенка к детскому саду ',4931),('Как правило, когда у мамы заканчивается отпуск по уходу за ребенком, малыш тоже отправляется на свою первую «работу» – в детский сад. ',4932),('<p>Как правило, когда у мамы заканчивается отпуск по уходу за ребенком, малыш тоже отправляется на свою первую &laquo;работу&raquo; &ndash; в детский сад.&nbsp;</p>\n',4933),('детский сад',4934),('Этикет для детей ',4987),('Воспитание - постоянная тема, которая сопровождает родителей на протяжении всего периода взросления их чад. Малышам, которые усвоили правила поведения еще в детстве, легче взаимодействовать с окружающим миром.',4988),('<p>Воспитание - постоянная тема, которая сопровождает родителей на протяжении всего периода взросления их чад. Малышам, которые усвоили правила поведения еще в детстве, легче взаимодействовать с окружающим миром.</p>\r\n',4989),('поведение детей',4990),(' Как электронные устройства стали модными детскими игрушками ',5064),('Современным детям можно только позавидовать. Ассортимент игрушек настолько огромен, что сможет удивить даже самого искушенного покупателя, а в детском магазине легко заблудиться. ',5065),('<p>Современным детям можно только позавидовать. Ассортимент игрушек настолько огромен, что сможет удивить даже самого искушенного покупателя, а в детском магазине легко заблудиться.&nbsp;</p>\r\n',5066),('электронные игрушки',5067),('Как улучшить работу мозга ',5078),('В современном мире, чтобы успешно существовать среди окружающих, выделяться из серой массы и уметь заинтересовать любого понравившегося человека, нужно быть умным. За ум отвечает мозг, поэтому его-то и нужно развивать, совершенствовать и заставлять работать на полную катушку.\r\nИтак, практические советы, или как улучшить работу мозга:',5079),('<p>В современном мире, чтобы успешно существовать среди окружающих, выделяться из серой массы и уметь заинтересовать любого понравившегося человека, нужно быть умным. За ум отвечает мозг, поэтому его-то и нужно развивать, совершенствовать и заставлять работать на полную катушку.<br />\r\nИтак, практические советы, или как улучшить работу мозга:</p>\r\n',5080),('Как улучшить работу мозга ',5081),('Идеальная девушка глазами мужчин.',5085),('«На вкус и цвет все фломастеры разные», - скажете вы. А я отвечу: «Несомненно, но всё-таки существуют такие черты, которые каждый мужчина хотел бы видеть в своей спутнице». Было проведено несчётное множество различных опросов, на основе которых психологи и вывели «формулу идеальной девушки». Давайте разбираться.',5086),('<p>&laquo;На вкус и цвет все фломастеры разные&raquo;, - скажете вы. А я отвечу: &laquo;Несомненно, но всё-таки существуют такие черты, которые каждый мужчина хотел 