ридумать, мы сразу же бросаем это дело. Потому что придумать что то уникальное очень тяжело. Порой можно сидеть часами придумывая новые идеи или хотя бы возможности изменить что то в своей повседневной жизни.</p>\r\n',5332),('идея',5333),('От куда рождаются новые идеи?',5337),('В повседневной жизни мы так привыкли к стандарту разнообразий наших мыслей, если мы хотим что то изменить в своей работе, жизни или элементарно что то придумать, мы сразу же бросаем это дело. Потому что придумать что то уникальное очень тяжело. Порой можно сидеть часами придумывая новые идеи или хотя бы возможности изменить что то в своей повседневной жизни.',5338),('<p>В повседневной жизни мы так привыкли к стандарту разнообразий наших мыслей, если мы хотим что то изменить в своей работе, жизни или элементарно что то придумать, мы сразу же бросаем это дело. Потому что придумать что то уникальное очень тяжело. Порой можно сидеть часами придумывая новые идеи или хотя бы возможности изменить что то в своей повседневной жизни.</p>\n',5339),('идея',5340),('Как помочь ребенку адаптироваться к детскому саду?',5344),('Дети - цветы жизни! С рождения они приносят в мир взрослого радость и счастье! Чего стоит только одна улыбка малыша, от которой жизнь становится яркой, осмысленной, наполненной положительными эмоциями!',5345),('<p>Дети - цветы жизни! С рождения они приносят в мир взрослого радость и счастье! Чего стоит только одна улыбка малыша, от которой жизнь становится яркой, осмысленной, наполненной положительными эмоциями!</p>\r\n',5346),('Адаптация в детском саду',5347),('Как помочь ребенку избавиться от чувства страха в темноте',5400),('Не существует практически ни одного ребенка, который бы комфортно чувствовал себя в сумраке. Боязнь возникает чаще всего из-за богатой природной фантазии, которая рисует малышам монстров и чудовищ в затемненных углах комнаты.',5401),('<p>Не существует практически ни одного ребенка, который бы комфортно чувствовал себя в сумраке. Боязнь возникает чаще всего из-за богатой природной фантазии, которая рисует малышам монстров и чудовищ в затемненных углах комнаты.</p>\r\n',5402),('страхи детей',5403),('Как помочь ребенку избавиться от чувства страха в темноте',5407),('Не существует практически ни одного ребенка, который бы комфортно чувствовал себя в сумраке. Боязнь возникает чаще всего из-за богатой природной фантазии, которая рисует малышам монстров и чудовищ в затемненных углах комнаты.',5408),('<p>Не существует практически ни одного ребенка, который бы комфортно чувствовал себя в сумраке. Боязнь возникает чаще всего из-за богатой природной фантазии, которая рисует малышам монстров и чудовищ в затемненных углах комнаты.</p>\n',5409),('страхи детей',5410),('Как быстро успокоить ребенка',5477),('Дети не всегда бывают милыми и послушными. Иногда они устраивают настоящие истерики, а еще хуже, если это происходит в общественном месте. Что вы можете сделать, чтобы быстро успокоить своего ребенка?',5478),('<p>Дети не всегда бывают милыми и послушными. Иногда они устраивают настоящие истерики, а еще хуже, если это происходит в общественном месте. Что вы можете сделать, чтобы быстро успокоить своего ребенка?</p>\r\n',5479),('истерика ребенка',5480),('Как научить ребёнка писать красиво?',5554),('Важной составной частью всестороннего развития подрастающего поколения является обучение школьника ровному почерку. В прежние годы в начальных классах советской школы детей учили чистому и красивому письму. Сейчас, к сожалению, не во всех российских школах чистописание входит в программу обучения.',5555),('<p>Важной составной частью всестороннего развития подрастающего поколения является обучение школьника ровному почерку. В прежние годы в начальных классах советской школы детей учили чистому и красивому письму. Сейчас, к сожалению, не во всех российских школах чистописание входит в программу обучения.</p>\r\n',5556),('красиво писать',5557),('Как приучить ребенка ложиться спать вовремя',5596),('Все дети засыпают по-разному. Укладывание в постель не должно вызывать у малышей неприятных ощущений, но непреклонность взрослых является обязательным условием. ',5597),('<p>Все дети засыпают по-разному. Укладывание в постель не должно вызывать у малышей неприятных ощущений, но непреклонность взрослых является обязательным условием.</p>\r\n',5598),('спать во время',5599),('Как приучить ребенка ложиться спать вовремя',5603),('Все дети засыпают по-разному. Укладывание в постель не должно вызывать у малышей неприятных ощущений, но непреклонность взрослых является обязательным условием. ',5604),('<p>Все дети засыпают по-разному. Укладывание в постель не должно вызывать у малышей неприятных ощущений, но непреклонность взрослых является обязательным условием.</p>\r\n',5605),('спать во время',5606),('Как приучить ребенка ложиться спать вовремя',5610),('Все дети засыпают по-разному. Укладывание в постель не должно вызывать у малышей неприятных ощущений, но непреклонность взрослых является обязательным условием. ',5611),('<p>Все дети засыпают по-разному. Укладывание в постель не должно вызывать у малышей неприятных ощущений, но непреклонность взрослых является обязательным условием.</p>\r\n',5612),('спать во время',5613),('Слова-бандиты',5666),('Реальный случай произошел когда-то. К очень интеллигентной бабушке издалека приехал маленький внук. Был он очень ласковый, с голубыми любознательными глазенками, умный и начитанный',5667),('<p>Реальный случай произошел когда-то. К очень интеллигентной бабушке издалека приехал маленький внук. Был он очень ласковый, с голубыми любознательными глазенками, умный и начитанный</p>\r\n',5668),('плохи слова для детей\r\n',5669),('Слова-бандиты',5673),('Реальный случай произошел когда-то. К очень интеллигентной бабушке издалека приехал маленький внук. Был он очень ласковый, с голубыми любознательными глазенками, умный и начитанный',5674),('<p>Реальный случай произошел когда-то. К очень интеллигентной бабушке издалека приехал маленький внук. Был он очень ласковый, с голубыми любознательными глазенками, умный и начитанный</p>\n',5675),('плохи слова для детей\n',5676),('Как помочь дошкольнику овладеть правильной и красивой речью',5743),('Речевые нарушения детей являются серьезной проблемой нашего времени. Огорчает то, что количество их не уменьшается, а год от года только растет - всё больше родителей обращается за помощью логопеда. Известно, что речь не дана ребенку от рождения, она развивается и совершенствуется одновременно с физическим и психическим развитием, а также зависит от определенных условий.',5744),('<p>Речевые нарушения детей являются серьезной проблемой нашего времени. Огорчает то, что количество их не уменьшается, а год от года только растет - всё больше родителей обращается за помощью логопеда. Известно, что речь не дана ребенку от рождения, она развивается и совершенствуется одновременно с физическим и психическим развитием, а также зависит от определенных условий.</p>\r\n',5745),('правильная речь',5746),('Как научить ребенка спорить?',5785),('Когда ребенок маленький, он воспринимает то, что ему говорят, как истину. Он просто верит в то, о чем говорят ему родители и другие взрослые. ',5786),('<p>Когда ребенок маленький, он воспринимает то, что ему говорят, как истину. Он просто верит в то, о чем говорят ему родители и другие взрослые.</p>\r\n',5787),('личное мнение',5788),('Формирование мировоззрения ребёнка',5834),('Психика маленького человека - это чистый лист, на котором можно написать что угодно. Первыми и самыми главными учителями ребёнка становятся его родители. Ребят часто называют \"отражением\" своих родителей',5835),('<p>Психика маленького человека - это чистый лист, на котором можно написать что угодно. Первыми и самыми главными учителями ребёнка становятся его родители. Ребят часто называют &quot;отражением&quot; своих родителей</p>\r\n',5836),('психика детей',5837),('Творческое развитие детей',5860),('Творческие способности есть у всех детей с рождения. Им не нужно учиться использовать свое воображение. К сожалению, взрослые могут все испортить',5861),('<p>Творческие способности есть у всех детей с рождения. Им не нужно учиться использовать свое воображение. К сожалению, взрослые могут все испортить</p>\r\n',5862),('творческий ребенок',5863);
