INSERT INTO `btContentLocal` VALUES (22,NULL),(27,''),(28,''),(38,''),(43,''),(50,''),(52,''),(54,''),(55,'<p>Лэндинг для:&nbsp;</p>\r\n'),(56,'<p>Лэндинг для: &nbsp;&quot;Помощь родителям&quot;</p>\r\n'),(57,'<p>Лэндинг для: &nbsp;Помощь Студентам</p>\r\n'),(58,'<p>Лэндинг для: &nbsp;помощь в отношениях</p>\r\n'),(59,'<p>Советы родителям Главная</p>\r\n'),(60,'<p>Советы Студентам - главная</p>\r\n'),(61,'<p>Советы в отношениях главная</p>\r\n'),(62,'<p>Для страницы:&nbsp;</p>\r\n'),(63,'<p>Для страницы...</p>\r\n'),(64,'<p>Список психологов</p>\r\n'),(65,'<p>Для страницы: &nbsp;статьи родителям</p>\r\n'),(66,'<p>Для страницы... вопрос-ответ родителям</p>\r\n'),(67,'<p>Для страницы: &nbsp;статьи студентам</p>\r\n'),(68,'<p>Для страницы... Вопрос-ответ студентам</p>\r\n'),(69,'<p>Для страницы: &nbsp;статьи отношения</p>\r\n'),(70,'<p>Для страницы... Отношения-вопросОтвет</p>\r\n'),(81,'<p>Введите текст страницы...</p>\r\n\r\n<h2 style=\"text-align: center;\">Тут будет подзаголовок</h2>\r\n\r\n<p>Тут что нибудь пишем</p>\r\n\r\n<p style=\"margin-left: 160px;\"><concrete-picture fID=\"1\" alt=\"14 поиск.jpg\" style=\"width: 400px; height: 269px; float: left;\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Продолжаем писанину, все вроде хорошо получается</p>\r\n'),(100,'<h2>Подзаголовок</h2>\r\n\r\n<p>Введите текст страницы...</p>\r\n\r\n<p>фывафывафывафывафываыфыфвафыва</p>\r\n\r\n<p>фывафывафывафывафывафывафыва</p>\r\n\r\n<p>фывафывафывафывафывафывафыва</p>\r\n\r\n<blockquote>\r\n<p>фывафывафывафывафывафывафываыва</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<figure class=\"content-editor-image-captioned\"><concrete-picture fID=\"4\" alt=\"033.jpg\" height=\"285\" width=\"292\" />\r\n<figcaption>Что то под картинкой</figcaption>\r\n</figure>\r\n</blockquote>\r\n\r\n<p>ывафывафывафывафываывф фвафывафыва фвыафыва</p>\r\n'),(102,'<p>Введите текст сюда</p>\r\n'),(103,'<p>Введите текст сюда</p>\r\n'),(104,'<p>Введите текст сюда</p>\r\n'),(112,'<p>Гиперактивность, в основном, наблюдается у детей и подростков из-за эмоционального и неуравновешенного состояния. Им не всегда удается справиться с таким состоянием самостоятельно. Связывают это явление с перенапряжением и нервной возбудимостью организма.<br />\r\nГиперактивность &ndash; это повышенное эмоциональное состояние, которое вызвано нервно-психическим расстройством. Оно выходит за пределы полагающейся нормы.<br />\r\nПричины возникновения у детей говорят сами за себя, а именно:<br />\r\n1) Недостаток внимания со стороны родителей.<br />\r\n2) Активность, превышающая норму.<br />\r\n3) Чрезмерная эмоциональность.<br />\r\n4) Импульсивность.</p>\r\n\r\n<p>&nbsp;</p>\r\n'),(113,'<hr />\r\n<h1 style=\"text-align: center;\"><span style=\"font-size:18px;\"><strong>Как бороться родителям с таким непоседливым малышом? </strong></span></h1>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />'),(114,'<p>&nbsp;</p>\r\n\r\n<p>Ребенок уже изначально, на первых месяцах жизни, может проявлять гиперактивность:<br />\r\n1) Плохо спать.<br />\r\n2) Много плакать.<br />\r\n3) Реагировать на любой звук, шум.<br />\r\nДетки, которые постарше:<br />\r\n1) Неусидчивы.<br />\r\n2) Не сидят на одном месте.<br />\r\n3) Агрессивны.<br />\r\n4) Возбудимы.<br />\r\n5) Невнимательны.</p>\r\n'),(115,'<hr />\r\n<p>Сложности могут возникнуть уже тогда, когда вы поведете ребенка впервые в детский сад, ведь ему приходится вливаться в незнакомую обстановку. Для него, конечно же, это стресс.<br />\r\nВ школьный период гиперактивным детям приходится нелегко. Он может плохо усваивать информацию, вступать в конфликтные ситуации со сверстниками и учителями.<br />\r\nБольшие ошибки совершают родители, испытывая трудности с гиперактивным ребенком. Мера наказания должна быть не такой строгой и дисциплинированной. Детям с повышенной активностью и непоседливостью очень трудно соблюдать правила и рамки, которые устанавливают ему родители. Здесь поможет только терпеливый и мудрый подход в сложившейся ситуации, а лучше всего поход к специалисту, который поможет разобраться, в чем причина такого поведения у ребенка.<br />\r\nДети с ярко выраженной гиперактивностью чаще наблюдаются у невролога и психолога, для того чтобы избежать последствий.<br />\r\nГиперактивный ребенок подвержен в два раза больше различным травмам. Поэтому необходимо заранее позаботиться о его безопасности. Пик активности у детей начинается в два, три года, далее в восемь, десять лет.</p>\r\n\r\n<hr />'),(116,'<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n\r\n<section id=\"content\">\r\n<section>\r\n<p id=\"inner-content\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">По статистике, гиперактивность чаще всего выявляют у мальчиков. Причина тому, что они рождаются крупней, чем девочки, и мозг развивается у них гораздо позже.<br />\r\nДля того чтобы облегчить состояние ребенка, лучше всего давать лекарства, которые помогут успокоить детскую нервную систему и сосредоточиться на информации, исходящей от взрослых людей.<br />\r\nСвоевременная помощь малышу поможет сделать жизнь его спокойней. И это порадует самих родителей. Правильный подход и терпение, в сложившейся ситуации, помогут справиться с гиперактивностью малыша. Важно дать ему понять, что его все равно любят, несмотря ни на что.</span><br />\r\n&nbsp;</p>\r\n</section>\r\n</section>\r\n\r\n<section class=\"clearbar\">&nbsp;</section>\r\n'),(122,'<p><span style=\"font-family:Verdana,Geneva,sans-serif;\">Конечно же все родители хотят, чтобы их дети были здоровыми, умными и развитыми для своих лет. Часто это желание распространяется ещё дальше &ndash; и тогда мамы и папы всерьез начинают задумываться об опережающем развитии своего ребенка. Благо сегодня существует огромное количество авторских методик раннего развития детей (<span style=\"display: none;\">&nbsp;</span><u><strong>Г. </strong>Домана<strong>, Н. Зайцева, С. Лупан</strong></u><span style=\"display: none;\">&nbsp;</span>, система Никитиных и других), предлагающих игровое обучение чтению и счету, а также знакомство с цифрами чуть ли не годовалых детей.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n\r\n<p class=\"content-editor-image-center\"><img alt=\"гиперактивный ребенок.jpg\" height=\"261\" src=\"/download_file/view_inline/8\" width=\"420\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-family:Verdana,Geneva,sans-serif;\">Безусловно, каждая из этих методик интересна и имеет положительные стороны: большинство детей действительно овладевают навыками чтения, счета и письма в возрасте 1-3 лет. Но так ли это нужно вашему ребенку? Ведь всему этому он сможет научиться в подготовительной к школе группе и школе, а драгоценное время безмятежного детства подменяется пусть и игровым, но всё же обучением. В то же время общение со сверстниками, становление которого происходит как раз в период 1-3 лет, и социализация ребенка отходят на второй план, а при поступлении в школу это выльется в весьма серьезные проблемы: ребенок может стать &laquo;изгоем&raquo; среди одноклассников, да и обучение в первом классе потеряет для него всю свою привлекательность из-за того, что он всему уже научился ранее. </span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-family:Verdana,Geneva,sans-serif;\">Так что, родители, выбор за вами &ndash; выбирать раннее обучение для своего ребенка или нет, но помните, что это очень серьезный и ответственный шаг, который может оказать влияние на дальнейшую жизнь вашего ребенка.</span></p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n'),(124,'<p><span style=\"font-family:Verdana,Geneva,sans-serif;\">Конечно же все родители хотят, чтобы их дети были здоровыми, умными и развитыми для своих лет. Часто это желание распространяется ещё дальше &ndash; и тогда мамы и папы всерьез начинают задумываться об опережающем развитии своего ребенка. Благо сегодня существует огромное количество авторских методик раннего развития детей (<span style=\"display: none;\">&nbsp;</span><u><strong>Г. </strong>Домана<strong>, Н. Зайцева, С. Лупан</strong></u><span style=\"display: none;\">&nbsp;</span>, система Никитиных и других), предлагающих игровое обучение чтению и счету, а также знакомство с цифрами чуть ли не годовалых детей.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n\r\n<p class=\"content-editor-image-center\"><img alt=\"гиперактивный ребенок.jpg\" height=\"261\" src=\"/download_file/view_inline/8\" width=\"420\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-family:Verdana,Geneva,sans-serif;\">Безусловно, каждая из этих методик интересна и имеет положительные стороны: большинство детей действительно овладевают навыками чтения, счета и письма в возрасте 1-3 лет. Но так ли это нужно вашему ребенку? Ведь всему этому он сможет научиться в подготовительной к школе группе и школе, а драгоценное время безмятежного детства подменяется пусть и игровым, но всё же обучением. В то же время общение со сверстниками, становление которого происходит как раз в период 1-3 лет, и социализация ребенка отходят на второй план, а при поступлении в школу это выльется в весьма серьезные проблемы: ребенок может стать &laquo;изгоем&raquo; среди одноклассников, да и обучение в первом классе потеряет для него всю свою привлекательность из-за того, что он всему уже научился ранее. </span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-family:Verdana,Geneva,sans-serif;\">Так что, родители, выбор за вами &ndash; выбирать раннее обучение для своего ребенка или нет, но помните, что это очень серьезный и ответственный шаг, который может оказать влияние на дальнейшую жизнь вашего ребенка.</span></p>\r\n'),(125,'<p>Гиперактивность, в основном, наблюдается у детей и подростков из-за эмоционального и неуравновешенного состояния. Им не всегда удается справиться с таким состоянием самостоятельно. Связывают это явление с перенапряжением и нервной возбудимостью организма.</p>\r\n\r\n<p>Гиперактивность &ndash; это повышенное эмоциональное состояние, которое вызвано нервно-психическим расстройством. Оно выходит за пределы полагающейся нормы.</p>\r\n\r\n<p><strong>Причины возникновения у детей говорят сами за себя, а именно:</strong></p>\r\n\r\n<ol>\r\n	<li>Недостаток внимания со стороны родителей.</li>\r\n	<li>Активность, превышающая норму.</li>\r\n	<li>Чрезмерная эмоциональность.</li>\r\n	<li>Импульсивность.</li>\r\n</ol>\r\n\r\n<blockquote>\r\n<p>Как бороться родителям с таким непоседливым малышом?</p>\r\n</blockquote>\r\n\r\n<p>Ребенок уже на первых месяцах жизни, может проявлять гиперактивность:</p>\r\n\r\n<ol>\r\n	<li>Плохо спать.</li>\r\n	<li>Много плакать.</li>\r\n	<li>Реагировать на любой звук, шум.</li>\r\n</ol>\r\n\r\n<p>Детки, которые постарше:</p>\r\n\r\n<ol>\r\n	<li>Неусидчивы.</li>\r\n	<li>Не сидят на одном месте.</li>\r\n	<li>Агрессивны.</li>\r\n	<li>Возбудимы.</li>\r\n	<li>Невнимательны.</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n\r\n<p>Сложности могут возникнуть уже тогда, когда вы поведете ребенка впервые в детский сад, ведь ему приходится вливаться в незнакомую обстановку. Для него, конечно же, это стресс.В школьный период гиперактивным детям приходится нелегко. Он может плохо усваивать информацию, вступать в конфликтные ситуации со сверстниками и учителями.</p>\r\n\r\n<p>Большие ошибки совершают родители, испытывая трудности с гиперактивным ребенком. Мера наказания должна быть не такой строгой и дисциплинированной. Детям с повышенной активностью и непоседливостью очень трудно соблюдать правила и рамки, которые устанавливают ему родители. Здесь поможет только терпеливый и мудрый подход в сложившейся ситуации, а лучше всего поход к специалисту, который поможет разобраться, в чем причина такого поведения у ребенка.</p>\r\n\r\n<p>Дети с ярко выраженной гиперактивностью чаще наблюдаются у невролога и психолога, для того чтобы избежать последствий. Гиперактивный ребенок подвержен в два раза больше различным травмам. Поэтому необходимо заранее позаботиться о его безопасности. Пик активности у детей начинается в два, три года, далее в восемь, десять лет.</p>\r\n\r\n<p>По статистике, гиперактивность чаще всего выявляют у мальчиков. Причина тому, что они рождаются крупней, чем девочки, и мозг развивается у них гораздо позже.<br />\r\nДля того чтобы облегчить состояние ребенка, лучше всего давать лекарства, которые помогут успокоить детскую нервную систему и сосредоточиться на информации, исходящей от взрослых людей.</p>\r\n\r\n<p>Своевременная помощь малышу поможет сделать жизнь его спокойней. И это порадует самих родителей. Правильный подход и терпение, в сложившейся ситуации, помогут справиться с гиперактивностью малыша. Важно дать ему понять, что его все равно любят, несмотря ни на что.&nbsp;</p>\r\n'),(130,'<p>Конечно же все родители хотят, чтобы их дети были здоровыми, умными и развитыми для своих лет. Часто это желание распространяется ещё дальше &ndash; и тогда мамы и папы всерьез начинают задумываться об опережающем развитии своего ребенка.</p>\r\n\r\n<p>Благо сегодня существует огромное количество авторских методик раннего развития детей (<span style=\"display: none;\">&nbsp;</span><u><strong>Г. </strong>Домана<strong>, Н. Зайцева, С. Лупан</strong></u><span style=\"display: none;\">&nbsp;</span>, система Никитиных и других), предлагающих игровое обучение чтению и счету, а также знакомство с цифрами чуть ли не годовалых детей.</p>\r\n\r\n<p class=\"content-editor-image-center\"><img alt=\"гиперактивный ребенок.jpg\" height=\"261\" src=\"/download_file/view_inline/8\" width=\"420\" /></p>\r\n\r\n<p>Безусловно, каждая из этих методик интересна и имеет положительные стороны: большинство детей действительно овладевают навыками чтения, счета и письма в возрасте 1-3 лет. Но так ли это нужно вашему ребенку? Ведь всему этому он сможет научиться в подготовительной к школе группе и школе, а драгоценное время безмятежного детства подменяется пусть и игровым, но всё же обучением.</p>\r\n\r\n<p>В то же время общение со сверстниками, становление которого происходит как раз в период 1-3 лет, и социализация ребенка отходят на второй план, а при поступлении в школу это выльется в весьма серьезные проблемы: ребенок может стать &laquo;изгоем&raquo; среди одноклассников, да и обучение в первом классе потеряет для него всю свою привлекательность из-за того, что он всему уже научился ранее.</p>\r\n\r\n<p>Так что, родители, выбор за вами &ndash; выбирать раннее обучение для своего ребенка или нет, но помните, что это очень серьезный и ответственный шаг, который может оказать влияние на дальнейшую жизнь вашего ребенка.</p>\r\n'),(131,'<p>&nbsp;</p>\r\n\r\n<p>Гиперактивность, в основном, наблюдается у детей и подростков из-за эмоционального и неуравновешенного состояния. Им не всегда удается справиться с таким состоянием самостоятельно. Связывают это явление с перенапряжением и нервной возбудимостью организма.</p>\r\n\r\n<p>Гиперактивность &ndash; это повышенное эмоциональное состояние, которое вызвано нервно-психическим расстройством. Оно выходит за пределы полагающейся нормы.</p>\r\n\r\n<p><strong>Причины возникновения у детей говорят сами за себя, а именно:</strong></p>\r\n\r\n<ol>\r\n	<li>Недостаток внимания со стороны родителей.</li>\r\n	<li>Активность, превышающая норму.</li>\r\n	<li>Чрезмерная эмоциональность.</li>\r\n	<li>Импульсивность.</li>\r\n</ol>\r\n\r\n<blockquote>\r\n<p>Как бороться родителям с таким непоседливым малышом?</p>\r\n</blockquote>\r\n\r\n<p>Ребенок уже на первых месяцах жизни, может проявлять гиперактивность:</p>\r\n\r\n<ol>\r\n	<li>Плохо спать.</li>\r\n	<li>Много плакать.</li>\r\n	<li>Реагировать на любой звук, шум.</li>\r\n</ol>\r\n\r\n<p>Детки, которые постарше:</p>\r\n\r\n<ol>\r\n	<li>Неусидчивы.</li>\r\n	<li>Не сидят на одном месте.</li>\r\n	<li>Агрессивны.</li>\r\n	<li>Возбудимы.</li>\r\n	<li>Невнимательны.</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n\r\n<p class=\"content-editor-image-center\"><concrete-picture fID=\"11\" alt=\"fbbae169ac798b03.jpg\" height=\"408\" width=\"528\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Сложности могут возникнуть уже тогда, когда вы поведете ребенка впервые в детский сад, ведь ему приходится вливаться в незнакомую обстановку. Для него, конечно же, это стресс.В школьный период гиперактивным детям приходится нелегко. Он может плохо усваивать информацию, вступать в конфликтные ситуации со сверстниками и учителями.</p>\r\n\r\n<p>Большие ошибки совершают родители, испытывая трудности с гиперактивным ребенком. Мера наказания должна быть не такой строгой и дисциплинированной. Детям с повышенной активностью и непоседливостью очень трудно соблюдать правила и рамки, которые устанавливают ему родители. Здесь поможет только терпеливый и мудрый подход в сложившейся ситуации, а лучше всего поход к специалисту, который поможет разобраться, в чем причина такого поведения у ребенка.</p>\r\n\r\n<p>Дети с ярко выраженной гиперактивностью чаще наблюдаются у невролога и психолога, для того чтобы избежать последствий. Гиперактивный ребенок подвержен в два раза больше различным травмам. Поэтому необходимо заранее позаботиться о его безопасности. Пик активности у детей начинается в два, три года, далее в восемь, десять лет.</p>\r\n\r\n<p>По статистике, гиперактивность чаще всего выявляют у мальчиков. Причина тому, что они рождаются крупней, чем девочки, и мозг развивается у них гораздо позже.<br />\r\nДля того чтобы облегчить состояние ребенка, лучше всего давать лекарства, которые помогут успокоить детскую нервную систему и сосредоточиться на информации, исходящей от взрослых людей.</p>\r\n\r\n<p>Своевременная помощь малышу поможет сделать жизнь его спокойней. И это порадует самих родителей. Правильный подход и терпение, в сложившейся ситуации, помогут справиться с гиперактивностью малыша. Важно дать ему понять, что его все равно любят, несмотря ни на что.&nbsp;</p>\r\n'),(132,'<p><strong>Купить мебель для детской комнаты довольно непросто,<br />\r\nДело даже не в том, что выбор шкафов и кроваток ограничен. В наше время в магазинах есть практически все, а остальное можно сделать на заказ.</strong><br />\r\n<br />\r\nПросто детская комната должна отражать внутренний мир вашего ребенка, соответствовать его интересам и развивать его способности.<br />\r\n<br />\r\nКомната малыша должна быть яркой, чтобы ему захотелось исследовать ее, открывать шкафчики, заглядывать на полки с книгами и разными мелочами<br />\r\n<br />\r\nКровать может быть с прекрасными подушками разных цветов, которыми можно биться как мечами и на которых так сладко засыпать.<br />\r\n<br />\r\nКомпьютерный стол (для детей постарше) должен быть удобным не только для компьютерных игр, но и для выполнения домашних заданий. А у школьников очень много различных книг, тетрадок и других школьных принадлежностей.<br />\r\n<br />\r\nНеобходимо найти место и для разнообразных игр ребенка (куклы, машинки, железные дороги) Они не должны валяться по всей комнате.<br />\r\n<br />\r\nСтены можно сделать разных цветов, но лучше слегка приглушенных тонов. Ведь ребенок не только играет и занимается в своей комнате, он в ней еще и спит. Перевозбуждение от ярких цветов может обернуться плохим сном для малыша.<br />\r\n<br />\r\nПусть детская комната для вашего ребенка станет не только миром, в котором он живет, но и окном в большой, взрослый мир<br />\r\n<br />\r\n&nbsp;</p>\r\n'),(133,'<p style=\"text-align: center;\"><em><span style=\"font-family:Verdana,Geneva,sans-serif;\"><span style=\"font-size: 16px;\"><strong>Когда в семье не один ребенок, то возникает проблема в их взаимопонимании между собой. Нет ничего ужасного в ссорах. </strong></span></span></em></p>\r\n\r\n<p><span style=\"font-family:Verdana,Geneva,sans-serif;\">Часто дети и обзываются, и дерутся. Правильным решением будет не вмешиваться в конфликты детей до поры до времени, они способны сами разобраться в своих проблемах. Нельзя оставаться в стороне, когда драки уже переходят ту грань, что становятся опасными, тут стоит вмешаться и развести их в разные стороны, попробовать отвлечь на время друг от друга.<br />\r\nЧаще всего наказывают старших детей, но не стоит забывать, что в ссоре участвовали оба. Для старшего ребенка складывается впечатление, что он всегда должен уступать, делиться с младшим, присматривать и помогать ему. Но он личность, у него свои интересы, занятия, не взваливайте на его плечи обязанности няньки, этим вы только вредите отношениям между детьми.<br />\r\nВ детском возрасте у них много общего между собой, они вместе играют, едят, ездят в гости, по сути, являются лучшими друзьями друг другу. И здесь родителям нужно быть аккуратными, уделять равное внимание и любовь. Если покупаете игрушку, то двоим. Не допустите ревности между ними, от этого скапливаются обиды и злость на того ребенка, который, по их мнению, получает больше заботы. Это не касается одежды. Приучайте детей с малого возраста быть объективными, в каждой семье разное материальное положение. Бывают ситуации, когда есть деньги купить только одну вещь в этом месяце, ребенок должен понимать это и не обижаться, если придется немного подождать.<br />\r\nЕсли старшая в семье девочка, она обычно с радостью помогает матери с младшим ребенком. Для нее это своеобразная игра, развивающая женское начало. А вам становится хорошей помощницей.<br />\r\nПри вступлении в подростковый возраст, братья и сестры отдаляются друг от друга, предпочитая общение со своими сверстниками. Интересуйтесь жизнью и проблемами вашего ребенка за пределами дома, чтобы не потерять ту нить, которая связывает вас и оградить его от необдуманных поступков.<br />\r\nСколько бы детей ни было в семье, ваша задача сохранить между всеми хорошие, крепкие отношения. Чтобы ребята выручали друг друга и пронесли свою любовь на долгие годы длиною в жизнь. </span></p>\r\n'),(134,'<p style=\"text-align: center;\"><strong>Всем, кто занимается воспитанием детей, приходится прибегать довольно часто к запретам. Известно, что подрастающее поколение реагирует на запреты по-разному: если один ребенок молча прекратит запрещенное мероприятие, то другой закатит настоящую истерику.</strong></p>\r\n\r\n<p><br />\r\nА если воспитанник подросток, то тут и вовсе жди серьезного протеста &ndash; либо скрытого (который постепенно вырвется наружу в самый неожиданный момент) или же явного и последствия его не будут такими безобидными, как у младших детей.<br />\r\nНу и что же делать &ndash; запрещать-то все равно приходится. Тут, как говорится, подход будет индивидуальным. В каждой семье приняты свои нормы поведения, методы воспитания могут быть отличными у каждого родителя.<br />\r\nНо есть общепринятые нормы поведения в обществе, уголовный кодекс, наконец, и вот здесь как раз все понятно &ndash; нельзя, значит нельзя. Главное доступно и понятно объяснить ребенку почему нельзя и какие последствия может повлечь за собой нарушение запрета.</p>\r\n\r\n<p><br />\r\nА вот во всем, что касается личного пространства семьи и ребенка, немного все по-другому. Некоторые родители придерживаются принципа: &laquo;запрещено все, что не разрешено&raquo;. Дети от них только и слышат: то нельзя и это нельзя.</p>\r\n\r\n<hr />\r\n<p style=\"text-align: center;\"><br />\r\n<strong>&laquo;Можно мне погулять?&raquo; - &laquo;Нет!&raquo;. &laquo;Могу я взять конфету?&raquo; - &laquo;Нельзя!&raquo;. &laquo;Можно пригласить Мишу в гости?&raquo; - &laquo;Нет!&raquo; И так на все вопросы, без объяснения причин. Что же в итоге?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>Пока маленький, ребенок будет подчиняться родителям, а куда деваться-то? Но по мере взросления постоянные запреты уже будут вызывать протест.<br />\r\nДети начинают нарушать их, сначала скрывая это от родителей, а потом, в подростковом периоде, уже в открытую, демонстративно: &laquo;Я уже вырос, могу делать что захочу! Ваше мнение мне безразлично!&raquo; И вот начинается конфликт поколений, который может иметь весьма печальные последствия.<br />\r\nТак что же делать, ведь нельзя же в самом деле все позволять? Конечно, нельзя. Но запреты должны быть как можно более редкими и иметь серьезные причины, такие, чтобы можно было объяснить ребенку.</p>\r\n\r\n<p><br />\r\nОбъяснять нужно обязательно, потому что голый запрет воспринимается как ваш личный каприз и вызывает обиду. &laquo;Мам, можно я залезу на дерево?&raquo; - &laquo;Попробуй, а я тебя подстрахую&raquo;. Так вы сможете проконтролировать ситуацию. А если вы сейчас запретите ему этот эксперимент, то ребенок все равно полезет на это дерево, но уже когда вас не будет рядом и тогда он может серьезно пострадать.<br />\r\nКогда малыш попробует и поймет, что это сложно и опасно, вот тогда и объясните ему, почему не стоит одному, без взрослого повторять этот трюк.<br />\r\nИли такая ситуация. Ребенок спрашивает, можно ли ему пригласить на День рождения весь класс. Конечно, разместить в однокомнатной квартире двадцать отпрысков не просто, да и накормить их и развлечь влетит вам в копеечку, но если вы сразу скажете &laquo;нет&raquo;, ребенок почувствует себя обиженным и еще долго будет считать, что вы поступили несправедливо.</p>\r\n\r\n<p><br />\r\nЛучше ответить &laquo;да&raquo;, а потом вместе с ребенком попытаться разобраться, что из этого получится. Когда он сам дойдет до мысли, что ничего хорошего выйти не может, получится, что вы ничего не запрещали, ребенок сам решил пригласить не весь класс, а нескольких друзей. Конфликта удалось избежать.<br />\r\nОднозначный запрет нужно накладывать на поступки, которые могут угрожать жизни и здоровью ребенка или окружающих. Тут необходимо твердое &laquo;нет&raquo;, раз и навсегда. И ни при каких обстоятельствах нельзя менять свое решение, так как непоследовательность в поступках взрослого серьезно подрывает его авторитет.</p>\r\n'),(135,'<p><strong>Воспитание детей в любой семье имеет свои особенности. У каждого родителя есть свои методы воспитания.Люди, создавшие семью, надеются на то, что в их семье будет царить мир, дружба и согласие между всеми членами семьи.</strong></p>\r\n\r\n<p>Раньше детей учили скромности и сдержанности. Было не принято говорить о своих способностях, рекламировать свои таланты и навыки. В наше время авторы многих книг пишут о том, что детей нужно хвалить, поощрять, прививать с детства самоуважение, высокую самооценку. Семьи ,которые следуют данным правилам, воспитывать ребенка-лидера. В этом есть свои плюсы.</p>\r\n\r\n<p>Ребенок-лидер умен, хитер, горд. Он легко может влиться в новый коллектив, умеет за себя постоять, знает себе цену. Ребенок-лидер всегда находится в центре внимания сверстников, его уважают, иногда даже боятся. Такой ребенок уверен в себе, умеет быстро принимать решения. Ему будет гораздо проще в жизни &quot;освоиться&quot;, чем ребенку, который не уверен в себе, и зажат. Чтобы воспитать ребенка-лидера , требуется немало усилий.</p>\r\n'),(136,'<p style=\"text-align: center;\"><strong>Воспитание ребенка в основном ложится на родителей. В большей степени первоначальным воспитанием ребенка занимается мать. Потому что только мать в состоянии уделять ребенку наибольшую часть времени и может отдать ему всю свою нежность, заботу и ласку.</strong></p>\r\n\r\n<p><br />\r\nНо стоит также помнить, что прекрасное воспитание зависит от семьи, в которой живет ребенок. Такой семьей может считаться та, где царит не только любовь друг к другу, но и любовь и уважение к другим людям.</p>\r\n\r\n<p><br />\r\nВоспитание единственного ребенка.<br />\r\nОбычно, в семье, где один ребенок, родители уделяют ему слишком много внимания. Основной причиной этого считается неопытность. Важно знать, что ребенок самостоятельно должен выработать в себе человека, нужно только не мешать ему в этом, а посодействовать.</p>\r\n\r\n<p><br />\r\nНельзя воспитывать ребенка в тепличных условиях, постоянно холить и лелеять, баловать и нежить - это может привести к помехам в психологическом развитии ребенка - оно замедляется. А также он вырастит избалованным, несамостоятельным и неуверенным в себе человеком. И когда ребенок пойдет в детский сад, то ожидая от окружающих такого же внимания, к какому он привык дома и не получая его, он может столкнуться с трудностями, что может привести к разочарованию. А также он начнет замыкаться в себе и уединяться, чтобы не находиться в обществе других детей, так как он не привык делиться игрушками, а привык к пристальному вниманию со стороны взрослых, что все ему и все для него.</p>\r\n\r\n<p><br />\r\nИ чтобы в дальнейшем такого не произошло, следует учесть то, что ребенок тоже человек, хоть пока еще и маленький, и у него должна быть свобода. У него должно быть детство, а в детстве имеет место быть беготня во дворе с друзьями и испачканные, рваные штаны. Не надо делать из него образцового ребенка.<br />\r\nВесь смысл воспитания ребенка состоит в том, чтобы научить его самостоятельности. Родители должны относиться к нему с первых дней жизни как к взрослому человеку и должны помнить, что ребенок - это тоже личность.</p>\r\n'),(137,'<p style=\"text-align: center;\">Канадские ученые из Монреальского университета определили, что дети, которых с детства воспитывают самостоятельными, имеют более высокие умственные и когнитивные навыки.<br />\r\n<br />\r\nВ рамках исследования ученые наблюдали за 78 детьми в возрасте от трех лет, которые играли в настольные игры, и их родителями. По мнению исследователей, именно такой способ игры позволяет максимально оценить интеллектуальные возможности детей, их умение самостоятельно планировать и организовывать определенные процессы, выполнять несколько действий одновременно.<br />\r\n<br />\r\n<strong>Результаты показали, что те дети, чьи родители воспитывают детей самостоятельными и независимыми, показали лучшие результаты, чем те, чьи родители излишне оберегают и ограничивают детей. </strong></p>\r\n'),(138,'<p><strong>Дети - цветы жизни! С рождения они приносят в мир взрослого радость и счастье! Чего стоит только одна улыбка малыша, от которой жизнь становится яркой, осмысленной, наполненной положительными эмоциями! Когда женщина узнает, что ожидает малыша, она испытывает невероятные чувства и эмоции. Это может быть удивление, неожиданность или, наоборот, долгожданное чудо, радость от ощущения нового состояния.</strong></p>\r\n\r\n<p>Порой материнство кардинально изменяет жизнь: новые заботы, обязанности, а какая доля ответственности за физиологическое и психологическое здоровье малыша ложится на плечи новоиспеченных родителей?! Первый вздох, плач, смех, слово, первые шаги - все это производит неизгладимое впечатление на людей, подаривших жизнь своему чаду.</p>\r\n\r\n<p>Познавая новый мир, дети учатся общению со своими сверстниками, у них возникают привязанности, эмоциональные связи; выстраиваются определенные взаимоотношения, взаимодействия, столь необходимые для их социального развития. Наверное, каждый взрослый замечал, что человек не может жить в одиночестве, без общения. Для нормального, полноценного развития человеку необходимы социальные контакты. Каждый из нас проходит через такие социальные институты как семья, детский сад, школа, средне или высшее профессиональное образование, различные объединения (по интересам, увлечениям, хобби), организации, религиозные институты (церкви, мечети или синагоги). Отсутствие важных социальных институтов оказывает огромное влияние на формирование личности. В этом случае, важно помнить, что ребенок познает, осваивает новый, сложный для него мир и учится выстраивать взаимоотношения самостоятельно. Поэтому, взрослым важно позитивно оценивать личность ребенка, тактично и аргументировано указывать на недостатки, терпеливо и умело поддерживать, хвалить за старание и инициативность. Ни в коем случае ребенка нельзя наказывать и запрещать. Помните такое выражение &ndash; запретный плод сладок? Так и ребенок в этом возрасте может совершать действия, которые противоречат словам взрослым. Необходимо предоставить ребенку возможность быть взрослым в бытовых ситуациях (самому завязать шнурки, почистить зубы, выбрать, что ему съесть на завтрак овсянку или яичницу с колбасой, играть дома или на детской площадке). Тем не менее, ребенок должен придерживаться режима (во сколько подъем, завтрак, прогулка, сон).</p>\r\n\r\n<hr />\r\n<p style=\"text-align: center;\"><br />\r\n<strong>Уважаемые родители, учитывайте возрастные особенности своего ребенка, будьте терпимее к его капризам, создайте для него благоприятную атмосферу, наполненную жизнерадостностью и оптимизмом, тогда процесс адаптации ребенка к детскому саду пройдет легко и быстро! </strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n'),(139,'<p><strong>Вы никогда не задумывались над тем, в какой мере мы женщины склонны к самообману. Что руководит нами в подобных действиях? Неужели страх одиночества настолько силен?</strong><br />\r\nНас всегда и везде окружают мужчины, нам лестно их внимание. И ведь, чем больше мужчин, тем больше склонность к одиночеству. Вся проблема в том, что человек не может без социума. Особенно мы женщины ищем постоянства и защиты за плечом любимого.</p>\r\n\r\n<p>Что делать, если мы этого не получаем? Самообман? Ненавидя себя за это и его за то, что мы покупаемся, продолжаем играть, будто ничего не происходит. Может вся наша жизнь сплошной самообман? И возможно ли от этого избавится? Или же удобнее продолжать игру, мило улыбаясь, показывать свою женскую слабость и кокетство?</p>\r\n\r\n<p>А одиночество - не так страшно, как описано? Лично я, читатели, не стремлюсь к переменам. И все продолжаю заниматься самообманом, пытаясь это использовать с умом. Наша сила в нашей слабости. Почему бы и не воспользоваться этим. Что же выберете вы?...</p>\r\n'),(140,'<p><strong>Знакомство в Интернете &ndash; это довольно распространенное явление в нашем современном мире. И ведь в таком знакомстве очень много положительного. </strong></p>\r\n\r\n<p>Например, люди, у которых довольно мало шансов встретиться в нашей жизни по каким &ndash; либо причинам свободно могут повстречать друг друга в этом неограниченном пространстве. И это должно радовать. Ведь теперь счастливых людей станет больше.</p>\r\n\r\n<p><br />\r\nНо, к сожалению, все это оказывается совершенно не так. И иногда такое знакомство в Интернете заставляет не столько радоваться, сколько грустить. И приносит такое &laquo;счастье&raquo; обычно больше горе и всевозможных неприятностей.<br />\r\nПочему же так происходит? Почему знакомство в Интернете бывает таким сложным и непонятным?</p>\r\n\r\n<p><br />\r\nОтветить однозначно на эти вопросы просто невозможно, но можно объяснить все это несколькими фактами. Например, тем, что не все знакомящиеся в интернете рассказывают всю правду о себе и вообще бывают честны.</p>\r\n\r\n<p><br />\r\nИменно во всемирной паутине поселились те. Кто ищет свою будущую жертву. Это могут быть и педофилы, и воры, и убийцы, и даже мошенники.</p>\r\n\r\n<p><br />\r\nСкучающие домохозяйки, молодые мамы, находящиеся в декретном отпуске, тоже неплохо проводят время в Интернете. Они знакомятся и развлекаются там с мужчинами в то время, пока их мужья зарабатывают деньги. И такое надувательство мужчин или кокетство также является преградой для тех, кто просто пытается познакомиться. Поэтому всегда будьте осторожны и не доверяйте первому встречному.</p>\r\n'),(141,'<hr />\r\n<p style=\"text-align: center;\"><strong>Ты об этом не думала? Я вот задумалась&hellip; Любовь &ndash; это сказка для детей? Или для маленьких взрослых девочек? Для тех, кто еще не вырос&hellip;</strong></p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n\r\n<p>А вырастаешь ты очень быстро, и уже научился ставить все доказанные теоремы мира под сомненье! И даже можешь опровергнуть, что земля круглая&hellip;так каково же черта мы так упорно верим в эту сказку под названием &laquo;Любовь&raquo;? Пора вырасти. Её нет! Как нет и принца на белом коне, и даже злой колдуньи нет. Ты это можешь понять? Разуй глаза!<br />\r\nЭто не любовь, это все иллюзия&hellip; фокус-покус для дурочек! Мне иногда кажется, что мы мазахистки. Как же &ndash; это состояния счастья, чувство окрыленности, когда ты &quot;пищищ &quot;от удовольствия в его объятьях, как ты бежишь навстречу, как засыпаешь и просыпаешься с мыслью о нем, как отдаешь всю себя, как забываешь все то, что было для тебя дорого до встречи с ним! С твоим принцем! А этот принц уже не смотрит на тебя с обожанием, больше не звонит тебе по несколько раз в день, и даже не пишет СМС! Эти самые обычные СМС! И ты терзаешься, мучаешься, винишь себя, потом его, а потом опять себя&hellip;И это замкнутый круг. Ты с ним даже говоришь: &laquo;Скажи, милый, что не так? Я же чувствую, тебя что-то беспокоит!&raquo; Классная! Ты очень внимательная! Можешь себя поздравить! Да все не так, ему скучно, ему все надоело! И вроде ты хорошая, но ему больше неинтересно!<br />\r\nТак, скажи &mdash; это любовь? То к чему мы всегда так стремимся? Запомни милая &ndash; если ты себе не дашь крылья, их тебе никто не даст! Твое счастье не зависит от какого-то там &laquo;принца&raquo;. Мы куем счастье своими руками, и если ты не будешь счастлива сама с собой, то счастливой тебя никто не сделает! Ни кто и ни когда! Забудь! Получай удовольствие, играй, заманивай, дразни, бери все и не отдавай ничего! В конце концов если не ты, то тебя!<br />\r\nМожет, это будет для него больно, но какая разница? Главное - не тебе! Ты же помнишь это чувство, когда сердце вырывается из груди, когда всю ночь воешь в подушку, а с утра протираешь лицо льдом, чтобы спала припухлость, как бродишь по улицам в надежде встретить его случайно, как мерзнешь и куришь, куришь и мерзнешь, как улыбаешься знакомым и говоришь, что все в порядке! Все отлично в твоей гребаной жизни. А потом &mdash; ночь и тоска. И тебе так холодно, и хочется, чтобы тебя согрела его нежная и сильная рука.<br />\r\nТы мне только ответь на один вопрос &mdash; зачем? Зачем тебе все это? Ты глупая? Мазохистка? Идиотка? Или слепая? Почему мы не видим очевидных вещей? Ее нет! Любви нет! Забудь! И просто живи для себя! Люби себя! Ведь ни кто и никогда не полюбит тебя больше чем ты сама! Цени себя! Холь и лелей! Ты одна &ndash; уникальная, сексуальная и свободная! И ни от кого не зависишь!</p>\r\n'),(142,'<p><strong>Каждый человек мечтает найти свою вторую половинку, но увы не каждому это удается... Мечты об идеальном спутнике жизни, романтических прогулках при луне и кротких поцелуях заставляют нас прибегать к помощи интернета.</strong></p>\r\n\r\n<p>В различных социальных сетях мы можем найти идеальную по внешности или предпочтениям половинку. Почему идеальную по внешности? Хм... Не стоит скрывать, что практически в 80% случаях знакомств в соц. сетях служит привлекательная внешность оппонента. Конечно, это может быть и так называемый &quot;фейк&quot;, а может и вполне реальный человек. Просматривая множество страниц в соц. сетях мы натыкаемся на самых разных людей и возможно некоторые привлекают наше внимание. Существует множество примеров знакомства в интернете, которые не редко заканчиваются свадебным маршем Мендельсона, но к сожалению есть и случаи горького расставания.</p>\r\n\r\n<p><br />\r\nНечего плохого в таких знакомствах нет! Это совершенно нормально! Ведь как говорится &quot; В любви как на войне - все средства хороши!&quot;. Но все есть и отрицательные стороны интернет знакомств. Мошенники! И не только! Насильники, маньяки, педофилы - и это далеко не весь список опасностей подобных знакомств. Конечно, все это кому-то может показаться большим преувеличение, но отнюдь нет, как бы мне хотелось чтобы это было лишь большой выдумкой. Обычно такие люди затевают знакомства очень даже радушно и мило, а потом начинают настаивать о встрече, где и происходит преступление. Чтобы обезопасить себя от такого рода посягательств следует соблюдать несколько не сложных предостережений:</p>\r\n\r\n<p>Во-первых, если вы познакомились с кем-то в интернете не стоит после недели общения сразу соглашаться на встречу. Лучше немного подождите и продолжите общения. Ведь кто умеет ждать, тот много добивается!</p>\r\n\r\n<p>Во-вторых, если все-таки оппонент удовлетворяет ваши требования и вроде ни каких особых угроз по вашему мнению он не представляет, вы согласились на встречу, то лучше пойти туда не одному, а с близким другом или на худой конец со старшим братом или сестрой. Чтобы не произошло недопонимание, просто попросите вашего потенциального партнера тоже пригласить близкого друга. Уверена не желающий вам нечего плохого человек с радостью согласится!</p>\r\n\r\n<p>Не переживайте о том, что вдруг вам не удастся по быть наедине, ведь в любой момент вы просто сможете покинуть своих друзей и пойти в какое-нибудь другое кафе или ресторан. Кто знает, может эта встреча соединит сразу несколько пар сердец!..</p>\r\n\r\n<p><br />\r\nЯ считаю, что поиски любимого или любимой должна быть случайными и спонтанными, устраивая смотрины в соц. сетях мы часто не задумываемся о состоянии души человека. Может нам совершенно не понравиться его дальнейшее поведение, но не стоит исключать и удовлетворительного исхода общения...</p>\r\n\r\n<p>Так что, дорогие читатели ищите свои вторые половинки!</p>\r\n'),(143,'<p><strong>&laquo;На вкус и цвет все фломастеры разные&raquo;, - скажете вы. А я отвечу: &laquo;Несомненно, но всё-таки существуют такие черты, которые каждый мужчина хотел бы видеть в своей спутнице&raquo;. Было проведено несчётное множество различных опросов, на основе которых психологи и вывели &laquo;формулу идеальной девушки&raquo;. Давайте разбираться..</strong></p>\r\n\r\n<p><br />\r\nУвидев первый пункт, девушки недовольно вздохнут, но такова мужская психология. Итак, мужчины поставили на первое место внешние данные женщины. Да-да, &laquo;Внешность &ndash; не главное&raquo;, - говорили они, - &laquo;Смотри, какая страшная баба идёт&raquo;, - говорили они. Но представители мужского пола отметили именно ухоженность девушки, а не природную красоту. То есть мужчине будет важно то, что ты следишь за собой, а не то, что у тебя от природы нет ног от ушей и груди третьего размера.<br />\r\nНа втором месте легендарный женский ум.</p>\r\n\r\n<p>Мужчины хотят видеть рядом интеллектуально развитую девушку и в то же время не хотят, чтобы женщина слишком много &laquo;умничала&raquo;. Следовательно, парням важна наша способность думать, но они хотят, чтобы мы это тщательно скрывали.</p>\r\n\r\n<p><br />\r\nТретье место в топе заняла верность. Именно так, мужчине важно, чтобы его любимая принадлежала только ему. Да, собственно, и сами женщины это хотят видеть и в мужчинах, не так ли?</p>\r\n\r\n<p><br />\r\nНа четвёртом месте сексуальность. Это вовсе не значит, что мужчина хочет видеть вас круглосуточно в нижнем белье, вовсе нет. Он должен чувствовать к вам желание. Ему должно вас хотеться, а это возможно и тогда, когда вы в одетом виде.<br />\r\nИ последнее место заняла хозяйственность.</p>\r\n\r\n<p>Да, мужчине хочется, чтобы вы порадовали его вкусным борщом и постирали его рубашку, но согласно статистике, мужчине важнее, что вы &ndash; <strong>верная, любящая и настоящая девушка</strong>, ведь какое счастье со &laquo;стервозной бабой&raquo;, даже несмотря на её широкие познания в кулинарии?</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p><br />\r\n<em>Таким образом, дорогие дамы, будьте собой. Будьте той, кем вы являетесь на самом деле, и ваша любовь вас найдёт!</em></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n'),(144,'<p><strong>Тело человека может очень многое о нем рассказать, даже больше чем ему (человеку) хотелось бы. По определенному положению тела можно увидеть например, чего мы боимся или о чем думаем.</strong></p>\r\n\r\n<p>Сейчас очень много фирм при приеме человека на работу, имеют в своем штате сотрудников умеющих понимать язык тела. Они очень точно распознают, что значит та или иная поза человека, пришедшего устраиваться к ним на фирму.<br />\r\nДовольно часто мы ощущаем в себе какую-то скованность и неудобство в самых важных для нас ситуациях. И тут возникает вопрос, а возможно ли как-то поменять состояние неловкости и показать собеседнику, что вы уверенны в себе. Достаточно разучить ряд жестов и немного изменить манеру поведения, и вы сможете расположить к себе любого человека, а также убедить его в том, что вы уверенны в себе. Так как же нужно вести себя, чтобы всем было приятно видеть вас?<br />\r\nБудьте улыбчивы.</p>\r\n\r\n<p><br />\r\nЕсли все видят что вы улыбаетесь, то значит вы все довольны и счастливы, ну и конечно уверены в себе. Улыбка значит, что вы ничего не боитесь чувствуете себя уверенно. Тогда у всех окружающих вы будете вызывать только симпатию.<br />\r\nХодите с расправленными плечами.<br />\r\nХодите прямо и не тащите ноги. Нужно расправить плечи и держать спину ровно, чтобы все люди видели, что от вас исходит сила, а сильный человек всегда производит приятное впечатление на окружающих. Не семените, шагайте шире и не оглядывайтесь по сторонам.</p>\r\n\r\n<p><br />\r\nНе прячьте глаза.<br />\r\nЕсли вы уверены в себе, то вам нечего скрывать от окружающих. Уверенный в себе человек не опускает глаза при разговоре, а спокойно смотрит собеседнику в глаза, не отводя взгляд. При разговоре это очень важно, когда вы смотрите собеседнику в глаза, то он видит, что вы ничего от него не скрываете и честны с ним. Не держите руки в карманах и не прячьте за спиной. Это может создать впечатление, что вы что-то скрываете. Держите руки в спокойном положении. Сидя, можно положить их на стол или на колени.</p>\r\n\r\n<p><br />\r\nБудьте всегда опрятны.<br />\r\nВнешний вид играет очень важную роль. Неряшливый, с дурным запахом и с непричесанными волосами человек, приятное впечатление на окружающих точно не произведет. И в себе уверен он от этого тоже не будет. Надо быть опрятным и хорошо выглядеть всегда, а не только перед каким-то мероприятием или встречей.<br />\r\nВсегда будьте спокойны.</p>\r\n\r\n<p><br />\r\nБольшинство людей во время серьезного разговора, начинают активно жестикулировать. Такое поведение, как правило, снимает чувство страха и обеспокоенность. Но вашему собеседнику все эти жестикуляции будут неприятны. Также это показывает вашу нервозность. И люди вокруг вас тоже становятся нервными. Все таки лучше взять себя в руки и успокоиться.<br />\r\nНе нужно скрещивать руки.</p>\r\n\r\n<p><br />\r\nТакой жест как скрещенные руки, истолковывается как защитный жест. Своим видом вы показываете окружающим, что разговор вам неприятен и общаться вы не хотите. Этим вы вызовете антипатию у знакомых или коллег по работе. Скрещенные руки &ndash; самая неудачная поза во время разговора.</p>\r\n\r\n<p><br />\r\nДержите руки спокойно.<br />\r\nВо время разговора большинство людей начинает сжимать руки в кулак, скрещивать пальцы, приглаживать волосы, крутить в руках какую-нибудь вещь. Такая жестикуляция показывает, что вы неуверенны в себе. Нужно успокоиться и не делать лишних телодвижений. Всем понравиться вы не сможете, но в некоторых случаях благоприятное впечатление на окружающих вы произведете. Независимо от того где вы находитесь &ndash; на деловой встрече или на свидании, позитивный настрой и уверенность в себе обязательно помогут вам решить исход дела (разговора) положительно.</p>\r\n'),(145,'<section id=\"content\">\r\n<section>\r\n<div id=\"inner-content\">Заканчивая школу, многие ребята задумываются о том, какую же форму обучения предпочесть: дневную или заочную. Несомненно, чтобы они не выбрали для себя, цель у них одна &ndash; получить диплом, но процессы и принципы обучения у этих форм существенно отличаются. Рассмотрим плюсы и минусы каждой из этих форм обучения.<br />\r\nЗаочную форму обучения многие выбирают, исходя из следующих положительных моментов:<br />\r\n- в первую очередь, это конечно, возможность совмещать работу и учебу, ведь посещать занятия нужно лишь раз в полгода;<br />\r\n- стоимость обучения заочно, зачастую значительно ниже, а это хорошая экономия средств;<br />\r\n- студент-заочник, как правило, самостоятельно изучает нужные для учебы источники, а значит, он может это делать в удобное для него время;<br />\r\n-преподаватели также довольно благосклонны к заочникам, прекрасно понимая их занятость.<br />\r\nНо при всех достоинствах заочной формы у нее есть и существенные минусы: это достаточно невысокое качество образования, так как программы заочного обучения преподаются в сокращенной форме. Студенты мало общаются с преподавателями вне занятий, не участвуют в студенческих научных проектах, экспедициях. Практика по специальности часто носит формальный характер. Да и качественно изучить гору специальной учебной литературы самостоятельно, у работающего студента не всегда получается. Работа после школы, когда нет специальности, редко бывает высокооплачиваемой.<br />\r\nТеперь перейдем к дневной форме обучения и обозначим явные плюсы:<br />\r\n- конечно же, главным плюсом будет получение полноценных теоретических знаний, а учебные программы по спецпредметам носят углубленный характер;<br />\r\n- участие в семинарах, практических работах, экспедициях, молодежных слетах, студенческих олимпиадах дает большой опыт общественной работы и отлично закрепляет полученные знания;<br />\r\n-получение образование очно, считается более престижным, и работодатели предпочитают брать на работу выпускников, которые учились на дневной форме;<br />\r\n- полноценная студенческая жизнь, в полной мере, ощущается при дневном обучении, воспоминания об этих веселых годах остаются на всю жизнь.<br />\r\nК недостаткам этой формы обучения относят, в первую очередь, довольно высокую плату, проходной балл также значительно выше, прохождение практик и стажировок не дают большого опыта, так как времени на них учебный план отводит немного.<br />\r\nНесомненно, одно &ndash; для получения действительно качественного образования, нужно иметь большое желание учиться. А что выбрать, каждый студент решает сам, в зависимости от своих финансовых возможностей, семейного положения и личных предпочтений.<br />\r\n&nbsp;</div>\r\n</section>\r\n</section>\r\n\r\n<section class=\"clearbar\">&nbsp;</section>\r\n\r\n<p>&nbsp;</p>\r\n'),(146,'<section id=\"content\">\r\n<section>\r\n<div id=\"inner-content\"><strong>Заканчивая школу, многие ребята задумываются о том, какую же форму обучения предпочесть: дневную или заочную. Несомненно, чтобы они не выбрали для себя, цель у них одна &ndash; получить диплом, но процессы и принципы обучения у этих форм существенно отличаются. </strong></div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div>Рассмотрим плюсы и минусы каждой из этих форм обучения.<br />\r\nЗаочную форму обучения многие выбирают, исходя из следующих положительных моментов:<br />\r\n- в первую очередь, это конечно, возможность совмещать работу и учебу, ведь посещать занятия нужно лишь раз в полгода;<br />\r\n- стоимость обучения заочно, зачастую значительно ниже, а это хорошая экономия средств;<br />\r\n- студент-заочник, как правило, самостоятельно изучает нужные для учебы источники, а значит, он может это делать в удобное для него время;<br />\r\n-преподаватели также довольно благосклонны к заочникам, прекрасно понимая их занятость.<br />\r\nНо при всех достоинствах заочной формы у нее есть и существенные минусы: это достаточно невысокое качество образования, так как программы заочного обучения преподаются в сокращенной форме. Студенты мало общаются с преподавателями вне занятий, не участвуют в студенческих научных проектах, экспедициях. Практика по специальности часто носит формальный характер. Да и качественно изучить гору специальной учебной литературы самостоятельно, у работающего студента не всегда получается. Работа после школы, когда нет специальности, редко бывает высокооплачиваемой.<br />\r\nТеперь перейдем к дневной форме обучения и обозначим явные плюсы:<br />\r\n- конечно же, главным плюсом будет получение полноценных теоретических знаний, а учебные программы по спецпредметам носят углубленный характер;<br />\r\n- участие в семинарах, практических работах, экспедициях, молодежных слетах, студенческих олимпиадах дает большой опыт общественной работы и отлично закрепляет полученные знания;<br />\r\n-получение образование очно, считается более престижным, и работодатели предпочитают брать на работу выпускников, которые учились на дневной форме;<br />\r\n- полноценная студенческая жизнь, в полной мере, ощущается при дневном обучении, воспоминания об этих веселых годах остаются на всю жизнь.<br />\r\nК недостаткам этой формы обучения относят, в первую очередь, довольно высокую плату, проходной балл также значительно выше, прохождение практик и стажировок не дают большого опыта, так как времени на них учебный план отводит немного.<br />\r\nНесомненно, одно &ndash; для получения действительно качественного образования, нужно иметь большое желание учиться. А что выбрать, каждый студент решает сам, в зависимости от своих финансовых возможностей, семейного положения и личных предпочтений.<br />\r\n&nbsp;</div>\r\n</section>\r\n</section>\r\n\r\n<section class=\"clearbar\">&nbsp;</section>\r\n\r\n<p>&nbsp;</p>\r\n'),(147,'<p><strong>Знание английского сегодня это отличное конкурентное преимущество. Умея говорить на английском проще найти работу, можно быстрее получать новые знания, создать успешный бизнес на примере иностранных аналогов. Так что если ты думаешь над тем, как быстро выучить английский язык с нуля, вот тебе 10 способов для этого.</strong></p>\r\n\r\n<p><br />\r\n<strong>1.</strong> Нанять профессионала<br />\r\nПожалуй, это лучший способ. Поэтому здесь могу порекомендовать онлайн школу английского Skyeng.ru. Онлайн формат позволит тебе самому выбирать где и когда учиться. Тебе подберут преподавателя под твои интересы и характер, а цифровой учебник облегчит обучение, сохранит все, что учишь в одном месте и покажет прогресс. Запишись на бесплатный урок на Skyeng.tu.<br />\r\n<strong>2.</strong> Полное погружение дома<br />\r\nОбклей каждый предмет в доме словом на английском языке. Подключи зарубежные каналы по ТВ. Установи на всех устройствах иностранный язык. Купи книги на английском. Слушай аудио на английском в плеере и машине. Это хороший способ выучить английский для начинающих.<br />\r\n<strong>3.</strong> Полное погружение за рубежом<br />\r\nПереезд в другую страну значительно ускоряет изучение языка. Ты везде слышишь иностранную речь. Все что тебя окружает на другом языке. Тебе самому приходится общаться на иностранном языке, чтобы тебя поняли. В таких условиях можно заговорить на английском уже через месяц.<br />\r\n<strong>4.</strong> Перейти на общение дома только на английском<br />\r\nНайди единомышленника среди родственников. И начните говорить только на английском. Не можешь сказать ищи словарь и переводи. С помощью приложений для смартфона это быстро делается.<br />\r\n<strong>5.</strong> Просмотр любимых фильмов в оригинале с русскими субтитрами<br />\r\nОбучение проходит быстрее и эффективнее когда тебе нравится то, что ты делаешь. Любимые фильмы создадут атмосферу интереса. Так что изучение английского будет проходить легче.<br />\r\n<strong>6.</strong> Найти иностранца желающего выучить русский<br />\r\nТы будешь учить его, он тебя. Вы можете общаться по скайп у. Познакомившись, можете начать ездить друг другу в гости еще больше погружаясь в нужную языковую среду.<br />\r\n<strong>7.</strong> Через музыку<br />\r\nЕсли ты меломан, найди тексты песен и их перевод. Пой, повторяй любимые песни и очень скоро наберешь необходимый словарный запас. Так же это хороший способ научиться понимать английскую речь на слух.<br />\r\n<strong>8.</strong> Купи интерактивные обучающие программы<br />\r\nИ занимайся каждый день минимум 1 час. Секрет успеха в изучении английского это постоянство. Занимайся каждый день и через 3 месяца уже сможешь общаться на английском.<br />\r\n<strong>9.</strong> Используй свое подсознание<br />\r\nНаше подсознание лучше запоминает если ты все прописываешь от руки. Также оно лучше запомнит если ты повторишь изученное за день перед сном. Также лучше запоминается информация, связанная с эмоциями. Поэтому ищи интересные для себя способы изучения английского. Как пример, я уже говорил про любимые фильмы и музыку.<br />\r\n<strong>10.</strong> Найди свое вдохновение<br />\r\nДостижение любой цели ускоряется в десятки раз, когда ты находишь мотивирующий тебя ответ Зачем тебе это нужно Представь, что ты знаешь английский. Какую работу ты сможешь найти и на сколько больше начнешь зарабатывать С кем сможешь познакомиться Что это тебе даст Подумай на этим. Особенно если тебе не хватает желания изучать английский. Вдохновение позволит тебе избавиться от лени, и нежелания зубрить английский.</p>\r\n'),(148,'<p><strong>Для работы, учебы и для общего развития человека ему необходимо иметь хорошую память. Не будем углубляться в теорию, что собой представляет человеческий мозг и память в частности, а лучше рассмотрим один из способов улучшения и расширения памяти.</strong></p>\r\n\r\n<p><br />\r\nМаксимализируйте силу своего мозга с помощью визуализации.<br />\r\nИменно визуализация является мощным инструментом для увеличения памяти. Она способствует развитию креативности и созданию комплексных идей.<br />\r\nСамый простой способ научится визуализация - это рисовать. Когда человек воспринимает информацию на слух, то он усваивает ее на 30% меньше, чем когда он видит это же. Нужно стараться рисовать то что слышишь.<br />\r\nЗадействуйте больший спектр своего мозга.<br />\r\nКогда человек мысленно воспроизводит информацию, его мозг задействует другую часть мозга, которая отвечает за креативность, что способствует лучшему усвоению полученных данных.<br />\r\nУправляйте информацией и расставляйте приоритеты.<br />\r\nПоскольку человек не может запомнить абсолютно весь поток информации, который он получает, очень важно уметь быстро анализировать и расставлять приоритеты. Нужно концентрировать свое внимание на том, что мы считаем важным, и визуализировать.<br />\r\nВизуальное восприятие информации намного сильнее. Не стесняйтесь рисовать и выделяйте для себя только саое важное.</p>\r\n'),(149,'<p><strong>Основные факторы выбора профессии:</strong></p>\r\n\r\n<p><br />\r\n-Профессиональная заинтересованность (зависит от увлечений и склонностей к определенным видам деятельности);</p>\r\n\r\n<p><br />\r\n- Умения (чаще всего бывает сложно определить свое истинное призвание для успешности в карьере);</p>\r\n\r\n<p><br />\r\n- Активность (высокая или низкая), степень подготовленности (успеваемость в школе);<br />\r\n- Осведомление о видах профессий;</p>\r\n\r\n<p><br />\r\n-Социальная и семейная среда и многое другое.</p>\r\n\r\n<hr />\r\n<p><br />\r\nОтсюда следует, что для удачной гармонизации всех трудных и разноречивых личностных взаимодействий в обществе и коллективе, в сочетании с группой экстроспективных политических, экономических и культурных обстоятельств, уместна и психологическая атмосфера, которые не реальны без развитых умений, навыков и работоспособности у любой переходящей на серьезный жизненный этап личности. Кризис таких данных резко проявляется в нынешний век, когда увеличиваются потребности в свободных коммуникациях с людьми различного статуса.<br />\r\n&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n'),(150,'<p><strong>В повседневной жизни мы так привыкли к стандарту разнообразий наших мыслей, если мы хотим что то изменить в своей работе, жизни или элементарно что то придумать, мы сразу же бросаем это дело. Потому что придумать что то уникальное очень тяжело. Порой можно сидеть часами придумывая новые идеи или хотя бы возможности изменить что то в своей повседневной жизни.</strong></p>\r\n\r\n<p><br />\r\nНо все таки есть уж люди у которых все получается. Они как обычно придумывают разные идеи одни да другими. Можно подумать что у них дар, но не стоит торопится выводами. На самом деле есть несколько методов с помощью которых можно придумать самые различные, и уникальные идеи в любой сфере.<br />\r\nНачнем мы с простого с метода сложения. Это очень простой метод. Надо только сложить две вещи и смотреть что получится. Например: возьмем зебру и карандаш у нас получится полосатый карандаш.</p>\r\n\r\n<p><br />\r\nВыйдите на пробежку, когда тело человека находится в движении. То легче придумать что то новое.</p>\r\n\r\n<p><br />\r\nНайдите свою среду обитания то есть кто то лучше думает в холоде а кто то на оборот. А вы попробуйте все.</p>\r\n\r\n<p><br />\r\nИ по чаще смотрите в окно, за окном чаще всего найдется новое.<br />\r\nНу вот и все желаю удачи! Успехов вам!</p>\r\n'),(151,'<p><strong>В современном мире, чтобы успешно существовать среди окружающих, выделяться из серой массы и уметь заинтересовать любого понравившегося человека, нужно быть умным. За ум отвечает мозг, поэтому его-то и нужно развивать, совершенствовать и заставлять работать на полную катушку.</strong></p>\r\n\r\n<p style=\"text-align: center;\"><br />\r\nИтак, практические советы, или как улучшить работу мозга:</p>\r\n\r\n<p>1. Больше книг, меньше телевизора.<br />\r\nПервое и самое основное правило: больше читайте. Книги развивают человека, вдохновляют, мотивируют и помогают стать умным. Именно книги, а не развлекательные передачи или комедийные фильмы. Однако книги должны быть полезными. Любовные романы, например, в эту категорию не вписываются. Зато энциклопедии, психология и философия помогут вам обрести свою точку зрения, научиться понимать людей и стать умней. Если совсем отказаться от телевизора кажется невозможным, старайтесь: во-первых, постепенно ограничивать время просмотра, с каждым разом уделять ящику всё меньше времени, во-вторых, смотреть лишь полезные и развивающие передачи.<br />\r\n2. Логически задачи.<br />\r\nЗнания &ndash; это хорошо. Книги, люди, познавательные передачи и прочее помогут вам узнать много нового, но радоваться рано. Чтобы мозг работал, его нужно нагружать не только новой информацией, но и устраивать ему тренировки. Нестандартные или логические задачки, кроссворды или сканворды, шарады или ребусы, головоломки, а также многие другие вещи позволят тренировать свой мозг. Кроссворды, например, помогут закрепить те знания, что вы получили из книг, ведь от теории без практики мало толку.<br />\r\n3. Оригинальность.<br />\r\nРазвивайте свою оригинальность ежедневно, избегайте шаблонности и штампов. Во-первых, это значительно поможет мозгу и его работе, во-вторых, это всегда пригодится вам в жизни. Научитесь делать привычные вещи непривычными способами: например, если вы правша, попробуйте во время еды держать ложку или вилку в левой руке. Для вас это будет необычно и непривычно, но благодаря подобным мелким упражнениям, вы сами заметите, что стали меньше использовать шаблонные слова и творить шаблонные действия.<br />\r\n4. Память.<br />\r\nЧтобы ваш мозг работал, вы обязаны развить свою память. То же чтение из 1-ого пункта вам неплохо поможет. Помимо чтения книг, учите стихотворения, используйте интересные методики для запоминания цифр, имён и лиц и развивайтесь. Настоятельно не рекомендуется пользоваться таблетками, препаратами и другими искусственными &laquo;помощниками&raquo;; они не только не помогут положительно повлиять на работу мозга, но могут и навредить.<br />\r\nВсего эти 4 совета помогут вам значительно повысить свой интеллект с помощью саморазвития. Ваш мозг будет трудиться, развиваться и совершенствоваться, а вы будете пожинать прекрасные плоды его качественной работы.<br />\r\n&nbsp;</p>\r\n'),(156,'<p>&nbsp;</p>\r\n\r\n<p>Гиперактивность, в основном, наблюдается у детей и подростков из-за эмоционального и неуравновешенного состояния. Им не всегда удается справиться с таким состоянием самостоятельно. Связывают это явление с перенапряжением и нервной возбудимостью организма.</p>\r\n\r\n<p>Гиперактивность &ndash; это повышенное эмоциональное состояние, которое вызвано нервно-психическим расстройством. Оно выходит за пределы полагающейся нормы.</p>\r\n\r\n<p><strong>Причины возникновения у детей говорят сами за себя, а именно:</strong></p>\r\n\r\n<ol>\r\n	<li>Недостаток внимания со стороны родителей.</li>\r\n	<li>Активность, превышающая норму.</li>\r\n	<li>Чрезмерная эмоциональность.</li>\r\n	<li>Импульсивность.</li>\r\n</ol>\r\n\r\n<blockquote>\r\n<p>Как бороться родителям с таким непоседливым малышом?</p>\r\n</blockquote>\r\n\r\n<p>Ребенок уже на первых месяцах жизни, может проявлять гиперактивность:</p>\r\n\r\n<ol>\r\n	<li>Плохо спать.</li>\r\n	<li>Много плакать.</li>\r\n	<li>Реагировать на любой звук, шум.</li>\r\n</ol>\r\n\r\n<p>Детки, которые постарше:</p>\r\n\r\n<ol>\r\n	<li>Неусидчивы.</li>\r\n	<li>Не сидят на одном месте.</li>\r\n	<li>Агрессивны.</li>\r\n	<li>Возбудимы.</li>\r\n	<li>Невнимательны.</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n\r\n<p class=\"content-editor-image-center\"><concrete-picture fID=\"11\" alt=\"fbbae169ac798b03.jpg\" height=\"408\" width=\"528\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Сложности могут возникнуть уже тогда, когда вы поведете ребенка впервые в детский сад, ведь ему приходится вливаться в незнакомую обстановку. Для него, конечно же, это стресс.В школьный период гиперактивным детям приходится нелегко. Он может плохо усваивать информацию, вступать в конфликтные ситуации со сверстниками и учителями.</p>\r\n\r\n<p>Большие ошибки совершают родители, испытывая трудности с гиперактивным ребенком. Мера наказания должна быть не такой строгой и дисциплинированной. Детям с повышенной активностью и непоседливостью очень трудно соблюдать правила и рамки, которые устанавливают ему родители. Здесь поможет только терпеливый и мудрый подход в сложившейся ситуации, а лучше всего поход к специалисту, который поможет разобраться, в чем причина такого поведения у ребенка.</p>\r\n\r\n<p>Дети с ярко выраженной гиперактивностью чаще наблюдаются у невролога и психолога, для того чтобы избежать последствий. Гиперактивный ребенок подвержен в два раза больше различным травмам. Поэтому необходимо заранее позаботиться о его безопасности. Пик активности у детей начинается в два, три года, далее в восемь, десять лет.</p>\r\n\r\n<p>По статистике, гиперактивность чаще всего выявляют у мальчиков. Причина тому, что они рождаются крупней, чем девочки, и мозг развивается у них гораздо позже.<br />\r\nДля того чтобы облегчить состояние ребенка, лучше всего давать лекарства, которые помогут успокоить детскую нервную систему и сосредоточиться на информации, исходящей от взрослых людей.</p>\r\n\r\n<p>Своевременная помощь малышу поможет сделать жизнь его спокойней. И это порадует самих родителей. Правильный подход и терпение, в сложившейся ситуации, помогут справиться с гиперактивностью малыша. Важно дать ему понять, что его все равно любят, несмотря ни на что.&nbsp;</p>\r\n'),(157,'<blockquote>\r\n<p><strong>Конечно же все родители хотят, чтобы их дети были здоровыми, умными и развитыми для своих лет.</strong></p>\r\n</blockquote>\r\n\r\n<p><strong>&nbsp;</strong>Часто это желание распространяется ещё дальше &ndash; и тогда мамы и папы всерьез начинают задумываться об опережающем развитии своего ребенка.</p>\r\n\r\n<p>Благо сегодня существует огромное количество авторских методик раннего развития детей (<span style=\"display: none;\">&nbsp;</span><u>Г. Домана, Н. Зайцева, С. Лупан</u><span style=\"display: none;\">&nbsp;</span>, система Никитиных и других), предлагающих игровое обучение чтению и счету, а также знакомство с цифрами чуть ли не годовалых детей.</p>\r\n\r\n<p class=\"content-editor-image-center\"><img alt=\"гиперактивный ребенок.jpg\" height=\"261\" src=\"/download_file/view_inline/8\" width=\"420\" /></p>\r\n\r\n<p>Безусловно, каждая из этих методик интересна и имеет положительные стороны: большинство детей действительно овладевают навыками чтения, счета и письма в возрасте 1-3 лет. Но так ли это нужно вашему ребенку? Ведь всему этому он сможет научиться в подготовительной к школе группе и школе, а драгоценное время безмятежного детства подменяется пусть и игровым, но всё же обучением.</p>\r\n\r\n<p>В то же время общение со сверстниками, становление которого происходит как раз в период 1-3 лет, и социализация ребенка отходят на второй план, а при поступлении в школу это выльется в весьма серьезные проблемы: ребенок может стать &laquo;изгоем&raquo; среди одноклассников, да и обучение в первом классе потеряет для него всю свою привлекательность из-за того, что он всему уже научился ранее.</p>\r\n\r\n<p style=\"text-align: center;\"><strong>фото скучающего школьника</strong></p>\r\n\r\n<p><strong>Так что, родители, выбор за вами &ndash; выбирать раннее обучение для своего ребенка или нет, но помните, что это очень серьезный и ответственный шаг, который может оказать влияние на дальнейшую жизнь вашего ребенка.</strong></p>\r\n'),(158,'<p style=\"text-align: center;\"><strong>Всем, кто занимается воспитанием детей, приходится прибегать довольно часто к запретам. Известно, что подрастающее поколение реагирует на запреты по-разному: если один ребенок молча прекратит запрещенное мероприятие, то другой закатит настоящую истерику.</strong></p>\r\n\r\n<p><br />\r\nА если воспитанник подросток, то тут и вовсе жди серьезного протеста &ndash; либо скрытого (который постепенно вырвется наружу в самый неожиданный момент) или же явного и последствия его не будут такими безобидными, как у младших детей.<br />\r\nНу и что же делать &ndash; запрещать-то все равно приходится. Тут, как говорится, подход будет индивидуальным. В каждой семье приняты свои нормы поведения, методы воспитания могут быть отличными у каждого родителя.<br />\r\n<strong>1.</strong>Но есть общепринятые нормы поведения в обществе, уголовный кодекс, наконец, и вот здесь как раз все понятно &ndash; нельзя, значит нельзя.<strong> Главное доступно и понятно объяснить ребенку почему нельзя и какие последствия может повлечь за собой нарушение запрета.</strong><br />\r\n<strong>2.</strong>А вот во всем, что касается личного пространства семьи и ребенка, немного все по-другому. Некоторые родители придерживаются принципа: &laquo;запрещено все, что не разрешено&raquo;. Дети от них только и слышат: то нельзя и это нельзя.</p>\r\n\r\n<hr />\r\n<p style=\"text-align: center;\"><br />\r\n<strong>&laquo;Можно мне погулять?&raquo; - &laquo;Нет!&raquo;. &laquo;Могу я взять конфету?&raquo; - &laquo;Нельзя!&raquo;. &laquo;Можно пригласить Мишу в гости?&raquo; - &laquo;Нет!&raquo; И так на все вопросы, без объяснения причин. Что же в итоге?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong> &nbsp; &nbsp; &nbsp;фото конфликта ребенка и родителей</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><strong>Пока маленький, ребенок будет подчиняться родителям, а куда деваться-то? </strong></p>\r\n\r\n<p>Но по мере взросления постоянные запреты уже будут вызывать протест.<br />\r\nДети начинают нарушать их, сначала скрывая это от родителей, а потом, в подростковом периоде, уже в открытую, демонстративно: &laquo;Я уже вырос, могу делать что захочу! Ваше мнение мне безразлично!&raquo; И вот начинается конфликт поколений, который может иметь весьма печальные последствия.<br />\r\nТак что же делать, ведь нельзя же в самом деле все позволять? Конечно, нельзя. Но запреты должны быть как можно более редкими и иметь серьезные причины, такие, чтобы можно было объяснить ребенку.</p>\r\n\r\n<p style=\"text-align: center;\"><br />\r\n<strong>Объяснять нужно обязательно, потому что голый запрет воспринимается как ваш личный каприз и вызывает обиду</strong>.</p>\r\n\r\n<p><strong>1.</strong>&laquo;Мам, можно я залезу на дерево?&raquo; - &laquo;Попробуй, а я тебя подстрахую&raquo;. Так вы сможете проконтролировать ситуацию. А если вы сейчас запретите ему этот эксперимент, то ребенок все равно полезет на это дерево, но уже когда вас не будет рядом и тогда он может серьезно пострадать.Когда малыш попробует и поймет, что это сложно и опасно, вот тогда и объясните ему, почему не стоит одному, без взрослого повторять этот трюк.<br />\r\n<strong>2.</strong>Или такая ситуация. Ребенок спрашивает, можно ли ему пригласить на День рождения весь класс. Конечно, разместить в однокомнатной квартире двадцать отпрысков не просто, да и накормить их и развлечь влетит вам в копеечку, но если вы сразу скажете &laquo;нет&raquo;, ребенок почувствует себя обиженным и еще долго будет считать, что вы поступили несправедливо.Лучше ответить &laquo;да&raquo;, а потом вместе с ребенком попытаться разобраться, что из этого получится. Когда он сам дойдет до мысли, что ничего хорошего выйти не может, получится, что вы ничего не запрещали, ребенок сам решил пригласить не весь класс, а нескольких друзей. Конфликта удалось избежать.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; фото помощи родителя ребенку</strong></p>\r\n\r\n<blockquote>\r\n<p><br />\r\n<strong>Однозначный запрет нужно накладывать на поступки, которые могут угрожать жизни и здоровью ребенка или окружающих. Тут необходимо твердое &laquo;нет&raquo;, раз и навсегда. И ни при каких обстоятельствах нельзя менять свое решение, так как непоследовательность в поступках взрослого серьезно подрывает его авторитет.</strong></p>\r\n</blockquote>\r\n'),(159,'<p>Заканчивая школу, многие ребята задумываются о том, какую же форму обучения предпочесть: дневную или заочную форму. Несомненно, чтобы они не выбрали для себя, цель у них одна &ndash; получить диплом, но процессы и принципы обучения у этих форм существенно отличаются.<br />\r\n<br />\r\n<br />\r\nРассмотрим плюсы и минусы каждой из этих форм обучения.<br />\r\nЗаочную форму обучения многие выбирают, исходя из следующих положительных моментов:<br />\r\n- в первую очередь, это конечно, возможность совмещать работу и учебу, ведь посещать занятия нужно лишь раз в полгода;<br />\r\n- стоимость обучения заочно, зачастую значительно ниже, а это хорошая экономия средств;<br />\r\n- студент заочник, как правило, самостоятельно изучает нужные для учебы источники, а значит, он может это делать в удобное для него время;<br />\r\nпреподаватели также довольно благосклонны к заочникам, прекрасно понимая их занятость.<br />\r\nНо при всех достоинствах заочной формы у нее есть и существенные минусы: это достаточно невысокое качество образования, так как программы заочного обучения преподаются в сокращенной форме. Студенты мало общаются с преподавателями вне занятий, не участвуют в студенческих научных проектах, экспедициях. Практика по специальности часто носит формальный характер. Да и качественно изучить гору специальной учебной литературы самостоятельно, у работающего студента не всегда получается. Работа после школы, когда нет специальности, редко бывает высоко оплачиваемой.<br />\r\nТеперь перейдем к дневной форме обучения и обозначим явные плюсы:<br />\r\n- конечно же, главным плюсом будет получение полноценных теоретических знаний, а учебные программы по специальным предметам носят углубленный характер;<br />\r\n- участие в семинарах, практических работах, экспедициях, молодежных слетах, студенческих олимпиадах дает большой опыт общественной работы и отлично закрепляет полученные знания;<br />\r\n- получение образование очно, считается более престижным, и работодатели предпочитают брать на работу выпускников, которые учились на дневной форме;<br />\r\n- полноценная студенческая жизнь, в полной мере, ощущается при дневном обучении, воспоминания об этих веселых годах остаются на всю жизнь.<br />\r\nК недостаткам этой формы обучения относят, в первую очередь, довольно высокую плату, проходной балл также значительно выше, прохождение практик и стажировок не дают большого опыта, так как времени на них учебный план отводит немного.<br />\r\nНесомненно, одно &ndash; для получения действительно качественного образования, нужно иметь большое желание учиться. А что выбрать, каждый студент решает сам, в зависимости от своих финансовых возможностей, семейного положения и личных предпочтений.</p>\r\n'),(160,'<p><strong>Тело человека может очень многое о нем рассказать, даже больше чем ему (человеку) хотелось бы. По определенному положению тела можно увидеть например, чего мы боимся или о чем думаем.</strong></p>\r\n\r\n<p>Сейчас очень много фирм при приеме человека на работу, имеют в своем штате сотрудников умеющих понимать язык тела. Они очень точно распознают, что значит та или иная поза человека, пришедшего устраиваться к ним на фирму.<br />\r\nДовольно часто мы ощущаем в себе какую-то скованность и неудобство в самых важных для нас ситуациях. И тут возникает вопрос, а возможно ли как-то поменять состояние неловкости и показать собеседнику, что вы уверенны в себе. Достаточно разучить ряд жестов и немного изменить манеру поведения, и вы сможете расположить к себе любого человека, а также убедить его в том, что вы уверенны в себе. Так как же нужно вести себя, чтобы всем было приятно видеть вас?<br />\r\nБудьте улыбчивы.</p>\r\n\r\n<p><br />\r\nЕсли все видят что вы улыбаетесь, то значит вы все довольны и счастливы, ну и конечно уверены в себе. Улыбка значит, что вы ничего не боитесь чувствуете себя уверенно. Тогда у всех окружающих вы будете вызывать только симпатию.<br />\r\nХодите с расправленными плечами.<br />\r\nХодите прямо и не тащите ноги. Нужно расправить плечи и держать спину ровно, чтобы все люди видели, что от вас исходит сила, а сильный человек всегда производит приятное впечатление на окружающих. Не семените, шагайте шире и не оглядывайтесь по сторонам.</p>\r\n\r\n<p><br />\r\nНе прячьте глаза.<br />\r\nЕсли вы уверены в себе, то вам нечего скрывать от окружающих. Уверенный в себе человек не опускает глаза при разговоре, а спокойно смотрит собеседнику в глаза, не отводя взгляд. При разговоре это очень важно, когда вы смотрите собеседнику в глаза, то он видит, что вы ничего от него не скрываете и честны с ним. Не держите руки в карманах и не прячьте за спиной. Это может создать впечатление, что вы что-то скрываете. Держите руки в спокойном положении. Сидя, можно положить их на стол или на колени.</p>\r\n\r\n<p><br />\r\nБудьте всегда опрятны.<br />\r\nВнешний вид играет очень важную роль. Неряшливый, с дурным запахом и с непричесанными волосами человек, приятное впечатление на окружающих точно не произведет. И в себе уверен он от этого тоже не будет. Надо быть опрятным и хорошо выглядеть всегда, а не только перед каким-то мероприятием или встречей.<br />\r\nВсегда будьте спокойны.</p>\r\n\r\n<p><br />\r\nБольшинство людей во время серьезного разговора, начинают активно жестикулировать. Такое поведение, как правило, снимает чувство страха и обеспокоенность. Но вашему собеседнику все эти жестикуляции будут неприятны. Также это показывает вашу нервозность. И люди вокруг вас тоже становятся нервными. Все таки лучше взять себя в руки и успокоиться.<br />\r\nНе нужно скрещивать руки.</p>\r\n\r\n<p><br />\r\nТакой жест как скрещенные руки, истолковывается как защитный жест. Своим видом вы показываете окружающим, что разговор вам неприятен и общаться вы не хотите. Этим вы вызовете антипатию у знакомых или коллег по работе. Скрещенные руки &ndash; самая неудачная поза во время разговора.</p>\r\n\r\n<p><br />\r\nДержите руки спокойно.<br />\r\nВо время разговора большинство людей начинает сжимать руки в кулак, скрещивать пальцы, приглаживать волосы, крутить в руках какую-нибудь вещь. Такая жестикуляция показывает, что вы неуверенны в себе. Нужно успокоиться и не делать лишних телодвижений. Всем понравиться вы не сможете, но в некоторых случаях благоприятное впечатление на окружающих вы произведете. Независимо от того где вы находитесь &ndash; на деловой встрече или на свидании, позитивный настрой и уверенность в себе обязательно помогут вам решить исход дела (разговора) положительно.</p>\r\n'),(161,'<p>Диагностические критерии СДВГ<br />\r\nРекомендации для родителей<br />\r\nРекомендации для педагогов.</p>\r\n\r\n<p style=\"text-align: center;\"><br />\r\n<strong>Очень часто бывает так, что родители жалуются на то, что их ребенок неусидчив, не </strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>слушается, ни секунды не сидит на месте, ему очень трудно хоть сколько-то посидеть</p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;<strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; фото жабы че</strong></p>\r\n\r\n<p>спокойно и заниматься делом. Может ли это быть просто особенностью характера ребенка, невоспит</p>\r\n'),(162,'<p>&nbsp;</p>\r\n\r\n<p>Гиперактивность, в основном, наблюдается у детей и подростков из-за эмоционального и неуравновешенного состояния. Им не всегда удается справиться с таким состоянием самостоятельно. Связывают это явление с перенапряжением и нервной возбудимостью организма.</p>\r\n\r\n<p>Гиперактивность &ndash; это повышенное эмоциональное состояние, которое вызвано нервно-психическим расстройством. Оно выходит за пределы полагающейся нормы.</p>\r\n\r\n<p><strong>Причины возникновения у детей говорят сами за себя, а именно:</strong></p>\r\n\r\n<ol>\r\n	<li>Недостаток внимания со стороны родителей.</li>\r\n	<li>Активность, превышающая норму.</li>\r\n	<li>Чрезмерная эмоциональность.</li>\r\n	<li>Импульсивность.</li>\r\n</ol>\r\n\r\n<blockquote>\r\n<p>Как бороться родителям с таким непоседливым малышом?</p>\r\n</blockquote>\r\n\r\n<p>Ребенок уже на первых месяцах жизни, может проявлять гиперактивность:</p>\r\n\r\n<ol>\r\n	<li>Плохо спать.</li>\r\n	<li>Много плакать.</li>\r\n	<li>Реагировать на любой звук, шум.</li>\r\n</ol>\r\n\r\n<p>Детки, которые постарше:</p>\r\n\r\n<ol>\r\n	<li>Неусидчивы.</li>\r\n	<li>Не сидят на одном месте.</li>\r\n	<li>Агрессивны.</li>\r\n	<li>Возбудимы.</li>\r\n	<li>Невнимательны.</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n\r\n<p class=\"content-editor-image-center\">&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Сложности могут возникнуть:</p>\r\n\r\n<p>1)Когда вы поведете ребенка впервые в детский сад, ведь ему приходится вливаться в незнакомую обстановку. Для него, конечно же, это стресс.</p>\r\n\r\n<p>2)В школьный период гиперактивным детям приходится нелегко. Он может плохо усваивать информацию, вступать в конфликтные ситуации со сверстниками и учителями.</p>\r\n\r\n<blockquote>\r\n<p><strong>Большие ошибки совершают родители, испытывая трудности с гиперактивным ребенком. </strong></p>\r\n</blockquote>\r\n\r\n<p>Мера наказания должна быть не такой строгой и дисциплинированной. Детям с повышенной активностью и непоседливостью очень трудно соблюдать правила и рамки, которые устанавливают ему родители. Здесь поможет только терпеливый и мудрый подход в сложившейся ситуации, а лучше всего поход к специалисту, который поможет разобраться, в чем причина такого поведения у ребенка.</p>\r\n\r\n<p>Дети с ярко выраженной гиперактивностью чаще наблюдаются у невролога и психолога, для того чтобы избежать последствий. Гиперактивный ребенок подвержен в два раза больше различным травмам. Поэтому необходимо заранее позаботиться о его безопасности. Пик активности у детей начинается в два, три года, далее в восемь, десять лет.</p>\r\n\r\n<p style=\"text-align: center;\"><strong>фото ребенкка с разбитым коленом</strong></p>\r\n\r\n<p>По статистике, гиперактивность чаще всего выявляют у мальчиков. Причина тому, что они рождаются крупней, чем девочки, и мозг развивается у них гораздо позже.<br />\r\nДля того чтобы облегчить состояние ребенка, лучше всего давать лекарства, которые помогут успокоить детскую нервную систему и сосредоточиться на информации, исходящей от взрослых людей.</p>\r\n\r\n<p>Своевременная помощь малышу поможет сделать жизнь его спокойней. И это порадует самих родителей. Правильный подход и терпение, в сложившейся ситуации, помогут справиться с гиперактивностью малыша. Важно дать ему понять, что его все равно любят, несмотря ни на что.&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><strong>фото любящей семьи</strong></p>\r\n'),(163,'<p><span class=\"word\">Когда</span> <span class=\"word\">в</span> <span class=\"word\">семье</span> <span class=\"word\">не</span> <span class=\"word\">один</span> <span class=\"word\">ребенок</span>, <span class=\"word\">то</span> <span class=\"word\">возникает</span> <span class=\"word\">проблема</span> <span class=\"word\">в</span> <span class=\"word\">их</span> <span class=\"word\">взаимопонимании</span> <span class=\"word\">между</span> <span class=\"word\">собой</span>. <span class=\"word\">Нет</span> <span class=\"word\">ничего</span> <span class=\"word\">ужасного</span> <span class=\"word\">в</span> <span class=\"word\">ссорах</span>.<br />\r\n<br />\r\n<span class=\"word\">Часто</span> <span class=\"word\">дети</span> <span class=\"word\">и</span> <span class=\"word\">обзываются</span>, <span class=\"word\">и</span> <span class=\"word\">дерутся</span>. <span class=\"word\">Правильным</span> <span class=\"word\">решением</span> <span class=\"word\">будет</span> <span class=\"word\">не</span> <span class=\"word\">вмешиваться</span> <span class=\"word\">в</span> <span class=\"word\">конфликты</span> <span class=\"word\">детей</span> <span class=\"word\">до</span> <span class=\"word\">поры</span> <span class=\"word\">до</span> <span class=\"word\">времени</span>, <span class=\"word\">они</span> <span class=\"word\">способны</span> <span class=\"word\">сами</span> <span class=\"word\">разобраться</span> <span class=\"word\">в</span> <span class=\"word\">своих</span> <span class=\"word\">проблемах</span>. <span class=\"word\">Нельзя</span> <span class=\"word\">оставаться</span> <span class=\"word\">в</span> <span class=\"word\">стороне</span>, <span class=\"word\">когда</span> <span class=\"word\">драки</span> <span class=\"word\">уже</span> <span class=\"word\">переходят</span> <span class=\"word\">ту</span> <span class=\"word\">грань</span>, <span class=\"word\">что</span> <span class=\"word\">становятся</span> <span class=\"word\">опасными</span>, <span class=\"word\">тут</span> <span class=\"word\">стоит</span> <span class=\"word\">вмешаться</span> <span class=\"word\">и</span> <span class=\"word\">развести</span> <span class=\"word\">их</span> <span class=\"word\">в</span> <span class=\"word\">разные</span> <span class=\"word\">стороны</span>, <span class=\"word\">попробовать</span> <span class=\"word\">отвлечь</span> <span class=\"word\">на</span> <span class=\"word\">время</span> <span class=\"word\">друг</span> <span class=\"word\">от</span> <span class=\"word\">друга</span>.<br />\r\n<span class=\"word\">Чаще</span> <span class=\"word\">всего</span> <span class=\"word\">наказывают</span> <span class=\"word\">старших</span> <span class=\"word\">детей</span>, <span class=\"word\">но</span> <span class=\"word\">не</span> <span class=\"word\">стоит</span> <span class=\"word\">забывать</span>, <span class=\"word\">что</span> <span class=\"word\">в</span> <span class=\"word\">ссоре</span> <span class=\"word\">участвовали</span> <span class=\"word\">оба</span>. <span class=\"word\">Для</span> <span class=\"word\">старшего</span> <span class=\"word\">ребенка</span> <span class=\"word\">складывается</span> <span class=\"word\">впечатление</span>, <span class=\"word\">что</span> <span class=\"word\">он</span> <span class=\"word\">всегда</span> <span class=\"word\">должен</span> <span class=\"word\">уступать</span>, <span class=\"word\">делиться</span> <span class=\"word\">с</span> <span class=\"word\">младшим</span>, <span class=\"word\">присматривать</span> <span class=\"word\">и</span> <span class=\"word\">помогать</span> <span class=\"word\">ему</span>. <span class=\"word\">Но</span> <span class=\"word\">он</span> <span class=\"word\">личность</span>, <span class=\"word\">у</span> <span class=\"word\">него</span> <span class=\"word\">свои</span> <span class=\"word\">интересы</span>, <span class=\"word\">занятия</span>, <span class=\"word\">не</span> <span class=\"word\">взваливайте</span> <span class=\"word\">на</span> <span class=\"word\">его</span> <span class=\"word\">плечи</span> <span class=\"word\">обязанности</span> <span class=\"word\">няньки</span>, <span class=\"word\">этим</span> <span class=\"word\">вы</span> <span class=\"word\">только</span> <span class=\"word\">вредите</span> <span class=\"word\">отношениям</span> <span class=\"word\">между</span> <span class=\"word\">детьми</span>.<br />\r\n<span class=\"word\">В</span> <span class=\"word\">детском</span> <span class=\"word\">возрасте</span> <span class=\"word\">у</span> <span class=\"word\">них</span> <span class=\"word\">много</span> <span class=\"word\">общего</span> <span class=\"word\">между</span> <span class=\"word\">собой</span>, <span class=\"word\">они</span> <span class=\"word\">вместе</span> <span class=\"word\">играют</span>, <span class=\"word\">едят</span>, <span class=\"word\">ездят</span> <span class=\"word\">в</span> <span class=\"word\">гости</span>, <span class=\"word\">по</span> <span class=\"word\">сути</span>, <span class=\"word\">являются</span> <span class=\"word\">лучшими</span> <span class=\"word\">друзьями</span> <span class=\"word\">друг</span> <span class=\"word\">другу</span>. <span class=\"word\">И</span> <span class=\"word\">здесь</span> <span class=\"word\">родителям</span> <span class=\"word\">нужно</span> <span class=\"word\">быть</span> <span class=\"word\">аккуратными</span>, <span class=\"word\">уделять</span> <span class=\"word\">равное</span> <span class=\"word\">внимание</span> <span class=\"word\">и</span> <span class=\"word\">любовь</span>. <span class=\"word\">Если</span> <span class=\"word\">покупаете</span> <span class=\"word\">игрушку</span>, <span class=\"word\">то</span> <span class=\"word\">двоим</span>. <span class=\"word\">Не</span> <span class=\"word\">допустите</span> <span class=\"word\">ревности</span> <span class=\"word\">между</span> <span class=\"word\">ними</span>, <span class=\"word\">от</span> <span class=\"word\">этого</span> <span class=\"word\">скапливаются</span> <span class=\"word\">обиды</span> <span class=\"word\">и</span> <span class=\"word\">злость</span> <span class=\"word\">на</span> <span class=\"word\">того</span> <span class=\"word\">ребенка</span>, <span class=\"word\">который</span>, <span class=\"word\">по</span> <span class=\"word\">их</span> <span class=\"word\">мнению</span>, <span class=\"word\">получает</span> <span class=\"word\">больше</span> <span class=\"word\">заботы</span>. <span class=\"word\">Это</span> <span class=\"word\">не</span> <span class=\"word\">касается</span> <span class=\"word\">одежды</span>. <span class=\"word\">Приучайте</span> <span class=\"word\">детей</span> <span class=\"word\">с</span> <span class=\"word\">малого</span> <span class=\"word\">возраста</span> <span class=\"word\">быть</span> <span class=\"word\">объективными</span>, <span class=\"word\">в</span> <span class=\"word\">каждой</span> <span class=\"word\">семье</span> <span class=\"word\">разное</span> <span class=\"word\">материальное</span> <span class=\"word\">положение</span>. <span class=\"word\">Бывают</span> <span class=\"word\">ситуации</span>, <span class=\"word\">когда</span> <span class=\"word\">есть</span> <span class=\"word\">деньги</span> <span class=\"word\">купить</span> <span class=\"word\">только</span> <span class=\"word\">одну</span> <span class=\"word\">вещь</span> <span class=\"word\">в</span> <span class=\"word\">этом</span> <span class=\"word\">месяце</span>, <span class=\"word\">ребенок</span> <span class=\"word\">должен</span> <span class=\"word\">понимать</span> <span class=\"word\">это</span> <span class=\"word\">и</span> <span class=\"word\">не</span> <span class=\"word\">обижаться</span>, <span class=\"word\">если</span> <span class=\"word\">придется</span> <span class=\"word\">немного</span> <span class=\"word\">подождать</span>.<br />\r\n<span class=\"word\">Если</span> <span class=\"word\">старшая</span> <span class=\"word\">в</span> <span class=\"word\">семье</span> <span class=\"word\">девочка</span>, <span class=\"word\">она</span> <span class=\"word\">обычно</span> <span class=\"word\">с</span> <span class=\"word\">радостью</span> <span class=\"word\">помогает</span> <span class=\"word\">матери</span> <span class=\"word\">с</span> <span class=\"word\">младшим</span> <span class=\"word\">ребенком</span>. <span class=\"word\">Для</span> <span class=\"word\">нее</span> <span class=\"word\">это</span> <span class=\"word\">своеобразная</span> <span class=\"word\">игра</span>, <span class=\"word\">развивающая</span> <span class=\"word\">женское</span> <span class=\"word\">начало</span>. <span class=\"word\">А</span> <span class=\"word\">вам</span> <span class=\"word\">становится</span> <span class=\"word\">хорошей</span> <span class=\"word\">помощницей</span>.<br />\r\n<span class=\"word\">При</span> <span class=\"word\">вступлении</span> <span class=\"word\">в</span> <span class=\"word\">подростковый</span> <span class=\"word\">возраст</span>, <span class=\"word\">братья</span> <span class=\"word\">и</span> <span class=\"word\">сестры</span> <span class=\"word\">отдаляются</span> <span class=\"word\">друг</span> <span class=\"word\">от</span> <span class=\"word\">друга</span>, <span class=\"word\">предпочитая</span> <span class=\"word\">общение</span> <span class=\"word\">со</span> <span class=\"word\">своими</span> <span class=\"word\">сверстниками</span>. <span class=\"word\">Интересуйтесь</span> <span class=\"word\">жизнью</span> <span class=\"word\">и</span> <span class=\"word\">проблемами</span> <span class=\"word\">вашего</span> <span class=\"word\">ребенка</span> <span class=\"word\">за</span> <span class=\"word\">пределами</span> <span class=\"word\">дома</span>, <span class=\"word\">чтобы</span> <span class=\"word\">не</span> <span class=\"word\">потерять</span> <span class=\"word\">ту</span> <span class=\"word\">нить</span>, <span class=\"word\">которая</span> <span class=\"word\">связывает</span> <span class=\"word\">вас</span> <span class=\"word\">и</span> <span class=\"word\">оградить</span> <span class=\"word\">его</span> <span class=\"word\">от</span> <span class=\"word\">необдуманных</span> <span class=\"word\">поступков</span>.<br />\r\n<span class=\"word\">Сколько</span> <span class=\"word\">бы</span> <span class=\"word\">детей</span> <span class=\"word\">ни</span> <span class=\"word\">было</span> <span class=\"word\">в</span> <span class=\"word\">семье</span>, <span class=\"word\">ваша</span> <span class=\"word\">задача</span> <span class=\"word\">сохранить</span> <span class=\"word\">между</span> <span class=\"word\">всеми</span> <span class=\"word\">хорошие</span>, <span class=\"word\">крепкие</span> <span class=\"word\">отношения</span>. <span class=\"word\">Чтобы</span> <span class=\"word\">ребята</span> <span class=\"word\">выручали</span> <span class=\"word\">друг</span> <span class=\"word\">друга</span> <span class=\"word\">и</span> <span class=\"word\">пронесли</span> <span class=\"word\">свою</span> <span class=\"word\">любовь</span> <span class=\"word\">на</span> <span class=\"word\">долгие</span> <span class=\"word\">годы</span> <span class=\"word\">длиною</span> <span class=\"word\">в</span> <span class=\"word\">жизнь</span>.</p>\r\n'),(164,'<p><span class=\"word\">Когда</span> <span class=\"word\">в</span> <span class=\"word\">семье</span> <span class=\"word\">не</span> <span class=\"word\">один</span> <span class=\"word\">ребенок</span>, <span class=\"word\">то</span> <span class=\"word\">возникает</span> <span class=\"word\">проблема</span> <span class=\"word\">в</span> <span class=\"word\">их</span> <span class=\"word\">взаимопонимании</span> <span class=\"word\">между</span> <span class=\"word\">собой</span>. <span class=\"word\">Нет</span> <span class=\"word\">ничего</span> <span class=\"word\">ужасного</span> <span class=\"word\">в</span> <span class=\"word\">ссорах</span>.</p>\r\n\r\n<ul>\r\n	<li><em>&nbsp;&nbsp;&nbsp; фото</em></li>\r\n</ul>\r\n\r\n<p><br />\r\n<span class=\"word\">Часто</span> <span class=\"word\">дети</span> <span class=\"word\">и</span> <span class=\"word\">обзываются</span>, <span class=\"word\">и</span> <span class=\"word\">дерутся</span>. <span class=\"word\">Правильным</span> <span class=\"word\">решением</span> <span class=\"word\">будет</span> <span class=\"word\">не</span> <span class=\"word\">вмешиваться</span> <span class=\"word\">в</span> <span class=\"word\">конфликты</span> <span class=\"word\">детей</span> <span class=\"word\">до</span> <span class=\"word\">поры</span> <span class=\"word\">до</span> <span class=\"word\">времени</span>, <span class=\"word\">они</span> <span class=\"word\">способны</span> <span class=\"word\">сами</span> <span class=\"word\">разобраться</span> <span class=\"word\">в</span> <span class=\"word\">своих</span> <span class=\"word\">проблемах</span>. <span class=\"word\">Нельзя</span> <span class=\"word\">оставаться</span> <span class=\"word\">в</span> <span class=\"word\">стороне</span>, <span class=\"word\">когда</span> <span class=\"word\">драки</span> <span class=\"word\">уже</span> <span class=\"word\">переходят</span> <span class=\"word\">ту</span> <span class=\"word\">грань</span>, <span class=\"word\">что</span> <span class=\"word\">становятся</span> <span class=\"word\">опасными</span>, <span class=\"word\">тут</span> <span class=\"word\">стоит</span> <span class=\"word\">вмешаться</span> <span class=\"word\">и</span> <span class=\"word\">развести</span> <span class=\"word\">их</span> <span class=\"word\">в</span> <span class=\"word\">разные</span> <span class=\"word\">стороны</span>, <span class=\"word\">попробовать</span> <span class=\"word\">отвлечь</span> <span class=\"word\">на</span> <span class=\"word\">время</span> <span class=\"word\">друг</span> <span class=\"word\">от</span> <span class=\"word\">друга</span>.<br />\r\n<span class=\"word\">Чаще</span> <span class=\"word\">всего</span> <span class=\"word\">наказывают</span> <span class=\"word\">старших</span> <span class=\"word\">детей</span>, <span class=\"word\">но</span> <span class=\"word\">не</span> <span class=\"word\">стоит</span> <span class=\"word\">забывать</span>, <span class=\"word\">что</span> <span class=\"word\">в</span> <span class=\"word\">ссоре</span> <span class=\"word\">участвовали</span> <span class=\"word\">оба</span>. <span class=\"word\">Для</span> <span class=\"word\">старшего</span> <span class=\"word\">ребенка</span> <span class=\"word\">складывается</span> <span class=\"word\">впечатление</span>, <span class=\"word\">что</span> <span class=\"word\">он</span> <span class=\"word\">всегда</span> <span class=\"word\">должен</span> <span class=\"word\">уступать</span>, <span class=\"word\">делиться</span> <span class=\"word\">с</span> <span class=\"word\">младшим</span>, <span class=\"word\">присматривать</span> <span class=\"word\">и</span> <span class=\"word\">помогать</span> <span class=\"word\">ему</span>. <span class=\"word\">Но</span> <span class=\"word\">он</span> <span class=\"word\">личность</span>, <span class=\"word\">у</span> <span class=\"word\">него</span> <span class=\"word\">свои</span> <span class=\"word\">интересы</span>, <span class=\"word\">занятия</span>, <span class=\"word\">не</span> <span class=\"word\">взваливайте</span> <span class=\"word\">на</span> <span class=\"word\">его</span> <span class=\"word\">плечи</span> <span class=\"word\">обязанности</span> <span class=\"word\">няньки</span>, <span class=\"word\">этим</span> <span class=\"word\">вы</span> <span class=\"word\">только</span> <span class=\"word\">вредите</span> <span class=\"word\">отношениям</span> <span class=\"word\">между</span> <span class=\"word\">детьми</span>.<br />\r\n<span class=\"word\">В</span> <span class=\"word\">детском</span> <span class=\"word\">возрасте</span> <span class=\"word\">у</span> <span class=\"word\">них</span> <span class=\"word\">много</span> <span class=\"word\">общего</span> <span class=\"word\">между</span> <span class=\"word\">собой</span>, <span class=\"word\">они</span> <span class=\"word\">вместе</span> <span class=\"word\">играют</span>, <span class=\"word\">едят</span>, <span class=\"word\">ездят</span> <span class=\"word\">в</span> <span class=\"word\">гости</span>, <span class=\"word\">по</span> <span class=\"word\">сути</span>, <span class=\"word\">являются</span> <span class=\"word\">лучшими</span> <span class=\"word\">друзьями</span> <span class=\"word\">друг</span> <span class=\"word\">другу</span>. <span class=\"word\">И</span> <span class=\"word\">здесь</span> <span class=\"word\">родителям</span> <span class=\"word\">нужно</span> <span class=\"word\">быть</span> <span class=\"word\">аккуратными</span>, <span class=\"word\">уделять</span> <span class=\"word\">равное</span> <span class=\"word\">внимание</span> <span class=\"word\">и</span> <span class=\"word\">любовь</span>. <span class=\"word\">Если</span> <span class=\"word\">покупаете</span> <span class=\"word\">игрушку</span>, <span class=\"word\">то</span> <span class=\"word\">двоим</span>. <span class=\"word\">Не</span> <span class=\"word\">допустите</span> <span class=\"word\">ревности</span> <span class=\"word\">между</span> <span class=\"word\">ними</span>, <span class=\"word\">от</span> <span class=\"word\">этого</span> <span class=\"word\">скапливаются</span> <span class=\"word\">обиды</span> <span class=\"word\">и</span> <span class=\"word\">злость</span> <span class=\"word\">на</span> <span class=\"word\">того</span> <span class=\"word\">ребенка</span>, <span class=\"word\">который</span>, <span class=\"word\">по</span> <span class=\"word\">их</span> <span class=\"word\">мнению</span>, <span class=\"word\">получает</span> <span class=\"word\">больше</span> <span class=\"word\">заботы</span>. <span class=\"word\">Это</span> <span class=\"word\">не</span> <span class=\"word\">касается</span> <span class=\"word\">одежды</span>. <span class=\"word\">Приучайте</span> <span class=\"word\">детей</span> <span class=\"word\">с</span> <span class=\"word\">малого</span> <span class=\"word\">возраста</span> <span class=\"word\">быть</span> <span class=\"word\">объективными</span>, <span class=\"word\">в</span> <span class=\"word\">каждой</span> <span class=\"word\">семье</span> <span class=\"word\">разное</span> <span class=\"word\">материальное</span> <span class=\"word\">положение</span>. <span class=\"word\">Бывают</span> <span class=\"word\">ситуации</span>, <span class=\"word\">когда</span> <span class=\"word\">есть</span> <span class=\"word\">деньги</span> <span class=\"word\">купить</span> <span class=\"word\">только</span> <span class=\"word\">одну</span> <span class=\"word\">вещь</span> <span class=\"word\">в</span> <span class=\"word\">этом</span> <span class=\"word\">месяце</span>, <span class=\"word\">ребенок</span> <span class=\"word\">должен</span> <span class=\"word\">понимать</span> <span class=\"word\">это</span> <span class=\"word\">и</span> <span class=\"word\">не</span> <span class=\"word\">обижаться</span>, <span class=\"word\">если</span> <span class=\"word\">придется</span> <span class=\"word\">немного</span> <span class=\"word\">подождать</span>.<br />\r\n<span class=\"word\">Если</span> <span class=\"word\">старшая</span> <span class=\"word\">в</span> <span class=\"word\">семье</span> <span class=\"word\">девочка</span>, <span class=\"word\">она</span> <span class=\"word\">обычно</span> <span class=\"word\">с</span> <span class=\"word\">радостью</span> <span class=\"word\">помогает</span> <span class=\"word\">матери</span> <span class=\"word\">с</span> <span class=\"word\">младшим</span> <span class=\"word\">ребенком</span>. <span class=\"word\">Для</span> <span class=\"word\">нее</span> <span class=\"word\">это</span> <span class=\"word\">своеобразная</span> <span class=\"word\">игра</span>, <span class=\"word\">развивающая</span> <span class=\"word\">женское</span> <span class=\"word\">начало</span>. <span class=\"word\">А</span> <span class=\"word\">вам</span> <span class=\"word\">становится</span> <span class=\"word\">хорошей</span> <span class=\"word\">помощницей</span>.<br />\r\n<span class=\"word\">При</span> <span class=\"word\">вступлении</span> <span class=\"word\">в</span> <span class=\"word\">подростковый</span> <span class=\"word\">возраст</span>, <span class=\"word\">братья</span> <span class=\"word\">и</span> <span class=\"word\">сестры</span> <span class=\"word\">отдаляются</span> <span class=\"word\">друг</span> <span class=\"word\">от</span> <span class=\"word\">друга</span>, <span class=\"word\">предпочитая</span> <span class=\"word\">общение</span> <span class=\"word\">со</span> <span class=\"word\">своими</span> <span class=\"word\">сверстниками</span>. <span class=\"word\">Интересуйтесь</span> <span class=\"word\">жизнью</span> <span class=\"word\">и</span> <span class=\"word\">проблемами</span> <span class=\"word\">вашего</span> <span class=\"word\">ребенка</span> <span class=\"word\">за</span> <span class=\"word\">пределами</span> <span class=\"word\">дома</span>, <span class=\"word\">чтобы</span> <span class=\"word\">не</span> <span class=\"word\">потерять</span> <span class=\"word\">ту</span> <span class=\"word\">нить</span>, <span class=\"word\">которая</span> <span class=\"word\">связывает</span> <span class=\"word\">вас</span> <span class=\"word\">и</span> <span class=\"word\">оградить</span> <span class=\"word\">его</span> <span class=\"word\">от</span> <span class=\"word\">необдуманных</span> <span class=\"word\">поступков</span>.<br />\r\n<span class=\"word\">Сколько</span> <span class=\"word\">бы</span> <span class=\"word\">детей</span> <span class=\"word\">ни</span> <span class=\"word\">было</span> <span class=\"word\">в</span> <span class=\"word\">семье</span>, <span class=\"word\">ваша</span> <span class=\"word\">задача</span> <span class=\"word\">сохранить</span> <span class=\"word\">между</span> <span class=\"word\">всеми</span> <span class=\"word\">хорошие</span>, <span class=\"word\">крепкие</span> <span class=\"word\">отношения</span>. <span class=\"word\">Чтобы</span> <span class=\"word\">ребята</span> <span class=\"word\">выручали</span> <span class=\"word\">друг</span> <span class=\"word\">друга</span> <span class=\"word\">и</span> <span class=\"word\">пронесли</span> <span class=\"word\">свою</span> <span class=\"word\">любовь</span> <span class=\"word\">на</span> <span class=\"word\">долгие</span> <span class=\"word\">годы</span> <span class=\"word\">длиною</span> <span class=\"word\">в</span> <span class=\"word\">жизнь</span>.</p>\r\n'),(165,'<p>Купить мебель для детской комнаты довольно непросто,<br />\r\nДело даже не в том, что выбор шкафов и кроваток ограничен. В наше время в магазинах есть практически все, а остальное можно сделать на заказ.<br />\r\n<br />\r\n<strong>Просто детская комната должна отражать внутренний мир вашего ребенка, соответствовать его интересам и развивать его способности.</strong><br />\r\n<br />\r\nКомната малыша должна быть яркой, чтобы ему захотелось исследовать ее, открывать шкафчики, заглядывать на полки с книгами и разными мелочами<br />\r\n<br />\r\n<strong>1.</strong>Кровать может быть с прекрасными подушками разных цветов, которыми можно биться как мечами и на которых так сладко засыпать.<br />\r\n<br />\r\n<strong>2.</strong>Компьютерный стол (для детей постарше) должен быть удобным не только для компьютерных игр, но и для выполнения домашних заданий. А у школьников очень много различных книг, тетрадок и других школьных принадлежностей.<br />\r\n<br />\r\nНеобходимо найти место и для разнообразных игр ребенка (куклы, машинки, железные дороги) Они не должны валяться по всей комнате.<br />\r\n<br />\r\nСтены можно сделать разных цветов, но лучше слегка приглушенных тонов. Ведь ребенок не только играет и занимается в своей комнате, он в ней еще и спит. Перевозбуждение от ярких цветов может обернуться плохим сном для малыша.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Пусть детская комната для вашего ребенка станет не только миром, в котором он живет, но и окном в большой, взрослый мир</strong><br />\r\n<br />\r\n&nbsp;</p>\r\n'),(166,'<p>Купить мебель для детской комнаты довольно непросто,<br />\r\nДело даже не в том, что выбор шкафов и кроваток ограничен. В наше время в магазинах есть практически все, а остальное можно сделать на заказ.<br />\r\n<br />\r\n<strong>Просто детская комната должна отражать внутренний мир вашего ребенка, соответствовать его интересам и развивать его способности.</strong><br />\r\n<br />\r\nКомната малыша должна быть яркой, чтобы ему захотелось исследовать ее, открывать шкафчики, заглядывать на полки с книгами и разными мелочами</p>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; фото необычной детской комнаты</strong><br />\r\n<br />\r\n<strong>1.</strong>Кровать может быть с прекрасными подушками разных цветов, которыми можно биться как мечами и на которых так сладко засыпать.<br />\r\n<br />\r\n<strong>2.</strong>Компьютерный стол (для детей постарше) должен быть удобным не только для компьютерных игр, но и для выполнения домашних заданий. А у школьников очень много различных книг, тетрадок и других школьных принадлежностей.</p>\r\n\r\n<p>Необходимо найти место и для разнообразных игр ребенка (куклы, машинки, железные дороги) Они не должны валяться по всей комнате.</p>\r\n\r\n<p>Стены можно сделать разных цветов, но лучше слегка приглушенных тонов. Ведь ребенок не только играет и занимается в своей комнате, он в ней еще и спит. Перевозбуждение от ярких цветов может обернуться плохим сном для малыша.</p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><strong>Пусть детская комната для вашего ребенка станет не только миром, в котором он живет, но и окном в большой, взрослый мир</strong><br />\r\n<br />\r\n&nbsp;</p>\r\n'),(167,'<p>Купить мебель для детской комнаты довольно непросто,<br />\r\nДело даже не в том, что выбор шкафов и кроваток ограничен. В наше время в магазинах есть практически все, а остальное можно сделать на заказ.<br />\r\n<br />\r\n<strong>Просто детская комната должна отражать внутренний мир вашего ребенка, соответствовать его интересам и развивать его способности.</strong><br />\r\n<br />\r\nКомната малыша должна быть яркой, чтобы ему захотелось исследовать ее, открывать шкафчики, заглядывать на полки с книгами и разными мелочами</p>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; фото необычной детской комнаты</strong><br />\r\n<br />\r\n<strong>1.</strong>Кровать может быть с прекрасными подушками разных цветов, которыми можно биться как мечами и на которых так сладко засыпать.<br />\r\n<br />\r\n<strong>2.</strong>Компьютерный стол (для детей постарше) должен быть удобным не только для компьютерных игр, но и для выполнения домашних заданий. А у школьников очень много различных книг, тетрадок и других школьных принадлежностей.</p>\r\n\r\n<p>Необходимо найти место и для разнообразных игр ребенка (куклы, машинки, железные дороги) Они не должны валяться по всей комнате.</p>\r\n\r\n<p>Стены можно сделать разных цветов, но лучше слегка приглушенных тонов. Ведь ребенок не только играет и занимается в своей комнате, он в ней еще и спит. Перевозбуждение от ярких цветов может обернуться плохим сном для малыша.</p>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; фото ребенка,который не может заснуть</strong></p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><strong>Пусть детская комната для вашего ребенка станет не только миром, в котором он живет, но и окном в большой, взрослый мир</strong><br />\r\n<br />\r\n&nbsp;</p>\r\n'),(168,'<blockquote>\r\n<p><span class=\"word\">Когда</span> <span class=\"word\">в</span> <span class=\"word\">семье</span> <span class=\"word\">не</span> <span class=\"word\">один</span> <span class=\"word\">ребенок</span>, <span class=\"word\">то</span> <span class=\"word\">возникает</span> <span class=\"word\">проблема</span> <span class=\"word\">в</span> <span class=\"word\">их</span> <span class=\"word\">взаимопонимании</span> <span class=\"word\">между</span> <span class=\"word\">собой</span>. <span class=\"word\">Нет</span> <span class=\"word\">ничего</span> <span class=\"word\">ужасного</span> <span class=\"word\">в</span> <span class=\"word\">ссорах</span>.</p>\r\n</blockquote>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;фото конфликта 2 детей</strong><br />\r\n&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><strong><span class=\"word\">Часто</span> <span class=\"word\">дети</span> <span class=\"word\">и</span> <span class=\"word\">обзываются</span>, <span class=\"word\">и</span> <span class=\"word\">дерутся</span>.</strong></p>\r\n\r\n<p><span class=\"word\">Правильным</span> <span class=\"word\">решением</span> <span class=\"word\">будет</span> <span class=\"word\">не</span> <span class=\"word\">вмешиваться</span> <span class=\"word\">в</span> <span class=\"word\">конфликты</span> <span class=\"word\">детей</span> <span class=\"word\">до</span> <span class=\"word\">поры</span> <span class=\"word\">до</span> <span class=\"word\">времени</span>, <span class=\"word\">они</span> <span class=\"word\">способны</span> <span class=\"word\">сами</span> <span class=\"word\">разобраться</span> <span class=\"word\">в</span> <span class=\"word\">своих</span> <span class=\"word\">проблемах</span>.<span class=\"word\">Нельзя</span> <span class=\"word\">оставаться</span> <span class=\"word\">в</span> <span class=\"word\">стороне</span>, <span class=\"word\">когда</span> <span class=\"word\">драки</span> <span class=\"word\">уже</span> <span class=\"word\">переходят</span> <span class=\"word\">ту</span> <span class=\"word\">грань</span>, <span class=\"word\">что</span> <span class=\"word\">становятся</span> <span class=\"word\">опасными</span>, <span class=\"word\">тут</span> <span class=\"word\">стоит</span> <span class=\"word\">вмешаться</span> <span class=\"word\">и</span> <span class=\"word\">развести</span> <span class=\"word\">их</span> <span class=\"word\">в</span> <span class=\"word\">разные</span> <span class=\"word\">стороны</span>, <span class=\"word\">попробовать</span> <span class=\"word\">отвлечь</span> <span class=\"word\">на</span> <span class=\"word\">время</span> <span class=\"word\">друг</span> <span class=\"word\">от</span> <span class=\"word\">друга</span>.</p>\r\n\r\n<p><br />\r\n<span class=\"word\">Чаще</span> <span class=\"word\">всего</span> <span class=\"word\">наказывают</span> <span class=\"word\">старших</span> <span class=\"word\">детей</span>, <span class=\"word\">но</span> <span class=\"word\">не</span> <span class=\"word\">стоит</span> <span class=\"word\">забывать</span>, <span class=\"word\">что</span> <span class=\"word\">в</span> <span class=\"word\">ссоре</span> <span class=\"word\">участвовали</span> <span class=\"word\">оба</span>. <span class=\"word\">Для</span> <span class=\"word\">старшего</span> <span class=\"word\">ребенка</span> <span class=\"word\">складывается</span> <span class=\"word\">впечатление</span>, <span class=\"word\">что</span> <span class=\"word\">он</span> <span class=\"word\">всегда</span> <span class=\"word\">должен</span> <span class=\"word\">уступать</span>, <span class=\"word\">делиться</span> <span class=\"word\">с</span> <span class=\"word\">младшим</span>, <span class=\"word\">присматривать</span> <span class=\"word\">и</span> <span class=\"word\">помогать</span> <span class=\"word\">ему</span>. <span class=\"word\">Но</span> <span class=\"word\">он</span> <span class=\"word\">личность</span>, <span class=\"word\">у</span> <span class=\"word\">него</span> <span class=\"word\">свои</span> <span class=\"word\">интересы</span>, <span class=\"word\">занятия</span>, <span class=\"word\">не</span> <span class=\"word\">взваливайте</span> <span class=\"word\">на</span> <span class=\"word\">его</span> <span class=\"word\">плечи</span> <span class=\"word\">обязанности</span> <span class=\"word\">няньки</span>, <span class=\"word\">этим</span> <span class=\"word\">вы</span> <span class=\"word\">только</span> <span class=\"word\">вредите</span> <span class=\"word\">отношениям</span> <span class=\"word\">между</span> <span class=\"word\">детьми</span>.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<strong>фото наказанного ребенка</strong></p>\r\n\r\n<p><br />\r\n<span class=\"word\">В</span> <span class=\"word\">детском</span> <span class=\"word\">возрасте</span> <span class=\"word\">у</span> <span class=\"word\">них</span> <span class=\"word\">много</span> <span class=\"word\">общего</span> <span class=\"word\">между</span> <span class=\"word\">собой</span>, <span class=\"word\">они</span> <span class=\"word\">вместе</span> <span class=\"word\">играют</span>, <span class=\"word\">едят</span>, <span class=\"word\">ездят</span> <span class=\"word\">в</span> <span class=\"word\">гости</span>, <span class=\"word\">по</span> <span class=\"word\">сути</span>, <span class=\"word\">являются</span> <span class=\"word\">лучшими</span> <span class=\"word\">друзьями</span> <span class=\"word\">друг</span> <span class=\"word\">другу</span>. <span class=\"word\">И</span> <span class=\"word\">здесь</span> <span class=\"word\">родителям</span> <span class=\"word\">нужно</span> <span class=\"word\">быть</span> <span class=\"word\">аккуратными</span>, <span class=\"word\">уделять</span> <span class=\"word\">равное</span> <span class=\"word\">внимание</span> <span class=\"word\">и</span> <span class=\"word\">любовь</span>.</p>\r\n\r\n<p><span class=\"word\"><strong>1.</strong>Если</span> <span class=\"word\">покупаете</span> <span class=\"word\">игрушку</span>, <span class=\"word\">то</span> <span class=\"word\">двоим</span>.</p>\r\n\r\n<p><span class=\"word\"><strong>2.</strong>Не</span> <span class=\"word\">допустите</span> <span class=\"word\">ревности</span> <span class=\"word\">между</span> <span class=\"word\">ними</span>, <span class=\"word\">от</span> <span class=\"word\">этого</span> <span class=\"word\">скапливаются</span> <span class=\"word\">обиды</span> <span class=\"word\">и</span> <span class=\"word\">злость</span> <span class=\"word\">на</span> <span class=\"word\">того</span> <span class=\"word\">ребенка</span>, <span class=\"word\">который</span>, <span class=\"word\">по</span> <span class=\"word\">их</span> <span class=\"word\">мнению</span>, <span class=\"word\">получает</span> <span class=\"word\">больше</span> <span class=\"word\">заботы</span>. <span class=\"word\">Это</span> <span class=\"word\">не</span> <span class=\"word\">касается</span> <span class=\"word\">одежды</span>.</p>\r\n\r\n<p><span class=\"word\"><strong>3.</strong>Приучайте</span> <span class=\"word\">детей</span> <span class=\"word\">с</span> <span class=\"word\">малого</span> <span class=\"word\">возраста</span> <span class=\"word\">быть</span> <span class=\"word\">объективными</span>, <span class=\"word\">в</span> <span class=\"word\">каждой</span> <span class=\"word\">семье</span> <span class=\"word\">разное</span> <span class=\"word\">материальное</span> <span class=\"word\">положение</span>. <span class=\"word\">Бывают</span> <span class=\"word\">ситуации</span>, <span class=\"word\">когда</span> <span class=\"word\">есть</span> <span class=\"word\">деньги</span> <span class=\"word\">купить</span> <span class=\"word\">только</span> <span class=\"word\">одну</span> <span class=\"word\">вещь</span> <span class=\"word\">в</span> <span class=\"word\">этом</span> <span class=\"word\">месяце</span>, <span class=\"word\">ребенок</span> <span class=\"word\">должен</span> <span class=\"word\">понимать</span> <span class=\"word\">это</span> <span class=\"word\">и</span> <span class=\"word\">не</span> <span class=\"word\">обижаться</span>, <span class=\"word\">если</span> <span class=\"word\">придется</span> <span class=\"word\">немного</span> <span class=\"word\">подождать</span>.</p>\r\n\r\n<blockquote>\r\n<p><br />\r\n<span class=\"word\">Если</span> <span class=\"word\">старшая</span> <span class=\"word\">в</span> <span class=\"word\">семье</span> <span class=\"word\">девочка</span>, <span class=\"word\">она</span> <span class=\"word\">обычно</span> <span class=\"word\">с</span> <span class=\"word\">радостью</span> <span class=\"word\">помогает</span> <span class=\"word\">матери</span> <span class=\"word\">с</span> <span class=\"word\">младшим</span> <span class=\"word\">ребенком</span>. <span class=\"word\">Для</span> <span class=\"word\">нее</span> <span class=\"word\">это</span> <span class=\"word\">своеобразная</span> <span class=\"word\">игра</span>, <span class=\"word\">развивающая</span> <span class=\"word\">женское</span> <span class=\"word\">начало</span>. <span class=\"word\">А</span> <span class=\"word\">вам</span> <span class=\"word\">становится</span> <span class=\"word\">хорошей</span> <span class=\"word\">помощницей</span>.</p>\r\n</blockquote>\r\n\r\n<p><br />\r\n<span class=\"word\">При</span> <span class=\"word\">вступлении</span> <span class=\"word\">в</span> <span class=\"word\">подростковый</span> <span class=\"word\">возраст</span>, <span class=\"word\">братья</span> <span class=\"word\">и</span> <span class=\"word\">сестры</span> <span class=\"word\">отдаляются</span> <span class=\"word\">друг</span> <span class=\"word\">от</span> <span class=\"word\">друга</span>, <span class=\"word\">предпочитая</span> <span class=\"word\">общение</span> <span class=\"word\">со</span> <span class=\"word\">своими</span> <span class=\"word\">сверстниками</span>. <span class=\"word\">Интересуйтесь</span> <span class=\"word\">жизнью</span> <span class=\"word\">и</span> <span class=\"word\">проблемами</span> <span class=\"word\">вашего</span> <span class=\"word\">ребенка</span> <span class=\"word\">за</span> <span class=\"word\">пределами</span> <span class=\"word\">дома</span>, <span class=\"word\">чтобы</span> <span class=\"word\">не</span> <span class=\"word\">потерять</span> <span class=\"word\">ту</span> <span class=\"word\">нить</span>, <span class=\"word\">которая</span> <span class=\"word\">связывает</span> <span class=\"word\">вас</span> <span class=\"word\">и</span> <span class=\"word\">оградить</span> <span class=\"word\">его</span> <span class=\"word\">от</span> <span class=\"word\">необдуманных</span> <span class=\"word\">поступков</span>.</p>\r\n\r\n<p style=\"text-align: center;\"><br />\r\n<strong><span class=\"word\">Сколько</span> <span class=\"word\">бы</span> <span class=\"word\">детей</span> <span class=\"word\">ни</span> <span class=\"word\">было</span> <span class=\"word\">в</span> <span class=\"word\">семье</span>, <span class=\"word\">ваша</span> <span class=\"word\">задача</span> <span class=\"word\">сохранить</span> <span class=\"word\">между</span> <span class=\"word\">всеми</span> <span class=\"word\">хорошие</span>, <span class=\"word\">крепкие</span> <span class=\"word\">отношения</span>. <span class=\"word\">Чтобы</span> <span class=\"word\">ребята</span> <span class=\"word\">выручали</span> <span class=\"word\">друг</span> <span class=\"word\">друга</span> <span class=\"word\">и</span> <span class=\"word\">пронесли</span> <span class=\"word\">свою</span> <span class=\"word\">любовь</span> <span class=\"word\">на</span> <span class=\"word\">долгие</span> <span class=\"word\">годы</span> <span class=\"word\">длиною</span> <span class=\"word\">в</span> <span class=\"word\">жизнь</span>.</strong></p>\r\n'),(169,'<p><strong>Воспитание детей в любой семье имеет свои особенности. У каждого родителя есть свои методы воспитания.Люди, создавшие семью, надеются на то, что в их семье будет царить мир, дружба и согласие между всеми членами семьи.</strong></p>\r\n\r\n<p>Раньше детей учили скромности и сдержанности. Было не принято говорить о своих способностях, рекламировать свои таланты и навыки. В наше время авторы многих книг пишут о том, что детей нужно хвалить, поощрять, прививать с детства самоуважение, высокую самооценку.</p>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; фото поощерения детей</strong></p>\r\n\r\n<p style=\"text-align: center;\"><strong>Семьи,которые следуют данным правилам, воспитывать ребенка-лидера. В этом есть свои плюсы</strong>.</p>\r\n\r\n<p><strong>1.</strong>Ребенок-лидер умен, хитер, горд.</p>\r\n\r\n<p><strong>2.</strong>Он легко может влиться в новый коллектив, умеет за себя постоять, знает себе цену. <strong>3.</strong>Ребенок-лидер всегда находится в центре внимания сверстников, его уважают, иногда даже боятся. &nbsp;</p>\r\n\r\n<p><strong>4.</strong>Такой ребенок уверен в себе, умеет быстро принимать решения.</p>\r\n\r\n<p><strong>5.</strong>Ему будет гораздо проще в жизни &quot;освоиться&quot;, чем ребенку, который не уверен в себе, и зажат.</p>\r\n\r\n<blockquote>\r\n<p style=\"text-align: center;\">Чтобы воспитать ребенка-лидера , требуется немало усилий.</p>\r\n</blockquote>\r\n'),(170,'<blockquote>\r\n<p style=\"text-align: center;\"><strong>Воспитание ребенка в основном ложится на родителей. В большей степени первоначальным воспитанием ребенка занимается мать. Потому что только мать в состоянии уделять ребенку наибольшую часть времени и может отдать ему всю свою нежность, заботу и ласку.</strong></p>\r\n</blockquote>\r\n\r\n<p><br />\r\nНо стоит также помнить, что прекрасное воспитание зависит от семьи, в которой живет ребенок. Такой семьей может считаться та, где царит не только любовь друг к другу, но и любовь и уважение к другим людям.</p>\r\n\r\n<p style=\"text-align: center;\"><br />\r\n<strong>Воспитание единственного ребенка.&nbsp;</strong></p>\r\n\r\n<p><br />\r\nОбычно, в семье, где один ребенок, родители уделяют ему слишком много внимания. Основной причиной этого считается неопытность. Важно знать, что ребенок самостоятельно должен выработать в себе человека, нужно только не мешать ему в этом, а посодействовать.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <strong>&nbsp; фото ребенка-царя</strong></p>\r\n\r\n<p><br />\r\nНельзя воспитывать ребенка в тепличных условиях, постоянно холить и лелеять, баловать и нежить - это может привести к помехам в психологическом развитии ребенка - оно замедляется. А также он вырастит избалованным, несамостоятельным и неуверенным в себе человеком. И когда ребенок пойдет в детский сад, то ожидая от окружающих такого же внимания, к какому он привык дома и не получая его, он может столкнуться с трудностями, что может привести к разочарованию. А также он начнет замыкаться в себе и уединяться, чтобы не находиться в обществе других детей, так как он не привык делиться игрушками, а привык к пристальному вниманию со стороны взрослых, что все ему и все для него.</p>\r\n\r\n<p><br />\r\n<strong>И чтобы в дальнейшем такого не произошло, следует учесть то, что ребенок тоже человек, хоть пока еще и маленький, и у него должна быть свобода.&nbsp;</strong></p>\r\n\r\n<p><strong>1.</strong> У него должно быть детство, а в детстве имеет место беготня во дворе с друзьями и испачканные, рваные штаны.</p>\r\n\r\n<p><strong>2.</strong>Не надо делать из него образцового ребенка.<br />\r\n<strong>3.</strong>Весь смысл воспитания ребенка состоит в том, чтобы научить его самостоятельности. <strong>4.</strong>Родители должны относиться к нему с первых дней жизни как к взрослому человеку и должны помнить, что ребенок - это тоже личность.</p>\r\n'),(171,'<blockquote>\r\n<p style=\"text-align: center;\"><strong>Канадские ученые из Монреальского университета определили, что дети, которых с детства воспитывают самостоятельными, имеют более высокие умственные и когнитивные навыки.</strong></p>\r\n</blockquote>\r\n\r\n<p><br />\r\nВ рамках исследования ученые наблюдали за 78 детьми в возрасте от трех лет, которые играли в настольные игры, и их родителями. По мнению исследователей, именно такой способ игры позволяет:</p>\r\n\r\n<p>1. максимально оценить интеллектуальные возможности детей</p>\r\n\r\n<p>2.умение самостоятельно планировать и организовывать определенные процессы.</p>\r\n\r\n<p>3.выполнять несколько действий одновременно.<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <strong>&nbsp; &nbsp; &nbsp; фото игры детей в настольные игры</strong><br />\r\n<strong>Результаты показали, что те дети, чьи родители воспитывают детей самостоятельными и независимыми, показали лучшие результаты, чем те , чьи родители излишне оберегают и ограничивают детей. </strong></p>\r\n'),(172,'<p><strong>Дети - цветы жизни! С рождения они приносят в мир взрослого радость и счастье! Чего стоит только одна улыбка малыша, от которой жизнь становится яркой, осмысленной, наполненной положительными эмоциями! Когда женщина узнает, что ожидает малыша, она испытывает невероятные чувства и эмоции. Это может быть удивление, неожиданность или, наоборот, долгожданное чудо, радость от ощущения нового состояния.</strong></p>\r\n\r\n<p>Порой материнство кардинально изменяет жизнь: новые заботы, обязанности, а какая доля ответственности за физиологическое и психологическое здоровье малыша ложится на плечи новоиспеченных родителей?! Первый вздох, плач, смех, слово, первые шаги - все это производит неизгладимое впечатление на людей, подаривших жизнь своему чаду.</p>\r\n\r\n<p>Познавая новый мир, дети учатся:</p>\r\n\r\n<p><strong>1.</strong>общению со своими сверстниками</p>\r\n\r\n<p><strong>2</strong>. у них возникают привязанности, эмоциональные связи</p>\r\n\r\n<p><strong>3.</strong>выстраиваются определенные взаимоотношения, взаимодействия, столь необходимые для их социального развития.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong> фото ступений развития ребенка</strong></p>\r\n\r\n<p style=\"text-align: center;\"><strong>Наверное, каждый взрослый замечал, что человек не может жить в одиночестве, без общения.</strong></p>\r\n\r\n<p>Для нормального, полноценного развития человеку необходимы социальные контакты. Каждый из нас проходит через такие социальные институты как семья, детский сад, школа, средне или высшее профессиональное образование, различные объединения (по интересам, увлечениям, хобби), организации, религиозные институты (церкви, мечети или синагоги). Отсутствие важных социальных институтов оказывает огромное влияние на формирование личности. В этом случае, важно помнить, что ребенок познает, осваивает новый, сложный для него мир и учится выстраивать взаимоотношения самостоятельно.</p>\r\n\r\n<p>Поэтому, взрослым важно позитивно оценивать личность ребенка, тактично и аргументировано указывать на недостатки, терпеливо и умело поддерживать, хвалить за старание и инициативность. Ни в коем случае ребенка нельзя наказывать и запрещать.</p>\r\n\r\n<p style=\"text-align: center;\"><strong>Помните такое выражение &ndash; запретный плод сладок?</strong></p>\r\n\r\n<p><strong>&nbsp;</strong>Так и ребенок в этом возрасте может совершать действия, которые противоречат словам взрослым. Необходимо предоставить ребенку возможность быть взрослым в бытовых ситуациях (самому завязать шнурки, почистить зубы, выбрать, что ему съесть на завтрак овсянку или яичницу с колбасой, играть дома или на детской площадке). Тем не менее ребенок должен придерживаться режима (во сколько подъем, завтрак, прогулка, сон).</p>\r\n\r\n<hr />\r\n<p style=\"text-align: center;\"><br />\r\n<strong>Уважаемые родители, учитывайте возрастные особенности своего ребенка, будьте терпимее к его капризам, создайте для него благоприятную атмосферу, наполненную жизнерадостностью и оптимизмом, тогда процесс адаптации ребенка к детскому саду пройдет легко и быстро! </strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n'),(173,'<p><strong>Тело человека может очень многое о нем рассказать, даже больше чем ему (человеку) хотелось бы. По определенному положению тела можно увидеть например, чего мы боимся или о чем думаем.</strong></p>\r\n\r\n<p>Сейчас очень много фирм при приеме человека на работу, имеют в своем штате сотрудников умеющих понимать язык тела. Они очень точно распознают, что значит та или иная поза человека, пришедшего устраиваться к ним на фирму.<br />\r\nДовольно часто мы ощущаем в себе какую-то скованность и неудобство в самых важных для нас ситуациях.</p>\r\n\r\n<p>И тут возникает вопрос, а возможно ли как-то поменять состояние неловкости и показать собеседнику, что вы уверенны в себе. Достаточно разучить ряд жестов и немного изменить манеру поведения, и вы сможете расположить к себе любого человека, а также убедить его в том, что вы уверенны в себе.</p>\r\n\r\n<p style=\"text-align: center;\"><strong>Так как же нужно вести себя, чтобы всем было приятно видеть вас?</strong></p>\r\n\r\n<p><br />\r\n<strong>1.</strong>Будьте улыбчивы.Если все видят что вы улыбаетесь, то значит вы все довольны и счастливы, ну и конечно уверены в себе. Улыбка значит, что вы ничего не боитесь чувствовать себя уверенно. Тогда у всех окружающих вы будете вызывать только симпатию.<br />\r\n<strong>2.</strong>Ходите с расправленными плечами.<br />\r\nХодите прямо и не тащите ноги. Нужно расправить плечи и держать спину ровно, чтобы все люди видели, что от вас исходит сила, а сильный человек всегда производит приятное впечатление на окружающих. Не семените, шагайте шире и не оглядывайтесь по сторонам.<br />\r\n<strong>3.</strong>Не прячьте глаза.<br />\r\nЕсли вы уверены в себе, то вам нечего скрывать от окружающих. Уверенный в себе человек не опускает глаза при разговоре, а спокойно смотрит собеседнику в глаза, не отводя взгляд. При разговоре это очень важно, когда вы смотрите собеседнику в глаза, то он видит, что вы ничего от него не скрываете и честны с ним. Не держите руки в карманах и не прячьте за спиной. Это может создать впечатление, что вы что-то скрываете. Держите руки в спокойном положении. Сидя, можно положить их на стол или на колени.</p>\r\n\r\n<p><strong>4.</strong>Будьте всегда опрятны.<br />\r\nВнешний вид играет очень важную роль. Неряшливый, с дурным запахом и с непричесанными волосами человек, приятное впечатление на окружающих точно не произведет. И в себе уверен он от этого тоже не будет. Надо быть опрятным и хорошо выглядеть всегда, а не только перед каким-то мероприятием или встречей.<br />\r\nВсегда будьте спокойны.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <strong>фото человека идущего в офис</strong></p>\r\n\r\n<blockquote>\r\n<p><br />\r\n<strong>Большинство людей во время серьезного разговора, начинают активно жестикулировать. Такое поведение, как правило, снимает чувство страха и обеспокоенность. Но вашему собеседнику все эти жестикуляции будут неприятны. Также это показывает вашу нервозность. И люди вокруг вас тоже становятся нервными</strong>.</p>\r\n</blockquote>\r\n\r\n<p><strong>Все таки лучше взять себя в руки и успокоиться.</strong><br />\r\n<strong>1.</strong>Не&nbsp;нужно скрещивать руки.Такой жест как скрещенные руки, истолковывается как защитный жест. Своим видом вы показываете окружающим, что разговор вам неприятен и общаться вы не хотите. Этим вы вызовете антипатию у знакомых или коллег по работе. Скрещенные руки &ndash; самая неудачная поза во время разговора.</p>\r\n\r\n<p><strong>2.</strong>Держите руки спокойно.<br />\r\nВо время разговора большинство людей начинает сжимать руки в кулак, скрещивать пальцы, приглаживать волосы, крутить в руках какую-нибудь вещь. Такая жестикуляция показывает, что вы неуверенны в себе. Нужно успокоиться и не делать лишних телодвижений.</p>\r\n\r\n<p><strong>Всем понравиться вы не сможете, но в некоторых случаях благоприятное впечатление на окружающих вы произведете. Независимо от того где вы находитесь &ndash; на деловой встрече или на свидании, позитивный настрой и уверенность в себе обязательно помогут вам решить исход дела (разговора) положительно.</strong></p>\r\n'),(174,'<blockquote>\r\n<p>Заканчивая школу, многие ребята задумываются о том, какую же форму обучения предпочесть: дневную или заочную форму. Несомненно, чтобы они не выбрали для себя, цель у них одна &ndash; получить диплом, но процессы и принципы обучения у этих форм существенно отличаются.</p>\r\n</blockquote>\r\n\r\n<p style=\"text-align: center;\"><br />\r\n<br />\r\n<strong>Рассмотрим плюсы и минусы каждой из этих форм обучения.&nbsp;</strong></p>\r\n\r\n<p><br />\r\n<strong>1.</strong>Заочную форму обучения многие выбирают, исходя из следующих положительных моментов:<br />\r\n- в первую очередь, это конечно, возможность совмещать работу и учебу, ведь посещать занятия нужно лишь раз в полгода;<br />\r\n- стоимость обучения заочно, зачастую значительно ниже, а это хорошая экономия средств;<br />\r\n- студент заочник, как правило, самостоятельно изучает нужные для учебы источники, а значит, он может это делать в удобное для него время;<br />\r\nпреподаватели также довольно благосклонны к заочникам, прекрасно понимая их занятость.<br />\r\nНо при всех достоинствах заочной формы у нее есть и существенные минусы: это достаточно невысокое качество образования, так как программы заочного обучения преподаются в сокращенной форме. Студенты мало общаются с преподавателями вне занятий, не участвуют в студенческих научных проектах, экспедициях. Практика по специальности часто носит формальный характер. Да и качественно изучить гору специальной учебной литературы самостоятельно, у работающего студента не всегда получается. Работа после школы, когда нет специальности, редко бывает высоко оплачиваемой.</p>\r\n\r\n<p>&nbsp; &nbsp;<strong> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;фото совмещение учебы и работы</strong></p>\r\n\r\n<p><br />\r\n<strong>2.</strong>Теперь перейдем к дневной форме обучения и обозначим явные плюсы:<br />\r\n- конечно же, главным плюсом будет получение полноценных теоретических знаний, а учебные программы по специальным предметам носят углубленный характер;<br />\r\n- участие в семинарах, практических работах, экспедициях, молодежных слетах, студенческих олимпиадах дает большой опыт общественной работы и отлично закрепляет полученные знания;<br />\r\n- получение образование очно, считается более престижным, и работодатели предпочитают брать на работу выпускников, которые учились на дневной форме;<br />\r\n- полноценная студенческая жизнь, в полной мере, ощущается при дневном обучении, воспоминания об этих веселых годах остаются на всю жизнь.</p>\r\n\r\n<p><br />\r\nК недостаткам этой формы обучения относят, в первую очередь, довольно высокую плату, проходной балл также значительно выше, прохождение практик и стажировок не дают большого опыта, так как времени на них учебный план отводит немного.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;фото счастливого студента</strong></p>\r\n\r\n<p style=\"text-align: center;\"><br />\r\n<strong>Несомненно, одно &ndash; для получения действительно качественного образования, нужно иметь большое желание учиться. А что выбрать, каждый студент решает сам, в зависимости от своих финансовых возможностей, семейного положения и личных предпочтений.</strong></p>\r\n'),(175,'<p style=\"text-align: center;\"><strong>&nbsp;Основные факторы выбора профессии:</strong></p>\r\n\r\n<p><br />\r\n<strong>1.</strong>Профессиональная заинтересованность (зависит от увлечений и склонностей к определенным видам деятельности)</p>\r\n\r\n<p><strong>2</strong>.Умения (чаще всего бывает сложно определить свое истинное призвание для успешности в карьере)</p>\r\n\r\n<p><strong>3.</strong>Активность (высокая или низкая), степень подготовленности (успеваемость в школе)<br />\r\n<strong>4</strong>.Осведомление о видах профессий</p>\r\n\r\n<p><strong>5.</strong>Социальная и семейная среда и многое другое.</p>\r\n\r\n<hr />\r\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; фото разных профессий</strong></p>\r\n\r\n<p><br />\r\n<strong>Отсюда следует, что для удачной гармонизации всех трудных и разноречивых личностных взаимодействий в обществе и коллективе, в сочетании с группой экстроспективных политических, экономических и культурных обстоятельств, уместна и психологическая атмосфера, которые не реальны без развитых умений, навыков и работоспособности у любой переходящей на серьезный жизненный этап личности. Кризис таких данных резко проявляется в нынешний век, когда увеличиваются потребности в свободных коммуникациях с людьми различного статуса.</strong><br />\r\n&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n'),(176,'<blockquote>\r\n<p>Для работы, учебы и для общего развития человека ему необходимо иметь хорошую память.</p>\r\n</blockquote>\r\n\r\n<p>Не будем углубляться в теорию, что собой представляет человеческий мозг и память в частности, а лучше рассмотрим один из способов улучшения и расширения памяти.</p>\r\n\r\n<p><strong>1.</strong>Максимализируйте силу своего мозга с помощью визуализации.<br />\r\nИменно визуализация является мощным инструментом для увеличения памяти. Она способствует развитию креативности и созданию комплексных идей.<br />\r\nСамый простой способ научится визуализация - это рисовать. Когда человек воспринимает информацию на слух, то он усваивает ее на 30% меньше, чем когда он видит это же. Нужно стараться рисовать то, что слышишь.<br />\r\n<strong>2.</strong>Задействуйте больший спектр своего мозга.<br />\r\nКогда человек мысленно воспроизводит информацию, его мозг задействует другую часть мозга, которая отвечает за креативность, что способствует лучшему усвоению полученных данных.<br />\r\n<strong>3.</strong>Управляйте информацией и расставляйте приоритеты.<br />\r\nПоскольку человек не может запомнить абсолютно весь поток информации, который он получает, очень важно уметь быстро анализировать и расставлять приоритеты.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <strong>&nbsp; &nbsp; &nbsp; &nbsp;фото головы со светящимся мозгом</strong></p>\r\n\r\n<blockquote>\r\n<p><strong>Нужно концентрировать свое внимание на том, что мы считаем важным, и визуализировать.Визуальное восприятие информации намного сильнее. Не стесняйтесь рисовать и выделяйте для себя только саое важное</strong>.</p>\r\n</blockquote>\r\n'),(177,'<blockquote>\r\n<p><strong>Знание английского сегодня это отличное конкурентное преимущество. Умея говорить на английском проще найти работу, можно быстрее получать новые знания, создать успешный бизнес на примере иностранных аналогов.</strong></p>\r\n</blockquote>\r\n\r\n<p><strong>Так что если ты думаешь над тем, как быстро выучить английский язык с нуля, вот тебе 10 способов для этого.</strong></p>\r\n\r\n<p><strong>1.</strong> Нанять профессионала<br />\r\nПожалуй, это лучший способ. Поэтому здесь могу порекомендовать онлайн школу английского Skyeng.ru. Онлайн формат позволит тебе самому выбирать где и когда учиться. Тебе подберут преподавателя под твои интересы и характер, а цифровой учебник облегчит обучение, сохранит все, что учишь в одном месте и покажет прогресс. Запишись на бесплатный урок на Skyeng.tu.<br />\r\n<strong>2.</strong> Полное погружение дома<br />\r\nОбклей каждый предмет в доме словом на английском языке. Подключи зарубежные каналы по ТВ. Установи на всех устройствах иностранный язык. Купи книги на английском языке. Слушай аудио на английском в плеере и машине. Это хороший способ выучить английский для начинающих.<br />\r\n<strong>3.</strong> Полное погружение за рубежом<br />\r\nПереезд в другую страну значительно ускоряет изучение языка. Ты везде слышишь иностранную речь. Все что тебя окружает на другом языке. Тебе самому приходится общаться на иностранном языке, чтобы тебя поняли. В таких условиях можно заговорить на английском уже через месяц.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong> &nbsp;фото русского в америке</strong><br />\r\n<strong>4.</strong> Перейти на общение дома только на английском<br />\r\nНайди единомышленника среди родственников. И начните говорить только на английском языке. Не можешь сказать ищи словарь и переводи. С помощью приложений для смартфона это быстро делается.<br />\r\n<strong>5.</strong> Просмотр любимых фильмов в оригинале с русскими субтитрами<br />\r\nОбучение проходит быстрее и эффективнее когда тебе нравится то, что ты делаешь. Любимые фильмы создадут атмосферу интереса. Так что изучение английского будет проходить легче.<br />\r\n<strong>6.</strong> Найти иностранца желающего выучить русский<br />\r\nТы будешь учить его, он тебя. Вы можете общаться по скайп у. Познакомившись, можете начать ездить друг другу в гости еще больше погружаясь в нужную языковую среду.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;фото разговора русского с американцем<br />\r\n<strong>7.</strong> Через музыку<br />\r\nЕсли ты меломан, найди тексты песен и их перевод. Пой, повторяй любимые песни и очень скоро наберешь необходимый словарный запас. Так же это хороший способ научиться понимать английскую речь на слух.<br />\r\n<strong>8.</strong> Купи интерактивные обучающие программы<br />\r\nИ занимайся каждый день минимум 1 час. Секрет успеха в изучении английского это постоянство. Занимайся каждый день и через 3 месяца уже сможешь общаться на английском.<br />\r\n<strong>9.</strong> Используй свое подсознание<br />\r\nНаше подсознание лучше запоминает если ты все прописываешь от руки. Также оно лучше запомнит если ты повторишь изученное за день перед сном. Также лучше запоминается информация, связанная с эмоциями. Поэтому ищи интересные для себя способы изучения английского. Как пример, я уже говорил про любимые фильмы и музыку.<br />\r\n<strong>10.</strong> Найди свое вдохновение<br />\r\nДостижение любой цели ускоряется в десятки раз, когда ты находишь мотивирующий тебя ответ Зачем тебе это нужно Представь, что ты знаешь английский. Какую работу ты сможешь найти и на сколько больше начнешь зарабатывать С кем сможешь познакомиться Что это тебе даст Подумай на этим. Особенно если тебе не хватает желания изучать английский. Вдохновение позволит тебе избавиться от лени, и нежелания зубрить английский.</p>\r\n'),(179,'<blockquote>\r\n<p><strong>В повседневной жизни мы так привыкли к стандарту разнообразий наших мыслей, если мы хотим что то изменить в своей работе, жизни или элементарно что то придумать, мы сразу же бросаем это дело. </strong></p>\r\n</blockquote>\r\n\r\n<p><strong>Потому что придумать что-то уникальное очень тяжело. Порой можно сидеть часами придумывая новые идеи или хотя бы возможности изменить что-то в своей повседневной жизни.</strong></p>\r\n\r\n<p>Но все таки есть уж люди у которых все получается. Они, как обычно, придумывают разные идеи одни да другими. Можно подумать что у них дар, но не стоит торопиться выводами. На самом деле есть несколько методов с помощью которых можно придумать самые различные, и уникальные идеи в любой сфере.&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong> фото человека с лампочкой над головой</strong><br />\r\nНачнем мы с простого с метода сложения. Это очень простой метод. Надо только сложить две вещи и смотреть что получится. Например: возьмем зебру и карандаш у нас получится полосатый карандаш.</p>\r\n\r\n<p><strong>1.</strong>Выйдите на пробежку, когда тело человека находится в движении. То легче придумать что-то новое.<br />\r\n<strong>2.</strong>Найдите свою среду обитания, то есть кто-то лучше думает в холоде, а кто-то на оборот. А вы попробуйте все.​​​​​​​<br />\r\n<strong>3</strong>.И по чаще смотрите в окно, за окном чаще всего найдется новое.</p>\r\n\r\n<p style=\"text-align: center;\"><br />\r\n<strong>Ну вот и все желаю удачи! Успехов вам!</strong></p>\r\n'),(180,'<p style=\"text-align: center;\"><strong>Вы никогда не задумывались над тем, в какой мере мы женщины склонны к самообману. Что руководит нами в подобных действиях? Неужели страх одиночества настолько силен?</strong></p>\r\n\r\n<p>Нас всегда и везде окружают мужчины, нам лестно их внимание. И ведь, чем больше мужчин, тем больше склонность к одиночеству. Вся проблема в том, что человек не может без социума. Особенно мы женщины ищем постоянства и защиты за плечом любимого.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; фото женщина за спиной мужчины</p>\r\n\r\n<p style=\"text-align: center;\"><strong>Что делать, если мы этого не получаем? Самообман? </strong></p>\r\n\r\n<p>Ненавидя себя за это и его за то, что мы покупаемся, продолжаем играть, будто ничего не происходит. Может вся наша жизнь сплошной самообман? И возможно ли от этого избавится? Или же удобнее продолжать игру, мило улыбаясь, показывать свою женскую слабость и кокетство?</p>\r\n\r\n<blockquote>\r\n<p>А одиночество - не так страшно, как описано? Я, читатели, не стремлюсь к переменам. И все продолжаю заниматься самообманом, пытаясь это использовать с умом. Наша сила в нашей слабости. Почему бы и не воспользоваться этим. Что же выберете вы?...</p>\r\n</blockquote>\r\n'),(181,'<blockquote>\r\n<p><strong>Знакомство в Интернете &ndash; это довольно распространенное явление в нашем современном мире. И ведь в таком знакомстве очень много положительного. </strong></p>\r\n</blockquote>\r\n\r\n<p>Например, люди, у которых довольно мало шансов встретиться в нашей жизни по каким &ndash; либо причинам свободно могут повстречать друг друга в этом неограниченном пространстве. И это должно радовать. Ведь теперь счастливых людей станет больше.</p>\r\n\r\n<p>Но, к сожалению, все это оказывается совершенно не так. И иногда такое знакомство в Интернете заставляет не столько радоваться, сколько грустить. И приносит такое &laquo;счастье&raquo; обычно больше горе и всевозможных неприятностей.</p>\r\n\r\n<p style=\"text-align: center;\"><strong>фото грустного человека за компьютером<br />\r\nПочему же так происходит? Почему знакомство в Интернете бывает таким сложным и непонятным?</strong></p>\r\n\r\n<p>Ответить однозначно на эти вопросы просто невозможно, но можно объяснить все это несколькими фактами. Например, тем, что не все знакомящиеся в интернете рассказывают всю правду о себе и вообще бывают честны.</p>\r\n\r\n<p><strong>1.</strong>Именно во всемирной паутине поселились те, кто ищет свою будущую жертву. Это могут быть и педофилы, и воры, и убийцы, и даже мошенники.​​​​​​​<br />\r\n<strong>2.</strong>Скучающие домохозяйки, молодые мамы, находящиеся в декретном отпуске, тоже неплохо проводят время в Интернете. Они знакомятся и развлекаются там с мужчинами в то время, пока их мужья зарабатывают деньги. И такое надувательство мужчин или кокетство также является преградой для тех, кто просто пытается познакомиться.</p>\r\n\r\n<p style=\"text-align: center;\"><strong>Поэтому всегда будьте осторожны и не доверяйте первому встречному.</strong></p>\r\n'),(182,'<blockquote>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><strong>Ты об этом не думала? Я вот задумалась&hellip; Любовь &ndash; это сказка для детей? Или для маленьких взрослых девочек? Для тех, кто еще не вырос&hellip;</strong></p>\r\n</blockquote>\r\n\r\n<hr />\r\n<hr />\r\n<p>&nbsp;</p>\r\n\r\n<p>А вырастаешь ты очень быстро, и уже научился ставить все доказанные теоремы мира под сомненье! И даже можешь опровергнуть, что земля круглая&hellip;так каково же черта мы так упорно верим в эту сказку под названием &laquo;Любовь&raquo;? Пора вырасти. Её нет! Как нет и принца на белом коне, и даже злой колдуньи нет. Ты это можешь понять? Разуй глаза!<br />\r\nЭто не любовь, это все иллюзия&hellip; фокус-покус для дурочек! Мне иногда кажется, что мы мазахистки. Как же &ndash; это состояния счастья, чувство окрыленности, когда ты &quot;пищищ &quot;от удовольствия в его объятьях, как ты бежишь навстречу, как засыпаешь и просыпаешься с мыслью о нем, как отдаешь всю себя, как забываешь все то, что было для тебя дорого до встречи с ним! С твоим принцем! А этот принц уже не смотрит на тебя с обожанием, больше не звонит тебе по несколько раз в день, и даже не пишет СМС! Эти самые обычные СМС! И ты терзаешься, мучаешься, винишь себя, потом его, а потом опять себя&hellip;И это замкнутый круг. Ты с ним даже говоришь: &laquo;Скажи, милый, что не так? Я же чувствую, тебя что-то беспокоит!&raquo; Классная! Ты очень внимательная! Можешь себя поздравить! Да все не так, ему скучно, ему все надоело! И вроде ты хорошая, но ему больше неинтересно!</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <strong>&nbsp; фото &nbsp; девушки с телефоном в руках</strong></p>\r\n\r\n<blockquote>\r\n<p><br />\r\n<strong>Так, скажи &mdash; это любовь? То к чему мы всегда так стремимся? Запомни милая &ndash; если ты себе не дашь крылья, их тебе никто не даст! Твое счастье не зависит от какого-то там &laquo;принца&raquo;. Мы куем счастье своими руками, и если ты не будешь счастлива сама с собой, то счастливой тебя никто не сделает! Ни кто и ни когда! Забудь! Получай удовольствие, играй, заманивай, дразни, бери все и не отдавай ничего! В конце концов если не ты, то тебя!</strong></p>\r\n</blockquote>\r\n\r\n<p><br />\r\nМожет, это будет для него больно, но какая разница? Главное - не тебе! Ты же помнишь это чувство, когда сердце вырывается из груди, когда всю ночь воешь в подушку, а с утра протираешь лицо льдом, чтобы спала припухлость, как бродишь по улицам в надежде встретить его случайно, как мерзнешь и куришь, куришь и мерзнешь, как улыбаешься знакомым и говоришь, что все в порядке! Все отлично в твоей гребаной жизни. А потом &mdash; ночь и тоска. И тебе так холодно, и хочется, чтобы тебя согрела его нежная и сильная рука.<br />\r\nТы мне только ответь на один вопрос &mdash; зачем? Зачем тебе все это? Ты глупая? Мазохистка? Идиотка? Или слепая? Почему мы не видим очевидных вещей? Ее нет! Любви нет! Забудь! И просто живи для себя! Люби себя! Ведь ни кто и никогда не полюбит тебя больше чем ты сама! Цени себя! Холь и лелей! Ты одна &ndash; уникальная, сексуальная и свободная! И ни от кого не зависишь!</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <strong>&nbsp; &nbsp; &nbsp; фото девушки</strong>&nbsp;</p>\r\n'),(183,'<blockquote>\r\n<p><strong>Каждый человек мечтает найти свою вторую половинку, но увы не каждому это удается... Мечты об идеальном спутнике жизни, романтических прогулках при луне и кротких поцелуях заставляют нас прибегать к помощи интернета.</strong></p>\r\n</blockquote>\r\n\r\n<p>В различных социальных сетях мы можем найти идеальную по внешности или предпочтениям половинку. Почему идеальную по внешности? Хм... Не стоит скрывать, что практически в 80% случаях знакомств в соц. сетях служит привлекательная внешность оппонента.</p>\r\n\r\n<p>Конечно, это может быть и так называемый &quot;фейк&quot;, а может и вполне реальный человек. Просматривая множество страниц в соц. сетях мы натыкаемся на самых разных людей и возможно некоторые привлекают наше внимание. Существует множество примеров знакомства в интернете, которые не редко заканчиваются свадебным маршем Мендельсона, но к сожалению есть и случаи горького расставания.</p>\r\n\r\n<p style=\"text-align: center;\"><br />\r\n<strong>Нечего плохого в таких знакомствах нет! Это совершенно нормально! Ведь как говорится &quot; В любви как на войне - все средства хороши!&quot;.</strong></p>\r\n\r\n<p>Но все есть и отрицательные стороны интернет знакомств. Мошенники! И не только! Насильники, маньяки, педофилы - и это далеко не весь список опасностей подобных знакомств. Конечно, все это кому-то может показаться большим преувеличение, но отнюдь нет, как бы мне хотелось чтобы это было лишь большой выдумкой. Обычно такие люди затевают знакомства очень даже радушно и мило, а потом начинают настаивать о встрече, где и происходит преступление.</p>\r\n\r\n<p>Чтобы обезопасить себя от такого рода посягательств следует соблюдать несколько не сложных предостережений:</p>\r\n\r\n<p><strong>1.</strong>Если вы познакомились с кем-то в интернете не стоит после недели общения сразу соглашаться на встречу. Лучше немного подождите и продолжите общения. Ведь кто умеет ждать, тот много добивается!</p>\r\n\r\n<p><strong>2.</strong>Если все-таки оппонент удовлетворяет ваши требования и вроде ни каких особых угроз по вашему мнению он не представляет, вы согласились на встречу, то лучше пойти туда не одному, а с близким другом или на худой конец со старшим братом или сестрой. Чтобы не произошло недопонимание, просто попросите вашего потенциального партнера тоже пригласить близкого друга. Уверена не желающий вам нечего плохого человек с радостью согласится!</p>\r\n\r\n<blockquote>\r\n<p>Не переживайте о том, что вдруг вам не удастся побыть наедине, ведь в любой момент вы просто сможете покинуть своих друзей и пойти в какое-нибудь другое кафе или ресторан. Кто знает, может эта встреча соединит сразу несколько пар сердец!..</p>\r\n</blockquote>\r\n\r\n<p><br />\r\nЯ считаю, что поиски любимого или любимой должна быть случайными и спонтанными, устраивая смотрины в соц. сетях мы часто не задумываемся о состоянии души человека. Может нам совершенно не понравиться его дальнейшее поведение, но не стоит исключать и удовлетворительного исхода общения...</p>\r\n\r\n<p style=\"text-align: center;\"><strong>Так что, дорогие читатели ищите свои вторые половинки!</strong></p>\r\n'),(184,'<blockquote>\r\n<p><strong>&laquo;На вкус и цвет все фломастеры разные&raquo;, - скажете вы. А я отвечу: &laquo;Несомненно, но всё-таки существуют такие черты, которые каждый мужчина хотел бы видеть в своей спутнице&raquo;.</strong></p>\r\n</blockquote>\r\n\r\n<p><strong>Было проведено несчётное множество различных опросов, на основе которых психологи и вывели &laquo;формулу идеальной девушки&raquo;. Давайте разбираться..</strong></p>\r\n\r\n<p><br />\r\nУвидев первый пункт, девушки недовольно вздохнут, но такова мужская психология. Итак, мужчины поставили на первое место внешние данные женщины. Да-да, <strong>&laquo;Внешность &ndash; не главное&raquo;</strong>, - говорили они, - &laquo;Смотри, какая страшная баба идёт&raquo;, - говорили они. Но представители мужского пола отметили именно ухоженность девушки, а не природную красоту. То есть мужчине будет важно то, что ты следишь за собой, а не то&nbsp;что у тебя от природы нет ног от ушей и груди третьего размера.</p>\r\n\r\n<p>На втором месте легендарный женский ум. Мужчины хотят видеть рядом интеллектуально развитую девушку и в то же время не хотят, чтобы женщина слишком много &laquo;умничала&raquo;. Следовательно, парням важна наша способность думать, но они хотят, чтобы мы это тщательно скрывали.</p>\r\n\r\n<p><br />\r\nТретье место в топе заняла верность. Именно так, мужчине важно, чтобы его любимая принадлежала только ему. Да, собственно, и сами женщины это хотят видеть и в мужчинах, не так ли?</p>\r\n\r\n<p>На четвёртом месте сексуальность. Это вовсе не значит, что мужчина хочет видеть вас круглосуточно в нижнем белье, вовсе нет. Он должен чувствовать к вам желание. Ему должно вас хотеться, а это возможно и тогда, когда вы в одетом виде.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; фото красивой фигуры девушки</p>\r\n\r\n<p>И последнее место заняла хозяйственность. Да, мужчине хочется, чтобы вы порадовали его вкусным борщом и постирали его рубашку, но согласно статистике, мужчине важнее, что вы &ndash; <strong>верная, любящая и настоящая девушка</strong>, ведь какое счастье со &laquo;стервозной бабой&raquo;, даже несмотря на её широкие познания в кулинарии?</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p style=\"text-align: center;\"><br />\r\n<strong><em>Таким образом, дорогие дамы, будьте собой. Будьте той, кем вы являетесь на самом деле, и ваша любовь вас найдёт!</em></strong></p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n'),(185,'<blockquote>\r\n<p>В современном мире, чтобы успешно существовать среди окружающих, выделяться из серой массы и уметь заинтересовать любого понравившегося человека, нужно быть умным. За ум отвечает мозг, поэтому его и нужно развивать, совершенствовать и заставлять работать на полную катушку.</p>\r\n</blockquote>\r\n\r\n<p style=\"text-align: center;\"><br />\r\n<strong>Итак, практические советы, или как улучшить работу мозга:</strong></p>\r\n\r\n<p><strong>1. Больше книг, меньше телевизора.</strong><br />\r\nПервое и самое основное правило: больше читайте. Книги развивают человека, вдохновляют, мотивируют и помогают стать умным. Именно книги, а не развлекательные передачи или комедийные фильмы. Однако книги должны быть полезными. Любовные романы, например, в эту категорию не вписываются. Зато энциклопедии, психология и философия помогут вам обрести свою точку зрения, научиться понимать людей и стать умней. Если совсем отказаться от телевизора кажется невозможным, старайтесь: во-первых, постепенно ограничивать время просмотра, с каждым разом уделять ящику всё меньше времени, во-вторых, смотреть лишь полезные и развивающие передачи.<br />\r\n<strong>2. Логически задачи.</strong><br />\r\nЗнания &ndash; это хорошо. Книги, люди, познавательные передачи и прочее помогут вам узнать много нового, но радоваться рано. Чтобы мозг работал, его нужно нагружать не только новой информацией, но и устраивать ему тренировки. Нестандартные или логические задачки, кроссворды или сканворды, шарады или ребусы, головоломки, а также многие другие вещи позволят тренировать свой мозг. Кроссворды, например, помогут закрепить те знания, что вы получили из книг, ведь от теории без практики мало толку.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; фото размышляющего человека<br />\r\n<strong>3. Оригинальность.</strong><br />\r\nРазвивайте свою оригинальность ежедневно, избегайте шаблонности и штампов. Во-первых, это значительно поможет мозгу и его работе, во-вторых, это всегда пригодится вам в жизни. Научитесь делать привычные вещи непривычными способами: например, если вы правша, попробуйте во время еды держать ложку или вилку в левой руке. Для вас это будет необычно и непривычно, но благодаря подобным мелким упражнениям, вы сами заметите, что стали меньше использовать шаблонные слова и творить шаблонные действия.<br />\r\n<strong>4. Память.</strong><br />\r\nЧтобы ваш мозг работал, вы обязаны развить свою память. То же чтение из 1-ого пункта вам неплохо поможет. Помимо чтения книг, учите стихотворения, используйте интересные методики для запоминания цифр, имён и лиц и развивайтесь. Настоятельно не рекомендуется пользоваться таблетками, препаратами и другими искусственными &laquo;помощниками&raquo;; они не только не помогут положительно повлиять на работу мозга, но могут и навредить.</p>\r\n\r\n<p style=\"text-align: center;\"><br />\r\n<strong>Всего эти 4 совета помогут вам значительно повысить свой интеллект с помощью саморазвития. Ваш мозг будет трудиться, развиваться и совершенствоваться, а вы будете пожинать прекрасные плоды его качественной работы</strong>.<br />\r\n&nbsp;</p>\r\n'),(186,'<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><strong>Гиперактивность, в основном, наблюдается у детей и подростков из-за эмоционального и неуравновешенного состояния. </strong></p>\r\n\r\n<p>Им не всегда удается справиться с таким состоянием самостоятельно. Связывают это явление с перенапряжением и нервной возбудимостью организма.</p>\r\n\r\n<p><strong>Гиперактивность</strong> &ndash; это повышенное эмоциональное состояние, которое вызвано нервно-психическим расстройством. Оно выходит за пределы полагающейся нормы.</p>\r\n\r\n<p><strong>Причины возникновения у детей говорят сами за себя, а именно:</strong></p>\r\n\r\n<ol>\r\n	<li>Недостаток внимания со стороны родителей.</li>\r\n	<li>Активность, превышающая норму.</li>\r\n	<li>Чрезмерная эмоциональность.</li>\r\n	<li>Импульсивность.</li>\r\n</ol>\r\n\r\n<blockquote>\r\n<p>Как бороться родителям с таким непоседливым малышом?</p>\r\n</blockquote>\r\n\r\n<p><strong>Ребенок уже на первых месяцах жизни, может проявлять гиперактивность:</strong></p>\r\n\r\n<ol>\r\n	<li>Плохо спать.</li>\r\n	<li>Много плакать.</li>\r\n	<li>Реагировать на любой звук, шум.</li>\r\n</ol>\r\n\r\n<p><strong>Детки, которые постарше:</strong></p>\r\n\r\n<ol>\r\n	<li>Неусидчивы.</li>\r\n	<li>Не сидят на одном месте.</li>\r\n	<li>Агрессивны.</li>\r\n	<li>Возбудимы.</li>\r\n	<li>Невнимательны.</li>\r\n</ol>\r\n\r\n<p><strong>Сложности могут возникнуть:</strong></p>\r\n\r\n<p>1)Когда вы поведете ребенка впервые в детский сад, ведь ему приходится вливаться в незнакомую обстановку. Для него, конечно же, это стресс.</p>\r\n\r\n<p>2)В школьный период гиперактивным детям приходится нелегко. Он может плохо усваивать информацию, вступать в конфликтные ситуации со сверстниками и учителями.</p>\r\n\r\n<blockquote>\r\n<p><strong>Большие ошибки совершают родители, испытывая трудности с гиперактивным ребенком. </strong></p>\r\n</blockquote>\r\n\r\n<p>Мера наказания должна быть не такой строгой и дисциплинированной. Детям с повышенной активностью и непоседливостью очень трудно соблюдать правила и рамки, которые устанавливают ему родители. Здесь поможет только терпеливый и мудрый подход в сложившейся ситуации, а лучше всего поход к специалисту, который поможет разобраться, в чем причина такого поведения у ребенка.</p>\r\n\r\n<p>Дети с ярко выраженной гиперактивностью чаще наблюдаются у невролога и психолога, для того чтобы избежать последствий. Гиперактивный ребенок подвержен в два раза больше различным травмам. Поэтому необходимо заранее позаботиться о его безопасности. Пик активности у детей начинается в два, три года, далее в восемь, десять лет.</p>\r\n\r\n<p style=\"text-align: center;\"><strong>фото ребенкка с разбитым коленом</strong></p>\r\n\r\n<p>По статистике, гиперактивность чаще всего выявляют у мальчиков. Причина тому, что они рождаются крупней, чем девочки, и мозг развивается у них гораздо позже.<br />\r\nДля того чтобы облегчить состояние ребенка, лучше всего давать лекарства, которые помогут успокоить детскую нервную систему и сосредоточиться на информации, исходящей от взрослых людей.</p>\r\n\r\n<p>Своевременная помощь малышу поможет сделать жизнь его спокойней. И это порадует самих родителей.</p>\r\n\r\n<p style=\"text-align: center;\"><strong>Правильный подход и терпение, в сложившейся ситуации, помогут справиться с гиперактивностью малыша. Важно дать ему понять, что его все равно любят, несмотря ни на что.&nbsp;</strong></p>\r\n\r\n<p style=\"text-align: center;\"><strong>фото любящей семьи</strong></p>\r\n'),(187,'<blockquote>\r\n<p><strong>Конечно же все родители хотят, чтобы их дети были здоровыми, умными и развитыми для своих лет.</strong></p>\r\n</blockquote>\r\n\r\n<p><strong>&nbsp;</strong>Часто это желание распространяется ещё дальше &ndash; и тогда мамы и папы всерьез начинают задумываться об опережающем развитии своего ребенка.</p>\r\n\r\n<p>Благо сегодня существует огромное количество авторских методик раннего развития детей (<span style=\"display: none;\">&nbsp;</span><u>Г. Домана, Н. Зайцева, С. Лупан</u><span style=\"display: none;\">&nbsp;</span>, система Никитиных и других), предлагающих игровое обучение чтению и счету, а также знакомство с цифрами чуть ли не годовалых детей.</p>\r\n\r\n<p class=\"content-editor-image-center\"><img alt=\"гиперактивный ребенок.jpg\" height=\"261\" src=\"/download_file/view_inline/8\" width=\"420\" /></p>\r\n\r\n<p>Безусловно, каждая из этих методик интересна и имеет положительные стороны: большинство детей действительно овладевают навыками чтения, счета и письма в возрасте 1-3 лет. Но так ли это нужно вашему ребенку? Ведь всему этому он сможет научиться в подготовительной к школе группе и школе, а драгоценное время безмятежного детства подменяется пусть и игровым, но всё же обучением.</p>\r\n\r\n<p>В то же время общение со сверстниками, становление которого происходит как раз в период 1-3 лет, и социализация ребенка отходят на второй план, а при поступлении в школу это выльется в весьма серьезные проблемы: ребенок может стать<strong> &laquo;изгоем&raquo; </strong>среди одноклассников, да и обучение в первом классе потеряет для него всю свою привлекательность из-за того, что он всему уже научился ранее.</p>\r\n\r\n<p style=\"text-align: center;\"><strong>фото скучающего школьника</strong></p>\r\n\r\n<p style=\"text-align: center;\"><strong>Так что, родители, выбор за вами &ndash; выбирать раннее обучение для своего ребенка или нет, но помните, что это очень серьезный и ответственный шаг, который может оказать влияние на дальнейшую жизнь вашего ребенка.</strong></p>\r\n'),(188,'<blockquote>\r\n<p><strong>&laquo;На вкус и цвет все фломастеры разные&raquo;, - скажете вы. А я отвечу: &laquo;Несомненно, но всё-таки существуют такие черты, которые каждый мужчина хотел бы видеть в своей спутнице&raquo;.</strong></p>\r\n</blockquote>\r\n\r\n<p style=\"text-align: center;\"><strong>Было проведено несчётное множество различных опросов, на основе которых психологи и вывели &laquo;формулу идеальной девушки&raquo;. Давайте разбираться..</strong></p>\r\n\r\n<p><br />\r\n<strong>1.</strong>Увидев первый пункт, девушки недовольно вздохнут, но такова мужская психология. Итак, мужчины поставили на первое место внешние данные женщины. Да-да, <strong>&laquo;Внешность &ndash; не главное&raquo;</strong>, - говорили они, - &laquo;Смотри, какая страшная баба идёт&raquo;, - говорили они. Но представители мужского пола отметили именно ухоженность девушки, а не природную красоту. То есть мужчине будет важно то, что ты следишь за собой, а не то&nbsp;что у тебя от природы нет ног от ушей и груди третьего размера.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; фото идеала девушки</strong></p>\r\n\r\n<p><strong>2.</strong>На втором месте легендарный женский ум. Мужчины хотят видеть рядом <strong>интеллектуально развитую</strong> девушку и в то же время не хотят, чтобы женщина слишком много &laquo;умничала&raquo;. Следовательно, парням важна наша способность думать, но они хотят, чтобы мы это тщательно скрывали.</p>\r\n\r\n<p><strong>3.</strong>Третье место в топе заняла верность. Именно так, мужчине важно, чтобы его любимая принадлежала только ему. Да, собственно, и сами женщины это хотят видеть и в мужчинах, не так ли?</p>\r\n\r\n<p><strong>4.</strong>На четвёртом месте сексуальность. Это вовсе не значит, что мужчина хочет видеть вас круглосуточно в нижнем белье, вовсе нет. Он должен чувствовать к вам желание. Ему должно вас хотеться, а это возможно и тогда, когда вы в одетом виде.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong> &nbsp; фото красивой фигуры девушки</strong></p>\r\n\r\n<p><strong>5.</strong>И последнее место заняла хозяйственность. Да, мужчине хочется, чтобы вы порадовали его вкусным борщом и постирали его рубашку, но согласно статистике, мужчине важнее, что вы &ndash; <strong>верная, любящая и настоящая девушка</strong>, ведь какое счастье со &laquo;стервозной бабой&raquo;, даже несмотря на её широкие познания в кулинарии?</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p style=\"text-align: center;\"><br />\r\n<strong><em>Таким образом, дорогие дамы, будьте собой. Будьте той, кем вы являетесь на самом деле, и ваша любовь вас найдёт!</em></strong></p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n'),(189,'<p>Купить мебель для детской комнаты довольно непросто. Дело даже не в том, что выбор шкафов и кроваток ограничен. В наше время в магазинах есть практически все, а остальное можно сделать на заказ.</p>\r\n\r\n<blockquote>\r\n<p><br />\r\n<br />\r\n<strong>Просто детская комната должна отражать внутренний мир вашего ребенка, соответствовать его интересам и развивать его способности.</strong></p>\r\n</blockquote>\r\n\r\n<p style=\"text-align: center;\"><br />\r\n<strong>Комната малыша должна быть яркой, чтобы ему захотелось исследовать ее, открывать шкафчики, заглядывать на полки с книгами и разными мелочами</strong></p>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; фото необычной детской комнаты</strong><br />\r\n<br />\r\n<strong>1.</strong>Кровать может быть с прекрасными подушками разных цветов, которыми можно биться как мечами и на которых так сладко засыпать.<br />\r\n<br />\r\n<strong>2.</strong>Компьютерный стол (для детей постарше) должен быть удобным не только для компьютерных игр, но и для выполнения домашних заданий. А у школьников очень много различных книг, тетрадок и других школьных принадлежностей.</p>\r\n\r\n<p><strong>3</strong>.Необходимо найти место и для разнообразных игр ребенка (куклы, машинки, железные дороги) Они не должны валяться по всей комнате.</p>\r\n\r\n<p><strong>4.</strong>Стены можно сделать разных цветов, но лучше слегка приглушенных тонов. Ведь ребенок не только играет и занимается в своей комнате, он в ней еще и спит. Перевозбуждение от ярких цветов может обернуться плохим сном для малыша.</p>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; фото ребенка,который не может заснуть</strong></p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><strong>Пусть детская комната для вашего ребенка станет не только миром, в котором он живет, но и окном в большой, взрослый мир</strong><br />\r\n<br />\r\n&nbsp;</p>\r\n'),(190,'<blockquote>\r\n<p><span class=\"word\">Когда</span> <span class=\"word\">в</span> <span class=\"word\">семье</span> <span class=\"word\">не</span> <span class=\"word\">один</span> <span class=\"word\">ребенок</span>, <span class=\"word\">то</span> <span class=\"word\">возникает</span> <span class=\"word\">проблема</span> <span class=\"word\">в</span> <span class=\"word\">их</span> <span class=\"word\">взаимопонимании</span> <span class=\"word\">между</span> <span class=\"word\">собой</span>. <span class=\"word\">Нет</span> <span class=\"word\">ничего</span> <span class=\"word\">ужасного</span> <span class=\"word\">в</span> <span class=\"word\">ссорах</span>.</p>\r\n</blockquote>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;фото конфликта 2 детей</strong><br />\r\n&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><strong><span class=\"word\">Часто</span> <span class=\"word\">дети</span> <span class=\"word\">и</span> <span class=\"word\">обзываются</span>, <span class=\"word\">и</span> <span class=\"word\">дерутся</span>.</strong></p>\r\n\r\n<p><span class=\"word\"><strong>1.</strong>Правильным</span> <span class=\"word\">решением</span> <span class=\"word\">будет</span> <span class=\"word\">не</span> <span class=\"word\">вмешиваться</span> <span class=\"word\">в</span> <span class=\"word\">конфликты</span> <span class=\"word\">детей</span> <span class=\"word\">до</span> <span class=\"word\">поры</span> <span class=\"word\">до</span> <span class=\"word\">времени</span>, <span class=\"word\">они</span> <span class=\"word\">способны</span> <span class=\"word\">сами</span> <span class=\"word\">разобраться</span> <span class=\"word\">в</span> <span class=\"word\">своих</span> <span class=\"word\">проблемах</span>.</p>\r\n\r\n<p><strong>2.</strong><span class=\"word\">Нельзя</span> <span class=\"word\">оставаться</span> <span class=\"word\">в</span> <span class=\"word\">стороне</span>, <span class=\"word\">когда</span> <span class=\"word\">драки</span> <span class=\"word\">уже</span> <span class=\"word\">переходят</span> <span class=\"word\">ту</span> <span class=\"word\">грань</span>, <span class=\"word\">что</span> <span class=\"word\">становятся</span> <span class=\"word\">опасными</span>, <span class=\"word\">тут</span> <span class=\"word\">стоит</span> <span class=\"word\">вмешаться</span> <span class=\"word\">и</span> <span class=\"word\">развести</span> <span class=\"word\">их</span> <span class=\"word\">в</span> <span class=\"word\">разные</span> <span class=\"word\">стороны</span>, <span class=\"word\">попробовать</span> <span class=\"word\">отвлечь</span> <span class=\"word\">на</span> <span class=\"word\">время</span> <span class=\"word\">друг</span> <span class=\"word\">от</span> <span class=\"word\">друга</span>.</p>\r\n\r\n<p><br />\r\n<span class=\"word\">Чаще</span> <span class=\"word\">всего</span> <span class=\"word\">наказывают</span> <span class=\"word\">старших</span> <span class=\"word\">детей</span>, <span class=\"word\">но</span> <span class=\"word\">не</span> <span class=\"word\">стоит</span> <span class=\"word\">забывать</span>, <span class=\"word\">что</span> <span class=\"word\">в</span> <span class=\"word\">ссоре</span> <span class=\"word\">участвовали</span> <span class=\"word\">оба</span>. <span class=\"word\">Для</span> <span class=\"word\">старшего</span> <span class=\"word\">ребенка</span> <span class=\"word\">складывается</span> <span class=\"word\">впечатление</span>, <span class=\"word\">что</span> <span class=\"word\">он</span> <span class=\"word\">всегда</span> <span class=\"word\">должен</span> <span class=\"word\">уступать</span>, <span class=\"word\">делиться</span> <span class=\"word\">с</span> <span class=\"word\">младшим</span>, <span class=\"word\">присматривать</span> <span class=\"word\">и</span> <span class=\"word\">помогать</span> <span class=\"word\">ему</span>. <span class=\"word\">Но</span> <span class=\"word\">он</span> <span class=\"word\">личность</span>, <span class=\"word\">у</span> <span class=\"word\">него</span> <span class=\"word\">свои</span> <span class=\"word\">интересы</span>, <span class=\"word\">занятия</span>, <span class=\"word\">не</span> <span class=\"word\">взваливайте</span> <span class=\"word\">на</span> <span class=\"word\">его</span> <span class=\"word\">плечи</span> <span class=\"word\">обязанности</span> <span class=\"word\">няньки</span>, <span class=\"word\">этим</span> <span class=\"word\">вы</span> <span class=\"word\">только</span> <span class=\"word\">вредите</span> <span class=\"word\">отношениям</span> <span class=\"word\">между</span> <span class=\"word\">детьми</span>.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<strong>фото наказанного ребенка</strong></p>\r\n\r\n<p><br />\r\n<span class=\"word\">В</span> <span class=\"word\">детском</span> <span class=\"word\">возрасте</span> <span class=\"word\">у</span> <span class=\"word\">них</span> <span class=\"word\">много</span> <span class=\"word\">общего</span> <span class=\"word\">между</span> <span class=\"word\">собой</span>, <span class=\"word\">они</span> <span class=\"word\">вместе</span> <span class=\"word\">играют</span>, <span class=\"word\">едят</span>, <span class=\"word\">ездят</span> <span class=\"word\">в</span> <span class=\"word\">гости</span>, <span class=\"word\">по</span> <span class=\"word\">сути</span>, <span class=\"word\">являются</span> <span class=\"word\">лучшими</span> <span class=\"word\">друзьями</span> <span class=\"word\">друг</span> <span class=\"word\">другу</span>. <span class=\"word\">И</span> <span class=\"word\">здесь</span> <span class=\"word\">родителям</span> <span class=\"word\">нужно</span> <span class=\"word\">быть</span> <span class=\"word\">аккуратными</span>, <span class=\"word\">уделять</span> <span class=\"word\">равное</span> <span class=\"word\">внимание</span> <span class=\"word\">и</span> <span class=\"word\">любовь</span>.</p>\r\n\r\n<p><span class=\"word\"><strong>1.</strong>Если</span> <span class=\"word\">покупаете</span> <span class=\"word\">игрушку</span>, <span class=\"word\">то</span> <span class=\"word\">двоим</span>.</p>\r\n\r\n<p><span class=\"word\"><strong>2.</strong>Не</span> <span class=\"word\">допустите</span> <span class=\"word\">ревности</span> <span class=\"word\">между</span> <span class=\"word\">ними</span>, <span class=\"word\">от</span> <span class=\"word\">этого</span> <span class=\"word\">скапливаются</span> <span class=\"word\">обиды</span> <span class=\"word\">и</span> <span class=\"word\">злость</span> <span class=\"word\">на</span> <span class=\"word\">того</span> <span class=\"word\">ребенка</span>, <span class=\"word\">который</span>, <span class=\"word\">по</span> <span class=\"word\">их</span> <span class=\"word\">мнению</span>, <span class=\"word\">получает</span> <span class=\"word\">больше</span> <span class=\"word\">заботы</span>. <span class=\"word\">Это</span> <span class=\"word\">не</span> <span class=\"word\">касается</span> <span class=\"word\">одежды</span>.</p>\r\n\r\n<p><span class=\"word\"><strong>3.</strong>Приучайте</span> <span class=\"word\">детей</span> <span class=\"word\">с</span> <span class=\"word\">малого</span> <span class=\"word\">возраста</span> <span class=\"word\">быть</span> <span class=\"word\">объективными</span>, <span class=\"word\">в</span> <span class=\"word\">каждой</span> <span class=\"word\">семье</span> <span class=\"word\">разное</span> <span class=\"word\">материальное</span> <span class=\"word\">положение</span>. <span class=\"word\">Бывают</span> <span class=\"word\">ситуации</span>, <span class=\"word\">когда</span> <span class=\"word\">есть</span> <span class=\"word\">деньги</span> <span class=\"word\">купить</span> <span class=\"word\">только</span> <span class=\"word\">одну</span> <span class=\"word\">вещь</span> <span class=\"word\">в</span> <span class=\"word\">этом</span> <span class=\"word\">месяце</span>, <span class=\"word\">ребенок</span> <span class=\"word\">должен</span> <span class=\"word\">понимать</span> <span class=\"word\">это</span> <span class=\"word\">и</span> <span class=\"word\">не</span> <span class=\"word\">обижаться</span>, <span class=\"word\">если</span> <span class=\"word\">придется</span> <span class=\"word\">немного</span> <span class=\"word\">подождать</span>.</p>\r\n\r\n<blockquote>\r\n<p><br />\r\n<span class=\"word\">Если</span> <span class=\"word\">старшая</span> <span class=\"word\">в</span> <span class=\"word\">семье</span> <span class=\"word\">девочка</span>, <span class=\"word\">она</span> <span class=\"word\">обычно</span> <span class=\"word\">с</span> <span class=\"word\">радостью</span> <span class=\"word\">помогает</span> <span class=\"word\">матери</span> <span class=\"word\">с</span> <span class=\"word\">младшим</span> <span class=\"word\">ребенком</span>. <span class=\"word\">Для</span> <span class=\"word\">нее</span> <span class=\"word\">это</span> <span class=\"word\">своеобразная</span> <span class=\"word\">игра</span>, <span class=\"word\">развивающая</span> <span class=\"word\">женское</span> <span class=\"word\">начало</span>. <span class=\"word\">А</span> <span class=\"word\">вам</span> <span class=\"word\">становится</span> <span class=\"word\">хорошей</span> <span class=\"word\">помощницей</span>.</p>\r\n</blockquote>\r\n\r\n<p><br />\r\n<span class=\"word\">При</span> <span class=\"word\">вступлении</span> <span class=\"word\">в</span> <span class=\"word\">подростковый</span> <span class=\"word\">возраст</span>, <span class=\"word\">братья</span> <span class=\"word\">и</span> <span class=\"word\">сестры</span> <span class=\"word\">отдаляются</span> <span class=\"word\">друг</span> <span class=\"word\">от</span> <span class=\"word\">друга</span>, <span class=\"word\">предпочитая</span> <span class=\"word\">общение</span> <span class=\"word\">со</span> <span class=\"word\">своими</span> <span class=\"word\">сверстниками</span><strong>. <span class=\"word\">Интересуйтесь</span> <span class=\"word\">жизнью</span> <span class=\"word\">и</span> <span class=\"word\">проблемами</span> <span class=\"word\">вашего</span> <span class=\"word\">ребенка</span> </strong><span class=\"word\">за</span> <span class=\"word\">пределами</span> <span class=\"word\">дома</span>, <span class=\"word\">чтобы</span> <span class=\"word\">не</span> <span class=\"word\">потерять</span> <span class=\"word\">ту</span> <span class=\"word\">нить</span>, <span class=\"word\">которая</span> <span class=\"word\">связывает</span> <span class=\"word\">вас</span> <span class=\"word\">и</span> <span class=\"word\">оградить</span> <span class=\"word\">его</span> <span class=\"word\">от</span> <span class=\"word\">необдуманных</span> <span class=\"word\">поступков</span>.</p>\r\n\r\n<p style=\"text-align: center;\"><br />\r\n<strong><span class=\"word\">Сколько</span> <span class=\"word\">бы</span> <span class=\"word\">детей</span> <span class=\"word\">ни</span> <span class=\"word\">было</span> <span class=\"word\">в</span> <span class=\"word\">семье</span>, <span class=\"word\">ваша</span> <span class=\"word\">задача</span> <span class=\"word\">сохранить</span> <span class=\"word\">между</span> <span class=\"word\">всеми</span> <span class=\"word\">хорошие</span>, <span class=\"word\">крепкие</span> <span class=\"word\">отношения</span>. <span class=\"word\">Чтобы</span> <span class=\"word\">ребята</span> <span class=\"word\">выручали</span> <span class=\"word\">друг</span> <span class=\"word\">друга</span> <span class=\"word\">и</span> <span class=\"word\">пронесли</span> <span class=\"word\">свою</span> <span class=\"word\">любовь</span> <span class=\"word\">на</span> <span class=\"word\">долгие</span> <span class=\"word\">годы</span> <span class=\"word\">длиною</span> <span class=\"word\">в</span> <span class=\"word\">жизнь</span>.</strong></p>\r\n'),(191,'<blockquote>\r\n<p style=\"text-align: center;\"><strong>Всем, кто занимается воспитанием детей, приходится прибегать довольно часто к запретам.</strong></p>\r\n</blockquote>\r\n\r\n<p style=\"text-align: center;\"><strong>Известно, что подрастающее поколение реагирует на запреты по-разному: если один ребенок молча прекратит запрещенное мероприятие, то другой закатит настоящую истерику.</strong></p>\r\n\r\n<p><br />\r\nА если воспитанник подросток, то тут и вовсе жди серьезного протеста &ndash; либо скрытого (который постепенно вырвется наружу в самый неожиданный момент) или же явного и последствия его не будут такими безобидными, как у младших детей.<br />\r\nНу и что же делать &ndash; запрещать-то все равно приходится. Тут, как говорится, подход будет индивидуальным.</p>\r\n\r\n<p>В каждой семье приняты свои нормы поведения, методы воспитания могут быть отличными у каждого родителя.<br />\r\n<strong>1.</strong>Но есть общепринятые нормы поведения в обществе, уголовный кодекс, наконец, и вот здесь как раз все понятно &ndash; нельзя, значит нельзя.<strong> Главное доступно и понятно объяснить ребенку почему нельзя и какие последствия может повлечь за собой нарушение запрета.</strong><br />\r\n<strong>2.</strong>А вот во всем, что касается личного пространства семьи и ребенка, немного все по-другому. Некоторые родители придерживаются принципа: &laquo;запрещено все, что не разрешено&raquo;. Дети от них только и слышат: то нельзя и это нельзя.</p>\r\n\r\n<hr />\r\n<p style=\"text-align: center;\"><br />\r\n<strong>&laquo;Можно мне погулять?&raquo; - &laquo;Нет!&raquo;. &laquo;Могу я взять конфету?&raquo; - &laquo;Нельзя!&raquo;. &laquo;Можно пригласить Мишу в гости?&raquo; - &laquo;Нет!&raquo; И так на все вопросы, без объяснения причин. Что же в итоге?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong> &nbsp; &nbsp; &nbsp;фото конфликта ребенка и родителей</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><strong>Пока маленький, ребенок будет подчиняться родителям, а куда деваться-то? </strong></p>\r\n\r\n<p>Но по мере взросления постоянные запреты уже будут вызывать протест.<br />\r\nДети начинают нарушать их, сначала скрывая это от родителей, а потом, в подростковом периоде, уже в открытую, демонстративно: &laquo;Я уже вырос, могу делать что захочу! Ваше мнение мне безразлично!&raquo; И вот начинается конфликт поколений, который может иметь весьма печальные последствия.<br />\r\nТак что же делать, ведь нельзя же в самом деле все позволять? Конечно, нельзя. Но запреты должны быть как можно более редкими и иметь серьезные причины, такие, чтобы можно было объяснить ребенку.</p>\r\n\r\n<p style=\"text-align: center;\"><br />\r\n<strong>Объяснять нужно обязательно, потому что голый запрет воспринимается как ваш личный каприз и вызывает обиду</strong>.</p>\r\n\r\n<p><strong>1.</strong>&laquo;Мам, можно я залезу на дерево?&raquo; - &laquo;Попробуй, а я тебя подстрахую&raquo;. Так вы сможете проконтролировать ситуацию. А если вы сейчас запретите ему этот эксперимент, то ребенок все равно полезет на это дерево, но уже когда вас не будет рядом и тогда он может серьезно пострадать.Когда малыш попробует и поймет, что это сложно и опасно, вот тогда и объясните ему, почему не стоит одному, без взрослого повторять этот трюк.<br />\r\n<strong>2.</strong>Или такая ситуация. Ребенок спрашивает, можно ли ему пригласить на День рождения весь класс. Конечно, разместить в однокомнатной квартире двадцать отпрысков не просто, да и накормить их и развлечь влетит вам в копеечку, но если вы сразу скажете &laquo;нет&raquo;, ребенок почувствует себя обиженным и еще долго будет считать, что вы поступили несправедливо.Лучше ответить &laquo;да&raquo;, а потом вместе с ребенком попытаться разобраться, что из этого получится. Когда он сам дойдет до мысли, что ничего хорошего выйти не может, получится, что вы ничего не запрещали, ребенок сам решил пригласить не весь класс, а нескольких друзей. Конфликта удалось избежать.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; фото помощи родителя ребенку</strong></p>\r\n\r\n<blockquote>\r\n<p><br />\r\n<strong>Однозначный запрет нужно накладывать на поступки, которые могут угрожать жизни и здоровью ребенка или окружающих. Тут необходимо твердое &laquo;нет&raquo;, раз и навсегда. И ни при каких обстоятельствах нельзя менять свое решение, так как непоследовательность в поступках взрослого серьезно подрывает его авторитет.</strong></p>\r\n</blockquote>\r\n'),(192,'<blockquote>\r\n<p style=\"text-align: center;\"><strong>Воспитание ребенка в основном ложится на родителей. В большей степени первоначальным воспитанием ребенка занимается мать. Потому что только мать в состоянии уделять ребенку наибольшую часть времени и может отдать ему всю свою нежность, заботу и ласку.</strong></p>\r\n</blockquote>\r\n\r\n<p><br />\r\nНо стоит также помнить, что прекрасное воспитание зависит от семьи, в которой живет ребенок. Такой семьей может считаться та, где царит не только любовь друг к другу, но и любовь и уважение к другим людям.</p>\r\n\r\n<p style=\"text-align: center;\"><br />\r\n<strong>Воспитание единственного ребенка.&nbsp;</strong></p>\r\n\r\n<p><br />\r\nОбычно, в семье, где один ребенок, родители уделяют ему слишком много внимания. Основной причиной этого считается неопытность. Важно знать, что ребенок самостоятельно должен выработать в себе человека, нужно только не мешать ему в этом, а посодействовать.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <strong>&nbsp; фото ребенка-царя</strong></p>\r\n\r\n<p><br />\r\nНельзя воспитывать ребенка в тепличных условиях, постоянно холить и лелеять, баловать и нежить - это может привести к помехам в психологическом развитии ребенка - оно замедляется. А также он вырастит избалованным, несамостоятельным и неуверенным в себе человеком.</p>\r\n\r\n<p>И когда ребенок пойдет в детский сад, то ожидая от окружающих такого же внимания, к какому он привык дома и не получая его, он может столкнуться с трудностями, что может привести к разочарованию. А также он начнет замыкаться в себе и уединяться, чтобы не находиться в обществе других детей, так как он не привык делиться игрушками, а привык к пристальному вниманию со стороны взрослых, что все ему и все для него.</p>\r\n\r\n<p><br />\r\n<strong>И чтобы в дальнейшем такого не произошло, следует учесть то, что ребенок тоже человек, хоть пока еще и маленький, и у него должна быть свобода.&nbsp;</strong></p>\r\n\r\n<p><strong>1.</strong> У него должно быть детство, а в детстве имеет место беготня во дворе с друзьями и испачканные, рваные штаны.</p>\r\n\r\n<p><strong>2.</strong>Не надо делать из него образцового ребенка.<br />\r\n<strong>3.</strong>Весь смысл воспитания ребенка состоит в том, чтобы научить его самостоятельности. <strong>4.</strong>Родители должны относиться к нему с первых дней жизни как к взрослому человеку и должны помнить, что ребенок - это тоже личность.</p>\r\n'),(193,'<blockquote>\r\n<p style=\"text-align: center;\"><strong>Канадские ученые из Монреальского университета определили, что дети, которых с детства воспитывают самостоятельными, имеют более высокие умственные и когнитивные навыки.</strong></p>\r\n</blockquote>\r\n\r\n<p><br />\r\nВ рамках исследования ученые наблюдали за 78 детьми в возрасте от трех лет, которые играли в настольные игры, и их родителями. По мнению исследователей, именно такой способ игры позволяет:</p>\r\n\r\n<p>1. максимально оценить интеллектуальные возможности детей</p>\r\n\r\n<p>2.умение самостоятельно планировать и организовывать определенные процессы.</p>\r\n\r\n<p>3.выполнять несколько действий одновременно.<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <strong>&nbsp; &nbsp; &nbsp; фото игры детей в настольные игры</strong><br />\r\n<strong>Результаты показали, что те дети, чьи родители воспитывают детей самостоятельными и независимыми, показали лучшие результаты, чем те , чьи родители излишне оберегают и ограничивают детей. </strong></p>\r\n'),(194,'<p><strong>Дети - цветы жизни! С рождения они приносят в мир взрослого радость и счастье! Чего стоит только одна улыбка малыша, от которой жизнь становится яркой, осмысленной, наполненной положительными эмоциями!</strong></p>\r\n\r\n<blockquote>\r\n<p><strong>Когда женщина узнает, что ожидает малыша, она испытывает невероятные чувства и эмоции. Это может быть удивление, неожиданность или, наоборот, долгожданное чудо, радость от ощущения нового состояния.</strong></p>\r\n</blockquote>\r\n\r\n<p>Порой материнство кардинально изменяет жизнь: новые заботы, обязанности, а какая доля ответственности за физиологическое и психологическое здоровье малыша ложится на плечи новоиспеченных родителей?! Первый вздох, плач, смех, слово, первые шаги - все это производит неизгладимое впечатление на людей, подаривших жизнь своему чаду.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Познавая новый мир, дети учатся:</strong></p>\r\n\r\n<p><strong>1.</strong>общению со своими сверстниками</p>\r\n\r\n<p><strong>2</strong>. у них возникают привязанности, эмоциональные связи</p>\r\n\r\n<p><strong>3.</strong>выстраиваются определенные взаимоотношения, взаимодействия, столь необходимые для их социального развития.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong> фото ступений развития ребенка</strong></p>\r\n\r\n<p style=\"text-align: center;\"><strong>Наверное, каждый взрослый замечал, что человек не может жить в одиночестве, без общения.</strong></p>\r\n\r\n<p>Для нормального, полноценного развития человеку необходимы социальные контакты. Каждый из нас проходит через такие социальные институты как семья, детский сад, школа, средне или высшее профессиональное образование, различные объединения (по интересам, увлечениям, хобби), организации, религиозные институты (церкви, мечети или синагоги).</p>\r\n\r\n<p>Отсутствие важных социальных институтов оказывает огромное влияние на формирование личности. В этом случае, важно помнить, что ребенок познает, осваивает новый, сложный для него мир и учится выстраивать взаимоотношения самостоятельно.</p>\r\n\r\n<p>Поэтому, взрослым<strong> важно позитивно&nbsp;оценивать личность ребенка,</strong> тактично и аргументировано указывать на недостатки, терпеливо и умело поддерживать, хвалить за старание и инициативность. Ни в коем случае ребенка нельзя наказывать и запрещать.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong> &nbsp;фото ребенка в окружающем мире</strong></p>\r\n\r\n<p style=\"text-align: center;\"><strong>Помните такое выражение &ndash; запретный плод сладок?</strong></p>\r\n\r\n<p><strong>&nbsp;</strong>Так и ребенок в этом возрасте может совершать действия, которые противоречат словам взрослым. Необходимо предоставить ребенку возможность быть взрослым в бытовых ситуациях (самому завязать шнурки, почистить зубы, выбрать, что ему съесть на завтрак овсянку или яичницу с колбасой, играть дома или на детской площадке). Тем не менее ребенок должен придерживаться режима (во сколько подъем, завтрак, прогулка, сон).</p>\r\n\r\n<hr />\r\n<p style=\"text-align: center;\"><br />\r\n<strong>Уважаемые родители, учитывайте возрастные особенности своего ребенка, будьте терпимее к его капризам, создайте для него благоприятную атмосферу, наполненную жизнерадостностью и оптимизмом, тогда процесс адаптации ребенка к детскому саду пройдет легко и быстро! </strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n'),(195,'<blockquote>\r\n<p><strong>Тело человека может очень многое о нем рассказать, даже больше чем ему (человеку) хотелось бы. По определенному положению тела можно увидеть например, чего мы боимся или о чем думаем.</strong></p>\r\n</blockquote>\r\n\r\n<p>Сейчас очень много фирм при приеме человека на работу, имеют в своем штате сотрудников умеющих понимать язык тела. Они очень точно распознают, что значит та или иная поза человека, пришедшего устраиваться к ним на фирму.<br />\r\nДовольно часто мы ощущаем в себе какую-то скованность и неудобство в самых важных для нас ситуациях.</p>\r\n\r\n<p>И тут возникает вопрос, а возможно ли как-то поменять состояние неловкости и показать собеседнику, что вы уверенны в себе. Достаточно разучить ряд жестов и немного изменить манеру поведения, и вы сможете расположить к себе любого человека, а также убедить его в том, что вы уверенны в себе.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><strong>Так как же нужно вести себя, чтобы всем было приятно видеть вас?</strong></p>\r\n\r\n<p><br />\r\n<strong>1.</strong>Будьте улыбчивы.Если все видят что вы улыбаетесь, то значит вы все довольны и счастливы, ну и конечно уверены в себе. Улыбка значит, что вы ничего не боитесь чувствовать себя уверенно. Тогда у всех окружающих вы будете вызывать только симпатию.</p>\r\n\r\n<p><br />\r\n<strong>2.</strong>Ходите с расправленными плечами.<br />\r\nХодите прямо и не тащите ноги. Нужно расправить плечи и держать спину ровно, чтобы все люди видели, что от вас исходит сила, а сильный человек всегда производит приятное впечатление на окружающих. Не семените, шагайте шире и не оглядывайтесь по сторонам.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <strong>&nbsp; &nbsp;фото красивой походки</strong><br />\r\n<strong>3.</strong>Не прячьте глаза.<br />\r\nЕсли вы уверены в себе, то вам нечего скрывать от окружающих. Уверенный в себе человек не опускает глаза при разговоре, а спокойно смотрит собеседнику в глаза, не отводя взгляд. При разговоре это очень важно, когда вы смотрите собеседнику в глаза, то он видит, что вы ничего от него не скрываете и честны с ним. Не держите руки в карманах и не прячьте за спиной. Это может создать впечатление, что вы что-то скрываете. Держите руки в спокойном положении. Сидя, можно положить их на стол или на колени.</p>\r\n\r\n<p><strong>4.</strong>Будьте всегда опрятны.<br />\r\nВнешний вид играет очень важную роль. Неряшливый, с дурным запахом и с непричесанными волосами человек, приятное впечатление на окружающих точно не произведет. И в себе уверен он от этого тоже не будет. Надо быть опрятным и хорошо выглядеть всегда, а не только перед каким-то мероприятием или встречей.<br />\r\nВсегда будьте спокойны.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <strong>фото человека идущего в офис</strong></p>\r\n\r\n<blockquote>\r\n<p><br />\r\n<strong>Большинство людей во время серьезного разговора, начинают активно жестикулировать. Такое поведение, как правило, снимает чувство страха и обеспокоенность. Но вашему собеседнику все эти жестикуляции будут неприятны. Также это показывает вашу нервозность. И люди вокруг вас тоже становятся нервными</strong>.</p>\r\n</blockquote>\r\n\r\n<p><strong>Все таки лучше взять себя в руки и успокоиться.</strong><br />\r\n<strong>1.</strong>Не&nbsp;нужно скрещивать руки.Такой жест как скрещенные руки, истолковывается как защитный жест. Своим видом вы показываете окружающим, что разговор вам неприятен и общаться вы не хотите. Этим вы вызовете антипатию у знакомых или коллег по работе. Скрещенные руки &ndash; самая неудачная поза во время разговора.</p>\r\n\r\n<p><strong>2.</strong>Держите руки спокойно.<br />\r\nВо время разговора большинство людей начинает сжимать руки в кулак, скрещивать пальцы, приглаживать волосы, крутить в руках какую-нибудь вещь. Такая жестикуляция показывает, что вы неуверенны в себе. Нужно успокоиться и не делать лишних телодвижений.</p>\r\n\r\n<p style=\"text-align: center;\"><strong>Всем понравиться вы не сможете, но в некоторых случаях благоприятное впечатление на окружающих вы произведете. Независимо от того где вы находитесь &ndash; на деловой встрече или на свидании, позитивный настрой и уверенность в себе обязательно помогут вам решить исход дела (разговора) положительно.</strong></p>\r\n'),(196,'<blockquote>\r\n<p>Заканчивая школу, многие ребята задумываются о том, какую же форму обучения предпочесть: дневную или заочную форму. Несомненно, чтобы они не выбрали для себя, цель у них одна &ndash; получить диплом, но процессы и принципы обучения у этих форм существенно отличаются.</p>\r\n</blockquote>\r\n\r\n<p style=\"text-align: center;\"><br />\r\n<br />\r\n<strong>Рассмотрим плюсы и минусы каждой из этих форм обучения.&nbsp;</strong></p>\r\n\r\n<p><br />\r\n<strong>1.</strong>Заочную форму обучения многие выбирают, исходя из следующих положительных моментов:<br />\r\n<strong>- </strong>в первую очередь, это конечно, возможность совмещать работу и учебу, ведь посещать занятия нужно лишь раз в полгода;<br />\r\n<strong>-</strong> стоимость обучения заочно, зачастую значительно ниже, а это хорошая экономия средств;<br />\r\n<strong>-</strong> студент заочник, как правило, самостоятельно изучает нужные для учебы источники, а значит, он может это делать в удобное для него время;<br />\r\nпреподаватели также довольно благосклонны к заочникам, прекрасно понимая их занятость.&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><br />\r\n<strong>Но при всех достоинствах заочной формы у нее есть и существенные минусы&nbsp;</strong></p>\r\n\r\n<p><strong>1.)</strong> это достаточно невысокое качество образования, так как программы заочного обучения преподаются в сокращенной форме.</p>\r\n\r\n<p><strong>2.)</strong>Студенты мало общаются с преподавателями вне занятий, не участвуют в студенческих научных проектах, экспедициях.</p>\r\n\r\n<p><strong>3.)</strong>Практика по специальности часто носит формальный характер.</p>\r\n\r\n<p><strong>4.)</strong>Да и качественно изучить гору специальной учебной литературы самостоятельно, у работающего студента не всегда получается.</p>\r\n\r\n<p><strong>5.)</strong>Работа после школы, когда нет специальности, редко бывает высоко оплачиваемой.</p>\r\n\r\n<p>&nbsp; &nbsp;<strong> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;фото совмещение учебы и работы</strong></p>\r\n\r\n<p><br />\r\n<strong>2.</strong>Теперь перейдем к дневной форме обучения и обозначим явные плюсы:<br />\r\n<strong>-</strong> конечно же, главным плюсом будет получение полноценных теоретических знаний, а учебные программы по специальным предметам носят углубленный характер;<br />\r\n<strong>-</strong> участие в семинарах, практических работах, экспедициях, молодежных слетах, студенческих олимпиадах дает большой опыт общественной работы и отлично закрепляет полученные знания;<br />\r\n<strong>- </strong>получение образование очно, считается более престижным, и работодатели предпочитают брать на работу выпускников, которые учились на дневной форме;<br />\r\n<strong>-</strong> полноценная студенческая жизнь, в полной мере, ощущается при дневном обучении, воспоминания об этих веселых годах остаются на всю жизнь.</p>\r\n\r\n<p style=\"text-align: center;\"><br />\r\n<strong>К недостаткам этой формы обучения относят&nbsp;</strong></p>\r\n\r\n<p><strong>1.) </strong>в первую очередь, довольно высокую плату</p>\r\n\r\n<p><strong>2.)</strong>проходной балл также значительно выше</p>\r\n\r\n<p><strong>3.)</strong>прохождение практик и стажировок не дают большого опыта, так как времени на них учебный план отводит немного.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;фото счастливого студента</strong></p>\r\n\r\n<p style=\"text-align: center;\"><br />\r\n<strong>Несомненно, одно &ndash; для получения действительно качественного образования, нужно иметь большое желание учиться. А что выбрать, каждый студент решает сам, в зависимости от своих финансовых возможностей, семейного положения и личных предпочтений.</strong></p>\r\n'),(197,'<p style=\"text-align: center;\"><strong>&nbsp;Основные факторы выбора профессии:</strong></p>\r\n\r\n<p><br />\r\n<strong>1.</strong>Профессиональная заинтересованность (зависит от увлечений и склонностей к определенным видам деятельности)</p>\r\n\r\n<p><strong>2</strong>.Умения (чаще всего бывает сложно определить свое истинное призвание для успешности в карьере)</p>\r\n\r\n<p><strong>3.</strong>Активность (высокая или низкая), степень подготовленности (успеваемость в школе)<br />\r\n<strong>4</strong>.Осведомление о видах профессий</p>\r\n\r\n<p><strong>5.</strong>Социальная и семейная среда и многое другое.</p>\r\n\r\n<hr />\r\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; фото разных профессий</strong></p>\r\n\r\n<p><br />\r\n<strong>Отсюда следует, что для удачной гармонизации всех трудных и разноречивых личностных взаимодействий в обществе и коллективе, в сочетании с группой экстроспективных политических, экономических и культурных обстоятельств, уместна и психологическая атмосфера, которые не реальны без развитых умений, навыков и работоспособности у любой переходящей на серьезный жизненный этап личности. Кризис таких данных резко проявляется в нынешний век, когда увеличиваются потребности в свободных коммуникациях с людьми различного статуса.</strong><br />\r\n&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n'),(198,'<blockquote>\r\n<p>Для работы, учебы и для общего развития человека ему необходимо иметь хорошую память.</p>\r\n</blockquote>\r\n\r\n<p>Не будем углубляться в теорию, что собой представляет человеческий мозг и память в частности, а лучше рассмотрим один из способов улучшения и расширения памяти.</p>\r\n\r\n<p><strong>1.</strong>Максимализируйте силу своего мозга с помощью визуализации.<br />\r\nИменно визуализация является мощным инструментом для увеличения памяти. Она способствует развитию креативности и созданию комплексных идей.<br />\r\nСамый простой способ научится визуализация - это рисовать. Когда человек воспринимает информацию на слух, то он усваивает ее на 30% меньше, чем когда он видит это же. Нужно стараться рисовать то, что слышишь.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <strong>&nbsp; &nbsp; &nbsp; фото рисующего человека</strong><br />\r\n<strong>2.</strong>Задействуйте больший спектр своего мозга.<br />\r\nКогда человек мысленно воспроизводит информацию, его мозг задействует другую часть мозга, которая отвечает за креативность, что способствует лучшему усвоению полученных данных.<br />\r\n<strong>3.</strong>Управляйте информацией и расставляйте приоритеты.<br />\r\nПоскольку человек не может запомнить абсолютно весь поток информации, который он получает, очень важно уметь быстро анализировать и расставлять приоритеты.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <strong>&nbsp; &nbsp; &nbsp; &nbsp;фото головы со светящимся мозгом</strong></p>\r\n\r\n<blockquote>\r\n<p><strong>Нужно концентрировать свое внимание на том, что мы считаем важным, и визуализировать.Визуальное восприятие информации намного сильнее. Не стесняйтесь рисовать и выделяйте для себя только саое важное</strong>.</p>\r\n</blockquote>\r\n'),(199,'<blockquote>\r\n<p><strong>Знание английского сегодня это отличное конкурентное преимущество. Умея говорить на английском проще найти работу, можно быстрее получать новые знания, создать успешный бизнес на примере иностранных аналогов.</strong></p>\r\n</blockquote>\r\n\r\n<p><strong>Так что если ты думаешь над тем, как быстро выучить английский язык с нуля, вот тебе 10 способов для этого.</strong></p>\r\n\r\n<p><strong>1.</strong> Нанять профессионала<br />\r\nПожалуй, это лучший способ. Поэтому здесь могу порекомендовать онлайн школу английского Skyeng.ru. Онлайн формат позволит тебе:</p>\r\n\r\n<p><strong>-</strong>самому выбирать где и когда учиться</p>\r\n\r\n<p><strong>-</strong>тебе подберут преподавателя под твои интересы и характер</p>\r\n\r\n<p><strong>-</strong>а цифровой учебник облегчит обучение, сохранит все, что учишь в одном месте и покажет прогресс. Запишись на бесплатный урок на Skyeng.tu.</p>\r\n\r\n<p><br />\r\n<strong>2.</strong> Полное погружение дома<br />\r\n1)Обклей каждый предмет в доме словом на английском языке.</p>\r\n\r\n<p>2)Подключи зарубежные каналы по ТВ.</p>\r\n\r\n<p>3)Установи на всех устройствах иностранный язык.</p>\r\n\r\n<p>4)Купи книги на английском языке.</p>\r\n\r\n<p>5)Слушай аудио на английском в плеере и машине. Это хороший способ выучить английский для начинающих.</p>\r\n\r\n<p><br />\r\n<strong>3.</strong> Полное погружение за рубежом</p>\r\n\r\n<p>Переезд в другую страну значительно ускоряет изучение языка. Ты везде слышишь иностранную речь. Все что тебя окружает на другом языке. Тебе самому приходится общаться на иностранном языке, чтобы тебя поняли. В таких условиях можно заговорить на английском уже через месяц.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong> &nbsp;фото русского в америке</strong><br />\r\n<strong>4.</strong> Перейти на общение дома только на английском<br />\r\nНайди единомышленника среди родственников. И начните говорить только на английском языке. Не можешь сказать ищи словарь и переводи. С помощью приложений для смартфона это быстро делается.</p>\r\n\r\n<p><br />\r\n<strong>5.</strong> Просмотр любимых фильмов в оригинале с русскими субтитрами<br />\r\nОбучение проходит быстрее и эффективнее когда тебе нравится то, что ты делаешь. Любимые фильмы создадут атмосферу интереса. Так что изучение английского будет проходить легче.</p>\r\n\r\n<p><br />\r\n<strong>6.</strong> Найти иностранца желающего выучить русский<br />\r\nТы будешь учить его, он тебя. Вы можете общаться по скайп у. Познакомившись, можете начать ездить друг другу в гости еще больше погружаясь в нужную языковую среду.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong> &nbsp; &nbsp; &nbsp;фото разговора русского с американцем</strong><br />\r\n<strong>7.</strong> Через музыку<br />\r\nЕсли ты меломан, найди тексты песен и их перевод. Пой, повторяй любимые песни и очень скоро наберешь необходимый словарный запас. Так же это хороший способ научиться понимать английскую речь на слух.</p>\r\n\r\n<p><br />\r\n<strong>8.</strong> Купи интерактивные обучающие программы<br />\r\nИ занимайся каждый день минимум 1 час. Секрет успеха в изучении английского это постоянство. Занимайся каждый день и через 3 месяца уже сможешь общаться на английском.</p>\r\n\r\n<p><br />\r\n<strong>9.</strong> Используй свое подсознание<br />\r\nНаше подсознание лучше запоминает если ты все прописываешь от руки. Также оно лучше запомнит если ты повторишь изученное за день перед сном. Также лучше запоминается информация, связанная с эмоциями. Поэтому ищи интересные для себя способы изучения английского. Как пример, я уже говорил про любимые фильмы и музыку.</p>\r\n\r\n<p><br />\r\n<strong>10.</strong> Найди свое вдохновение<br />\r\nДостижение любой цели ускоряется в десятки раз, когда ты находишь мотивирующий тебя ответ Зачем тебе это нужно Представь, что ты знаешь английский. Какую работу ты сможешь найти и на сколько больше начнешь зарабатывать. С кем сможешь познакомиться. Что это тебе даст. <strong>Подумай на этим</strong>. Особенно если тебе не хватает желания изучать английский.</p>\r\n\r\n<blockquote>\r\n<p><strong>Вдохновение позволит тебе избавиться от лени, и нежелания зубрить английский.</strong></p>\r\n</blockquote>\r\n'),(200,'<blockquote>\r\n<p><strong>В повседневной жизни мы так привыкли к стандарту разнообразий наших мыслей, если мы хотим что то изменить в своей работе, жизни или элементарно что то придумать, мы сразу же бросаем это дело. </strong></p>\r\n</blockquote>\r\n\r\n<p><strong>Потому что придумать что-то уникальное очень тяжело. Порой можно сидеть часами придумывая новые идеи или хотя бы возможности изменить что-то в своей повседневной жизни.</strong></p>\r\n\r\n<p>Но все таки есть уж люди у которых все получается. Они, как обычно, придумывают разные идеи одни да другими. Можно подумать что у них дар, но не стоит торопиться выводами. На самом деле есть несколько методов с помощью которых можно придумать самые различные, и уникальные идеи в любой сфере.&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong> фото человека с лампочкой над головой</strong><br />\r\nНачнем мы с простого с метода сложения. Это очень простой метод. Надо только сложить две вещи и смотреть что получится. Например: возьмем зебру и карандаш у нас получится полосатый карандаш.</p>\r\n\r\n<p><strong>1.</strong>Выйдите на пробежку, когда тело человека находится в движении. То легче придумать что-то новое.<br />\r\n<strong>2.</strong>Найдите свою среду обитания, то есть кто-то лучше думает в холоде, а кто-то на оборот. А вы попробуйте все.<br />\r\n<strong>3</strong>.И по чаще смотрите в окно, за окном чаще всего найдется новое.</p>\r\n\r\n<p style=\"text-align: center;\"><br />\r\n<strong>Ну вот и все желаю удачи! Успехов вам!</strong></p>\r\n'),(201,'<blockquote>\r\n<p><strong>Знакомство в Интернете &ndash; это довольно распространенное явление в нашем современном мире. И ведь в таком знакомстве очень много положительного. </strong></p>\r\n</blockquote>\r\n\r\n<p>Например, люди, у которых довольно мало шансов встретиться в нашей жизни по каким &ndash; либо причинам свободно могут повстречать друг друга в этом неограниченном пространстве. И это должно радовать. Ведь теперь счастливых людей станет больше.</p>\r\n\r\n<p>Но, к сожалению, все это оказывается совершенно не так. И иногда такое знакомство в Интернете заставляет не столько радоваться, сколько грустить. И приносит такое &laquo;счастье&raquo; обычно больше горе и всевозможных неприятностей.</p>\r\n\r\n<p style=\"text-align: center;\"><strong>фото грустного человека за компьютером<br />\r\nПочему же так происходит? Почему знакомство в Интернете бывает таким сложным и непонятным?</strong></p>\r\n\r\n<p>Ответить однозначно на эти вопросы просто невозможно, но можно объяснить все это несколькими фактами.</p>\r\n\r\n<p>Например, тем, что не все знакомящиеся в интернете рассказывают всю правду о себе и вообще бывают честны.</p>\r\n\r\n<p><strong>1.</strong>Именно во всемирной паутине поселились те, кто ищет свою будущую жертву. Это могут быть и педофилы, и воры, и убийцы, и даже мошенники.</p>\r\n\r\n<p><br />\r\n<strong>2.</strong>Скучающие домохозяйки, молодые мамы, находящиеся в декретном отпуске, тоже неплохо проводят время в Интернете. Они знакомятся и развлекаются там с мужчинами в то время, пока их мужья зарабатывают деньги. И такое надувательство мужчин или кокетство также является преградой для тех, кто просто пытается познакомиться.</p>\r\n\r\n<p style=\"text-align: center;\"><strong>Поэтому всегда будьте осторожны и не доверяйте первому встречному.</strong></p>\r\n'),(202,'<blockquote>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><strong>Ты об этом не думала? Я вот задумалась&hellip; Любовь &ndash; это сказка для детей? Или для маленьких взрослых девочек? Для тех, кто еще не вырос&hellip;</strong></p>\r\n</blockquote>\r\n\r\n<hr />\r\n<hr />\r\n<p>&nbsp;</p>\r\n\r\n<p>А вырастаешь ты очень быстро, и уже научился ставить все доказанные теоремы мира под сомненье! И даже можешь опровергнуть, что земля круглая&hellip;так каково же черта мы так упорно верим в эту сказку под названием &laquo;Любовь&raquo;? Пора вырасти. Её нет! Как нет и принца на белом коне, и даже злой колдуньи нет. Ты это можешь понять? Разуй глаза!<br />\r\nЭто не любовь, это все иллюзия&hellip; фокус-покус для дурочек! Мне иногда кажется, что мы мазахистки.</p>\r\n\r\n<p><strong>1)</strong>Как же &ndash; это состояния счастья, чувство окрыленности, когда ты &quot;пищищ &quot;от удовольствия в его объятьях, как ты бежишь навстречу, как засыпаешь и просыпаешься с мыслью о нем.</p>\r\n\r\n<p><strong>2)К</strong>ак отдаешь всю себя, как забываешь все то, что было для тебя дорого до встречи с ним! С твоим принцем!</p>\r\n\r\n<p>А этот принц уже не смотрит на тебя с обожанием, больше не звонит тебе по несколько раз в день, и даже не пишет СМС! Эти самые обычные СМС! И ты терзаешься, мучаешься, винишь себя, потом его, а потом опять себя&hellip;И это замкнутый круг. Ты с ним даже говоришь: &laquo;Скажи, милый, что не так? Я же чувствую, тебя что-то беспокоит!&raquo; Классная! Ты очень внимательная! Можешь себя поздравить! Да все не так, ему скучно, ему все надоело! И вроде ты хорошая, но ему больше неинтересно!</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <strong>&nbsp; фото &nbsp; девушки с телефоном в руках</strong></p>\r\n\r\n<blockquote>\r\n<p><br />\r\n<strong>Так, скажи &mdash; это любовь? То к чему мы всегда так стремимся? Запомни милая &ndash; если ты себе не дашь крылья, их тебе никто не даст! Твое счастье не зависит от какого-то там &laquo;принца&raquo;. Мы куем счастье своими руками, и если ты не будешь счастлива сама с собой, то счастливой тебя никто не сделает! Ни кто и ни когда! Забудь! Получай удовольствие, играй, заманивай, дразни, бери все и не отдавай ничего! В конце концов если не ты, то тебя!</strong></p>\r\n</blockquote>\r\n\r\n<p><br />\r\nМожет, это будет для него больно, но какая разница? Главное - не тебе! Ты же помнишь это чувство, когда сердце вырывается из груди, когда всю ночь воешь в подушку, а с утра протираешь лицо льдом, чтобы спала припухлость, как бродишь по улицам в надежде встретить его случайно, как мерзнешь и куришь, куришь и мерзнешь, как улыбаешься знакомым и говоришь, что все в порядке! Все отлично в твоей гребаной жизни. А потом &mdash; ночь и тоска. И тебе так холодно, и хочется, чтобы тебя согрела его нежная и сильная рука.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;фото девушки разочерованной<br />\r\nТы мне только ответь на один вопрос &mdash; зачем? Зачем тебе все это? Ты глупая? Мазохистка? Идиотка? Или слепая? Почему мы не видим очевидных вещей? Ее нет! Любви нет! Забудь! И просто живи для себя! Люби себя! Ведь ни кто и никогда не полюбит тебя больше чем ты сама! Цени себя! Холь и лелей! <strong>Ты одна &ndash; уникальная, сексуальная и свободная! И ни от кого не зависишь!</strong></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <strong>&nbsp; &nbsp; &nbsp;</strong></p>\r\n'),(203,'<blockquote>\r\n<p><strong>Каждый человек мечтает найти свою вторую половинку, но увы не каждому это удается... Мечты об идеальном спутнике жизни, романтических прогулках при луне и кротких поцелуях заставляют нас прибегать к помощи интернета.</strong></p>\r\n</blockquote>\r\n\r\n<p>В различных социальных сетях мы можем найти идеальную по внешности или предпочтениям половинку. Почему идеальную по внешности? Хм... Не стоит скрывать, что практически <strong>в 80% случаях знакомств в соц. сетях служит привлекательная внешность оппонента.</strong></p>\r\n\r\n<p>Конечно, это может быть и так называемый &quot;фейк&quot;, а может и вполне реальный человек. Просматривая множество страниц в соц. сетях мы натыкаемся на самых разных людей и возможно некоторые привлекают наше внимание. Существует множество примеров знакомства в интернете, которые не редко заканчиваются свадебным маршем Мендельсона, но к сожалению есть и случаи горького расставания.</p>\r\n\r\n<p style=\"text-align: center;\"><br />\r\n<strong>Нечего плохого в таких знакомствах нет! Это совершенно нормально! Ведь как говорится &quot; В любви как на войне - все средства хороши!&quot;.</strong></p>\r\n\r\n<p>Но все есть и отрицательные стороны интернет знакомств. Мошенники! И не только! Насильники, маньяки, педофилы - и это далеко не весь список опасностей подобных знакомств. Конечно, все это кому-то может показаться большим преувеличение, но отнюдь нет, как бы мне хотелось чтобы это было лишь большой выдумкой. Обычно такие люди затевают знакомства очень даже радушно и мило, а потом начинают настаивать о встрече, где и происходит преступление.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; фото насильника</strong></p>\r\n\r\n<p style=\"text-align: center;\"><strong>Чтобы обезопасить себя от такого рода посягательств следует соблюдать несколько не сложных предостережений:</strong></p>\r\n\r\n<p><strong>1.</strong>Если вы познакомились с кем-то в интернете не стоит после недели общения сразу соглашаться на встречу. Лучше немного подождите и продолжите общения. Ведь кто умеет ждать, тот много добивается!</p>\r\n\r\n<p><strong>2.</strong>Если все-таки оппонент удовлетворяет ваши требования и вроде ни каких особых угроз по вашему мнению он не представляет, вы согласились на встречу, то лучше пойти туда не одному, а с близким другом или на худой конец со старшим братом или сестрой. Чтобы не произошло недопонимание, просто попросите вашего потенциального партнера тоже пригласить близкого друга. Уверена не желающий вам нечего плохого человек с радостью согласится!</p>\r\n\r\n<blockquote>\r\n<p>Не переживайте о том, что вдруг вам не удастся побыть наедине, ведь в любой момент вы просто сможете покинуть своих друзей и пойти в какое-нибудь другое кафе или ресторан. Кто знает, может эта встреча соединит сразу несколько пар сердец!..</p>\r\n</blockquote>\r\n\r\n<p><br />\r\nЯ считаю, что поиски любимого или любимой должна быть случайными и спонтанными, устраивая смотрины в соц. сетях мы часто не задумываемся о состоянии души человека. Может нам совершенно не понравиться его дальнейшее поведение, но не стоит исключать и удовлетворительного исхода общения...</p>\r\n\r\n<p style=\"text-align: center;\"><strong>Так что, дорогие читатели ищите свои вторые половинки!</strong></p>\r\n'),(204,'<blockquote>\r\n<p>В современном мире, чтобы успешно существовать среди окружающих, выделяться из серой массы и уметь заинтересовать любого понравившегося человека, нужно быть умным. За ум отвечает мозг, поэтому его и нужно развивать, совершенствовать и заставлять работать на полную катушку.</p>\r\n</blockquote>\r\n\r\n<p style=\"text-align: center;\"><br />\r\n<strong>Итак, практические советы, или как улучшить работу мозга:</strong></p>\r\n\r\n<p><strong>1. Больше книг, меньше телевизора.</strong><br />\r\nПервое и самое основное правило: больше читайте. Книги развивают человека, вдохновляют, мотивируют и помогают стать умным. Именно книги, а не развлекательные передачи или комедийные фильмы.</p>\r\n\r\n<p>Однако книги должны быть полезными. Любовные романы, например, в эту категорию не вписываются. Зато энциклопедии, психология и философия помогут вам обрести свою точку зрения, научиться понимать людей и стать умней.</p>\r\n\r\n<p>Если совсем отказаться от телевизора кажется невозможным, старайтесь:</p>\r\n\r\n<p><strong>1)</strong> постепенно ограничивать время просмотра, с каждым разом уделять ящику всё меньше времени</p>\r\n\r\n<p><strong>2)</strong> смотреть лишь полезные и развивающие передачи.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong> &nbsp; &nbsp; &nbsp; &nbsp; фото интелектуальной программы</strong><br />\r\n<strong>2. Логически задачи.</strong><br />\r\nЗнания &ndash; это хорошо. Книги, люди, познавательные передачи и прочее помогут вам узнать много нового, но радоваться рано. Чтобы мозг работал, его нужно нагружать не только новой информацией, но и устраивать ему тренировки.</p>\r\n\r\n<p><strong>-</strong>Нестандартные или логические задачки</p>\r\n\r\n<p><strong>-</strong>кроссворды или сканворды, шарады или ребусы</p>\r\n\r\n<p><strong>-</strong>головоломки, а также многие другие вещи позволят тренировать свой мозг. Кроссворды, например, помогут закрепить те знания, что вы получили из книг, ведь от теории без практики мало толку.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; фото размышляющего человека<br />\r\n<strong>3. Оригинальность.</strong><br />\r\nРазвивайте свою оригинальность ежедневно, избегайте шаблонности и штампов. Во-первых, это значительно поможет мозгу и его работе, во-вторых, это всегда пригодится вам в жизни. Научитесь делать привычные вещи непривычными способами: например, если вы правша, попробуйте во время еды держать ложку или вилку в левой руке. Для вас это будет необычно и непривычно, но благодаря подобным мелким упражнениям, вы сами заметите, что стали меньше использовать шаблонные слова и творить шаблонные действия.</p>\r\n\r\n<p><br />\r\n<strong>4. Память.</strong><br />\r\nЧтобы ваш мозг работал, вы обязаны развить свою память. То же чтение из 1-ого пункта вам неплохо поможет. Помимо чтения книг:</p>\r\n\r\n<p><strong>-</strong>учите стихотворения</p>\r\n\r\n<p><strong>-</strong>используйте интересные методики для запоминания цифр, имён и лиц и развивайтесь.</p>\r\n\r\n<p>Настоятельно не рекомендуется пользоваться таблетками, препаратами и другими искусственными &laquo;помощниками&raquo;; они не только не помогут положительно повлиять на работу мозга, но могут и навредить.</p>\r\n\r\n<p style=\"text-align: center;\"><br />\r\n<strong>Всего эти 4 совета помогут вам значительно повысить свой интеллект с помощью саморазвития. Ваш мозг будет трудиться, развиваться и совершенствоваться, а вы будете пожинать прекрасные плоды его качественной работы</strong>.<br />\r\n&nbsp;</p>\r\n'),(205,'<p>&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><strong>Будем ли мы вместе?</strong></p>\r\n\r\n<p style=\"text-align: center;\"><strong>5 вещей, которые разрушают отношения быстрее всего</strong></p>\r\n\r\n<p>Какие поступки разрушают отношения быстрее всего? Что может сделать девушка, чтобы сохранить отношения?</p>\r\n\r\n<blockquote>\r\n<p>Если ты дорожишь своими отношениями и партнером, никогда не совершай того, о чем пойдет речь ниже. Это способно разрушить даже самые крепкие отношения.</p>\r\n</blockquote>\r\n\r\n<p>&nbsp;<br />\r\n<strong>1.</strong>Попытки изменить его</p>\r\n\r\n<p><br />\r\n&nbsp;Тебе может показаться, что таким образом ты делаешь своему партнеру одолжение, помогаешь ему измениться и стать лучше во всех смыслах.</p>\r\n\r\n<p>Но нужно понять и принять тот факт, что он, скорее всего, не хочет ничего менять в своей жизни и прекрасно чувствует себя как есть. Попытки изменить человека &ndash; пустая трата времени и сил. Да и мало кому это может понравиться.<br />\r\n&nbsp;<br />\r\n<strong>2.</strong>Ссоры на публике<br />\r\n&nbsp;Так ты демонстрируешь свое глубокое неуважение к партнеру. Или негатива накопилось столько, что ты только и ищешь возможности выплеснуть его наружу? Во всяком случае, выяснять отношения нужно не на потеху публике, а дома.</p>\r\n\r\n<p><br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;фото ссоры пары</p>\r\n\r\n<p><br />\r\n<strong>3.</strong>Слежка</p>\r\n\r\n<p><br />\r\n&nbsp;Взломать его аккаунт в соцсети было делом плевым. Зато теперь ты знаешь о нем все: с кем он общается, с кем поддерживает хорошие отношения и, конечно, детали переписки. А он об этом знает? Нет? А теперь представь, как он отреагирует, когда все выяснится. Даже если он никогда не узнает об этом, уверена ли ты, что хочешь увидеть его переписку? Это один из тех случаев, когда знание бывает лишним.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;фото шпиона<br />\r\n&nbsp;<br />\r\n<strong>4.</strong>Критиковать его семью<br />\r\n&nbsp;<br />\r\nКакие бы &laquo;тараканы в голове&raquo; ни были у его родных, тебе не следует дурно отзываться о них. Вероятно, он и сам все прекрасно понимает, просто услышать правду от другого человека &ndash; всегда неприятно.<strong> Это может подорвать ваши отношения.<br />\r\n&nbsp;</strong><br />\r\n<strong>5</strong>.Врать<br />\r\n&nbsp;<br />\r\nОб этом скажет всякий психолог и опытный в отношениях человек: доверие &ndash; основа отношений. Если вы постоянно что-то скрываете друг от друга, недоговариваете или врете, отношения уж никак нельзя считать здоровыми.</p>\r\n\r\n<p style=\"text-align: center;\"><strong>А если это так, нужны ли они вам вообще?</strong></p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n'),(206,'<p>&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><strong>Будем ли мы вместе?</strong></p>\r\n\r\n<p style=\"text-align: center;\"><strong>5 вещей, которые разрушают отношения быстрее всего</strong></p>\r\n\r\n<p>Какие поступки разрушают отношения быстрее всего? Что может сделать девушка, чтобы сохранить отношения?</p>\r\n\r\n<blockquote>\r\n<p>Если ты дорожишь своими отношениями и партнером, никогда не совершай того, о чем пойдет речь ниже. Это способно разрушить даже самые крепкие отношения.</p>\r\n</blockquote>\r\n\r\n<p>&nbsp;<br />\r\n<strong>1.</strong>Попытки изменить его</p>\r\n\r\n<p><br />\r\n&nbsp;Тебе может показаться, что таким образом ты делаешь своему партнеру одолжение, помогаешь ему измениться и стать лучше во всех смыслах.</p>\r\n\r\n<p>Но нужно понять и принять тот факт, что он, скорее всего, не хочет ничего менять в своей жизни и прекрасно чувствует себя как есть. Попытки изменить человека &ndash; пустая трата времени и сил. Да и мало кому это может понравиться.<br />\r\n&nbsp;<br />\r\n<strong>2.</strong>Ссоры на публике<br />\r\n&nbsp;Так ты демонстрируешь свое глубокое неуважение к партнеру. Или негатива накопилось столько, что ты только и ищешь возможности выплеснуть его наружу? Во всяком случае, выяснять отношения нужно не на потеху публике, а дома.</p>\r\n\r\n<p><br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;фото ссоры пары</p>\r\n\r\n<p><br />\r\n<strong>3.</strong>Слежка</p>\r\n\r\n<p><br />\r\n&nbsp;Взломать его аккаунт в соцсети было делом плевым. Зато теперь ты знаешь о нем все: с кем он общается, с кем поддерживает хорошие отношения и, конечно, детали переписки. А он об этом знает? Нет? А теперь представь, как он отреагирует, когда все выяснится. Даже если он никогда не узнает об этом, уверена ли ты, что хочешь увидеть его переписку? Это один из тех случаев, когда знание бывает лишним.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;фото шпиона<br />\r\n&nbsp;<br />\r\n<strong>4.</strong>Критиковать его семью<br />\r\n&nbsp;<br />\r\nКакие бы &laquo;тараканы в голове&raquo; ни были у его родных, тебе не следует дурно отзываться о них. Вероятно, он и сам все прекрасно понимает, просто услышать правду от другого человека &ndash; всегда неприятно.<strong> Это может подорвать ваши отношения.<br />\r\n&nbsp;</strong><br />\r\n<strong>5</strong>.Врать<br />\r\n&nbsp;<br />\r\nОб этом скажет всякий психолог и опытный в отношениях человек: доверие &ndash; основа о