пары</p>\r\n\r\n<p><br />\r\n<strong>3.</strong>Слежка</p>\r\n\r\n<p><br />\r\n&nbsp;Взломать его аккаунт в соцсети было делом плевым. Зато теперь ты знаешь о нем все: с кем он общается, с кем поддерживает хорошие отношения и, конечно, детали переписки. А он об этом знает? Нет?</p>\r\n\r\n<p>А теперь представь, как он отреагирует, когда все выяснится. Даже если он никогда не узнает об этом, уверена ли ты, что хочешь увидеть его переписку? Это один из тех случаев, когда знание бывает лишним.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;фото шпиона<br />\r\n&nbsp;<br />\r\n<strong>4.</strong>Критиковать его семью<br />\r\n&nbsp;<br />\r\nКакие бы &laquo;тараканы в голове&raquo; ни были у его родных, тебе не следует дурно отзываться о них. Вероятно, он и сам все прекрасно понимает, просто услышать правду от другого человека &ndash; всегда неприятно.<strong> Это может подорвать ваши отношения.<br />\r\n&nbsp;</strong><br />\r\n<strong>5</strong>.Врать<br />\r\n&nbsp;<br />\r\nОб этом скажет всякий психолог и опытный в отношениях человек: доверие &ndash; основа отношений. Если вы постоянно что-то скрываете друг от друга, недоговариваете или врете, отношения уж никак нельзя считать здоровыми.</p>\r\n\r\n<p style=\"text-align: center;\"><strong>А если это так, нужны ли они вам вообще?</strong></p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n'),(208,'<p>&nbsp;</p>\r\n\r\n<p>Какие поступки разрушают отношения быстрее всего? Что может сделать девушка, чтобы сохранить отношения?</p>\r\n\r\n<blockquote>\r\n<p>Если ты дорожишь своими отношениями и партнером, никогда не совершай того, о чем пойдет речь ниже. Это способно разрушить даже самые крепкие отношения.</p>\r\n</blockquote>\r\n\r\n<p>&nbsp;<br />\r\n<strong>1.</strong>Попытки изменить его</p>\r\n\r\n<p><br />\r\n&nbsp;Тебе может показаться, что таким образом ты делаешь своему партнеру одолжение, помогаешь ему измениться и стать лучше во всех смыслах.</p>\r\n\r\n<p>Но нужно понять и принять тот факт, что он, скорее всего, не хочет ничего менять в своей жизни и прекрасно чувствует себя как есть. Попытки изменить человека &ndash; пустая трата времени и сил. Да и мало кому это может понравиться.<br />\r\n&nbsp;<br />\r\n<strong>2.</strong>Ссоры на публике<br />\r\n&nbsp;Так ты демонстрируешь свое глубокое неуважение к партнеру. Или негатива накопилось столько, что ты только и ищешь возможности выплеснуть его наружу? Во всяком случае, выяснять отношения нужно не на потеху публике, а дома.</p>\r\n\r\n<p><br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;фото ссоры пары</p>\r\n\r\n<p><br />\r\n<strong>3.</strong>Слежка</p>\r\n\r\n<p><br />\r\n&nbsp;Взломать его аккаунт в соцсети было делом плевым. Зато теперь ты знаешь о нем все: с кем он общается, с кем поддерживает хорошие отношения и, конечно, детали переписки. А он об этом знает? Нет?</p>\r\n\r\n<p>А теперь представь, как он отреагирует, когда все выяснится. Даже если он никогда не узнает об этом, уверена ли ты, что хочешь увидеть его переписку? Это один из тех случаев, когда знание бывает лишним.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;фото шпиона<br />\r\n&nbsp;<br />\r\n<strong>4.</strong>Критиковать его семью<br />\r\n&nbsp;<br />\r\nКакие бы &laquo;тараканы в голове&raquo; ни были у его родных, тебе не следует дурно отзываться о них. Вероятно, он и сам все прекрасно понимает, просто услышать правду от другого человека &ndash; всегда неприятно.<strong> Это может подорвать ваши отношения.<br />\r\n&nbsp;</strong><br />\r\n<strong>5</strong>.Врать<br />\r\n&nbsp;<br />\r\nОб этом скажет всякий психолог и опытный в отношениях человек:<strong> доверие &ndash; основа отношений.</strong></p>\r\n\r\n<blockquote>\r\n<p>Если вы постоянно что-то скрываете друг от друга, недоговариваете или врете, отношения уж никак нельзя считать здоровыми.<strong>А если это так, нужны ли они вам вообще?</strong></p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n</blockquote>\r\n'),(209,'<p>&nbsp;</p>\r\n\r\n<p>Какие поступки разрушают отношения быстрее всего? Что может сделать девушка, чтобы сохранить отношения?</p>\r\n\r\n<blockquote>\r\n<p>Если ты дорожишь своими отношениями и партнером, никогда не совершай того, о чем пойдет речь ниже. Это способно разрушить даже самые крепкие отношения.</p>\r\n</blockquote>\r\n\r\n<p>&nbsp;<br />\r\n<strong>1.</strong>Попытки изменить его</p>\r\n\r\n<p><br />\r\n&nbsp;Тебе может показаться, что таким образом ты делаешь своему партнеру одолжение, помогаешь ему измениться и стать лучше во всех смыслах.</p>\r\n\r\n<p>Но нужно понять и принять тот факт, что он, скорее всего, не хочет ничего менять в своей жизни и прекрасно чувствует себя как есть. Попытки изменить человека &ndash; пустая трата времени и сил. Да и мало кому это может понравиться.<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&nbsp;фото ссоры пары<br />\r\n<strong>2.</strong>Ссоры на публике<br />\r\n&nbsp;Так ты демонстрируешь свое глубокое неуважение к партнеру. Или негатива накопилось столько, что ты только и ищешь возможности выплеснуть его наружу? Во всяком случае, выяснять отношения нужно не на потеху публике, а дома.</p>\r\n\r\n<p><br />\r\n<strong>3.</strong>Слежка</p>\r\n\r\n<p><br />\r\n&nbsp;Взломать его аккаунт в соцсети было делом плевым. Зато теперь ты знаешь о нем все: с кем он общается, с кем поддерживает хорошие отношения и, конечно, детали переписки. А он об этом знает? Нет?</p>\r\n\r\n<p>А теперь представь, как он отреагирует, когда все выяснится. Даже если он никогда не узнает об этом, уверена ли ты, что хочешь увидеть его переписку? Это один из тех случаев, когда знание бывает лишним.<br />\r\n&nbsp;<br />\r\n<strong>4.</strong>Критиковать его семью<br />\r\n&nbsp;<br />\r\nКакие бы &laquo;тараканы в голове&raquo; ни были у его родных, тебе не следует дурно отзываться о них. Вероятно, он и сам все прекрасно понимает, просто услышать правду от другого человека &ndash; всегда неприятно.<strong> Это может подорвать ваши отношения.<br />\r\n&nbsp;</strong><br />\r\n<strong>5</strong>.Врать<br />\r\n&nbsp;<br />\r\nОб этом скажет всякий психолог и опытный в отношениях человек:<strong> доверие &ndash; основа отношений.</strong></p>\r\n\r\n<blockquote>\r\n<p>Если вы постоянно что-то скрываете друг от друга, недоговариваете или врете, отношения уж никак нельзя считать здоровыми.<strong>А если это так, нужны ли они вам вообще?</strong></p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n</blockquote>\r\n'),(210,'<p><br />\r\nНесколько советов девушке, как стать популярной в коллективе</p>\r\n\r\n<p style=\"text-align: center;\"><br />\r\n<br />\r\n<strong>Что делать, если вам нужно вливаться в новый коллектив? Как найти новых друзей и стать частью нового окружения?</strong></p>\r\n\r\n<blockquote>\r\n<p><br />\r\nСовременная девушка - это уверенная и модная красотка, которая хочет быть всегда в центре внимания.</p>\r\n</blockquote>\r\n\r\n<p>Однако в нашей жизни случаются такие ситуации, когда человек попадает в новый коллектив. Соответственно, ему нужно наладить новые контакты, обзавестись друзьями и знакомыми. А сложившиеся компании не всегда готовы принять в свой коллектив новых и незрелых птенцов.&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><br />\r\n<strong>Что же делать в этом случае?&nbsp;</strong></p>\r\n\r\n<p><strong>1.</strong>Прежде всего, вы должны привлекать внимание на себя. В этом вам, конечно, может помочь яркая одежда и аксессуары, но ваша общая история намного важнее.&nbsp;</p>\r\n\r\n<p><strong>2.</strong>Вы должны казаться милой и коммуникабельной, чтобы заслужить уважение. Поэтому нужно заранее придумать, что рассказывать о себе своим будущим друзьям.&nbsp;</p>\r\n\r\n<p><strong>3.</strong>Как вы переехали сюда? Кто ваши родители?</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; фото девушки в экстримальной ситуации</strong></p>\r\n\r\n<p>Можно придумать какой-то острый поворот сюжета в вашей истории. Что-то экстремальное и курьезное. Это увлечет ваших слушателей, а далее вызовет долю уважения. Например, была какая-то опасная ситуация, а вам удалось удачно выпутаться из этой ситуации.&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><strong>Интересуйтесь жизнью своих новых коллег, задавайте вопросы и внимательно слушайте ответы</strong>.</p>\r\n\r\n<p><strong>1.</strong>Старайтесь помогать своим новым коллегам, не отказывайте им в мелких просьбах.</p>\r\n\r\n<p><strong>2.</strong>Не игнорируйте общие походы на обед или по магазинах, берите активное участие в жизни коллектива.</p>\r\n\r\n<p><strong>3.</strong>Будьте активными на &quot;летучках&quot; и совещаниях, высказывайте свое мнение, советуйтесь, действуйте.</p>\r\n\r\n<p><strong>4.</strong>Ведите себя уверенно, что бы ни произошло.</p>\r\n\r\n<blockquote>\r\n<p>Уверенный в себе человек автоматически привлекает к себе внимание и уважение других.</p>\r\n</blockquote>\r\n\r\n<p>&nbsp;</p>\r\n'),(212,'<p><strong>Дети - цветы жизни! С рождения они приносят в мир взрослого радость и счастье! Чего стоит только одна улыбка малыша, от которой жизнь становится яркой, осмысленной, наполненной положительными эмоциями!</strong></p>\r\n\r\n<blockquote>\r\n<p><strong>Когда женщина узнает, что ожидает малыша, она испытывает невероятные чувства и эмоции. Это может быть удивление, неожиданность или, наоборот, долгожданное чудо, радость от ощущения нового состояния.</strong></p>\r\n</blockquote>\r\n\r\n<p>Порой материнство кардинально изменяет жизнь: новые заботы, обязанности, а какая доля ответственности за физиологическое и психологическое здоровье малыша ложится на плечи новоиспеченных родителей?! Первый вздох, плач, смех, слово, первые шаги - все это производит неизгладимое впечатление на людей, подаривших жизнь своему чаду.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <concrete-picture fID=\"14\" alt=\"ступени развития ребенка.jpg\" height=\"256\" width=\"385\" /></p>\r\n\r\n<p style=\"text-align: center;\"><strong>&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Познавая новый мир, дети учатся:</strong></p>\r\n\r\n<p><strong>1.</strong>общению со своими сверстниками</p>\r\n\r\n<p><strong>2</strong>. у них возникают привязанности, эмоциональные связи</p>\r\n\r\n<p><strong>3.</strong>выстраиваются определенные взаимоотношения, взаимодействия, столь необходимые для их социального развития.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><strong>Наверное, каждый взрослый замечал, что человек не может жить в одиночестве, без общения.</strong></p>\r\n\r\n<p>Для нормального, полноценного развития человеку необходимы социальные контакты. Каждый из нас проходит через такие социальные институты как семья, детский сад, школа, средне или высшее профессиональное образование, различные объединения (по интересам, увлечениям, хобби), организации, религиозные институты (церкви, мечети или синагоги).</p>\r\n\r\n<p>Отсутствие важных социальных институтов оказывает огромное влияние на формирование личности. В этом случае, важно помнить, что ребенок познает, осваивает новый, сложный для него мир и учится выстраивать взаимоотношения самостоятельно.</p>\r\n\r\n<p>Поэтому, взрослым<strong> важно позитивно&nbsp;оценивать личность ребенка,</strong> тактично и аргументировано указывать на недостатки, терпеливо и умело поддерживать, хвалить за старание и инициативность. Ни в коем случае ребенка нельзя наказывать и запрещать.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong>&nbsp; </strong></p>\r\n\r\n<p style=\"text-align: center;\"><strong>Помните такое выражение &ndash; запретный плод сладок?</strong></p>\r\n\r\n<p><strong>&nbsp;</strong>Так и ребенок в этом возрасте может совершать действия, которые противоречат словам взрослым. Необходимо предоставить ребенку возможность быть взрослым в бытовых ситуациях (самому завязать шнурки, почистить зубы, выбрать, что ему съесть на завтрак овсянку или яичницу с колбасой, играть дома или на детской площадке). Тем не менее ребенок должен придерживаться режима (во сколько подъем, завтрак, прогулка, сон).</p>\r\n\r\n<hr />\r\n<p style=\"text-align: center;\"><br />\r\n<strong>Уважаемые родители, учитывайте возрастные особенности своего ребенка, будьте терпимее к его капризам, создайте для него благоприятную атмосферу, наполненную жизнерадостностью и оптимизмом, тогда процесс адаптации ребенка к детскому саду пройдет легко и быстро! </strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n'),(213,'<p><strong>Дети - цветы жизни! С рождения они приносят в мир взрослого радость и счастье! Чего стоит только одна улыбка малыша, от которой жизнь становится яркой, осмысленной, наполненной положительными эмоциями!</strong></p>\r\n\r\n<blockquote>\r\n<p><strong>Когда женщина узнает, что ожидает малыша, она испытывает невероятные чувства и эмоции. Это может быть удивление, неожиданность или, наоборот, долгожданное чудо, радость от ощущения нового состояния.</strong></p>\r\n</blockquote>\r\n\r\n<p>Порой материнство кардинально изменяет жизнь: новые заботы, обязанности, а какая доля ответственности за физиологическое и психологическое здоровье малыша ложится на плечи новоиспеченных родителей?! Первый вздох, плач, смех, слово, первые шаги - все это производит неизгладимое впечатление на людей, подаривших жизнь своему чаду.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <concrete-picture fID=\"14\" alt=\"ступени развития ребенка.jpg\" height=\"256\" width=\"385\" /></p>\r\n\r\n<p style=\"text-align: center;\"><strong>&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Познавая новый мир, дети учатся:</strong></p>\r\n\r\n<p><strong>1.</strong>общению со своими сверстниками</p>\r\n\r\n<p><strong>2</strong>. у них возникают привязанности, эмоциональные связи</p>\r\n\r\n<p><strong>3.</strong>выстраиваются определенные взаимоотношения, взаимодействия, столь необходимые для их социального развития.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><strong>Наверное, каждый взрослый замечал, что человек не может жить в одиночестве, без общения.</strong></p>\r\n\r\n<p>Для нормального, полноценного развития человеку необходимы социальные контакты. Каждый из нас проходит через такие социальные институты как семья, детский сад, школа, средне или высшее профессиональное образование, различные объединения (по интересам, увлечениям, хобби), организации, религиозные институты (церкви, мечети или синагоги).</p>\r\n\r\n<p>Отсутствие важных социальных институтов оказывает огромное влияние на формирование личности. В этом случае, важно помнить, что ребенок познает, осваивает новый, сложный для него мир и учится выстраивать взаимоотношения самостоятельно.</p>\r\n\r\n<p>Поэтому, взрослым<strong> важно позитивно&nbsp;оценивать личность ребенка,</strong> тактично и аргументировано указывать на недостатки, терпеливо и умело поддерживать, хвалить за старание и инициативность. Ни в коем случае ребенка нельзя наказывать и запрещать.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp;<strong>&nbsp; <concrete-picture fID=\"15\" alt=\"ребенка в окружающем мире.jpg\" height=\"397\" width=\"595\" /></strong></p>\r\n\r\n<p style=\"text-align: center;\"><strong>Помните такое выражение &ndash; запретный плод сладок?</strong></p>\r\n\r\n<p><strong>&nbsp;</strong>Так и ребенок в этом возрасте может совершать действия, которые противоречат словам взрослым. Необходимо предоставить ребенку возможность быть взрослым в бытовых ситуациях (самому завязать шнурки, почистить зубы, выбрать, что ему съесть на завтрак овсянку или яичницу с колбасой, играть дома или на детской площадке). Тем не менее ребенок должен придерживаться режима (во сколько подъем, завтрак, прогулка, сон).</p>\r\n\r\n<hr />\r\n<p style=\"text-align: center;\"><br />\r\n<strong>Уважаемые родители, учитывайте возрастные особенности своего ребенка, будьте терпимее к его капризам, создайте для него благоприятную атмосферу, наполненную жизнерадостностью и оптимизмом, тогда процесс адаптации ребенка к детскому саду пройдет легко и быстро! </strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n'),(214,'<p><strong>Дети - цветы жизни! С рождения они приносят в мир взрослого радость и счастье! Чего стоит только одна улыбка малыша, от которой жизнь становится яркой, осмысленной, наполненной положительными эмоциями!</strong></p>\r\n\r\n<blockquote>\r\n<p><strong>Когда женщина узнает, что ожидает малыша, она испытывает невероятные чувства и эмоции. Это может быть удивление, неожиданность или, наоборот, долгожданное чудо, радость от ощущения нового состояния.</strong></p>\r\n</blockquote>\r\n\r\n<p>Порой материнство кардинально изменяет жизнь: новые заботы, обязанности, а какая доля ответственности за физиологическое и психологическое здоровье малыша ложится на плечи новоиспеченных родителей?! Первый вздох, плач, смех, слово, первые шаги - все это производит неизгладимое впечатление на людей, подаривших жизнь своему чаду.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <concrete-picture fID=\"14\" alt=\"ступени развития ребенка.jpg\" height=\"256\" width=\"385\" /></p>\r\n\r\n<p style=\"text-align: center;\"><strong>&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Познавая новый мир, дети учатся:</strong></p>\r\n\r\n<p><strong>1.</strong>общению со своими сверстниками</p>\r\n\r\n<p><strong>2</strong>. у них возникают привязанности, эмоциональные связи</p>\r\n\r\n<p><strong>3.</strong>выстраиваются определенные взаимоотношения, взаимодействия, столь необходимые для их социального развития.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><strong>Наверное, каждый взрослый замечал, что человек не может жить в одиночестве, без общения.</strong></p>\r\n\r\n<p>Для нормального, полноценного развития человеку необходимы социальные контакты. Каждый из нас проходит через такие социальные институты как семья, детский сад, школа, средне или высшее профессиональное образование, различные объединения (по интересам, увлечениям, хобби), организации, религиозные институты (церкви, мечети или синагоги).</p>\r\n\r\n<p>Отсутствие важных социальных институтов оказывает огромное влияние на формирование личности. В этом случае, важно помнить, что ребенок познает, осваивает новый, сложный для него мир и учится выстраивать взаимоотношения самостоятельно.</p>\r\n\r\n<p>Поэтому, взрослым<strong> важно позитивно&nbsp;оценивать личность ребенка,</strong> тактично и аргументировано указывать на недостатки, терпеливо и умело поддерживать, хвалить за старание и инициативность. Ни в коем случае ребенка нельзя наказывать и запрещать.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp;<strong>&nbsp; <concrete-picture fID=\"15\" alt=\"ребенка в окружающем мире.jpg\" height=\"397\" width=\"595\" /></strong></p>\r\n\r\n<p style=\"text-align: center;\"><strong>Помните такое выражение &ndash; запретный плод сладок?</strong></p>\r\n\r\n<p><strong>&nbsp;</strong>Так и ребенок в этом возрасте может совершать действия, которые противоречат словам взрослым. Необходимо предоставить ребенку возможность быть взрослым в бытовых ситуациях (самому завязать шнурки, почистить зубы, выбрать, что ему съесть на завтрак овсянку или яичницу с колбасой, играть дома или на детской площадке). Тем не менее ребенок должен придерживаться режима (во сколько подъем, завтрак, прогулка, сон).</p>\r\n\r\n<hr />\r\n<p style=\"text-align: center;\"><br />\r\n<strong>Уважаемые родители, учитывайте возрастные особенности своего ребенка, будьте терпимее к его капризам, создайте для него благоприятную атмосферу, наполненную жизнерадостностью и оптимизмом, тогда процесс адаптации ребенка к детскому саду пройдет легко и быстро! </strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n'),(215,'<blockquote>\r\n<p>В статье приводятся ошибки, которые люди, разочарованные предыдущими отношениями, часто допускают на первом свидании: поиск идеала, страх быть брошенным, отсутствие позитивного настроя и другие.</p>\r\n</blockquote>\r\n\r\n<p style=\"text-align: center;\"><br />\r\n<br />\r\n<strong>Одинокие, незанятые, свободные люди в большинстве своем мечтают выйти из зачарованного круга бесконечных свиданий с потенциальными партнерами, но как-то неосознанно превращают постройку интимной связи в тяжелую работу. И этим одним отпугивают вторую половинку.</strong></p>\r\n\r\n<p>Поговорим о распространенных ошибках при первом свидании, о том, как эти ошибки исправить. Итак, советы для тех, кому надоели извечные первые свидания.</p>\r\n\r\n<p><strong>Ошибка № 1</strong>: поиск принца (принцессы)</p>\r\n\r\n<p>Мы зацикливаемся на поисках одного-единственного (одной-единственной), отвергая потенциальных претендентов через вторичные причины, и имеем склонность разрывать связь при первой возникшей проблеме.</p>\r\n\r\n<p>Что делать? Не потворствуйте невольному импульсу найти в новом партнере пороки и недостатки. Можно же взглянуть на полупустой стакан иначе.</p>\r\n\r\n<p><strong>1.</strong>Нужно отметить для себя преимущества и достоинства человека</p>\r\n\r\n<p><strong>2</strong>.найти в нем потенциал для продолжения отношений.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong>фото ножа в сердце</strong></p>\r\n\r\n<p><strong>Ошибка 2:</strong> разрыв связи без всякой причины, боязнь быть отвергнутым</p>\r\n\r\n<p>Во многих случаях страх вынуждает человека преждевременно наносить предупреждающий удар. <strong>Помните, любовь - это не бокс!</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Ошибка 3:</strong> пустые ожидания</p>\r\n\r\n<p>Во время первых свиданий люди, настроенные серьезно, зачастую избегают объяснений, не рассказывают, чего они ждут от будущей романтической связи. А потом выясняется, что их партнер вообще хотел легкого флирта. Все это приводит к болезненным переживаниям.</p>\r\n\r\n<p><strong>1.</strong>Поэтому не стесняйтесь спрашивать про вещи, которые важны для вас, говорить о них уже на первом свидании.</p>\r\n\r\n<p><strong>2.</strong>Объяснитесь (хотя бы намеками) про ваши ценности, про ваши ожидания от связи. В большинстве случаев вас поймут.</p>\r\n\r\n<blockquote>\r\n<p>Помните, разговор - надежный путь, который позволяет выяснить уже на первом свидании, совпадают ли ваши ожидания с ожиданиями другого человека.</p>\r\n\r\n<p>&nbsp;</p>\r\n</blockquote>\r\n\r\n<p><strong>Ошибка 4:</strong> отсутствие позитивной энергии и инициативы</p>\r\n\r\n<p><strong>1.</strong>Выйдите из дома такой, какой вы есть. Вы - не машина для свиданий.</p>\r\n\r\n<p><strong>2.</strong>Вычислите наперед атмосферу свидания (будете ли вы внимательно слушать друг друга, веселиться и т. д.), подумайте, что вы будете делать, чтобы создать ее.</p>\r\n\r\n<p><strong>3.</strong>Чтобы добиться искренности, которая в конечном итоге приведет к глубокому знакомству с человеком, кто-то из двоих должен взять инициативу на себя. Почему бы не вы?</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong> &nbsp; &nbsp;фото сранения людей</strong></p>\r\n\r\n<p><strong>Ошибка 5: </strong>сравнение с прошлыми партнерами</p>\r\n\r\n<p>На первое свидание мы несем всю свою обиду, все просчеты прошлого, включая воспоминания о наших бывших, которые разочаровали, бросили и т. д. Мы садимся напротив нового человека и смотрим на него через фильтр прошлого.</p>\r\n\r\n<blockquote>\r\n<p>&nbsp;Живите сегодняшним днем!&nbsp;Можно же одолеть черную полосу. И сначала попробуйте отнестись к человеку так, как бы вы хотели, чтобы он обошелся с вами. Поверьте, несчастная любовь не охотится лично на вас.</p>\r\n\r\n<p>&nbsp;</p>\r\n</blockquote>\r\n'),(216,'<blockquote>\r\n<p>В статье приводятся ошибки, которые люди, разочарованные предыдущими отношениями, часто допускают на первом свидании: поиск идеала, страх быть брошенным, отсутствие позитивного настроя и другие.</p>\r\n</blockquote>\r\n\r\n<p style=\"text-align: center;\"><br />\r\n<br />\r\n<strong>Одинокие, незанятые, свободные люди в большинстве своем мечтают выйти из зачарованного круга бесконечных свиданий с потенциальными партнерами, но как-то неосознанно превращают постройку интимной связи в тяжелую работу. И этим одним отпугивают вторую половинку.</strong></p>\r\n\r\n<p>Поговорим о распространенных ошибках при первом свидании, о том, как эти ошибки исправить. Итак, советы для тех, кому надоели извечные первые свидания.</p>\r\n\r\n<p><strong>Ошибка № 1</strong>: поиск принца (принцессы)</p>\r\n\r\n<p>Мы зацикливаемся на поисках одного-единственного (одной-единственной), отвергая потенциальных претендентов через вторичные причины, и имеем склонность разрывать связь при первой возникшей проблеме.</p>\r\n\r\n<p>Что делать? Не потворствуйте невольному импульсу найти в новом партнере пороки и недостатки. Можно же взглянуть на полупустой стакан иначе.</p>\r\n\r\n<p><strong>1.</strong>Нужно отметить для себя преимущества и достоинства человека</p>\r\n\r\n<p><strong>2</strong>.найти в нем потенциал для продолжения отношений.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong>фото ножа в сердце</strong></p>\r\n\r\n<p><strong>Ошибка 2:</strong> разрыв связи без всякой причины, боязнь быть отвергнутым</p>\r\n\r\n<p>Во многих случаях страх вынуждает человека преждевременно наносить предупреждающий удар. <strong>Помните, любовь - это не бокс!</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Ошибка 3:</strong> пустые ожидания</p>\r\n\r\n<p>Во время первых свиданий люди, настроенные серьезно, зачастую избегают объяснений, не рассказывают, чего они ждут от будущей романтической связи. А потом выясняется, что их партнер вообще хотел легкого флирта. Все это приводит к болезненным переживаниям.</p>\r\n\r\n<p><strong>1.</strong>Поэтому не стесняйтесь спрашивать про вещи, которые важны для вас, говорить о них уже на первом свидании.</p>\r\n\r\n<p><strong>2.</strong>Объяснитесь (хотя бы намеками) про ваши ценности, про ваши ожидания от связи. В большинстве случаев вас поймут.</p>\r\n\r\n<blockquote>\r\n<p>Помните, разговор - надежный путь, который позволяет выяснить уже на первом свидании, совпадают ли ваши ожидания с ожиданиями другого человека.</p>\r\n\r\n<p>&nbsp;</p>\r\n</blockquote>\r\n\r\n<p><strong>Ошибка 4:</strong> отсутствие позитивной энергии и инициативы</p>\r\n\r\n<p><strong>1.</strong>Выйдите из дома такой, какой вы есть. Вы - не машина для свиданий.</p>\r\n\r\n<p><strong>2.</strong>Вычислите наперед атмосферу свидания (будете ли вы внимательно слушать друг друга, веселиться и т. д.), подумайте, что вы будете делать, чтобы создать ее.</p>\r\n\r\n<p><strong>3.</strong>Чтобы добиться искренности, которая в конечном итоге приведет к глубокому знакомству с человеком, кто-то из двоих должен взять инициативу на себя. Почему бы не вы?</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong> &nbsp; &nbsp;фото сранения людей</strong></p>\r\n\r\n<p><strong>Ошибка 5: </strong>сравнение с прошлыми партнерами</p>\r\n\r\n<p>На первое свидание мы несем всю свою обиду, все просчеты прошлого, включая воспоминания о наших бывших, которые разочаровали, бросили и т. д. Мы садимся напротив нового человека и смотрим на него через фильтр прошлого.</p>\r\n\r\n<blockquote>\r\n<p>&nbsp;Живите сегодняшним днем!&nbsp;Можно же одолеть черную полосу. И сначала попробуйте отнестись к человеку так, как бы вы хотели, чтобы он обошелся с вами. Поверьте, несчастная любовь не охотится лично на вас.</p>\r\n\r\n<p>&nbsp;</p>\r\n</blockquote>\r\n'),(217,'<p><br />\r\nВ статье рассказывается о том, что такое первая любовь, что чувствует человек в этот период жизни.</p>\r\n\r\n<blockquote>\r\n<p><br />\r\n<br />\r\nЕсли вы спросите о ней своих родителей, бабушек или дедушек, они мечтательно поднимут глаза к небу и улыбнутся. Какой бы, возможно, трагедией она не обернулась для них в юности, первая любовь, спустя много времени, приносит только приятные ностальгические воспоминания.</p>\r\n\r\n<p>&nbsp;</p>\r\n</blockquote>\r\n\r\n<p>Сразу вспоминаются те первые нежные слова, робкие поцелуи и признания, имеющие аромат доверчивости и готовности жертвовать всем ради любимого. <strong>Только первая любовь воспринимается человеком настолько серьезно,</strong> потому что с получением житейского опыта и взросления вы становитесь уже не тем романтиком, что были раньше.</p>\r\n\r\n<p>Может быть, сказки о любви еще свежи в вашей памяти, или мерки об идеальном партнере еще не столь категоричны, и потому вам кажется, что именно ваш нынешний партнер по отношениям является человеком всей вашей жизни.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><strong>Со временем мечты и фантазии уступают место реальному взгляду на мир. </strong></p>\r\n\r\n<blockquote>\r\n<p>Почему-то сейчас вырастают незыблемые преграды, которые раньше вы переступили бы без раздумья. Что и говорить, первая любовь &ndash; это сочетание сумасбродства с юношеским максимализмом. И все же, как это прекрасно!</p>\r\n</blockquote>\r\n\r\n<p><strong>1</strong>.Если вы скажете молодому человеку, переживающему это непередаваемое чувство первой любви, что в будущем он не будет рядом со своей нынешней половинкой, он искренне удивится и будет яростно протестовать, говорить, что не представляет дальнейшей жизни без своей возлюбленной.&nbsp;</p>\r\n\r\n<p><strong>2</strong>.К сожалению, многие из нас не могут уберечь это нежное чувство, и искренне завидуют тем редким случаям, когда люди, впервые полюбившие, проживают вместе всю жизнь. Наверное, у них есть свои непередаваемые секреты сохранения отношений, или они просто вовремя научились ценить и уважать друг друга, избегая мелких ссор и недопониманий, разбивающих всю поэзию первой любви.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong> &nbsp; &nbsp; &nbsp;фото ступеней любви</strong></p>\r\n\r\n<p>Любовь должна пройти такие испытани:</p>\r\n\r\n<p><strong>1.</strong> как взросление</p>\r\n\r\n<p><strong>2</strong>.становление личности</p>\r\n\r\n<p><strong>3.</strong> нехватка денег</p>\r\n\r\n<p><strong>4.</strong>разногласия в быту</p>\r\n\r\n<p><strong>5.</strong>рождение и воспитание детей.</p>\r\n\r\n<p>Часто отношения между людьми так непрочны, а характеры так непохожи, что даже самая пламенная страсть остужается с приходом малейших поводов для раздора.</p>\r\n\r\n<blockquote>\r\n<p>А потому, цените друг друга именно тогда, когда это нужно, а не в тот момент, когда вы поняли, что все для вас потеряно. Храните свою первую любовь, сделайте ее бессмертной!</p>\r\n\r\n<p>&nbsp;</p>\r\n</blockquote>\r\n'),(218,'<p><br />\r\nВ статье рассказывается о том, что такое первая любовь, что чувствует человек в этот период жизни.</p>\r\n\r\n<blockquote>\r\n<p><br />\r\n<br />\r\nЕсли вы спросите о ней своих родителей, бабушек или дедушек, они мечтательно поднимут глаза к небу и улыбнутся. Какой бы, возможно, трагедией она не обернулась для них в юности, первая любовь, спустя много времени, приносит только приятные ностальгические воспоминания.</p>\r\n\r\n<p>&nbsp;</p>\r\n</blockquote>\r\n\r\n<p>Сразу вспоминаются те первые нежные слова, робкие поцелуи и признания, имеющие аромат доверчивости и готовности жертвовать всем ради любимого. <strong>Только первая любовь воспринимается человеком настолько серьезно,</strong> потому что с получением житейского опыта и взросления вы становитесь уже не тем романтиком, что были раньше.</p>\r\n\r\n<p>Может быть, сказки о любви еще свежи в вашей памяти, или мерки об идеальном партнере еще не столь категоричны, и потому вам кажется, что именно ваш нынешний партнер по отношениям является человеком всей вашей жизни.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><strong>Со временем мечты и фантазии уступают место реальному взгляду на мир. </strong></p>\r\n\r\n<blockquote>\r\n<p>Почему-то сейчас вырастают незыблемые преграды, которые раньше вы переступили бы без раздумья. Что и говорить, первая любовь &ndash; это сочетание сумасбродства с юношеским максимализмом. И все же, как это прекрасно!</p>\r\n</blockquote>\r\n\r\n<p><strong>1</strong>.Если вы скажете молодому человеку, переживающему это непередаваемое чувство первой любви, что в будущем он не будет рядом со своей нынешней половинкой, он искренне удивится и будет яростно протестовать, говорить, что не представляет дальнейшей жизни без своей возлюбленной.&nbsp;</p>\r\n\r\n<p><strong>2</strong>.К сожалению, многие из нас не могут уберечь это нежное чувство, и искренне завидуют тем редким случаям, когда люди, впервые полюбившие, проживают вместе всю жизнь. Наверное, у них есть свои непередаваемые секреты сохранения отношений, или они просто вовремя научились ценить и уважать друг друга, избегая мелких ссор и недопониманий, разбивающих всю поэзию первой любви.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong> &nbsp; &nbsp; &nbsp;фото ступеней любви</strong></p>\r\n\r\n<p>Любовь должна пройти такие испытания:</p>\r\n\r\n<p><strong>1.</strong> как взросление</p>\r\n\r\n<p><strong>2</strong>.становление личности</p>\r\n\r\n<p><strong>3.</strong> нехватка денег</p>\r\n\r\n<p><strong>4.</strong>разногласия в быту</p>\r\n\r\n<p><strong>5.</strong>рождение и воспитание детей.</p>\r\n\r\n<p>Часто отношения между людьми так непрочны, а характеры так непохожи, что даже самая пламенная страсть остужается с приходом малейших поводов для раздора.</p>\r\n\r\n<blockquote>\r\n<p>А потому, цените друг друга именно тогда, когда это нужно, а не в тот момент, когда вы поняли, что все для вас потеряно. Храните свою первую любовь, сделайте ее бессмертной!</p>\r\n\r\n<p>&nbsp;</p>\r\n</blockquote>\r\n'),(219,'<p>Принципы и понятия воспитания ребенка на 3, 4 году жизни.</p>\r\n\r\n<blockquote>\r\n<p><br />\r\n<br />\r\nПериод развития ребенка в возрасте от 3 до 4 лет является наиболее определяющим и важным этапом в его жизни.</p>\r\n</blockquote>\r\n\r\n<p>Опираясь на исследования ученых, можно сказать о том, что основой его развития в это время является его положительное самоощущение:</p>\r\n\r\n<p><strong>1.</strong>уверенность ребенка в себе и в своих действиях</p>\r\n\r\n<p><strong>2.</strong>ощущение того, что он является самым любимым и самым хорошим.</p>\r\n\r\n<p>Но сами по себе такие ощущения у малышей не возникают. Они появляются у них только тогда, когда у них установлен счастливый, доверительный и искренний контакт с родителями и другими близкими членами семьи.</p>\r\n\r\n<p style=\"text-align: center;\"><strong>Поэтому воспитание ребенка 3-4 года должно быть выстроено таким образом, чтобы маленький человечек постоянно ощущал заботу и любовь со стороны близких ему людей.</strong></p>\r\n\r\n<p>И для этого много не надо, всего лишь:<br />\r\n<strong>1. </strong>чаще прижимать свое маленькое сокровище к себе</p>\r\n\r\n<p><strong>2.</strong> тихо, ласково вести с ним разговор</p>\r\n\r\n<p><strong>3.</strong> во время ссор и конфликтов стараться как можно доступнее все объяснять. &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong> &nbsp; &nbsp; &nbsp; &nbsp; фото ребенка в обьятьях родителей</strong></p>\r\n\r\n<p>Безусловно, чтобы быть хорошими родителями, прежде всего надо любить и понимать своего малыша. Но и не лишним будет иметь некоторые познания в области возрастных особенностей ребенка, а также способствовать его личностному, социальному и познавательному развитию.</p>\r\n\r\n<p style=\"text-align: center;\"><strong>Вообще, милые родители, нужно знать, что в научной литературе, посвященной дошкольному периоду, есть такое определение, как нежный возраст. </strong></p>\r\n\r\n<p>Не известно с чем связано такое название, может благодаря тому, что именно в этом возрасте дети особенно очаровательны и привлекательны и взрослые с упоением наблюдают за их мимикой, движениями, поступками. Однако, несмотря на все очарование, счастье и радость, именно этот возраст может вызвать у родителей массу проблем.</p>\r\n\r\n<p>1,Очень часто малыш не слушается взрослых</p>\r\n\r\n<p>2.не может занять себя, при этом капризничает и постоянно требует внимания со стороны родителей</p>\r\n\r\n<p>3.также может проявлять агрессию к другим детям и родителям.</p>\r\n\r\n<p>Взрослые такое поведение ребенка очень часто связывают с его избалованностью. Также по незнанию, родители характеризуют поведение малыша, как неправильное, хотя наука дает этому совсем другое объяснение.</p>\r\n\r\n<p>Ученые связывают такое поведение с отношениями <strong>&laquo;родители и дети&raquo;,</strong> которые в основном обусловлены неправильным поведением первых. Также стоит отметить и то, что правильное воспитание детей на данном этапе очень влияет на их здоровье и развитие.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; фото спортивного ребенка</strong></p>\r\n\r\n<p>Очень важно в этом возрасте начинать физически развивать ребенка, так как от этого зависит и развитие его умственных способностей. Но здесь самое главное &ndash; не переусердствовать, чтобы не вызвать у ребенка отвращения к занятиям физкультурой и умственным упражнениям.</p>\r\n\r\n<p>В возрасте 3-4 лет ребенок подвержен частой смене настроения и это вовсе не капризы, а формирование и становление его характера. Именно в этот период малыш начинает пересматривать свои взгляды на некоторые вещи. И родителям желательно не упустить этот момент и постараться перестроить свое поведение.</p>\r\n\r\n<blockquote>\r\n<p>Уважаемые папы и мамы, не оставляйте своего малыша наедине с его мыслями, так как только вы сможете доходчиво и подробно объяснить ему о тех трудностях, с которыми столкнется он.</p>\r\n</blockquote>\r\n'),(220,'<p style=\"text-align: center;\"><strong>4 вещи, препятствующие развитию креативности у ребенка￼</strong></p>\r\n\r\n<blockquote>\r\n<p><br />\r\nНаличие креативности помогает решать многие проблемы во взрослой жизни. Что может помешать развитию креативности у вашего ребенка?</p>\r\n\r\n<p>&nbsp;</p>\r\n</blockquote>\r\n\r\n<p><br />\r\n<br />\r\nТворческие способности есть у всех детей с рождения. Им не нужно учиться использовать свое воображение. К сожалению, взрослые могут все испортить. А жаль, потому что креативность помогает справиться с повседневностью и делает жизнь полной радости! Однако родители неоднократно подавляют воображение детей.</p>\r\n\r\n<p style=\"text-align: center;\"><strong>Вот 4 вещи, из-за которых ребенок забывает о своих творческих способностях.</strong></p>\r\n\r\n<p><strong>1. </strong>Контроль</p>\r\n\r\n<p>Вы каждую минуту проверяете, что именно делает ваш малыш?</p>\r\n\r\n<p>1)Дайте ему больше свободы</p>\r\n\r\n<p>2). Помните, что креативность нуждается в свободе.</p>\r\n\r\n<p>3)Даже если вы любите играть с ребенком, вы не должны управлять всеми его занятиями.</p>\r\n\r\n<p>4)Также не подталкивайте его к готовому решению. Пусть ваш малыш научится искать выход даже из сложных ситуаций и не рассчитывать на вашу постоянную помощь.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong> фото скучающего ребенка</strong></p>\r\n\r\n<p><strong>2</strong>.<strong> </strong>Напряженный график</p>\r\n\r\n<p>Вы хотите, чтобы ваши дети никогда не скучали, и плотно заполняете все их свободное время? Конечно, внеклассные мероприятия развивают детей, но лучшие идеи приходят от... скуки! Взрослые очень боятся ее, а дети даже любят.</p>\r\n\r\n<p style=\"text-align: center;\"><strong>Именно скука позволяет им развивать воображение!</strong></p>\r\n\r\n<p><strong>3</strong>. Строгое воспитание</p>\r\n\r\n<p>Ребенок нуждается в наличии понятных и четких правил поведения, но они, в то же время, должны оставлять ему свободное пространство для действий.</p>\r\n\r\n<p>Попробуйте отказаться от каких-то ежедневных вещей, из-за которых ваш ребенок не может играть тогда, когда он хочет, и так, как он хочет. Конечно, мы не говорим об игре среди ночи, но иногда стоит сделать исключение и позволить ребенку самому решать, как он хочет провести время.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong> фото ребенка с наградой</strong></p>\r\n\r\n<p><strong>4.</strong> &quot;Мотивация&quot;</p>\r\n\r\n<p>Вы приучили своего ребенка к тому, что каждый раз, когда он делает что-то, получает награду? Неужели полностью съеденный обед или уборка в комнате &ndash; занятия, на самом деле требующие много усилий? Поощрительные награды приводят к тому, что ребенок выполняет поручения только для получения награды, не думая о поиске интересных решений. Но ведь даже само действие может быть интересным!<strong> </strong></p>\r\n\r\n<blockquote>\r\n<p><strong>Научите малыша, что каждый из вас имеет в доме свои обязанности, и не подкупайте его.</strong></p>\r\n</blockquote>\r\n'),(221,'<blockquote>\r\n<p>Вашим детям не нужно все ваше внимание.</p>\r\n</blockquote>\r\n\r\n<p style=\"text-align: center;\"><strong>Как быть избирательным для своей выгоды.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Родители, технологии, YouTube и социальные сети сговорились создать привлекательных монстров. Эти монстры - наши дети, и они будут делать что угодно, чтобы заставить кого-то обратить внимание. Даже когда есть негативные причины и они закричат, ваше увеличенное внимание продолжает мотивировать неприятное поведение детей. И все это неуместное поведение действительно может отнять радость воспитания. Трудно наслаждаться временем с детьми, когда они отвратительны.</p>\r\n\r\n<p style=\"text-align: center;\"><br />\r\n<strong>Родители обучаются с того момента, как их ребенок задумал привлекать внимание к ним.</strong></p>\r\n\r\n<p><strong>1.</strong>Это начинается с недельных подробностей, представленных на родительских сайтах о чудесах, которые происходят внутри живота женщины.</p>\r\n\r\n<p><strong>2</strong>.Когда ребенок появляется, книги и видеоролики поощряют множество практических занятий. Добавьте необходимость публикаций фотографий и рассказов наших детей, делающих в основном что угодно, и у вас есть идеальная среда для постоянных проступков.</p>\r\n\r\n<p style=\"text-align: center;\"><strong>&nbsp; фото новорожденного</strong><br />\r\n<strong>Конечно, новорожденные нуждаются в кормлении, прогулках и ласке.</strong></p>\r\n\r\n<p>В течение этого времени родители должны заботиться о каждом ребенке. Это создает надежные условия, которые помогают ребенку чувствовать себя комфортно, чтобы расти и обучаться в будущем.<br />\r\nНо поскольку ребенок превращается в малыша, потребности ребенка меняются. Дети привыкли плакать, чтобы получить то, что они хотят. И родители, которые привыкли обращаться к каждому хныку и скулить от своих новорожденных, забывают переходить на другой вид воспитания.</p>\r\n\r\n<blockquote>\r\n<p><br />\r\nКогда дети становятся старше, они узнают, что ныть, плакать, жаловаться, и бросаться истерику - все это эффективные способы добиться желаемого.</p>\r\n</blockquote>\r\n\r\n<p><br />\r\nДети довольно умны. Они действуют только таким образом, который приносит им пользу.<br />\r\nРодители поддаются махинациям своих детей по разным причинам. Возможно, они отвлекаются на заботу о других детях или заняты домашними хлопотами.<br />\r\nПроблема состоит в том, что любое усиление поведения чаще повторяется. Поэтому каждый раз, когда мама говорит &laquo;нет&raquo; для печенья, но затем, после истерики, &laquo;хорошо, но только одно&raquo;, она усиливает это поведение.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; фото истерящего ребенка</strong></p>\r\n\r\n<p style=\"text-align: center;\"><br />\r\n<strong>Чтобы улучшить поведение, родители должны перестать уделять внимание детям (даже отрицательное внимание) когда они плохо себя ведут.</strong></p>\r\n\r\n<p><br />\r\n<strong>1</strong>.Вместо того, чтобы уступать плохому поведению, родители должны полностью его игнорировать.</p>\r\n\r\n<p><strong>2.</strong>Как только капризы прекратятся, нужно общаться с детьми, как будто этого эпизода никогда не было.<br />\r\n<strong>3.</strong>Дети быстро получат сообщение о том, что их поведение не стоит усилий. Зачем бросаться в истерику или плохо себя вести, если из этого ничего не выйдет?</p>\r\n\r\n<p><br />\r\n<strong>Чтобы быть ясным, есть несколько способов поведения, которые вы не должны игнорировать</strong>.</p>\r\n\r\n<p><strong>-</strong>Не пренебрегайте ребенком, который испытывает настоящую боль.</p>\r\n\r\n<p><strong>-</strong>Не игнорируйте любое поведение, которое опасно или может причинить вред другому ребенку или взрослым.</p>\r\n\r\n<p><strong>-</strong>Самое главное, никогда не игнорировать хорошее поведение.</p>\r\n'),(222,'<p>&nbsp;Данная статья расскажет о том, как подготовить малыша к посещению детского сада и сделать процесс адаптации максимально мягким.</p>\r\n\r\n<blockquote>\r\n<p>Как правило, когда у мамы заканчивается отпуск по уходу за ребенком, малыш тоже отправляется на свою первую &laquo;работу&raquo; &ndash; в детский сад.</p>\r\n</blockquote>\r\n\r\n<p>И это настолько ответственный и сложный этап в жизни крохи, что к нему стоит серьезно подготовиться. Как же сделать по возможности наименее травмирующим переход из уютного и безопасного семейного окружения в детское учреждение, где малышу предстоит провести 3&ndash;4 года?</p>\r\n\r\n<p><strong>1.</strong> Теоретическая подготовка</p>\r\n\r\n<p>Желательно за 2&ndash;3 месяца до поступления в садик начать рассказывать ребенку о том, что другие дети тоже туда ходят. При этом очень важно акцентировать внимание на положительных моментах в посещении детского сада.</p>\r\n\r\n<p>1)Описать, какие чудесные там игрушки</p>\r\n\r\n<p>2)Как дети занимаются все вместе</p>\r\n\r\n<p>3) Можно рассказать малышу о примерном режиме дня в саду, это поможет ему легче адаптироваться к новому распорядку, ведь он уже будет в курсе того, что его ожидает.&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong> фото самостоятельного малыша</strong></p>\r\n\r\n<p style=\"text-align: center;\"><strong>Очень важно перед поступлением в детский сад научить ребенка основным навыкам самообслуживания. </strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Если он будет многое уметь делать самостоятельно, то почувствует себя гораздо более уверенно, а это поможет быстрой адаптации.</p>\r\n\r\n<p>Как минимум, малыш должен:</p>\r\n\r\n<p>-уметь аккуратно кушать</p>\r\n\r\n<p>-проситься в туалет</p>\r\n\r\n<p>-а также четко выражать свои желания.</p>\r\n\r\n<p><strong>2.</strong> Практическая подготовка</p>\r\n\r\n<p>Как правило, многие воспитатели во второй половине августа уже находятся на рабочем месте и активно готовятся к приему ребятишек.</p>\r\n\r\n<p>-<strong>&nbsp;</strong>Было бы неплохо в это время вместе с малышом посетить группу, осмотреться, познакомиться с воспитательницей. Когда ребенок придет в садик в качестве воспитанника, окружающая обстановка уже не будет для него совершенно незнакомой, это поможет ему быстрее сориентироваться и привыкнуть к новой жизни.</p>\r\n\r\n<p><strong><em>-</em></strong> Желательно сразу рассказать воспитательнице об основных особенностях поведения и характере малыша, о том, на какие продукты у него аллергия, какие блюда он категорически отказывается есть. <strong>Чем больше воспитатель будет знать о ребенке, тем лучше.</strong></p>\r\n\r\n<p style=\"text-align: center;\"><strong>Посещение детского сада лучше всего начать с 1 сентября. </strong></p>\r\n\r\n<p><strong>1)</strong>Во-первых, дети с самого начала вместе адаптируются к новому распорядку и образу жизни, поэтому процесс привыкания к дошкольному учреждению проходит значительно легче.</p>\r\n\r\n<p><strong>2)</strong>Во-вторых, во многих садиках в этот день устраивается небольшой праздник, малышам это очень нравится.</p>\r\n\r\n<p><strong>3)</strong>В-третьих, иногда в первые недели посещения, когда дети только знакомятся с группой и воспитателем, мамам разрешается присутствовать в саду. Позже такая возможность может не представиться.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong>фото часов</strong></p>\r\n\r\n<p><strong>3. </strong>Полезные рекомендации</p>\r\n\r\n<blockquote>\r\n<p>У малышей еще не сформировано представление о времени, поэтому слова &laquo;я скоро за тобой приду&raquo; кроху вряд ли удовлетворят.</p>\r\n</blockquote>\r\n\r\n<p><strong>1)</strong>Лучше говорить, ориентируясь на определенные действия, происходящие в саду. Например, можно пообещать забрать малыша после сна или после прогулки. Но при этом обязательно следует выполнить обещанное и прийти в указанный промежуток времени, иначе ребенок будет относиться к посещению сада с недоверием и опаской. Ведь если малыш не знает, когда мама его заберет, то трудно быть спокойным и получать удовольствие от игр.</p>\r\n\r\n<p><strong>2)</strong>Если у крохи сильная привязанность к маме, то лучше, если первое время в садик его будет отводить папа. Как правило, это помогает избежать истерик при расставании.</p>\r\n\r\n<p><strong>3)</strong>Первое время ребенок может брать с собой в сад любимую игрушку, которая будет для него как бы частью &laquo;домашней жизни&raquo;, а также выполнять роль друга, ведь малыш не сразу найдет себе товарища.</p>\r\n\r\n<p style=\"text-align: center;\"><strong>Забирая кроху из детского сада, важно обращать внимание на его настроение, обязательно поинтересоваться, как он провел день. Искренняя заинтересованность мамы поможет малышу быстрее привыкнуть к наступившим в его жизни переменам.</strong></p>\r\n'),(223,'<p>Рекомендации о том, как привить ребенку хорошие манеры.</p>\r\n\r\n<blockquote>\r\n<p>Воспитание - постоянная тема, которая сопровождает родителей на протяжении всего периода взросления их чад.</p>\r\n</blockquote>\r\n\r\n<p>Малышам, которые усвоили правила поведения еще в детстве, легче взаимодействовать с окружающим миром.<br />\r\nЕсли родители подают хороший пример, то дети быстро учатся правилам поведения в обществе. Вежливым манерам учатся у взрослых.</p>\r\n\r\n<p style=\"text-align: center;\"><strong>Элементарные правила поведения для детей:</strong></p>\r\n\r\n<p><strong>1. </strong>В вашей семье должно быть повседневным правилом благодарность. &laquo;Пожалуйста&raquo;, &laquo;спасибо&raquo;, &laquo;приятного аппетита&raquo; - эти слова ребенок должен слышать постоянно.</p>\r\n\r\n<p><strong>2.</strong> Правила гигиены.</p>\r\n\r\n<p>2.1 После каждой прогулки, посещения туалета и перед едой руки тщательно вымыть.</p>\r\n\r\n<p>2.2 Всегда иметь при себе салфетки.</p>\r\n\r\n<p>2.3 Ребенок должен самостоятельно следить за своей гигиеной, внешним видом, состоянием прически.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; фото ребенка за столом</strong></p>\r\n\r\n<p><strong>3. </strong>Еда &ndash; не игрушка. Научите малыша пользоваться ложкой и вилкой до школы.</p>\r\n\r\n<p><strong>4.</strong> За столом необходимо сидеть прямо, не опираясь на локти.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><strong>Ссоры, скандалы &ndash; неэффективный способ решения конфликтов.</strong></p>\r\n\r\n<p><strong>5.&nbsp;</strong>Опять же, родители - лучшие образцы для подражания. Если они решают недомолвки цивилизованным образом, дети имеют больше шансов сделать так же. Строго пресекайте нецензурную брань, ругательства со стороны окружающих.</p>\r\n\r\n<p><strong>6.</strong> Ежедневно показывайте ребенку уроки вежливости и уважения, например, уступив место в транспорте пожилому человеку.</p>\r\n\r\n<p><strong>7.</strong> Уважайте личное пространство ребенка и научите уважать ваше право на личные границы. Тот факт, что ребенок стучит перед входом в спальню, уже говорит о его воспитанности.</p>\r\n\r\n<p><strong>8.</strong> Ковыряться в зубах, носу, грызть ногти &ndash; недопустимо.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong> фото ребенка-вандала</strong></p>\r\n\r\n<p><strong>9.</strong> Научите малыша уважать не только взрослых, но и животных, растения, чужое имущество.</p>\r\n\r\n<p><strong>10.</strong> Обязательно научите малыша основным правилам безопасности!</p>\r\n\r\n<p>Сегодня существует много помощников для обучения:</p>\r\n\r\n<p>10.1тематические мультфильмы</p>\r\n\r\n<p>10.2 игры</p>\r\n\r\n<p>10.3&nbsp;конкурсы</p>\r\n\r\n<p>10.4 эстафеты.</p>\r\n\r\n<blockquote>\r\n<p>Периодически напоминайте важную информацию. Беду лучше предотвратить.</p>\r\n</blockquote>\r\n\r\n<p><strong>11.</strong> Объясните ребенку ответственность за его поступки, научите признавать ошибки.</p>\r\n\r\n<p>Вместо наказания и упреков, вы можете и должны помочь любимому чаду адекватно реагировать на различные жизненные ситуации, искать способы взаимодействия с окружающим миром, развивать социальные навыки.</p>\r\n\r\n<p>В игровой форме, доступным языком даже неопытные родители смогут привить ребенку элементарные правила вежливого поведения.</p>\r\n'),(224,'<p>Современным детям можно только позавидовать. Ассортимент игрушек настолько огромен, что сможет удивить даже самого искушенного покупателя, а в детском магазине легко заблудиться. Среди множества товаров всегда определяются такие, которые есть у всех.</p>\r\n\r\n<p style=\"text-align: center;\"><strong>Что же сейчас в топах популярности среди игрушек?</strong></p>\r\n\r\n<p>Производители детских игрушек ежегодно тратят много времени и денег в попытке создать что-то новое, чтобы завоевать внимание покупателей.</p>\r\n\r\n<p><strong>1.</strong>То и дело появляются престижные новинки, обещающие стать следующим бестселлером и принести компании значительную прибыль.</p>\r\n\r\n<p><strong>2.</strong>Многие из этих игрушек быстро теряют свою популярность</p>\r\n\r\n<p><strong>3.</strong>Но есть и такие, которые остаются в топе продаж многие годы.</p>\r\n\r\n<blockquote>\r\n<p><br />\r\nВ современном мире высоких технологий электронные игрушки пользуются наибольшей популярностью.</p>\r\n</blockquote>\r\n\r\n<p>То, что сравнительно недавно еще считалось научной фантастикой, теперь настолько внедрилось в нашу жизнь, что стало вполне обычным развлечением для ребенка.&nbsp;<br />\r\nЭлектронные игрушки включают в себя&nbsp;широкий спектр товаров от поющих медвежат до радиоуправляемых машин и могут стоить от нескольких десятков до нескольких сотен тысяч рублей.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<strong> &nbsp; фото видеоигр</strong></p>\r\n\r\n<p><br />\r\nТоп рейтинга самых продаваемых игрушек последние два-три десятилетия занимают видеоигры. С тех пор, как первые компьютеризированные игры стали доступны в виде приставок для домашнего телевизора, этот вид развлечения продолжает бесконечно модернизироваться и набирать популярность с каждым годом.</p>\r\n\r\n<blockquote>\r\n<p>Сегодняшние видеоигры значительно превосходят даже те, что были выпущены только пять лет назад. Постоянно улучшаются графика и доступные опции.</p>\r\n</blockquote>\r\n\r\n<p><br />\r\nНо есть еще один вид игрушек, который надолго завоевал топ продаж. Это электронная техника, переделанная в игрушки для детей.<br />\r\nНапример, в качестве детских игрушек выпускаются музыкальные плееры.</p>\r\n\r\n<p><strong>1.</strong>Есть модели даже для малышей от шести месяцев.</p>\r\n\r\n<p><strong>2.</strong>Детские музыкальные плееры сконструированы так, чтобы с ними было удобно обращаться, когда еще не умеешь читать.</p>\r\n\r\n<p><strong>3.</strong>Многие плееры дополнены играми, возможностью просмотра видео и выхода в интернет.</p>\r\n\r\n<p><strong>4</strong>.С помощью детских плееров мамы развлекают малышей в поездках и в очередях, а дети постарше формируют свои первые музыкальные предпочтения.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong> &nbsp; фото ребенка за компьютером&nbsp;</strong><br />\r\nЕсть множество других электронных устройств, которые специально переделали для детей. Можно найти детские электронные книги, предназначенные для обучения чтению, детские цифровые камеры, даже детские портативные компьютеры.</p>\r\n\r\n<blockquote>\r\n<p><br />\r\nОчевидно, детям нравится идти в ногу со временем и использовать технологии наряду со взрослыми.</p>\r\n</blockquote>\r\n'),(225,'<p>Какие поступки разрушают отношения быстрее всего? Что может сделать девушка, чтобы сохранить отношения?</p>\r\n\r\n<blockquote>\r\n<p>Если ты дорожишь своими отношениями и партнером, никогда не совершай того, о чем пойдет речь ниже. Это способно разрушить даже самые крепкие отношения.</p>\r\n</blockquote>\r\n\r\n<p>&nbsp;<br />\r\n<strong>1.</strong>Попытки изменить его</p>\r\n\r\n<p>Тебе может показаться, что таким образом ты делаешь своему партнеру одолжение, помогаешь ему измениться и стать лучше во всех смыслах.</p>\r\n\r\n<p>Но нужно понять и принять тот факт, что он, скорее всего, не хочет ничего менять в своей жизни и прекрасно чувствует себя как есть. Попытки изменить человека &ndash; пустая трата времени и сил. Да и мало кому это может понравиться.<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&nbsp;фото ссоры пары<br />\r\n<strong>2.</strong>Ссоры на публике<br />\r\nТак ты демонстрируешь свое глубокое неуважение к партнеру. Или негатива накопилось столько, что ты только и ищешь возможности выплеснуть его наружу? &nbsp; &nbsp; Во всяком случае, выяснять отношения нужно не на потеху публике, а дома.</p>\r\n\r\n<p><br />\r\n<strong>3.</strong>Слежка</p>\r\n\r\n<p>Взломать его аккаунт в соцсети было делом плевым. Зато теперь ты знаешь о нем все: с кем он общается, с кем поддерживает хорошие отношения и, конечно, детали переписки. А он об этом знает? Нет?</p>\r\n\r\n<p>А теперь представь, как он отреагирует, когда все выяснится. Даже если он никогда не узнает об этом, уверена ли ты, что хочешь увидеть его переписку? Это один из тех случаев, когда знание бывает лишним.<br />\r\n&nbsp;<br />\r\n<strong>4.</strong>Критиковать его семью<br />\r\n&nbsp;<br />\r\nКакие бы &laquo;тараканы в голове&raquo; ни были у его родных, тебе не следует дурно отзываться о них. Вероятно, он и сам все прекрасно понимает, просто услышать правду от другого человека &ndash; всегда неприятно.<strong> Это может подорвать ваши отношения.<br />\r\n&nbsp;</strong><br />\r\n<strong>5</strong>.Врать<br />\r\n&nbsp;</p>\r\n\r\n<p>Об этом скажет всякий психолог и опытный в отношениях человек:<strong> доверие &ndash; основа отношений.</strong></p>\r\n\r\n<blockquote>\r\n<p>Если вы постоянно что-то скрываете друг от друга, недоговариваете или врете, отношения уж никак нельзя считать здоровыми.<strong>А если это так, нужны ли они вам вообще?</strong></p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n</blockquote>\r\n'),(226,'<p>В статье содержатся советы по преодолению ребенком ощущения ложной боязни в условиях полной или частичной темноты.</p>\r\n\r\n<blockquote>\r\n<p>Не существует практически ни одного ребенка, который бы комфортно чувствовал себя в сумраке. Боязнь возникает чаще всего из-за богатой природной фантазии, которая рисует малышам монстров и чудовищ в затемненных углах комнаты.</p>\r\n</blockquote>\r\n\r\n<p>У впечатлительных детей такой страх может вызвать множество негативных расстройств:</p>\r\n\r\n<p>- истерический плач</p>\r\n\r\n<p>- постоянное ощущение тревоги</p>\r\n\r\n<p>- стабильную фобию</p>\r\n\r\n<p>Бороться с этой боязнью практически бесполезно, поэтому страхи называют ступеньками детства<strong>.</strong></p>\r\n\r\n<p style=\"text-align: center;\"><strong>Чтобы снизить неблагоприятное воздействие детской тревоги, стоит прислушаться к советам и рекомендациям психологов. Тем более что в коррекции поведения малыша при боязливых ощущениях для родителей существует больше категорических табу, чем правильных действий.</strong></p>\r\n\r\n<p>&nbsp;<br />\r\n1.Нельзя насильно оставлять ребенка в темной комнате, надеясь, что он перешагнет порог ужаса самостоятельно. Не все дети обладают еще по-настоящему волевым характером, чтобы без последствий для психического здоровья пересилить этот страх.</p>\r\n\r\n<p><br />\r\n2.Если ребенок панически боится спать один, стоит решать такой вопрос конструктивно, без категорических запретов и ультимативных заявлений.</p>\r\n\r\n<p>2.1 Проводить ночной сон с открытыми дверьми во всех комнатах</p>\r\n\r\n<p>2.2 Поспать некоторое время вместе с малышом или забрать его к себе &ndash; лучшие варианты выхода из ситуаций.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <strong>фото ребенка гуляющего ночью</strong><br />\r\n3.Приучать к темноте ребенка стоит постепенно и совместно. То есть прогуливаться по ночным улицам хотя бы иногда. В домашних условиях также можно создавать игровые ситуации, танцевать и слушать музыку в полусумраке, чтобы малыш чувствовал себя спокойно при недостатке света.</p>\r\n\r\n<p style=\"text-align: center;\"><br />\r\n<strong>Наличие собственного фонарика у ребенка также добавит ему уверенности и храбрости.</strong></p>\r\n\r\n<p>4.Особенно если предварительно поиграть с малышом в теневой театр с помощью этого самого светильника и импровизированной сцены из простыни или покрывала. В этом случае стоит направить буйную детскую фантазию в русло творчества, пусть даже с негативными героями, но обязательно со счастливым концом.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong> &nbsp;фото монстра под кроватью</strong><br />\r\n5.Психотерапия страхов с помощью рисунка может проводиться и одним из родителей, которому малыш больше всего доверяет. Прорисовывание того, что пугает &ndash; лучшее избавление от внутренних тревог. Стоит помнить лишь, что в результате добрый герой обязан победить, а зло должно быть наказано.</p>\r\n\r\n<p><br />\r\n6.Оборудование детской комнаты гирляндами или светящимися ночниками также пойдет на пользу. А посещение планетария подарит ребенку незабываемые эмоциональные моменты и докажет познавательные свойства ночной тьмы.</p>\r\n\r\n<blockquote>\r\n<p><br />\r\n<strong>В любом случае помогать собственному чаду в борьбе с его детскими страхами &ndash; обязанность каждого ответственного родителя.</strong></p>\r\n</blockquote>\r\n\r\n<p>Но почувствовать душу ребенка и не навредить ей можно только с адекватным и терпеливым подходом к этому вопросу. А также стоит не забывать хвалить малыша за каждую маленькую победу, искренне радуясь тому, что темнота все больше становится загадочным другом, а не опасным врагом.</p>\r\n'),(227,'<p style=\"text-align: center;\"><strong>Ваш ребенок в очередной раз устроил истерику посреди улицы или в магазине? Вы не знаете, что делать? Наши советы помогут вам его успокоить.</strong></p>\r\n\r\n<p><br />\r\nДети не всегда бывают милыми и послушными. Иногда они устраивают настоящие истерики, а еще хуже, если это происходит в общественном месте. Что вы можете сделать, чтобы быстро успокоить своего ребенка?<br />\r\n<strong>1.Понять</strong><br />\r\nСтоит помнить, что ребенок делает это не для того, чтобы вас позлить. Ребенок не знает, что плач в магазине или на улице &ndash; это что-то недопустимое. Дети понимают все не так, как взрослые.</p>\r\n\r\n<p><strong>- </strong>прежде чем вы начнете уговаривать малыша успокоиться, постарайтесь успокоиться сами.</p>\r\n\r\n<p><strong>- </strong>то, что вы злитесь, является еще одним стрессовым фактором для ребенка &ndash; в такой ситуации ему трудно перестать плакать.</p>\r\n\r\n<p><br />\r\n<strong>2. Расспросить и узнать источник проблемы</strong><br />\r\nПрежде чем начать кричать на ребенка, спросите его, что именно произошло. Дети не всегда плачут из-за того, что они не могут получить желаемое в данный момент. Причина плача может быть какой угодно &ndash; его могут беспокоить тесные ботиночки или боль в животе.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong> &nbsp; фото &nbsp;плачущий ребенок в магазине</strong><br />\r\n<strong>3. Определить границы еще дома</strong><br />\r\nМаленькие дети с трудом понимают ограничения, с которыми им приходится сталкиваться. Поэтому когда вы собираетесь пойти за покупками вместе с ребенком: 1)объясните ему, какое поведение неприемлемо в общественном месте</p>\r\n\r\n<p>2)скажите ему, может ли он рассчитывать на какую-либо покупку именно для него или нет</p>\r\n\r\n<p>3)не реагируйте на его шантаж</p>\r\n\r\n<p>4) если в магазине малыш начнет капризничать, напомните ему, что вы договорились дома купить ему только один предмет.</p>\r\n\r\n<p>5) Научите его, что выполнение обещаний является очень хорошим качеством.</p>\r\n\r\n<p><br />\r\n<strong>4. Переключить внимание</strong><br />\r\nВместо того чтобы сосредоточиться на истерике малыша, попробуйте занять его чем-то другим. Скажите, что вы спешите, и вам нужно закончить покупки как можно скорее. Его также может заинтересовать его любимая игрушка. <strong>Если вы начнете ругать ребенка за его плач, вы дадите ему дополнительный предлог, чтобы продолжать плакать.</strong><br />\r\n<strong>5. Объяснять</strong><br />\r\n- Не забывайте о трудных ситуациях, которые произошли с вами вне дома.</p>\r\n\r\n<p>- После каждой истерики объясните ребенку, почему его поведение было неуместным.</p>\r\n\r\n<p>- Дайте ему понять, что его слезы &ndash; это манипуляция, которая на вас не действует.</p>\r\n'),(228,'<blockquote>\r\n<p><strong>Важной составной частью всестороннего развития подрастающего поколения является обучение школьника ровному почерку. В прежние годы в начальных классах советской школы детей учили чистому и красивому письму. Сейчас, к сожалению, не во всех российских школах чистописание входит в программу обучения.</strong></p>\r\n</blockquote>\r\n\r\n<p style=\"text-align: center;\"><br />\r\n<strong>Как научить ребёнка красиво писать? Что нужно, чтобы сделать почерк разборчивым и правильным?</strong></p>\r\n\r\n<p><strong>1.</strong>Прежде всего, надо исключить у школьника заболевания, связанные с неспособностью правильно и красиво писать.</p>\r\n\r\n<p>Врач поможет определить причины плохого почерка у ребёнка. Невропатолог проверит наличие у ребёнка проблем с концентрацией внимания, моторикой кистей рук, правильность осанки. Как правило, ребёнок неправильно сидит во время письма или неверно держит ручку.</p>\r\n\r\n<p>Установив причину, можно вырабатывать каллиграфический почерк с помощью различных комплексов упражнений. Правильно подобрать их помогут детский психолог, логопед или школьный учитель.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong>фото пишущего ребенка&nbsp;</strong></p>\r\n\r\n<p><strong>2</strong>.Родителям следует обратить внимание на конструкцию стола и позу ребёнка, когда он пишет или рисует, подбор специальной ручки (она отличается толщиной, формой, материалом, из которого сделана). При выборе ручки необходимо учесть манеру письма &mdash; правой или левой рукой. Важно проследить &mdash; правильно ли он её держит.</p>\r\n\r\n<p><strong>3. </strong>Для получения красивого почерка применяются прописи: обычные или оптимизированные для подростков.</p>\r\n\r\n<p>После занятий мышцы руки сильно устают, поэтому их следует расслабить.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong> фото лепки пластилином</strong></p>\r\n\r\n<p><strong>Мелкая моторика рук, её развитие &mdash; первый шаг к получению красивого почерка. </strong></p>\r\n\r\n<p>Хорошим помощником являются занятия лепкой из глины или пластилина, рисование, различные конструкторы.</p>\r\n\r\n<blockquote>\r\n<p>&nbsp;Добиться красивого почерка у школьника начальных классов гораздо легче, чем у подростка.</p>\r\n</blockquote>\r\n\r\n<p>В большинстве случаев, плохой почерк у ребёнка поддаётся исправлению. Существует много учебников и современных методик по этой проблеме. Но основным условием для достижения успеха являются настойчивость и терпение родителей, а также занятия каждый день в течение длительного времени.<br />\r\n&nbsp;</p>\r\n'),(229,'<p>О том, как приучить малыша ложиться спать без истерик. Какие ритуалы можно использовать. Сколько времени должен спать ребенок.</p>\r\n\r\n<p>Все дети засыпают по-разному.Укладывание в постель не должно вызывать у малышей неприятных ощущений, но непреклонность взрослых является обязательным условием. В редких случаях в виде исключения ребенок может отправиться в постель позже установленного времени, например, в праздничные дни. Многие семьи каждый вечер устраивают дебаты о времени отправления ребенка в постель.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><strong>Так как &laquo;безболезненно&raquo; уложить ребенка спать?</strong></p>\r\n\r\n<p><br />\r\n<strong>1.</strong>&laquo;Тихий час&raquo; посреди дня обязателен для всех детей.</p>\r\n\r\n<p>1.1 Устраивать его желательно сразу после обеда, пока ребенок не начал увлеченно играть.</p>\r\n\r\n<p>1.2 Слова и крики начинают действовать на малыша после трех-четырех лет, до этого времени его желательно вести в постель за руку.</p>\r\n\r\n<p><strong>2.</strong>Перед ночным сном хорошо поговорить о дневных занятиях ребенка. Действенно успокоить его определенным ритуалом перед сном, который повторяется каждый день. К примеру:</p>\r\n\r\n<p>1)Уложить спать игрушку.<br />\r\n2)Уложить в постель ребенка.<br />\r\n3)Поцеловать, рассказать сказку на ночь.<br />\r\n4)Потушить свет.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <strong>&nbsp; &nbsp; &nbsp; &nbsp;фото ребенка с мягкой игрушкой</strong></p>\r\n\r\n<p><strong>3.</strong>Нельзя позволять ребенку оттягивать время. Иногда пункт с прочтением книги можно пропустить. Нередко детки любят брать с собой в постель какую-либо игрушку. Это полезно, любимый мишка или кукла действуют успокаивающе.</p>\r\n\r\n<p><strong>4.</strong> Ребенок может душевно относиться к какому-нибудь предмету обихода, например, к старому одеялу. Не стоит запрещать ему любить эту вещь, нужно лишь напоминать, что наступит такое время, когда этот предмет больше не понадобится.</p>\r\n\r\n<p><strong>5</strong>. После двух лет малыш может бояться засыпать из-за сильных эмоций, ему мешающих. Он часто раздражается из-за &laquo;выяснения&raquo; отношений с родителями по вопросам установки &laquo;сонного времени&raquo;.</p>\r\n\r\n<p><strong>6.</strong>Ребенка более старшего возраста часто беспокоят невыполненные домашние задания. Если малыш мало спит, то нужно стараться увеличить его время отдыха.</p>\r\n\r\n<p><strong>Длительность ночного сна шестилетнего ребенка должна составлять около 12 часов. К 12 годам подросток спит ночью 10 часов.</strong> Это примерные цифры.</p>\r\n\r\n<blockquote>\r\n<p><strong>Все люди индивидуальны, поэтому одному ребенку нужно больше времени для сна, другому меньше.</strong></p>\r\n</blockquote>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong> &nbsp;фото играющего ребенка</strong></p>\r\n\r\n<p>Если ребенок трех-четырех лет не спит днем, то необходимо устроить ему отдых после обеда в виде спокойных занятий в комнате.</p>\r\n\r\n<p style=\"text-align: center;\"><strong>Разумеется, приятно, когда малыш ложится спать охотно. </strong></p>\r\n\r\n<p>1)Необходимо всегда помнить, что ребенок хочет уснуть, а капризничает он просто из-за усталости.</p>\r\n\r\n<p>2)Поэтому готовить его ко сну нужно как можно спокойнее, не спеша.</p>\r\n\r\n<p>3)Важно отложить все семейные ссоры и споры на потом.</p>\r\n\r\n<p>4)Ни в коем случае не ругайтесь на глазах у ребенка вечером.</p>\r\n\r\n<p><strong>7.</strong>Малыша проще уложить спать, так как его можно покачать на руках. Вообще перед сном ребенка важно всячески успокоить, чтобы он легче уснул, а ночью ему не снились кошмары. У себя в кроватке малыш должен чувствовать себя уютно.</p>\r\n\r\n<p>Многие дети боятся спать одни и хотят засыпать в постели родителей. До определенного возраста это возможно, впоследствии, около четырех-пяти лет ребенок сам начнет мечтать об отдельной кроватке. Волноваться по этому поводу не стоит.</p>\r\n\r\n<blockquote>\r\n<p>Важно помнить, что любовь к ребенку способна помочь во всех начинаниях.</p>\r\n</blockquote>\r\n'),(230,'<p>Реальный случай произошел когда-то. К очень интеллигентной бабушке издалека приехал маленький внук. Был он очень ласковый, с голубыми любознательными глазенками, умный и начитанный.</p>\r\n\r\n<p>Бабушка гордилась пятилетним внуком, и водила к знакомым, чтобы все оценили его безупречные манеры и знание литературных произведений. Но в гостях случился страшный конфуз. Милый ребенок вдруг остановился перед зеркалом и глядя на отражение стал смачно материться.</p>\r\n\r\n<p style=\"text-align: center;\"><strong>Разгневанная бабушка потребовала у родителей ответа &ndash; откуда ребенок знает такие отвратительные слова. </strong></p>\r\n\r\n<p>Из садика, ответили родители. И объяснили, что ходили по этому поводу к воспитателю, которая грустно заметила, что в группе 25 человек, и все произносят матерные слова. А бороться с этим явлением невозможно, так как никакие методы не помогают.</p>\r\n\r\n<blockquote>\r\n<p style=\"text-align: center;\"><br />\r\n<strong>В любом случае, посещает ли ребенок детский сад, или приходит с мамой каждый день на детскую площадку, с нецензурной лексикой он обязательно познакомиться</strong></p>\r\n</blockquote>\r\n\r\n<p><strong>1. </strong>Так как каждый день он пополняет свой словарный запас, эти слова будут для него такие же обычные, как и другие: те же различные сочетания букв. Потому для него не будет никакой разницы, какое новое слово произнести &ndash; которое воспринимается как неприличное, или обозначает, например, цвет неба.</p>\r\n\r\n<p><br />\r\n<strong>2. </strong>Если из маленького милого ротика вылетело слово из нецензурной лексики, главное для родителей сдержаться и не устроить грандиозный скандал. Лучше постараться не проявить никаких эмоций, тогда есть вероятность, что слово просто забудется.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong> &nbsp; фото взрослых смеющихся над ребенком</strong></p>\r\n\r\n<p><strong>3.</strong> Есть еще одна родительская реакция. Малыш, похожий на ангелочка, коверкая произносит фразу, которую можно услышать в самой низкосортной забегаловке. Это несоответствие кажется слишком смешным.</p>\r\n\r\n<p>Родители весело смеются, а малышу так нравится, когда все счастливы, и он пытается развеселить всех, снова и снова повторяя запомнившиеся слова. Поэтому слыша от маленького дитя слова нецензурные, нужно вовремя сориентироваться, чтобы потом не ломать голову, как убедить ребенка не произносить такие словосочетания.</p>\r\n\r\n<p><br />\r\n<strong>4.</strong>Если ребенок, вопреки просьбам и наказаниям продолжает произносить запрещенные фразы, пора использовать свою фантазию, придумывая интересные истории, главными героями выступают разные слова. Они в жизни людей играют важную роль.</p>\r\n\r\n<p>1)Одни помогают что-то сделать, другие дарят хорошее настроение</p>\r\n\r\n<p>2)Но есть плохие слова, которые стремятся все испортить в жизни, но хорошие слова ведут с ними борьбу и всегда побеждают.</p>\r\n\r\n<blockquote>\r\n<p><br />\r\n&nbsp;И чтобы убедить ребенка, что плохие слова произносить нельзя, родителям необходимо следить за своим собственным лексиконом.</p>\r\n</blockquote>\r\n'),(231,'<p style=\"text-align: center;\"><strong>&nbsp;10 советов логопедов, помогающих развивать речь дошкольника, наполнять ее новыми словами, делать красивой.&nbsp;</strong></p>\r\n\r\n<p>Речевые нарушения детей являются серьезной проблемой нашего времени. Огорчает то, что количество их не уменьшается, а год от года только растет - всё больше родителей обращается за помощью логопеда. Известно, что речь не дана ребенку от рождения, она развивается и совершенствуется одновременно с физическим и психическим развитием, а также зависит от определенных условий.</p>\r\n\r\n<blockquote>\r\n<p><br />\r\n<br />\r\nВажно, чтобы малыш был здоровым, с нормальным слухом и интеллектом, активным, имел вокруг себя полноценное речевое общение.</p>\r\n</blockquote>\r\n\r\n<p><br />\r\n&nbsp;<br />\r\n<strong>Советы логопеда</strong><br />\r\n&nbsp;<br />\r\n<strong>1) </strong>Основной вид детской деятельности &ndash; игра, поэтому необходимо подбирать речевые игры и упражнения в соответствии с возрастом ребенка. Это могут быть звукоподражательные игры, проговаривание прибауток, потешек, коротких стишков.<br />\r\n&nbsp;<br />\r\n<strong>2)</strong> Так как речь ребенка развивается за счет подражания, взрослым необходимо следить за собой: правильно и четко произносить все звуки, медленно проговаривать каждое слово от начала до конца, объяснять ребенку значение новых и малознакомых слов.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong>фото разговора ребенка и родителя</strong><br />\r\n&nbsp;<br />\r\n<strong>3)</strong> Важно постоянно следить за речью ребенка, поправлять его и показывать на примере, как правильно произносить то или иное слово. Учите ребенка говорить внятно, четко, выразительно, не торопясь. Никогда не передразнивайте неправильную речь ребенка и не смейтесь над ним.<br />\r\n&nbsp;<br />\r\n<strong>4)</strong> Каждый день необходимо читать. Не отказывайте малышу, даже если он просит снова и снова почитать понравившуюся сказку. Можно включить запись сказки, но все же ценным является именно личное общение.<br />\r\n&nbsp;<br />\r\n<strong>5)</strong> Нужно отвечать на все детские вопросы, проявлять интерес к беседе с ребенком.<br />\r\n&nbsp;<br />\r\n<strong>6) </strong>Через беседу с ребенком выясните, как он понимает вашу речь, как воспринимает содержание прочитанных произведений.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <strong>&nbsp; &nbsp; &nbsp; &nbsp; фото сборки констпуктора детьми</strong><br />\r\n&nbsp;<br />\r\n<strong>7)</strong> Развивайте подвижность рук и пальчиков ребенка. Доказано, что с развитием мелкой моторики рук активизируются речевые зоны головного мозга. Необходимо учить малыша самостоятельно одеваться и раздеваться, шнуровать, застёгивать и расстегивать пуговицы. Полезными будут игры с мелкими игрушками, конструкторами, мозаиками, пазлами и т.д.<br />\r\n<strong>&nbsp;<br />\r\n8)</strong> Часто у детей с речевыми нарушениями слабо развиты челюстные мышцы, которые также участвуют в речевом процессе. Поэтому для их развития необходимо давать чаще есть овощи и фрукты, мясо, сухари и хлеб с корочкой.<br />\r\n&nbsp;<br />\r\n<strong>9)</strong> Плавность и красота речи во многом зависит от того, как ребенок умеет правильно дышать. Для этого можно использовать разнообразные игры и упражнения на дыхание: &laquo;Сдуй снежинку&raquo;, &laquo;Бабочка летит&raquo;, &laquo;Чей мяч дальше укатится&raquo;.<br />\r\n&nbsp;<br />\r\n<strong>10) </strong>Одна из причин неправильной речи &ndash; деформация челюсти. Отучайте как можно раньше ребенка от соски, следите, чтобы он не подкладывал ладошки под щёку во время сна.</p>\r\n\r\n<blockquote>\r\n<p><br />\r\n&nbsp;<br />\r\n<strong>Очень важно, чтобы речь развивалась своевременно и правильно, так как от этого во многом зависит успешность ребенка в будущем &ndash; его общение со сверстниками и взрослыми, психическое состояние, обучение в школе, выбор будущей профессии.</strong></p>\r\n</blockquote>\r\n'),(232,'<p>О том, почему важно научить ребенка отстаивать свою точку зрения. Как это сделать? Несколько рекомендаций для родителей.</p>\r\n\r\n<blockquote>\r\n<p>Когда ребенок маленький, он воспринимает то, что ему говорят, как истину. Он просто верит в то, о чем говорят ему родители и другие взрослые.</p>\r\n</blockquote>\r\n\r\n<p>В маленьком возрасте ребенку не нужно уметь спорить, этот навык пока абсолютно бесполезен. Но чем старше малыш становится, тем для него важнее его собственная точка зрения. И если он не научится спорить, ему будет крайне тяжело отстоять свое мнение.<br />\r\n&nbsp;<br />\r\n<strong>1.</strong>Существует немало людей, которые не хотят спорить или просто не умеют, а принимают чужое мнение. Но в таком случае человек теряется как личность.</p>\r\n\r\n<p><strong>2.</strong>Кроме того, у других людей могут быть ошибочные суждения, поэтому очень важно иметь свою точку зрения и отстаивать ее.</p>\r\n\r\n<p><strong>3.</strong>Люди со своей точкой зрения меньше попадают под влияние других, а значит, им не грозит физическая или психологическая зависимость от кого-то.</p>\r\n\r\n<p><strong>4.</strong>Те, кто умеет спорить, - это открытые, общительные, всесторонне развитые люди, поэтому очень важно научить ребенка еще в детском возрасте спорить и отстаивать свое мнение.<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong> &nbsp; &nbsp; &nbsp; &nbsp; фото задумчивого &nbsp;малыша</strong></p>\r\n\r\n<p style=\"text-align: center;\"><br />\r\n<strong>Чтобы у малыша сформировалось свое личное мнение, его необходимо учить думать.</strong></p>\r\n\r\n<p>1)Если он задает вопрос, не нужно тут же давать на него свой ответ.</p>\r\n\r\n<p>2)Необходимо дать направление, подсказку, чтобы ответ ребенок нашел сам. Так он привыкнет самостоятельно мыслить, поскольку будет знать, что родители не будут за него это делать.</p>\r\n\r\n<p style=\"text-align: center;\"><strong>Итак, вот некоторые примеры, которые помогут маленькому человечку научиться думать самостоятельно.</strong><br />\r\n&nbsp;</p>\r\n\r\n<p><br />\r\n<strong>1.</strong>В обычной жизни отвечать вопросом на вопрос не принято. Но в целях воспитания такой прием пойдет только на пользу. На вопрос: &laquo;Мама, где моя игрушка?&raquo; стоит ответить: &laquo;А где ты ее положил?&raquo; -&nbsp;так у ребенка начинает работать логика.</p>\r\n\r\n<p>Гулял на улице с игрушкой, пришел домой, положил ее в ящик для игрушек или оставил на детской площадке, забыл в машине у папы. Проверяя все возможные версии, ребенок в конечном итоге находит то, что искал.<br />\r\n&nbsp;<br />\r\n<strong>2.</strong>Родителям необходимо постоянно интересоваться мнением ребенка, даже в бытовых вопросах. Понятно, что ритм современной жизни не позволяет постоянно спрашивать, что малыш будет на ужин или куда он хочет пойти после детского садика. Например, можно выделить один выходной, когда блюда будут готовиться по желанию ребенка.<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;фото поощерения ребенка</strong><br />\r\n<strong>3</strong>.Ребенку нужно чаще задавать вопросы с целью узнать его мнение - &laquo;Как ты считаешь, красивый ли цвет у этой машины?&raquo;, &laquo;Почему ты хочешь надеть именно эти ботинки?&raquo;. Необходимо хвалить малыша, если он пытается аргументировать свой ответ.</p>\r\n\r\n<p><br />\r\n<strong>4.</strong>Ребенка необходимо слушать, не перебивая и ни в коем случае не критикуя его. Если ребенок будет уверен в том, что с его мнением считаются, ему будет легче научиться отстаивать свою точку зрения в споре.</p>\r\n\r\n<p><strong>5.</strong>Родители должны учить ребенка делать выводы - &laquo;Хорошо, что ты справился со своей застенчивостью и познакомился с этим мальчиком&raquo;, &laquo;Замечательно, что ты сочувствуешь маленькому братику, который расплакался&raquo;.</p>\r\n'),(233,'<blockquote>\r\n<p>Психика маленького человека - это чистый лист, на котором можно написать что угодно. Первыми и самыми главными учителями ребёнка становятся его родители.</p>\r\n</blockquote>\r\n\r\n<p><strong>1.</strong>Ребят часто называют &quot;отражением&quot; своих родителей. Дети безоговорочно доверяют своим папам и мамам, они выполняют все их указания и рекомендации.</p>\r\n\r\n<p>Так происходит до определённого возраста, после которого маленький человек перестаёт слушать родителей. Он начинает просто копировать их поведение. <strong>Наставления и рекомендации при этом будут игнорироваться</strong>.</p>\r\n\r\n<p><strong>2</strong>.Родители дают своему чаду готовые схемы поведения в той или иной ситуации. Эти алгоритмы не всегда соответствуют нормам морали и нравственности. Ребёнок этого не понимает и принимает всё за чистую монету.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;фото мультфильма</strong></p>\r\n\r\n<p><strong>3.</strong>На формирование мировоззрения ребёнка большое влияние оказывают мультфильмы, сказки, поговорки и пословицы. Родители должны тщательно следить за &quot;информационным рационом&quot; своего отпрыска. Ребята часто пытаются подражать поведению героев мультфильмов и компьютерных игр. Полученная с телеэкрана информация на всю жизнь остаётся в бессознательном .</p>\r\n\r\n<p style=\"text-align: center;\"><strong>Дети быстро растут и начинают знакомиться со сверстниками во дворе.</strong></p>\r\n\r\n<p><strong>4</strong>.Эти встречи дают маленькому человеку почувствовать свою принадлежность к окружающему миру.</p>\r\n\r\n<p>1)Игры детей не всегда бывают добрыми.</p>\r\n\r\n<p>2)Они могут драться, мучить животных и заниматься мелким хулиганством.</p>\r\n\r\n<p>3)Родители должны по возможности ограждать своё чадо от общения с детьми алкоголиков, наркоманов и уголовников.</p>\r\n\r\n<p><strong>5</strong>.Формирование детского мировоззрения заканчивается в старших классах школы. На него оказывает большое влияние мнение сверстников, учителей, спортивных тренеров и других взрослых людей из ближайшего окружения ребёнка. У молодого человека формируется общая картина своих достоинств и недостатков.</p>\r\n\r\n<blockquote>\r\n<p>Окончательные взгляды на жизнь появляются под влиянием кулаков сверстников, неразделённой первой любви и психологического давления со стороны педагогов.&nbsp;</p>\r\n</blockquote>\r\n\r\n<p><strong>6.</strong>На формирование мировоззрения также влияют:</p>\r\n\r\n<p>-спортивные</p>\r\n\r\n<p>-творческие</p>\r\n\r\n<p>-школьные успехи подростка.</p>\r\n\r\n<p>Вся его дальнейшая жизнь будет зависеть от философии, которая сложилась в детские годы.</p>\r\n\r\n<p><strong>Мировоззрение</strong> - это устойчивая конструкция, которая практически не поддаётся коррекции. Философские взгляды могут измениться только под влиянием чрезвычайных обстоятельств.&nbsp;</p>\r\n'),(235,'<blockquote>\r\n<p>Психика маленького человека - это чистый лист, на котором можно написать что угодно. Первыми и самыми главными учителями ребёнка становятся его родители.</p>\r\n</blockquote>\r\n\r\n<p><strong>1.</strong>Ребят часто называют &quot;отражением&quot; своих родителей. Дети безоговорочно доверяют своим папам и мамам, они выполняют все их указания и рекомендации.</p>\r\n\r\n<p>Так происходит до определённого возраста, после которого маленький человек перестаёт слушать родителей. Он начинает просто копировать их поведение. <strong>Наставления и рекомендации при этом будут игнорироваться</strong>.</p>\r\n\r\n<p><strong>2</strong>.Родители дают своему чаду готовые схемы поведения в той или иной ситуации. Эти алгоритмы не всегда соответствуют нормам морали и нравственности. Ребёнок этого не понимает и принимает всё за чистую монету.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; <strong> &nbsp; &nbsp; &nbsp;&nbsp; <concrete-picture fID=\"17\" alt=\"Формирование мировоззрения ребёнка мультик.jpg\" height=\"252\" width=\"448\" /></strong></p>\r\n\r\n<p><strong>3.</strong>На формирование мировоззрения ребёнка большое влияние оказывают мультфильмы, сказки, поговорки и пословицы. Родители должны тщательно следить за &quot;информационным рационом&quot; своего отпрыска. Ребята часто пытаются подражать поведению героев мультфильмов и компьютерных игр. Полученная с телеэкрана информация на всю жизнь остаётся в бессознательном .</p>\r\n\r\n<p style=\"text-align: center;\"><strong>Дети быстро растут и начинают знакомиться со сверстниками во дворе.<